INSERT INTO `cao_atividade_report` (`id`, `co_cliente`, `inicio`, `fim`, `lembrete`, `co_atividade`, `co_os`, `assunto`, `conteudo`, `status`, `tempo`, `co_usuario`, `data_ativ`, `retorno`, `co_fase`) VALUES
	(1, 6, '54000', '59400', '', 4, 395, 'Toyota SBC - Operações de campo - Rogéri', 'Programado: Projeto para a área de Operação de Campo (Jun 16 09:00 AM ZW3 em Meeting Room 5/SBC@TDB)', '3', NULL, 'carlos.arruda', '2005-06-16 00:00:00', '', NULL),
	(2, 3, '50400', '57600', '', 4, 361, 'Apresentação de protótipo para o upgrade', 'Apresentação de protótipo para o upgrade SGV com Divanildo e Ana Paula.', '2', NULL, 'carlos.arruda', '2005-06-17 00:00:00', 'Ficou resolvido as telas, fecharam todas, lembraram da manutencao de objetivos mas ficou mais simples.\r\nLembraram da alocacao de veiculo que tem que ser testado pela Claudia.', NULL),
	(3, 2, '55800', '59400', '', 4, 121, 'Treinamento dos Advogados - Upgrade Sisc', 'Reunião de apresentação do upgrade de acesso pelos advogados ao sistema SISCONDJ.', '2', NULL, 'carlos.arruda', '2005-06-20 00:00:00', 'Ficou decidido que:\r\n\r\n- Qualquer usuário com acesso ao item "Cadastro de Subconta" pode associar uma subconta a um advogado.\r\n\r\n- Uma subconta pode conter "n" advogados associados a ela.\r\n\r\n- O usuário com perfil de "advogado" poderá ter acesso a tela "EMISSÃO DE GUIA" através do caminho "Administração -> Emissão de Guia (Boleto)".\r\n\r\n- Deverá ser desenvolvido e entregue toda documentação do sistema, contemplando inclusive um treinamento "in loco" para os analistas do TJ. Contato da Renata: 65-9982-9940 (renata.bueno@tj.mt.gov.br).', NULL),
	(4, 0, '25200', '25200', '', 8, 0, 'Início das Férias do JOE', 'Início das Férias do JOE - Atentar para o projeto SACCES', '2', NULL, 'carlos.arruda', '2005-07-04 00:00:00', '', NULL),
	(5, 0, '25200', '25200', '', 8, 0, 'Acertar com a Nice salário do mês', 'Acertar com a Nice salário do mês', '2', NULL, 'carlos.arruda', '2005-07-06 00:00:00', 'Pago, R$ 75,00.', NULL),
	(6, 1, '52200', '55800', '', 4, 0, 'Apresentação de proposta - Treinamento', 'Processo de estruturação do Treinamento. \r\nApresentação para Aline, gestora, proposta de apoio e protótipo.', '3', NULL, 'carlos.arruda', '2005-06-21 00:00:00', '', NULL),
	(7, 1, '32400', '25200', '', 2, 440, 'Ligar para Ana Carolina, agendar apresentação.', 'Agendar apresentação de proposta de desenvolvimento de protótipo na faixa, para depois emitir uma proposta com ME anexada. A apresentação será para a gerente da área, Aline.\r\n \r\nAna Carolina S. Marques\r\nVIVO - Divisão de Inteligência de Mercado Diretoria de Marketing Operacional - BU-Individuais\r\nFone     55  (11) 5105.2902\r\nCelular  55  (11) 9914.3924\r\nana.c.marques@vivo.com.br\r\nwww.vivo.com.br\r\n', '2', NULL, 'carlos.arruda', '2005-06-21 00:00:00', 'Falou que viu com a Aline e disse que veria os procedimentos internos primeiramente, que ainda nao estavam totalmente definidos, assim que tivesse partiria para o briefing, e que seria um protótipo conosco realmente.', NULL),
	(8, 6954, '36000', '39600', '', 3, 0, 'Pré-ME para site www.aposente.com.br', 'Domínio já foi registrado pelo cliente. Seu interesse mudou de criar um site sobre gás natural para um projeto que estava na gaveta e que quer reativar neste momento.', '3', '3600', 'edy.bruno', '2005-07-11 00:00:00', '', NULL),
	(9, 6950, '48600', '52200', '', 3, 0, 'Observações', 'Está em fase de reestruturação da clínica e só poderá conversar sobre o seu website em agosto', '2', '3600', 'edy.bruno', '2005-08-01 00:00:00', '', NULL),
	(10, 6956, '32400', '33300', '', 1, 0, 'Website Logos', 'Follow-up para prospecção de website para Logos Comunicação Visual', '2', '900', 'edy.bruno', '2005-08-15 00:00:00', '', NULL),
	(11, 6957, '32400', '33300', '', 1, 0, 'Hot site Espaço Fama', 'Prospecção de hot site para Espaço Fama', '3', '900', 'edy.bruno', '2005-07-11 00:00:00', 'Decidiu esperar conclusão do site pela empresa que havia assinado contrato anteriormente.', NULL),
	(12, 3, '54000', '60300', '', 4, 395, 'Operações de campo - Rogério Gianechini', 'Programado: Projeto para a área de Operação de Campo (Jun 16 09:00 AM ZW3 em Meeting Room 5/SBC@TDB).', '2', NULL, 'carlos.arruda', '2005-06-16 00:00:00', 'Foi feito a reunião e ficou resolvido que iremos receber do Rogério um e-mail com relatórios com informações estratégicas do que ele acha interessante para que possamos prototipar um boneco, daí em diante avançar com mais segurança nesse projeto.', NULL),
	(13, 6964, '28800', '32400', '', 1, 0, 'Apresentação da Agence', 'Apresentação da Agence. Caso o cliente se interesse pela consultoria, iniciar processo de diagnósitico de soluções.', '2', '3600', 'edy.bruno', '2005-07-12 00:00:00', '', NULL),
	(14, 6963, '57600', '58500', '', 1, 0, 'Visita de apresentação', 'Marcar horário para visita de apresentação da Agence', '2', '3600', 'edy.bruno', '2005-07-12 00:00:00', '', NULL),
	(15, 6961, '59400', '62100', '', 1, 0, 'Follow-up de prospecção', 'Saber como está a questão pendente sobre seu website, em relação ao desenvolvimento, pois estava esperando o pagamento de dívida de um cliente seu que também atua na área.\r\nJá verbalizou que sua preferência recai sobre a Agence.', '2', '900', 'edy.bruno', '2005-07-15 00:00:00', 'Contato positivo sobre sua intenção em desenvolver o site com a Agence. Contudo, ainda falta uma resposta sobre seu cliente devedor. Pediu para ligar em 15/07/05.', NULL),
	(16, 1433, '30600', '32400', '', 2, 0, 'Posicionamento sobre ME para website', 'Checar como está o andamento da análise da proposta da Agence para o Sindigraf', '2', '900', 'edy.bruno', '2005-07-07 00:00:00', 'Preço final ficou acima do esperado. Pediu para ligar mais em outubro/2005, pois até lá pode ser que o sindicato tenha nova intenção de aceite.', NULL),
	(17, 6955, '28800', '29700', '', 6, 420, 'Envio de ME e OS para o Sr. Paulo', 'Proposta foi recebida pelo cliente e será analisada com seu sócio.', '3', '900', 'edy.bruno', '2005-06-16 00:00:00', '', NULL),
	(18, 6951, '27900', '28800', '', 6, 392, 'Envio de proposta para Biolab', 'ME e OS enviada para cliente.', '2', '900', 'edy.bruno', '2005-06-28 00:00:00', 'Cliente pediu para retornar no final do mês, para assinar a OS e dar início aos trabalhos.', NULL),
	(19, 1433, '30600', '31500', '', 6, 421, 'Envio de ME e OS para o contato', 'Proposta recebida pelo contato e será analisada pelo conselho. Decisão deverá ser tomada em 15 dias.', '2', '900', 'edy.bruno', '2005-06-27 00:00:00', 'Recebeu a proposta e já encaminhou para a diretoria. Retornar em 15 dias.', NULL),
	(20, 6966, '25200', '25200', '15 minutos', 1, 0, 'Follow-up da proposta comercial', 'Ligar para saber sobre a porposta comercial', '1', NULL, 'carlos.carvalho', '2005-06-29 00:00:00', '', NULL),
	(21, 3, '55800', '61200', '', 4, 365, 'Validar telas para dimensionamento', 'Validar telas para dimensionamento de nosso depto de TI. Será feito com Ricardo Ribeiro e Centurião.', '2', NULL, 'carlos.arruda', '2005-06-22 00:00:00', 'Foi sugerido novas telas e funcionalidades. Iremos prototipar as alterações e inclusões para amanha ou depois validar mais uma vez.', NULL),
	(22, 6947, '50400', '51300', '15 minutos', 4, 0, 'Acessórios Land Rover', 'Agendar reuniao para saber sobre novo web-designer', '1', NULL, 'carlos.carvalho', '2005-06-27 00:00:00', '', NULL),
	(23, 3, '54000', '57600', '', 4, 365, 'Validar telas para dimensionamento', 'Validar telas para dimensionamento de nosso depto de TI. Será feito com Ricardo Ribeiro e companhia.', '2', NULL, 'carlos.arruda', '2005-06-24 00:00:00', 'Telas validadas. Foram incluídas algumas observações. Irei adicionar agora na OS de prospecção os detalhes de todas as implementações que deverão ser feitas.', NULL),
	(24, 3, '32400', '32400', '', 2, 194, 'Ligar para o M1, horas excessivas', 'Ligar para o M1 e explicar situacao de horas gastas no projeto até o momento, explicando que o planejamento é nao estourar o budget previsto, mesmo que se fature a menor no próximo mês.', '2', NULL, 'carlos.arruda', '2005-06-24 00:00:00', 'M1 deu retorno por email agradecendo e entendendo a situacao.', NULL),
	(25, 6967, '28800', '43200', '', 5, 448, 'Confecção de ME para o website para a Comercial SR', 'ME já foi dimensionada pela TI. Será enviado para o cliente a OS com o dimensionamento e preço.', '2', '14400', 'edy.bruno', '2005-06-28 00:00:00', 'Orçamentos foram entregues para o cliente. Levará proposta para a gerência de marketing da sua representada para que no início de agosto, assine a OS, dando início aos trabalhos.', NULL),
	(26, 3, '34200', '39600', '', 4, 450, 'Discutir melhorias no sistema. Fase 1 e 2.', 'Discutir melhorias no sistema.\r\n\r\nFase 1 ( a que estamos no momento )\r\n================================\r\n- Terminar de cadastrar todos os menus do TOIOS no sistema SIS\r\n- Criar uma view do sistema para integração com o TOIOS ( o Joe pode ajudar nisso, visto que já conversou com o Paulo - beinha )\r\n\r\nFase 2 \r\n======\r\n- Garantir alta disponibilidade para o sistema SIS, tais como cluster, sistemas distribuidos, etc.\r\n- Criar um FRAMEWORK-SIS para que sirva como padrão para integração de outros sistemas/módulos adquiridos pela Toyota. \r\nA idéia desse framework é "O que preciso informar aos fornecedores de software para que os sistemas sejam integrados com o SIS".\r\n- Integração via web services\r\n- Integração via EJB ( J2EE )', '2', NULL, 'carlos.arruda', '2005-06-29 00:00:00', 'Ata de Reunião:\r\n\r\n1ª Fase:\r\n\r\n- Criação de uma estrutura de dados no ambiente Toios/Progress a ser alimentada diariamente com dados do SIS por uma rotina batch Java. Podendo também ser "startada" manualmente a partir do próprio SIS.\r\n\r\n- Desenhar modelo para garantir alta disponibilidade para o SIS. Garantindo uma conexão inteligente, falhando um server aponta para outro.\r\n\r\n\r\n2ª Fase:\r\n\r\n- Proposta de portal de intranet para todas as aplicações web, baseado no conceito de Single Sign-ON.\r\n\r\n- Estudo e proposta para desenvolvimento de solução Single Sign-ON, com biblioteca java para outras aplicações. Manual de utilização da biblioteca para aplicações Java e instruções para implementação em outras linguagens web.', NULL),
	(27, 6968, '28800', '43200', '', 5, 451, 'Confecção de Matriz de Escopo', 'Matriz de Escopo já foi enviada para TI para dimensionamento de tempo e preço.', '2', '14400', 'edy.bruno', '2005-06-27 00:00:00', '', NULL),
	(28, 6712, '54000', '61200', '', 1, 322, 'Reunião de prospecção', 'Reunião com o Mauricio Bras para definição de um sistema de agendamento de consultor.', '1', NULL, 'carlos.carvalho', '2005-07-07 00:00:00', '', NULL),
	(29, 6970, '32400', '43200', '', 3, 461, 'Prospecção de sistema de Help Desk', 'Empresa interessada no sistema SOS de Help Desk. \r\nGostaria de estar recebendo as especificações do sistema e se possível um link de demonstração\r\n\r\nAline Patrícia Cunha\r\nRelacionamento com Cliente\r\naline@siq.com.br\r\nwww.siq.com.br\r\nFone: (11) 4586-0245\r\n\r\nRua Diogenes Duarte Paes, 240\r\nParque do Colégio - Jundiaí - SP\r\n13209-150 - Brasil\r\nFone/ Fax (55) (11) 4586-0245', '2', NULL, 'carlos.arruda', '2005-07-06 00:00:00', 'A SIQ é uma software-house especializada em sistemas ficados para a gestão de qualidade do fornecedor, atendem Toyota e outroas grandes empresas.\r\nViram o sistema de help desk da Agence e ficaram encantados, viram nele exatamente o que necessitam, e não como o SOS.\r\nPediram então um protótipo de uma solução específica para eles, já contemplando relatórios.\r\nSugeriram um usuário master de cliente que possa cadastrar outros usuários internos para gerenciar chamados.', NULL),
	(30, 3, '32400', '41400', '', 4, 0, 'Apresentação do 2know', 'Apresentação do sistema 2know para conhecimento da Toyota.', '2', NULL, 'carlos.arruda', '2005-07-08 00:00:00', 'Apresentado com sucesso.\r\nIremos propor alteração do 2know para o SIS. Eliminando o modulo de usuarios do sistema.', NULL),
	(31, 0, '25200', '25200', '', 8, 0, 'Acertar a esgrima', 'Pagar mais um mês a esgrima ou já fechar pacote de 3 / 6 meses.\r\nValor: R$ 112,00', '2', NULL, 'carlos.arruda', '2005-07-13 00:00:00', 'Acertado, 6 cheques de R$ 95,00.', NULL),
	(32, 6712, '54000', '61200', '', 3, 462, 'Prospecção de sistema de Controle de Projeto', 'Prospecção de sistema de Controle de Projeto, alocação de recursos, horas gastas, etc.', '2', NULL, 'carlos.arruda', '2005-07-07 00:00:00', 'Praticamente o CAOL menor, controle de projeto, controle de consultor, cadastro de usuario e relatorios de custo de projeto. \r\nVamos fazer um protótipo e tentar apresentar na semana que vem. Quinta-feira provavelmente. 14/07.', NULL),
	(33, 0, '48600', '25200', '', 8, 0, 'Emitir uma declaração para o Ricardo', 'Em agosto vai uma comissão do MEC para reconhecimento de curso na UMC e o coordenador me pediu vários documentos, inclusive que comprovem experência profissional.\r\n \r\nEle me adiantou que pode ser uma declaração da empresa onde presto serviços, mencionando a data de início e término (o que não é o caso).\r\n \r\n \r\nTeria como me providenciar uma ?', '2', NULL, 'carlos.arruda', '2005-07-07 00:00:00', 'Feito', NULL),
	(34, 6970, '50400', '55800', '', 4, 461, 'Apresentacao de prototipo', 'Apresentacao de prototipo para primeira validacao.\r\nConfirmar visita. \r\nSIQ System: 11-4586-0245\r\nAline: 11-8112-4742', '2', NULL, 'carlos.arruda', '2005-07-15 00:00:00', 'Apresentado protótipo e entregue orçamento de desenvolvimento do SOL.\r\nFalou-se em customizar um CAOL para eles e em terceirizar fábrica de software para eles.', NULL),
	(35, 3, '25200', '25200', '', 2, 0, 'Falar com Alexandre Riberi da Toyota', 'Falar com Alexandre Riberi da Toyota a respeito da reunião que seria ou hoje, quinta ou sexta-feira. \r\nDiscutir pontos a respeito de documentação dos outros sistemas Toyota como SVD, SGV, 2Know, etc. Todos dentro do padrão RUP.', '2', NULL, 'carlos.arruda', '2005-07-13 00:00:00', 'Conversado e resolvido. Agendado para esse mesmo dia.', NULL),
	(36, 0, '36000', '41400', '', 8, 0, 'Verificar extrato no banco - Isenção dos R$ 31,00', 'Verificar extrato no banco - Isenção dos R$ 31,00\r\n', '2', NULL, 'carlos.arruda', '2005-07-18 00:00:00', 'Verificado e ela autorizou o 100% de isenção. Vai extornar esse do dia 11.\r\n\r\nNada lançado no dia 10/07, e no mes passado foi lancado no dia 10/06.\r\nLigar para Marlene, lançaram os 31,00. E o CC tá isento em CG.\r\nMarlene: 3849-0908\r\n', NULL),
	(37, 6712, '32400', '39600', '', 4, 462, 'Apresentação de protótipo', 'Apresentação de protótipo do controle de projetos X consultores.', '2', NULL, 'carlos.arruda', '2005-07-18 00:00:00', 'Apresentado o protótipo, alterações deverão ser feitas até próxima reuniao de apresentacao. \r\nNessa próxima estará presente o dono da Prime.', NULL),
	(38, 6951, '61200', '63000', '', 2, 392, 'Fechamento do negócio com Dr. Edgar', 'Pediu para ligar nesta data, pois tinha urgências para serem atendidas no laboratório. Há grandes chances de concretização de negócio.', '1', '900', 'edy.bruno', '2005-09-01 00:00:00', '', NULL),
	(39, 6967, '28800', '30600', '', 2, 448, 'Fechamento de negociação', 'Fechamento de negociação com Sérgio Dosualdo, contato da empresa.', '1', '1800', 'edy.bruno', '2005-09-01 00:00:00', '', NULL),
	(40, 3, '50400', '54900', '', 4, 0, 'Reunião a respeito de documentação', 'Reunião com Alexandre Riberi e outras consultorias.\r\nO objetivo da reunião é expor a necessidade de documentar alguns sistemas já instalados e dar informação suficiente para as consultorias envolvidas criarem suas propostas para executar esta documentação.', '2', NULL, 'carlos.arruda', '2005-07-13 00:00:00', 'Necessário apresentar proposta com dim tempo e preço para o desenvolvimento de documentacao de 4 sistemas Agence.\r\nDeve ir proposta de metodologia e documentos.', NULL),
	(41, 3, '50400', '55800', '', 4, 472, 'Reunião para entendimento do sistema', 'Reunião para entendimento do sistema do painel Andon, tentativa de apresentar alguma coisa web bonita para o usuário entender do se trata.', '2', NULL, 'carlos.arruda', '2005-07-11 00:00:00', 'Feita reunião com apresentação de protótipo preliminar.\r\nMarcado nova reunião para apresentação de relatórios atuais existentes e melhor entendimento ainda do painel.', NULL),
	(42, 3, '57600', '64800', '', 4, 472, 'Apresentação de relatórios e manual', 'Apresentação de relatórios que eles geram atualmente em excel para facilitar a prototipagem.\r\nVão apresentar tb manual do sistema.', '2', NULL, 'carlos.arruda', '2005-07-13 00:00:00', 'Foram entregues gráficos e planilhas desenvolvidas diariamente.\r\nAgendado apresentação do painel físico em Indaiatuba.', NULL),
	(43, 3, '25200', '25200', '', 8, 361, 'Enviar NF de parcela 3/4', 'Enviar NF de parcela 3/4 do projeto SGV refactoring.\r\nFicou decidido que enviaríamos essa NF e a seguinte somente quando o analista viesse a SBC iniciar os testes das implementações.', '2', NULL, 'carlos.arruda', '2005-07-29 00:00:00', 'Já enviado.', NULL),
	(44, 0, '25200', '33300', '', 8, 0, 'Explicar Rui detalhes do Sales Follow Up - SGV', 'Explicar Rui detalhes do Sales Follow Up - SGV', '2', NULL, 'carlos.arruda', '2005-07-13 00:00:00', 'Feito.\r\nFiquei de tirar dúvida com Ana Paula a respeito do que significa B.O.', NULL),
	(45, 0, '25200', '25200', '', 8, 0, 'Chamar Ricardo para testes do 2know', 'Chamar Ricardo para testes do 2know', '2', NULL, 'carlos.arruda', '2005-07-13 00:00:00', 'Feito, tá sendo alterado para uma nova RN explicada pelo Centuriao.', NULL),
	(46, 3, '46800', '64800', '', 4, 472, 'Visita a Indaiatuba', 'Visita a Indaiatuba para conhecer melhor o painel e suas funcionalidades.', '2', NULL, 'carlos.arruda', '2005-07-14 00:00:00', 'Verificado, estarei agora passando os detalhes e direcionando o desenvolvimento do protótipo para a Cris.\r\nMarcado apresentação para a próxima semana no dia 22/07.', NULL),
	(47, 3, '25200', '25200', '', 8, 361, 'Implantação do Projeto', 'Implantação do Projeto', '3', NULL, 'carlos.arruda', '2005-10-12 00:00:00', '', NULL),
	(48, 3, '25200', '25200', '', 2, 0, 'Dar retorno sobre documentação dos sistemas - Alexandre', 'Falar se o que foi enviado é o suficiente para dimensionar tempo e preço para o desenvolvimento da documentação desses sistemas.\r\nFalar com Alexandre ou Cláudia.\r\nAtualizado a data devido ao atraso de entrega dos manuais.', '2', NULL, 'carlos.arruda', '2005-07-26 00:00:00', 'E-mail de retorno enviado.\r\n"No nosso caso, visto que fomos os desenvolvedores dos sistemas, os documentos entregues são suficientes para o dimensionamento de tempo e preço do desenvolvimento da documentação de especificação e de projeto dos sistemas Blue Print, SGV, SVD e 2know.\r\n\r\nEm relação a data limite para a entrega das propostas vocês já tem?"', NULL),
	(49, 0, '64800', '68400', '', 8, 0, 'Reunião com Fernando - Documentação do TCC', 'Reunião com Fernando.\r\n- Documentação do TCC.', '2', NULL, 'carlos.arruda', '2005-07-15 00:00:00', 'Falado por telefone mesmo e o Fernando nao vai poder documentar o sistema pra gente.\r\nTemos que alocar um analista próprio agora.', NULL),
	(50, 0, '66600', '67500', '', 8, 0, 'Assinatura de contrato com Júlio - Webdesigner', 'Assinatura de contrato com Júlio - Webdesigner', '2', NULL, 'carlos.arruda', '2005-07-15 00:00:00', 'O cara desistiu. Encontrou proposta melhor.', NULL),
	(51, 3, '25200', '32400', '', 4, 0, 'Instalação do CVS - Aviso da saída do Rui', 'Instalação do CVS - Aviso da saída do Rui', '2', NULL, 'carlos.arruda', '2005-07-15 00:00:00', 'Tudo ok. Avisado para o M2 e Biaggio.', NULL),
	(52, 3, '28800', '48600', '', 4, 472, 'Apresentação de protótipo e visita na linha de produção', 'Apresentação de protótipo do Painel Andon e visita na linha de produção.', '2', NULL, 'carlos.arruda', '2005-07-22 00:00:00', 'Visitado a linha, entendido melhor o fluxo das atividades dentro da linha. \r\nDeverá ser feito uma análise maior a respeito de como integrar com o PCP, sistema serial responsável por registrar as paradas na linha.', NULL),
	(53, 3, '34200', '50400', '', 4, 0, 'Conversa com Saito. Novo projeto', 'Conversa com Saito. Novo projeto.\r\nRemarcado mais uma vez, Saito muito atarefado.\r\nFabio Saito: 11-3089-9066 / 11-9980-7957', '2', NULL, 'carlos.arruda', '2005-08-16 00:00:00', 'Nao tive retorno. Sumiu.', NULL),
	(54, 3, '25200', '25200', '', 4, 194, 'Reuniao a respeito de cronograma com M1', 'Reuniao a respeito de cronograma com M1', '2', NULL, 'carlos.arruda', '2005-07-15 00:00:00', 'Enviado e-mail formalizando que iremos mandar um cronograma atualizado após retorno do Japão sobre o cálculo do acumulativo. ', NULL),
	(55, 3, '32400', '37800', '', 3, 0, 'Portal de RH - Denis', 'Visita para entender solicitação do RH da Toyota, portal colaborativo.\r\nDenis: 11-4390-5112', '2', NULL, 'carlos.arruda', '2005-07-19 00:00:00', 'Estaremos desenvolvendo um protótipo para apresentação.\r\nA data marcada é dia 27/07 para essa preliminar.\r\nOS de prospecção já criada.', NULL),
	(56, 0, '25200', '25200', '', 8, 0, 'Entrevista com Glauco Henrique', 'Entrevista com Glauco Henrique para webdesigner.', '2', NULL, 'carlos.arruda', '2005-07-20 00:00:00', 'Ok. Contratado como webdesigner para ajudar no projeto Caltabiano.', NULL),
	(57, 3, '50400', '55800', '', 4, 485, 'Apresentação de protótipo', 'Apresentação de protótipo para o Denis do RH.\r\nDenis: 11-4390-5112 ', '2', NULL, 'carlos.arruda', '2005-07-28 00:00:00', 'Apresentado. Novas funcionalidades sinalizadas pelo usuário foram ditas, novo protótipo será apresentado já com data marcada.', NULL),
	(58, 0, '25200', '25200', '', 8, 0, 'Pagar IPTU e Taxa do lixo do AP', 'Pagar IPTU e Taxa do lixo do AP', '2', NULL, 'carlos.arruda', '2005-09-25 00:00:00', '', NULL),
	(59, 6970, '25200', '25200', '', 2, 461, 'Falar com Ewerton a respeito da autorização do desenvolvimen', '"Concluímos a avaliação das alternativas avaliadas e decidimos (Tecnicamente) pelo software da Agence. Porém estamos aguardando nossa responsável pelos investimentos (Férias) na próxima semana. Ela entrará em contato com você para discutir os aspectos comerciais.\r\n Posiciono você na próxima quarta (27)"\r\n\r\nPosicionamento agora da própria Eliana:\r\n\r\n"Olá Carlos,\r\nestou retomando agora. Entro em contato nesta semana para darmos andamento ao negócio.\r\natenciosamente,\r\nEliana Carbonari"', '2', NULL, 'carlos.arruda', '2005-08-01 00:00:00', '"Obrigado pela paciência. Creio que estamos prontos para a retomada.\r\nGostaria de saber quando vc estará pela região de jundiaí e te peço mais uma visita aqui na SIQ. Quero que aproveite tua viagem até aqui, não venha especificamente.\r\nGostaria de conhecer o protótipo SOL e conversar quanto aos aspectos comerciais com você. Principalmente Prazos de pagamentos e prazo de entrega, entre outros detalhes.\r\nTe convido para um almoço, se quiseres vir na parte da manhã, ou para o café, se vieres a tarde!"', NULL),
	(60, 6970, '25200', '25200', '', 2, 461, 'Contato com Eliana', 'Contato com Eliana para saber a respeito da proposta comercial do sistema, qual a melhor forma de atendê-la.\r\n\r\n"Concluímos a avaliação das alternativas avaliadas e decidimos (Tecnicamente) pelo software da Agence. Porém estamos aguardando nossa responsável pelos investimentos (Férias) na próxima semana. Ela entrará em contato com você para\r\ndiscutir os aspectos comerciais.\r\n \r\nPosiciono você na próxima quarta (27)"', '3', NULL, 'carlos.arruda', '2005-08-01 00:00:00', '', NULL),
	(61, 6949, '25200', '25200', '', 2, 355, 'Falar com Graciela - Projeto TIM Retomada', 'Falar com Graciela - Projeto TIM Retomada\r\nTel.: 61-8113-1011', '2', NULL, 'carlos.arruda', '2005-08-10 00:00:00', 'Ficou de entrar em contato para orientações a respeito.', NULL),
	(62, 6947, '36000', '36000', '', 8, 342, 'Publicar Flash da Toyota na HOME', 'Flash', '1', NULL, 'carlos.carvalho', '2005-07-28 00:00:00', 'Deixar até proxima terca', NULL),
	(63, 3, '57600', '63000', '', 4, 0, 'Apresentação de protótipo - Indaiatuba', 'Segunda apresentação de protótipo do sistema.\r\nAcredito que agora feche para a fase de dimensionamento TI.', '2', NULL, 'carlos.arruda', '2005-07-29 00:00:00', 'Apresentado e agendado nova apresentação do protótipo com as revisões. Agora para o Duvanir Trigo.', NULL),
	(64, 6712, '29700', '37800', '', 4, 462, 'Apresentação de protótipo', 'Segunda apresentação do protótipo. \r\nAgora com a participação de Fábio Queiroz.', '2', NULL, 'carlos.arruda', '2005-08-02 00:00:00', 'Nao houve participacao do Fabio Queiroz, mas apresentamos para um usuario, que deu uma boa idéia em relacao ao controle do projeto, algo mais operacional.\r\nVamos fazer a alteracao e publicar num endereco para que o Mauricio possa apresentar para o Carlos, dono da Prime.', NULL),
	(65, 3, '25200', '25200', '', 2, 361, 'Falar com Ana Paula. Avisar sobre o início dos Testes.', 'Falar com Ana Paula. Avisar sobre o início dos Testes.\r\nTel.: 3089-9158', '2', NULL, 'carlos.arruda', '2005-07-28 00:00:00', 'Falado e combinado para o início dos testes na semana do dia 08.', NULL),
	(66, 3, '32400', '36000', '', 8, 361, 'Início dos testes com usuário', 'Início dos testes com usuário - Ana Paula e Divanildo\r\n\r\nAna Paula: 11-3089-9158', '3', NULL, 'carlos.arruda', '2005-10-10 00:00:00', '', NULL),
	(67, 3, '57600', '63900', '', 4, 485, 'Apresentação de protótipo', 'Segunda apresentacao de prototipo', '2', NULL, 'carlos.arruda', '2005-08-03 00:00:00', 'Apresentado e feito algumas obs no organograma desenvolvido. Iremos fazer algumas alterações e enviar por e-mail. \r\nFalou-se em desenvolver o site todo em flash, trazendo uma dinâmica ainda maior ao portal, com roteiros e tudo mais.', NULL),
	(68, 0, '25200', '25200', '', 8, 0, 'Buscar Denis e trazer Civio', 'Buscar Denis e trazer Civio para o aeroporto.\r\n\r\nDenis:  Brasília/São Paulo - Guarulhos 08:40 10:20 Sem escalas\r\n \r\nCivio: São Paulo - Guarulhos/Brasília  19:00  20:35  Sem escalas\r\n ', '2', NULL, 'carlos.arruda', '2005-08-01 00:00:00', 'Executado com sucesso.', NULL),
	(69, 0, '41400', '43200', '', 8, 0, 'Entrevista com Eduardo Pipole', 'Entrevistar Eduardo Pipole, analista Java, JBOSS.', '2', NULL, 'carlos.arruda', '2005-08-03 00:00:00', 'Sumiu.', NULL),
	(70, 3, '37800', '25200', '', 8, 501, 'Enviar proposta para as documentações', 'Enviar proposta para as documentações: SGV, SVD, Blue Print e 2know', '2', NULL, 'carlos.arruda', '2005-08-02 00:00:00', 'Enviado.\r\n\r\n"Boa tarde Cláudia e Alexandre,\r\n\r\nSegue abaixo link para download das propostas (separadas por sistema) para o desenvolvimento da documentação de especificação e projeto dos sistemas 2Know, Blue Print, SGV e SVD.\r\n\r\nhttp://www.agence.com.br/propostas/toyota/os_docs_02082005_zip.agc\r\n\r\nTem que trocar a extensão .agc por .zip após o download do arquivo, fizemos isso para passar pelo firewall da Toyota.\r\n \r\nQualquer dúvida ainda entrem em contato.\r\n\r\nAtt.;\r\nCarlos"', NULL),
	(71, 3, '37800', '25200', '', 8, 472, 'Volta do M2 - Apresentar Andon', 'Volta do M2, apresentar protótipo Andon', '2', NULL, 'carlos.arruda', '2005-08-10 00:00:00', 'Apresentado.\r\nFoi solicitado que seja feito a publicação para demonstração online para o Eduardo Barboni.', NULL),
	(72, 6970, '36000', '41400', '', 4, 461, 'Apresentação de protótipo e negociação comercial', '"Obrigado pela paciência. Creio que estamos prontos para a retomada.\r\nGostaria de saber quando vc estará pela região de jundiaí e te peço mais uma visita aqui na SIQ. Quero que aproveite tua viagem até aqui, não venha especificamente.\r\nGostaria de conhecer o protótipo SOL e conversar quanto aos aspectos comerciais com você. Principalmente Prazos de pagamentos e prazo de entrega, entre outros detalhes.\r\n\r\nTe convido para um almoço, se quiseres vir na parte da manhã, ou para o café, se vieres a tarde!"', '2', NULL, 'carlos.arruda', '2005-08-05 00:00:00', 'Conversado com eles e decidido que o planejamento é para que se inicie o projeto no final de setembro.\r\nFalou-se tb mais uma vez no outsourcing da fábrica de software, e tb no desenvolvimento do sistema de controle de projetos.', NULL),
	(73, 3, '36000', '39600', '', 4, 515, 'Apresentação de nova RFP', 'Conforme contato por telefone, comparecer na segunda dia 08/08 as 10:00h para reuniao de preview....\r\n\r\nEstamos com um projeto de fabrica de software para o sistema SLT, setor QA da Toyota.\r\nEste projeto visa o desenvolvimento de uma aplicação em JAVA usando banco de dados ORACLE de acordo com as especificações do QA e TI, descritas nos documentos de requisitos e visão anexos. \r\n\r\nAtualmente estamos apenas preparando documentos de cotação para aprovação pela diretoria do QA, e o projeto envolve :\r\nDesenvolvimento da aplicação e integração com outros sistemas,\r\nDocumentação do produto,\r\nPassagem dos fontes e documentos para a Toyota, caso seja necessário novas implementações futuras...\r\n\r\nA data prevista para essa reunião é o dia: 11/08/2005 as 14:00h na Toyota SBC - Sala: Meeting Room 6/SBC\r\n\r\nFavor confirmar participação, caso não possam comparecer ou tiverem duvidas, entrar em contato...\r\n\r\nAtenciosamente,', '2', NULL, 'carlos.arruda', '2005-08-08 00:00:00', 'Apresentado pelo Gaudêncio.\r\nIremos questionar a confecção de um protótipo do sistema baseado no fluxo desenvolvido pelo usuário conhecedor/gestor Tokihiro Okazaki.', NULL),
	(74, 3, '54000', '64800', '', 4, 515, 'Reunião com usuários do sistema atual', 'Reunião com usuários do sistema atual, discussão com usuários a respeito desse projeto.\r\nSerá feito uma conversão do Toios para Java.', '2', NULL, 'carlos.arruda', '2005-08-09 00:00:00', 'Apresentado e explicado todos os fluxos.\r\nFicou definido que deve ser apresentado proposta de desenvolvimento de protótipo e documentação de especificação até o dia 15/08.\r\nIremos sugerir apresentar proposta de documentação de especificação baseado num protótipo já desenvolvido.', NULL),
	(75, 6972, '32400', '37800', '', 3, 0, 'Apresentação da empresa e entendimento do problema', 'Apresentação da empresa e entendimento do problema.\r\nEles estão trocando atualmente de parceiro em tecnologia e sentem que o principal problema da atual empresa é o atendimento.\r\nContato é o Leonardo.\r\nRua Bahia 1126, Higienópolis.\r\n', '2', NULL, 'carlos.arruda', '2005-08-10 00:00:00', 'Recebemos os requisitos que devem ser implementados para que possamos fazer um dimensionamento de tempo e preço. Iremos fazer passando uma proposta de de modelo de negócio tb.\r\nCH assumindo a conta.', NULL),
	(76, 6972, '32400', '39600', '', 3, 0, 'Prospecção', 'Eles estão trocando de parceiros de tecnologia e somos uma opção que eles gostaram.\r\nwww.futurebrand.com', '1', NULL, 'carlos.carvalho', '2005-08-10 00:00:00', '', NULL),
	(77, 3, '32400', '34200', '', 4, 515, 'Apresentação de Protótipo - v. 1.0', 'Apresentação de Protótipo - v. 1.0\r\nAgendar com usuarios: Sandra e Okasaki', '2', NULL, 'carlos.arruda', '2005-08-12 00:00:00', 'Não pôde ser apresentado nada, o usuário alegou falta de tempo, mas acredito que seja porque não quer adiantar o projeto com um fornecedor primeiramente (Agence no caso).\r\nTem outro fornecedor que atende a mais tempo a área, a SIC Tecnologia.', NULL),
