	(113, 3, '37800', '41400', '', 4, 541, 'Reunião sobre a especificação do que foi pedido', 'Ricardo,\r\n\r\nRecebi a documentação da Agence sobre as suas solicitações de implementação, gostaria de agendar com você um horário para a semana se possível dia 04/10 às 9:00 aqui em SBC.\r\n\r\nEstarei aguardando sua confirmação.\r\n\r\nObrigada', '2', NULL, 'carlos.arruda', '2005-10-05 00:00:00', 'Apresentado para o Centuriao e para a Cláudia.\r\nA Claudia ficou de acertar a consulta de veículos vendidos (faturados - cancelados)', NULL),
	(114, 0, '25200', '25200', '', 8, 0, 'Verificar pacotes para o carnaval 2006', 'Verificar pacotes para o carnaval 2006', '3', NULL, 'carlos.arruda', '2005-11-29 00:00:00', 'Nao vamos mais.', NULL),
	(115, 3, '25200', '25200', '', 6, 568, 'Enviar proposta fechada', 'Carlos,\r\n\r\n\r\nConforme contato, precisamos ter o custo final fechado do sistema, incluíndo os relatórios e gráficos utilizados atualmente (hoje em excel).\r\n\r\nPoderia enviar até 07/10 proposta atualizada com o custo ajustado e fechado, considerando como base de conteúdo o documento requisitos funcionais, que já havia sido enviado, e como base de layout os 2 gráficos em planílha anexa ?\r\n\r\n(See attached file: Exemplo Graficos.xls)\r\n\r\nAtenciosamente,\r\n\r\nDavid Rogério de Araujo/TDB', '2', NULL, 'carlos.arruda', '2005-10-07 00:00:00', 'Enviada. E como dizia Júlio César, antes de atravessar o Rubicon e invadir Roma: "Alea iacta est".\r\n', NULL),
	(116, 0, '25200', '25200', '', 8, 0, 'Reunião com Daniel Silveira', 'Roberto Iunes', '2', NULL, 'carlos.arruda', '2005-10-11 00:00:00', '', NULL),
	(117, 0, '25200', '25200', '', 8, 0, 'cobrar memórias', 'Memórias, vencimento da segunda parcela, R$ 425,00.\r\n\r\nCompradas 5 pentes de 512mb da samsung. A R$ 170,00 cada.', '2', NULL, 'carlos.arruda', '2005-11-11 00:00:00', 'Enviado o email solicitando o reembolso.', NULL),
	(118, 0, '25200', '25200', '', 8, 0, 'Retorno da TIM em relação ao aparelho', 'Retorno da TIM em relacao ao aparelho e plano corporativo.\r\n\r\nProtocolo: 5284053\r\nCaso nao retornem até hoje ligar no numero 0800 741 0041\r\n\r\nPlano de 200 minutos compartilhado ou flexibilizado: R$ 80,00', '2', NULL, 'carlos.arruda', '2005-10-25 00:00:00', 'Aparelho mais caro que direto com a Nokia.\r\nVerificando a possibilidade de pegar um emprestado para o dia da apresentacao com a TIM.\r\nAcabamos comprando direto da nokia.', NULL),
	(119, 3, '34200', '41400', '', 4, 541, 'Reunião com Alexandre', 'Reunião com Alexandre a respeito do escopo desse upgrade.', '2', NULL, 'carlos.arruda', '2005-10-18 00:00:00', 'Ata de reunião - SVD Upgrade 18/10/2005\r\n\r\n- Adicionar ao documento de especificação do upgrade que o tempo de alerta de vencimento da carta de isenção ICMS será dinâmico, a informação estará em banco de dados e não direto no código.\r\n\r\n- Retirar do documento de especificação do upgrade a funcionalidade cadastro de estoque. Cláudia irá confirmar antes com o Vladimir Centurião.\r\n\r\n- Adicionar ao documento de especificação do upgrade a funcionalidade carga de estoque, onde poderá ser agendado o mês que o sistema irá rodar a rotina para cálculo de estoque da rede. Cláudia irá confirmar antes com o Vladimir Centurião.\r\n\r\n- Alterar no documento de especificação do upgrade onde diz que os gráficos serão gerados pelo JFreeChart para Flash. Alexandre irá confirmar a homologação Toyota da tecnologia flash para a geração dos gráficos.\r\n\r\n- Retirar do documento de especificação do upgrade a funcionalidade carga de veículos faturados. Será feito on-line no momento do pedido, consultando todos os veículos faturados para o cnpj/cpf consultado e seus coligados, subtraindo os cancelados e devolvidos.\r\n\r\n- Cláudia irá confirmar o conceito de veículos vendidos no mês com Centurião, qual regra exata a adotar. Essa mesma regra será utilizada em todos os momentos de consulta a veículos de vendas diretas vendidos.\r\n', NULL),
	(120, 3, '32400', '39600', '', 4, 321, 'Reunião com Alexandre, Cláudia e pessoal do Call Center', 'Reunião com Alexandre, Cláudia e pessoal do Call Center para validar a documentação de especificação do TCC', '3', NULL, 'carlos.arruda', '2005-10-31 00:00:00', '', NULL),
	(121, 6946, '45000', '54000', '', 4, 0, 'TOL', 'Discutiremos:\r\n\r\n- O que falta para implantar o TOL, da parte da Target e da Agence;\r\n- Qualidade do que foi entregue;\r\n- Eventuais desvios no escopo inicial, geradores de horas extras de trabalho por parte da Agence.', '2', NULL, 'carlos.arruda', '2005-10-21 00:00:00', '- O TOL ficará hospedado na Target em servidor windows com sql server rodando em PHP sobre um servidor Apache for windows.\r\n\r\n- Até o dia 28/10 o TOL deverá ser disponibilizado na Agence para testes de homologação da Target, rodando em PHP sobre um servidor Apache for windows com SQL Server. \r\n\r\n- A partir do dia 31/10 até o dia 11/11 irá acontecer essa fase de homologação que camaremos de testes/ajustes. \r\nEssa homologação será feita sobre as funcionalidades do sistema e sobre o comportamento dos dados dentro das tabelas do banco de dados. Uma porta do SQL Server deverá ser aberta para consulta remota pelos analistas da Target. A porta provável do SQL server é a 1433 e para maior segurança poderá ser aberta somente para o I.P. 201.20.202.150.\r\nDurante esse período os testes (Target) e ajustes (Agence) acontecerão simultaneamente, de forma que até o dia 11/11 isso termine com sucesso.\r\n\r\n- No dia 14/11 deverá ser enviado o pacote PHP para instalação no ambiente da Target, a partir dessa data é provável que aconteça uma homologação do fonte PHP.\r\nOs fontes do TOL deverão ser enviados sem lixo, ou seja, sem arquivos que estão sem uso como _backup, .bak, etc.', NULL),
	(122, 0, '55800', '61200', '', 8, 0, 'Reunião de apresentação do PEE Agence', 'Reunião de apresentação do PEE Agence', '2', NULL, 'carlos.arruda', '2005-10-26 00:00:00', 'Feita com sucesso.', NULL),
	(123, 0, '59400', '64800', '', 8, 0, 'Entrevista com Marcelo', 'Agnitia Solugues Ltda. \r\nCargo: Estagiario \r\nPermodo: De 06/2005 ati 09/2005  \r\nAtribuigues do cargo: As atividades desempenhadas sco: desenvolvimento, manutengco e atualizagco de sitemas comerciais para web, envolvendo tanto a area de desenvolvimento em si(programagco), quanto a area de criagco e gerenciamento de bancos de dados.\r\nRelagco de Softwares: Linux Fedora Core, OpenOffice, PHP, HTML, PostgreSQL, MySQL, Apache 2.0, DCL - Gerenciador de Bugs, CVS (Concurrent Versions System) \r\n\r\n\r\nCURSOS E ESPECIALIZAGUES \r\n \r\nHTML  Intermediario\r\nFlash  Basico\r\nDreamweaver  Intermediario \r\nHardware  Intermediario (grupo de estudos  1 ano)\r\nInstalando, Operando, Configurando e Administrando Sistemas e Redes Linux (44 horas)\r\nJava  Basico (20 horas)\r\nMicrosoft SQL Server 7.0  Intermediario\r\nOracle 9i  DBA (64 horas)\r\nUML  Basico\r\nConhecimentos nos Sistemas Operacionais: Windows 9x, Windows 2000, Millenium, NT, Suse 9.1 e Kurumin\r\nNogues de Redes, Delphi, Visual Basic, Argo UML\r\nIngljs  conversagco (Excellent global) \r\n', '2', NULL, 'carlos.arruda', '2005-10-24 00:00:00', 'Muito iniciante.', NULL),
	(124, 3, '43200', '48600', '', 4, 0, 'Reunião a respeito dos sistemas Java', 'Reunião a respeito dos sistemas Java', '2', NULL, 'carlos.arruda', '2005-10-24 00:00:00', 'Foi pedido finalmente um contrato de manutenção para os sistemas java.', NULL),
