	(127, 6949, '57600', '61200', '', 4, 629, 'Apresentação de protótipo', 'Apresentação de protótipo.\r\n\r\nAv. Afonso Pena, 1897.\r\nOitavo andar, sala 801', '2', NULL, 'carlos.arruda', '2005-11-01 00:00:00', 'Ótima apresentação, iniciamos o desenvolvimento para piloto no MS.', NULL),
	(128, 6980, '34200', '43200', '', 3, 0, 'Reformulação do website da Pousada', 'Cotação para um NOVO site para o AMOREIRAS HOTEL POUSADA . ( www.amoreiras.com.br) ; ja conheço o trabalho de voces atraves dos livros do Roberto Miranda que indica voces como uma sugestao para montagem de um site de hospedagem/hotelaria .. !! .. Gostaria de iniciar uma conversação para que possamos chegar a um site adequado as necessidades do mercado. \r\nGostaria que o Sr. observasse alguns modelos de site , dos quais são de nosso interesse essa forma de padronização.\r\n\r\nwww.puravidamaresias.com.br ( tela inicial e configuração do site e animação de botões )\r\n\r\nwww.pedamata.com ( Auto configuração em relação a visualização do site )\r\n\r\nwww.cantomagico.com.br ( formato de apresentação de disposição dos botões de link )\r\n\r\nhttp://www.villamare.com.br/brasil/webvillamare.html ( Rapidez e qualidade do site em sua animação nos botões e forma de apresentação )\r\n\r\n...... \r\n\r\n- O site deverá ser formatado para que ocupe a tela inteira ( auto ajustável ) , sem rolagem . Independente da configuração de visualização do computador ( 800x600 , 1024x768 .. etc )\r\n\r\n- Os botões do site : \r\n\r\n- A Pousada \r\n- Acomodações \r\n- Tarifas\r\n- Reservas\r\n- Como Chegar ( Utilizaçao do MapLink )\r\n- Lazer\r\n- Fotos\r\n- Fale Conosco ( Email , MSN , Skype , Tel )\r\n\r\nNas paginas deverá estar de fácil acesso visual da pousada , tais como : \r\n( geralmente no rodapé – em fonte pequena ) \r\n\r\n- Endereço / - CEP / - Cidade / - Estado / \r\n- Telefone / - Fax / \r\n- E-mail\r\n', '1', NULL, 'carlos.carvalho', '2005-11-07 00:00:00', '', NULL),
	(129, 6949, '28800', '32400', '', 1, 0, 'Contato com Rafael da TIM', 'Entrar em contato com o responsável pelo desenvolvimento da TIM.\r\nRafael Visconti\r\nrvisconti@timbrasil.com.br\r\n', '2', NULL, 'carlos.arruda', '2005-11-07 00:00:00', 'Enviado o email, vamos aguardar.', NULL),
