	(139, 0, '32400', '36000', '', 8, 0, 'Entrevista com Rodrigo e com Dimas', '	Rodrigo Antônio de Sousa Toledo\r\nIdade: 20 anos				Estado Civil: Solteiro\r\nEndereço: Rua José Alves Pereira – nº 250\r\nBairro: Anápolis, Caratinga / MG	CEP: 35300-187\r\nTelefone: 0(xx)33 3321-5319\r\n	ESCOLARIDADE\r\n-	Cursando terceiro período no curso de Ciência da Computação em Caratinga – MG. FACICOMP – FIC.\r\n-	Concluinte do 3º ano do 2º GRAU. Escola Estadual José Augusto Ferreira.\r\n-	Aprovado no vestibular da UNIFENAS (www.unifenas.br) realizado em 26/10/03. Curso: Web Design (Criação de Web Sites, Programação para os mesmos).\r\n	OBJETIVO\r\n-	Executar todas as tarefas a mim confiadas pela empresa, com interesse, responsabilidade e comprometimento.\r\n	CURSOS DE APERFEIÇOAMENTO\r\nCurso de computação – Escola de Informática Info Byte:\r\n-	I.P.D. (Introdução a Processamento de Dados)\r\n-	Windows 98 SE\r\n-	Word 2000\r\n-	Excel 2000\r\n-	Power Point 2000\r\n-	Access 2000\r\n-	Secretariado (Aplicado à Informática)\r\n-	Contabilidade (Aplicado à Informática)\r\n-	Administração (Aplicado à Informática)\r\n-	Técnicas Empresariais\r\n-	Propaganda e Publicidade (Aplicado à Internet)\r\n-	Internet\r\nCurso de PHP - CESAI – Ipatinga\r\n-	Banco de dados mySQL	(um ano e meio de experiência)\r\n-	PHP a nível avançado	(um ano e meio de experiência)\r\n\r\nCurso de Flash 5 e MX 2004 – Aula On Line pelo site Web Aula\r\n-	Conhecimento dos programas Macromedia Flash 4, 5 e MX e MX 2004\r\n-	Nível intermediário em ActionScript 2.0\r\n-	Montagem de Banners e Web Sites (Arquitetura, Design e Usabilidade)\r\nConcluinte do curso de PHP do site www.SCRIPTBRASIL.com.br\r\n	EXPERIÊNCIA PROFISSIONAL\r\n-	Programador contratado em PHP, empresa DoctumTec de Caratinga / MG (33224285).\r\n-	Programador estagiário em PHP, empresa DoctumTec de Caratinga / MG (33224285).\r\n-	Web designer da empresa Todeschini informática de Caratinga / MG (0xx33 3321 8991).\r\n-	Digitação Colegiado 2004 – 6ª SRE Caratinga MG\r\n-	Estagiário na escola de informática Pró-Info;\r\n-	Professor do programa Macromedia Flash 5 na escola TEK MICRO Informática;\r\n-	Professor de informática Básica na Escola Estadual José Augusto Ferreira;\r\n-	Portifólio:\r\nhttp://www.portalcaratinga.net\r\nhttp://www.tricolorpaulista.com (programação)\r\nhttp://www.ebrasil21.com – Comércio Eletrônico (fora do ar, mas tenho salvo o projeto)\r\nhttp://www.ebrasil21.com/admin/ (fora do ar, mas tenho salvo o projeto) (área administrativa, usuário “rodrigo”, senha “123456”)\r\nhttp://www.ibiju.com.br\r\nhttp://www.ibiju.com.br/admin/ (área administrativa, senha e usuário restritos)\r\nhttp://www.premiolionsdejornalismo.com.br (último mês online Abril de 03)\r\nhttp://www.copalestedevoolivre.hpg.com.br (off-line)\r\nhttp://www.skthead.hpg.com.br (off-line)\r\n', '2', NULL, 'carlos.arruda', '2005-11-28 00:00:00', 'Ótima, contratado o Rodrigo e o Dimas será tb, pelo menos por 3 meses.', NULL),
