	(169, 3, '36000', '46800', '', 4, 633, 'Testes / Homologação', 'Ajudar nos testes / homologação da fase 1 do sistema.', '2', NULL, 'carlos.arruda', '2006-02-01 00:00:00', 'Feita a reuniao de testes com alguns problemas em 3 funcionalidades.\r\nJá passadas para o Bruno repassar pra fábrica.\r\nNova reuniao agendada para segunda-feira (06/02) a tarde.', NULL),
	(170, 3, '50400', '57600', '', 4, 633, 'Testes / Homologação - Fase 1', 'Testes / Homologação - Fase 1', '2', NULL, 'carlos.arruda', '2006-02-07 00:00:00', 'Feito, alguns problemas ainda identificados.\r\n\r\n3. Na pop de alerta de pedidos com forma de pgto indefinido\r\n\r\n- "definir", com letra d minuscula na pop-up \r\n\r\n\r\n4. Pedidos Pendentes de Aprovação \r\n\r\n- Nao está aparecendo nenhum pedido pendente de aprovacao, essa primeira etapa nao está funcionando.\r\n\r\n\r\n7. Novo Pedido\r\n\r\n- Colocar uma gif "carregando" para quando selecionar a cor do item.\r\n- Alterar o nome do campo "Desconto" para "Desconto unitário"\r\n- Ao lado do desconto colocar a seguinte frase no campo: "Após a confirmação do item será calculado o desconto final de todos os itens deste pedido."\r\n- Caso seja um cnpj desabilitar o campo "CNPJ da Emp. Relacionada" e "Empresa Relacionada". \r\n\r\n\r\n5. Consulta da Carteira de Pedidos\r\n\r\n- Em relatório o sistema nao está ordenando quando número, testamos pela coluna "tempo ped fim do mes".\r\n- Em relatório a coluna "Previsão" já traz por default "Sem previsão".\r\n\r\nNo excel: Arrumar titulo da cor 2, deixar como a cor 1 só que 2.\r\nNo excel: Deixar tudo alinhado para esquerda, e sem espaços, estão aparecendo 2 espaços em branco.', NULL),
	(171, 6984, '37800', '41400', '', 4, 710, 'Apresentação do protótipo', 'Apresentação do protótipo', '2', NULL, 'carlos.arruda', '2006-02-06 00:00:00', 'Mais algumas alteracoes solicitadas, estaremos alterando e publicando as alteracoes.\r\n\r\nFicamos no aguardo tb de um email do Eduardo com alguns campos de formulario necessarios.', NULL),
	(172, 4343, '55800', '59400', '', 4, 725, 'Reunião de apresentação do sistema em produção', 'Reunião de apresentação do sistema em produção.\r\n\r\nOlá Carlos! \r\nA apresentação pode ser feita na Pirelli (escritório da Berrini) às 15:30h.\r\nObrigado e um abraço,\r\n\r\nRodolfo Neute Borges \r\nPirelli Pneus S.A. - Sales System \r\nTel 00 55 11 5508 9449 \r\nFax 00 55 11 5508 9457 \r\ne-mail. rodolfo.borges.st@pirelli.com.br \r\n\r\nEnvolvidos: Andrade Humberto Miranda de, BR / Takano Fabio, BR / Otsuki Luciana Ferraz Takimoto, BR', '2', NULL, 'carlos.arruda', '2006-02-08 00:00:00', 'Feita a apresentacao, solicitaram que mantivessem o Calendario Pirelli, deixamos dinamico tb.', NULL),
	(173, 0, '25200', '25200', '', 8, 0, 'Reuniao do LP e Guto na BRT', 'Reuniao do LP e Guto na BRT', '2', NULL, 'carlos.arruda', '2006-02-20 00:00:00', 'Demissão na BRT de 900 funcionarios. Nao tem a minima condicao de colocarmos gente lá.\r\nEssas informacoes vieram do Guto da Acc.', NULL),
	(174, 6988, '25200', '25200', '', 3, 0, 'Visita para discutir possível novo projeto', 'Visita para discutir possível novo projeto.\r\nCom Ricardo Meira e Rodrigo Ferreira (dono do buteco).', '2', NULL, 'carlos.arruda', '2006-02-08 00:00:00', 'Gostaram da apresentacao da Agence, acredito que iremos fazer projetos juntos, onde a Agence faça a especificacao junto com eles e depois podemos fabricar o software.', NULL),
	(175, 0, '50400', '53100', '', 8, 0, 'Ligação de Ricardo da JackBe', 'Ligação de Ricardo da JackBe dos EUA.', '1', NULL, 'carlos.arruda', '2006-02-21 00:00:00', '', NULL),
	(176, 0, '50400', '54000', '', 8, 0, 'Reunião com Adalberto da Webraska', 'Reunião com Adalberto da Webraska - Projeto Consulta Frete.', '2', NULL, 'carlos.arruda', '2006-02-08 00:00:00', 'Ficou de enviar tabela de preços para as nossas necessidades e liberar um webservice para que possamos testar o retorno do sistema deles. Me parece que eles tem a tecnologia, no entanto nao possuem a solucao pronta.', NULL),
	(177, 3, '50400', '59400', '', 4, 633, 'Homologação da fase 1', 'Homologação da fase 1.\r\nPoucos itens pendentes agora. Provável validação nesse dia.', '2', NULL, 'carlos.arruda', '2006-02-09 00:00:00', 'Ainda alguma coisa pendente, alguns itens não puderam ser testados por causa do servidor de homologacao da Toyota, problemas de configuracao.', NULL),
	(178, 0, '25200', '25200', '', 8, 0, 'Aniversário da PRI', 'Aniversário da PRI', '1', NULL, 'carlos.arruda', '2006-02-25 00:00:00', '', NULL),
	(179, 3, '54000', '61200', '', 4, 633, 'Homologação da fase 1', 'Homologação da fase 1', '2', NULL, 'carlos.arruda', '2006-02-14 00:00:00', 'Teste feito, ainda ficamos com alguns problemas em relação a tela de pendente de aprovação versao VD. Digão vai amanhã na Toyota tentar resolver esse problema de ambiente.\r\n\r\nSegue abaixo descricao das pendencias:\r\n\r\n1. Pedidos Pendentes de Aprovação \r\n\r\n- Nao está aparecendo nenhum pedido pendente de aprovacao.\r\n- Colocar essa frase quando nada encontrado: "Nenhuma ocorrência encontrada"\r\n- Somente os novos pedidos a partir do momento que entrar em producao esse upgrade tem que seguir esse fluxo.\r\n\r\n\r\n2. Novo Pedido\r\n\r\n- Aviso da segunda frase ainda nao está correto no item do pedido: "Ajustando valores, aguarde..." somente. Nao precisa dizer que está ajustando valores de desconto... Tem que ficar igual a primeira frase.\r\n- Quando o campo "ramo de atividade" for solicitado por causa do tipo do cliente, deixar esse campo como obrigatorio.\r\n\r\n\r\n3. Consulta da Carteira de Pedidos\r\n\r\nNo excel: Arrumar titulo da cor 2, deixar como a cor 1 só que 2. Do mesmo jeito do primeiro "Cor 2ª Opção"\r\n\r\n\r\n4. Consulta de pedidos\r\n\r\n- Deixar o cursor já habilitado nesse campo "cod. pedido" como default. Utilizar jscript de on_focus ou outra solução do tipo. O login do CAOL funciona assim, é só exibir o fonte da tela de login.\r\n', NULL),
