	(187, 46, '25200', '25200', '', 2, 724, 'Entrar em contato com Fábio Carvalho', 'Carlos,\r\n \r\nObrogado pela nova proposta. Vamos fazer então. Mas tem um detalhe, como as páginas novas são para fundos novos quen estamos abrindo, e a abertura dos novos fundos depende de aprovação da CVM (orgão do governo que regula o nosso negócio), essas alterações só podem ir pro ar após conseguirmos estas aprovações (o que deve acontecer em só após o Carnaval. Assim o idealseria só inixciarmos um pouco mais pra frente, pois se fizermos agora não poderia ir direto pra ar. \r\nAssim, considere que vamos fazer, mas planeje pra começar após o Carnaval, pode ser?\r\n \r\nAbraços,\r\n \r\nFabio', '2', NULL, 'carlos.arruda', '2006-03-13 00:00:00', 'Feito. Início autorizado. Segue email:\r\n\r\n"Carlos,\r\n\r\nOk, perfeito, vamos lá.\r\n\r\nUm dos itens, que é colocar um selo da Anbid na primeira pagina, preciso te mandar a imagem da Anbid, e precisamos definir juntos um lugar pra colocar.\r\n\r\nAbraços,\r\n\r\nFabio"', NULL),
