	(199, 0, '25200', '25200', '', 8, 0, 'Viagem para SP', 'Retorno do Rio.\r\nGaleao -> Guarulhos\r\n21:10\r\n\r\nData de emissco: 06Mar06\r\nPassageiro(a): CARLOS FLAVIO GIRAO ARRUDA\r\nLocalizador: HEXIHZ\r\ne-Ticket(s):   957 2313 921356', '2', NULL, 'carlos.arruda', '2006-03-12 00:00:00', 'Assaltado na porta da casa da Pri.\r\nFurto de Documentos - B.E.O. 44910/2006\r\n\r\nDetalhes da Ocorrência  \r\n \r\n \r\n \r\n \r\nTipo da ocorrência : Furto de Documentos \r\nTipo do documento : Pessoal \r\nInformações sobre o tipo do documento : Talão de cheques: Banco HSBC, Agência 2005, Conta número 03466-06 \r\n \r\n \r\n \r\nTalões de Cheques e/ou Cartões de Crédito: Foram furtadas as folhas de cheques com a seguinte numeração: 202466 202467 202468 202469 202470 202471 202472 202473 202474 202475 202476 202477 202478 202479 202480  \r\n \r\n \r\n\r\n \r\nConte-nos como aconteceu : Havia chego em casa de taxi e tinha deixado a bolsa no porta-malas. O taxista abriu o porta malas por dentro do veículo, fiquei fazendo o pagamento da corrida e quando fui pegar a minha bolsa no porta malas ela havia sumido. Possivelmente alguém passou por trás do veículo no tempo do preenchimento do cheque e levou a bolsa. \r\n \r\n   \r\n  \r\n \r\n   \r\n Informações do Atendimento  \r\n \r\n \r\nData de Cadastro: 13/03/2006 11:14:27 \r\nObservações: A redação do presente B.E.O. foi elaborada exclusivamente pelo declarante, sendo que as informações constantes são de sua exclusiva responsabilidade. B.E.O. validado baseando-se exclusivamente nos dados presentes nesta planilha eletrônica, em vista da consistência nas informações apresentadas. Filiação completa: Jose Fabiano Branco de Oliva. \r\nAutorizado por: Renata C \r\nData de atendimento: 13/03/2006 13:27:57 ', NULL),
