	(204, 6, '64800', '68400', '', 8, 678, 'Reunião com Gui de alinhamento de reuniões', 'Reunião com Gui de alinhamento de reuniões', '2', NULL, 'carlos.arruda', '2006-03-15 00:00:00', 'Fechado os seguintes pontos:\r\n\r\n- Tipo de busca: alterar a ordem, veículo primeiro.\r\n- Apresentar o resultado das buscas, quantos veículos/cargas encontrados.\r\n- Resultado com 10 linhas por página.\r\n- Filtro de quantidade de resultados por pagina.\r\n- Botão de anunciar a busca solicitada preenchendo no anúncio os dados parametrizados.\r\n- Ao lado dos itens tipo de busca, origem e tipo de veiculo um ponto de interrogacao como help.\r\n\r\n\r\n\r\nANUNCIAR CARGA\r\n\r\n- Tipo de veiculo com combo unica, com grupos e sub-grupos (similar a 123)\r\n- Dados para contato, adicionar mais um numero.\r\n- Dados opcionais, somente qtde de veiculos e obs.\r\n- Adicionar multiplas cargas\r\n- Em modo multiplo adicionar o campo de obs.\r\n\r\n\r\nANUNCIAR VEICULO\r\n\r\n- Trocar o nome do modo avancado para modo multiplo\r\n- Adicionar o modo avancado\r\n- Tipo de veiculo com combo unica, com grupos e sub-grupos (similar a 123)\r\n- Dados para contato, adicionar mais um numero.\r\n- Dados opcionais, somente qtde de veiculos e obs.\r\n- Em modo multiplo adicionar o campo de obs.', NULL),
