	(235, 0, '25200', '25200', '', 8, 0, 'Cobrar pagamento da FC2 referente a job da TIM.', 'Pagamento da FC2 referente a job da TIM.\r\nEra dia 19/05 sexta-feira.\r\n----\r\nCarlos,\r\n\r\nVerifiquei seu pagamento e o mesmo já se encontra com a minha controladoria para liberação de pagamento, mas adianto que Alexandre Piza já programou para o dia 19/05/06.\r\n\r\nEstarei depositando nesta data, na conta correspondente abaixo conforme solicitado.\r\n\r\nDesde já, agradeço sua atenção e compreensão.\r\n\r\nGrata,\r\nEliana Barbosa\r\nFC 2 Marketing Promocional e Eventos\r\nFinanceiro\r\nTel.        :  55.11.3887.77.28', '2', NULL, 'carlos.arruda', '2006-06-02 00:00:00', 'Pago hoje.', NULL),
