	(238, 3, '25200', '25200', '', 2, 0, 'Falar com M1 (4390-5134) a respeito do Andon.', 'Falar com M1 a respeito do Andon.\r\nVerificar possibilidade da gente assumir as horas dimensionadas internamente deles para desenvolver o Andon no mesmo custo.', '1', NULL, 'carlos.arruda', '2006-05-31 00:00:00', '', NULL),
	(239, 6984, '50400', '52200', '', 2, 0, 'SGC - Verificar se vão voltar a agitar o esquema', 'SGC - Verificar se vão voltar a agitar o esquema', '2', NULL, 'carlos.arruda', '2006-06-13 00:00:00', 'Retornado o e-mail do cliente.\r\nSegue abaixo:\r\nCarlos,\r\nConforme havíamos falado há alguns dias, retomaremos o projeto do SGC agora em junho. \r\nGostaria de verificar com você a possibilidade de marcarmos uma reunião par discussão da proposta previamente apresentada por vocês e início dos trabalhos. \r\nComo ña semana que vem, estarei fora alguns dias e haverá jogo do Brasil, minha sugetsão é marcarmos na semana do dia 26, pode ser?\r\nVocês podem na 2a ou 3a feira, dias 26 ou 27?\r\n \r\nAbs,\r\n', NULL),
	(240, 0, '25200', '25200', '', 8, 0, 'Conta Casa - IPTU', 'R$ 39,83\r\n"817900000008 398300003355 299091011559 682000140637" maio\r\nCad. Imóvel: 299.091.0115-5', '2', NULL, 'carlos.arruda', '2006-06-25 00:00:00', 'pago mes de maio', NULL),
	(241, 6999, '25200', '25200', '', 8, 0, 'Enviar proposta para o site de relacionamento', 'Boa tarde,\r\n\r\n \r\n\r\nMeu nome é Carlos Arruda e sou consultor de negócios da Agence.\r\n\r\nA respeito de site de relacionamento o que necessitamos é de um escopo definido, para que possamos dessa forma gerar um dimensionamento de tempo e preço para o projeto.\r\n\r\n \r\n\r\nO exemplo do site www.parperfeito.com.br pode ser considerado o escopo do projeto sem nenhum outro link a mais ou a menos? Tem como a gente estar falando com o cliente diretamente para esclarecer alguns pontos?\r\n\r\n \r\n\r\nAtt.;\r\n\r\nCarlos F. G. Arruda\r\n', '2', NULL, 'carlos.arruda', '2006-05-17 00:00:00', '', NULL),
	(242, 6988, '57600', '65700', '', 4, 735, 'Definição do caminho a seguir', 'Definição do caminho a seguir', '2', NULL, 'carlos.arruda', '2006-05-19 00:00:00', 'Contratada uma pessoa no Ideas para o desenvolvimento de documentos de especificação (Priscila).\r\nIremos conduzir o projeto Satipel para apresentação no começo de junho. O projeto continua quente.\r\n', NULL),
	(243, 0, '25200', '25200', '', 8, 0, 'Cobrar KK do projeto e-man.', 'Cobrar KK do projeto e-man.', '3', NULL, 'carlos.arruda', '2006-05-24 00:00:00', 'Lançado como tarefa.', NULL),
	(244, 7001, '25200', '25200', '', 2, 0, 'Falar com Miguel', 'Ligar para Miguel para agendar uma hora para apresentar TIMCAOL e seus derivados.\r\n\r\n11-8111-3485', '2', NULL, 'carlos.arruda', '2006-05-19 00:00:00', 'Marcada a reunião/apresentação para o dia 23/05 às 10:00.', NULL),
	(245, 0, '27000', '36000', '', 8, 0, 'Reunião com Alexandre Rodrigues', 'Reunião com Alexandre Rodrigues.\r\n\r\nCombinado 7:40 estarei te ligando. \r\nObrigado !!\r\nAbrs, AR.\r\n(21) 8244-5886\r\n\r\nOn 5/18/06, Carlos Flavio G. Arruda <carlos.arruda@agence.com.br> wrote: \r\nConfirmado então.\r\nDia 24/05 às 07:40 ok?! \r\nMe liga nesse número esse horário porque já estarei indo para o estacionamento do flat Prive Cidade Jardim. \r\n\r\nAbrs.;\r\nCarlos F. G. Arruda', '2', NULL, 'carlos.arruda', '2006-05-24 00:00:00', 'Preparado. \r\nNecessita de um fixo meio pesado para se sustentar pelo período de 3 meses, sugeriu 3k + comissao, veremos o que será enviado como proposta.', NULL),
	(246, 7001, '36000', '42300', '', 3, 0, 'Apresentação dos produtos Agence TIM', 'Apresentação dos produtos Agence TIM para Miguel Dickmann.', '2', NULL, 'carlos.arruda', '2006-05-23 00:00:00', 'Apresentado.\r\nFicaram muito interessados numa possível parceria no desenvolvimento de uma aplicação revolucionária para vender para o Brasil todo, eles ganhando 15% de comissão.  Pelo menos foi assim que negociaram com a empresa Argentina, mas ficaram mais interessados em nós por causa de nossa expertise no negócio e por nós estarmos a frente no protótipo.\r\n\r\nO sistema de automação comercial que eles utilizam no momento é o da Bematech (http://www.bematech.com.br/), no qual precisaremos integrar.\r\nA empresa Argentina que tem filial no Brasil se chama Full Field eu acho.', NULL),
	(247, 0, '25200', '25200', '', 8, 0, 'Retirada dos móveis para doação', 'Retirada dos móveis para doação.\r\n4 mesas.', '2', NULL, 'carlos.arruda', '2006-05-24 00:00:00', 'retirado 3 mesas. A quarta ficará com empregada do Bruno.', NULL),
	(248, 7002, '25200', '25200', '', 1, 0, 'Falar com Adriano da TI da Oi', 'Falar com Adriano da TI da Oi', '2', NULL, 'carlos.arruda', '2006-05-17 00:00:00', 'Falou que enviaria uma RFP pela área de compras para nossa cotação.\r\nVamos aguardar.', NULL),
	(249, 7002, '25200', '25200', '', 2, 0, 'Verificar com Adriano a respeito da RFP que ele estaria envi', 'Verificar com Adriano a respeito da RFP que ele estaria enviando.\r\nTalvez o melhor seja enviar um e-mail cobrando de forma amena. Sem pressão.', '1', NULL, 'carlos.arruda', '2006-06-30 00:00:00', 'Enviado um e-mail e ainda não retornado.', NULL),
	(250, 0, '50400', '54000', '', 8, 0, 'Reunião com Fernando Marinho', 'Reunião com Fernando Marinho.\r\nFinalização de contrato e alguma proposta para continuidade.', '2', NULL, 'carlos.arruda', '2006-05-24 00:00:00', 'Ficamos de dar retorno para ele no dia 06/06 para uma possível vaga de CN.', NULL),
	(251, 3, '50400', '54000', '', 4, 0, 'BluePrint - Upgrade de Integração', 'Definição de onde buscar os dados da ANFAVEA utilizados pelo sistema BP.', '2', '7200', 'bruno.freitas', '2006-05-25 00:00:00', 'Explicação do sistema TSM pelo pessoal responsável. Alguns pontos que podem ser citados:\r\n\r\n1) Bases do sistema não ficam no ambiente de Ti da Toyota (atualmente estão no CENU juntamente com o aplicativo).\r\n2) Os dados do sistema TSM são confiáveis e estão atualizados. Isso implica que o sistema BluePrint pode utilizar os dados já carregados sem a necessidade de realizar uma nova carga.\r\n3) A Toyota (Alexandre) está estudando uma solução para que o BluePrint possa ler diretamente os dados que são carregados pelo sistema TSM (migração de bases, espelhamento, etc).', NULL),
	(252, 3, '52200', '57600', '', 4, 0, 'Apresentação da Agence para Engenharia de Produtos', 'Apresentação da Agence para Engenharia de Produtos da Toyota, em SBC.\r\nIndicada pelo Humberto de Indaiatuba, Cristina Kato da Toyota SBC (Engenharia de Produtos) entrou em contato com o objetivo da Agence propor uma nova solução para o sistema de banco de dados deles.\r\n\r\n021 11 4390 5297', '2', NULL, 'carlos.arruda', '2006-05-25 00:00:00', 'Ótima reunião, foi entregue um CD com o banco de dados access atual que eles possuem.\r\nIremos startar o projeto batizado de SEP (Sistema de Engenharia de Projetos), com o acompanhamento de Umberto Marangoni Neto da TI IDT.\r\n', NULL),
	(253, 3, '50400', '57600', '', 4, 321, 'Apresentação da última versão do protótipo para homologação', 'Apresentação da última versão do protótipo para homologação do cliente.\r\nEnvolvidos: Claudia Porto; Lúcia Mara Duarte;Milton Roberto Mattos de Petta;Vivian Cristina Ribeiro G de Lima;Evandro Luiz Maggio;Ronaldo da Silva Ramada;', '2', NULL, 'carlos.arruda', '2006-05-29 00:00:00', 'Feita apresentaçao.\r\nDimensionamento concluído e já enviado proposta comercial.', NULL),
	(254, 6988, '30600', '36000', '', 4, 735, 'Discussão sobre o futuro do projeto', 'Discussão sobre o futuro do projeto.\r\nKSales e KContent', '2', NULL, 'carlos.arruda', '2006-05-25 00:00:00', 'Combinado que validariam inicialmente todo o projeto para que depois enviassem para dimensionamento.', NULL),
	(255, 6988, '36000', '42300', '', 4, 0, 'GED', 'Discutir com o cliente dele sobre uma possível solução GED web.\r\nO cliente é a Megafiles (http://www.megafiles.com.br) que faz serviços de guarda e digitalização de documentos.\r\nServiços prestados pela Megafiles:\r\nOrganização e Guarda de Arquivos\r\nGerenciamento Eletrônico de Documentos\r\nDigitalização de Documentos\r\nInformatização de Departamentos\r\n\r\n', '2', '14400', 'carlos.arruda', '2006-06-01 00:00:00', 'Atendido, iremos fazer um protótipo em cima do que foi enviado agora.', NULL),
	(256, 3, '52200', '57600', '', 4, 835, 'Apresentação de V0 do projeto', 'Apresentação de V0 do projeto', '2', '10800', 'carlos.arruda', '2006-06-01 00:00:00', 'Apresentado, detalhes foram levantados que serao corrigidos para a proxima apresentacao.', NULL),
	(257, 7005, '36000', '43200', '', 3, 0, 'Apresentação da empresa e coleta de informação', 'Apresentação da empresa e coleta de informação', '2', NULL, 'carlos.arruda', '2006-05-30 00:00:00', 'Apresentado a empresa.\r\nIrão enviar informações para orçamento de implementação até quinta-feira. \r\nPara que possamos dimensionar o projeto e enviar proposta comercial.', NULL),
	(258, 6988, '54000', '61200', '', 4, 0, 'Acompanhamento de Projetos', 'Acompanhamento de Projetos', '2', '7200', 'bruno.freitas', '2006-05-31 00:00:00', 'Reunião com a Controle para demonstração do KSales.', NULL),
	(259, 7006, '54000', '59400', '', 4, 0, 'Apresentação da primeira versão do protótipo', 'Apresentação da primeira versão do protótipo', '2', NULL, 'carlos.arruda', '2006-06-12 00:00:00', 'Ajustes necessários detectados, faremos nova apresentação provavelmente na sexta-feira próxima.', NULL),
	(260, 7005, '25200', '25200', '', 6, 839, 'Enviar proposta por hora e estimativa de pacote fechado', 'Enviar proposta por hora e estimativa de pacote fechado', '2', NULL, 'carlos.arruda', '2006-06-05 00:00:00', 'Boa noite Guilherme,\r\n\r\nMeus analistas retornaram o dimensionamento para o projeto de upgrade no WebCli e ficaram várias dúvidas em relação ao escopo completo, para que realmente fosse viável um dimensionamento real de nossa fábrica era necessário uma imersão com vocês para que entendêssemos totalmente a sua necessidade e possivelmente a geração de um protótipo.\r\n\r\nPara que não precisemos fazer esse trabalho nossa sugestão é o banco de horas mesmo, melhor solução para o caso de um desenvolvimento XP (Extreme Programmer), que é o caso da Archivum.\r\n\r\nCom isto, segue anexo nossa proposta de banco de horas, onde nossa fábrica se abre para a Archivum como se fosse uma TI, codificando on-demand.\r\n\r\nVeja que esse formato é o mais viável em termos de tempo e custo, tempo porque pode ser iniciado logo de imediato e custo porque banco de horas cobramos R$ 32,00 / hora e projeto fechado de R$ 42,00 a R$ 48,00 / hora.\r\n\r\nVeja o que acha da proposta e me retorne por favor.\r\n\r\nP.S.: Temos disponibilidade imediata para início.\r\n\r\nAbrs.;\r\nCarlos', NULL),
	(261, 7005, '25200', '25200', '', 2, 839, 'Fazer contato a respeito da proposta enviada.', 'Fazer contato a respeito da proposta enviada para ter um feed-back do cliente e até mesmo para explicar melhor a proposta de banco de horas.\r\n\r\nGuilherme Bonatelli\r\n19-3256-4422', '2', NULL, 'carlos.arruda', '2006-06-07 00:00:00', 'O Guilherme falou que estaria recebendo as outras propostas e que até o final dessa semana ele concluiria essa operação.\r\nAdmitiu ter o escopo um pouco aberto demais, e acredito que tenha entendido a questão do banco de horas.', NULL),
	(262, 3, '52200', '57600', '', 4, 835, 'Apresentação de V1 do projeto', 'Apresentação de V1 do projeto e estimativa de custos', '2', NULL, 'carlos.arruda', '2006-06-06 00:00:00', 'Apresentado, voltei para o escritório e enviei o seguinte e-mail.\r\n\r\nBoa tarde Cristina,\r\n\r\nComo combinado segue link de acesso ao sistema EMS - Engineering Management System.\r\n\r\nhttp://www.agence.com.br/propostas/toyota/ems/\r\n\r\nA estimativa para esse projeto baseado na quantidade atual de links e funcionalidades é de em torno de 600 horas de desenvolvimento, envolvendo as fases de documentação de especificação, análise, projeto, codificação, testes e implantação. \r\nEssa quantidade de horas daria em torno de R$ 30.000,00 levando em conta um sistema 100% web desenvolvido na plataforma java com banco de dados Oracle.\r\nÉ claro que isso é uma estimativa, nada oficial, apenas para efeito de estudo de viabilidade econômica financeira de vocês, inclusive ROI.\r\n\r\nNossos modelos de contrato de manutenção corretiva/evolutiva pós-implantação são 2:\r\n\r\n1 - Manutenção via OS on-demand: A cada necessidade detectada é feita uma solicitação formal para um gestor de TI da Toyota que em seguida nos acionará bem como outras consultorias, enviaremos então um dimensionamento de tempo/preço para a TI Toyota que junto com outros orçamentos irá escolher quem irá atender a necessidade do EMS, feito isso desenvolve-se a melhoria.\r\n\r\n2 - Manutenção via Banco de Horas: É comprada pela área requisitante um banco de horas da "fábrica" Agence, onde esse volume de horas é traduzido num valor em reais que é parcelado no número de vezes que for acordado. Esse volume de horas fica como um pré-pago, que na medida que se vai utilizando ele vai diminuindo, até se esgotar. A vantagem desse modelo é a burocracia muito menor e o preço por hora que sem dúvida será o melhor.\r\n\r\nEm relação a essa sua próxima apresentação para seus superiores diretos, em caso positivo, o próximo passo é validarmos tela-a-tela para que dessa forma possamos fechar em definitivo o escopo desse projeto, e então passar um orçamento definitivo e oficial. Com isso outras consultoria também passarão, mas isso ficará a cargo da TI Toyota gerenciar.\r\n\r\nNo aguardo de seu retorno na sexta-feira (09/06).\r\nAbrs.;\r\nCarlos', NULL),
	(263, 3, '25200', '25200', '', 8, 0, 'BluePrint', 'Instalação do BP em homolog.', '1', NULL, 'bruno.freitas', '2006-06-06 00:00:00', '', NULL),
	(264, 3, '36000', '39600', '', 2, 835, 'Contato para saber a respeito da apresentação aos superiores', 'Contato para saber a respeito da apresentação aos superiores, confirmando se há budget para o projeto Java ou não.', '2', NULL, 'carlos.arruda', '2006-06-09 00:00:00', 'Feito. A Cristina irá apresentar para mais alguns gerentes.\r\nNa semana que vem irá para a Argentina e depois no final da semana deverá dar um retorno a respeito do projeto.\r\nProvavelmente esquentou o projeto.\r\nLembrar de retirar o site do ar na segunda-feira (12/06).', NULL),
	(265, 6984, '54000', '59400', '', 4, 710, 'Reunião com Eduardo para discussão do projeto', 'Reunião com Eduardo para discussão do projeto.\r\n\r\nCarlos,\r\nConforme havíamos falado há alguns dias, retomaremos o projeto do SGC agora em junho. \r\nGostaria de verificar com você a possibilidade de marcarmos uma reunião par discussão da proposta previamente apresentada por vocês e início dos trabalhos. \r\nComo ña semana que vem, estarei fora alguns dias e haverá jogo do Brasil, minha sugetsão é marcarmos na semana do dia 26, pode ser?\r\nVocês podem na 2a ou 3a feira, dias 26 ou 27?\r\n \r\nAbs,', '2', NULL, 'carlos.arruda', '2006-06-26 00:00:00', 'Solicitado algumas alterações em protótipo já para fechar o contrato.', NULL),
	(266, 7006, '57600', '64800', '', 4, 842, 'Apresentação de V1 do projeto', 'Apresentação de V1 do projeto aqui mesmo na Agence', '2', NULL, 'carlos.arruda', '2006-06-19 00:00:00', 'Mais alguns ajustes solicitados, iremos instalar a última versão do Efile Manager delphi para entender melhor o que deve ser feito.\r\nDevemos fazer mais umas 2 apresentações de protótipo.', NULL),
	(267, 3, '50400', '55800', '', 4, 835, 'Discussão sobre continuidade da prototipagem', 'Discussão sobre continuidade da prototipagem.\r\nProjeto previamente aprovado para desenvolvimento.', '2', NULL, 'carlos.arruda', '2006-06-21 00:00:00', 'Entendido os ajustes, iremos fazer e logo depois marcar mais uma data de apresentação.', NULL),
	(268, 3, '36000', '43200', '', 4, 0, 'Apresentação do sistema Fleet Control Toyota', 'Apresentação do sistema Fleet Control Toyota para análise da funcionalidade comodato para uso de Vendas Diretas.', '2', NULL, 'carlos.arruda', '2006-06-23 00:00:00', 'Apresentado. Nasce assim um novo projeto de Upgrade SVD, controle de comodato.', NULL),
	(269, 3, '32400', '39600', '', 4, 471, 'Apresentação de nossa proposta para a solução com o SIS', 'Apresentação de nossa proposta para a solução com o SIS', '2', NULL, 'carlos.arruda', '2006-06-22 00:00:00', 'Entendido.\r\nMarcamos de apresentar uma proposta técnica na semana que vem.', NULL),
	(270, 6947, '36000', '50400', '', 4, 840, 'Primeira reunião de entendimento do problema', 'Primeira reunião de entendimento do problema.\r\n', '2', '18000', 'carlos.arruda', '2006-06-28 00:00:00', 'Entendido em parte, iniciaremos agora os estudos para agendar nova reunião para se apresentar um caminho de solução.', NULL),
