	(272, 3, '32400', '39600', '', 4, 471, 'Projeto Single Sign-On - Apresentação da proposta técnica (A', 'Projeto Single Sign-On - Apresentação da proposta técnica (AGENCE)', '2', '14400', 'carlos.arruda', '2006-07-03 00:00:00', 'Alinhado o escopo do projeto, devemos agora enviar proposta técnica e comercial para o desenvolvimento do projeto.', NULL),
	(273, 3, '37800', '43200', '', 4, 862, 'Apresentação Protótipo de Controle de Comodato - SVD', 'Apresentação Protótipo de Controle de Comodato - SVD', '2', NULL, 'carlos.arruda', '2006-07-04 00:00:00', 'Apresentado e coletado mais informações para novos ajustes no protótipo.\r\nHj foi envolvido um auditor de processos, Alberto. Do qual ficou nosso aliado pois ele busca um maior controle nos processos internos da Toyota.\r\nNova apresentação já está marcada.', NULL),
	(274, 3, '41400', '45000', '', 4, 710, 'Apresentação de novo protótipo e fechamento do contrato', 'Apresentação de novo protótipo e fechamento do contrato', '2', NULL, 'carlos.arruda', '2006-07-05 00:00:00', 'Apresentado e coletado mais informações do projeto para alteração do protótipo.\r\nFicou combinado que dia 13 eles estarão se fechando numa sala para sanar todas dúvidas do projeto para dia 14 reunirmos novamente e fechar o protótipo.', NULL),
	(275, 6988, '52200', '57600', '', 4, 735, 'Reunião relacionada ao KSales', 'Reunião relacionada ao KSales', '2', NULL, 'carlos.arruda', '2006-07-03 00:00:00', 'O cliente pediu para entrar com o sistema até o final da semana, para cadastro dos clientes.', NULL),
	(276, 3, '36000', '41400', '', 4, 862, 'Nova apresentacao da solução', 'Nova apresentacao da solução', '2', NULL, 'carlos.arruda', '2006-07-10 00:00:00', 'Apresentado para Ricardo, Murilo e Alberto.\r\nAlterações foram solicitadas e serão feitas. Provavelmente a nova apresentacao será virtual.', NULL),
	(277, 6988, '52200', '55800', '', 4, 0, 'KSales', 'Definições KSales.', '2', '3600', 'bruno.freitas', '2006-07-04 00:00:00', '', NULL),
	(278, 3, '50400', '57600', '', 4, 835, 'Apresentação das alterações', 'Apresentação das alterações e coleta de novas solicitações.', '2', '14400', 'carlos.arruda', '2006-07-07 00:00:00', 'Apresentação feita para a Cris e Itamar. As alteraçoes serao feitas sem problemas para apresentacao na proxima sexta-feira.\r\nItamar é outro engenheiro que controla os projetos, tanto de peças, testes e cronograma. Os upgrades solicitados por ele devem trazer uma complexidade boa para o projeto.', NULL),
	(279, 3, '32400', '36000', '', 4, 862, 'Apresentação das alterações em protótipo', 'Apresentação das alterações em protótipo', '2', NULL, 'carlos.arruda', '2006-07-13 00:00:00', 'Validado.\r\nIremos agora dimensionar e enviar proposta para o Centuriao, como solicitado e sugerido pelo Ricardo Ribeiro, para evitar transtornos com a TI.', NULL),
	(280, 3, '50400', '57600', '', 4, 835, 'Apresentação das alterações em protótipo', 'Apresentação das alterações em protótipo, agora considerando as do Itamar tb.', '2', '10800', 'carlos.arruda', '2006-07-14 00:00:00', 'Apresentado e coletado as informações sanando todas as dúvidas que haviam. Pelo menos até a próxima geracao de prototipo.\r\nProxima visita agendada para sexta-feira dia 21.', NULL),
	(281, 3, '50400', '55800', '', 4, 471, 'Apresentação da proposta técnica', 'Apresentação da proposta técnica', '1', NULL, 'carlos.arruda', '2006-07-18 00:00:00', '', NULL),
	(282, 2730, '36000', '41400', '', 3, 0, 'Apresentação da proposta técnica', 'Apresentação da proposta técnica', '1', NULL, 'carlos.arruda', '2006-07-19 00:00:00', '', NULL),
	(283, 3, '32400', '41400', '', 4, 480, 'Reunião para dirimir dúvidas', 'Reunião para dirimir dúvidas', '1', NULL, 'carlos.arruda', '2006-07-28 00:00:00', '', NULL),
	(284, 3, '50400', '55800', '', 4, 835, 'Últimos pontos do projeto', 'Últimos pontos do projeto', '1', NULL, 'carlos.arruda', '2006-07-28 00:00:00', '', NULL),
	(285, 7013, '55800', '59400', '', 3, 0, 'Visita para apresentação da empresa e coleta de dados', 'Visita para apresentação da empresa e coleta de dados', '2', '10800', 'carlos.arruda', '2006-08-03 00:00:00', 'Empresa apresentada e coletado dados para upgrade em sistema ASP+Oracle. Segue discurso do Luiz a respeito:\r\n\r\nComo  já lhe expliquei, esse aplicativo foi desenvolvido por um analista externo, não possuimos a documentação do sistema e no momento esse analista não está disponível para nos prestar esse serviço. \r\n\r\nEsse aplicativo foi desenvolvido para uma finalidade específica, voltada para o plano de carreira de nossos empregados. \r\n\r\nNossa necessidade atual é utiliza-lo na geração do orçamento de pessoal para 2007, que deve ser concluido até o final de agosto (com possibilidade de alguma negociação de prazo), contudo existe uma decisão de descentralização e participação dos executivos de todas as Vices-Presidências, de forma a que eles possam indicar as suas ações para 2007, prevendo-se assim os desligamentos, admissões e promoções de pessoal. \r\n\r\nComo esse aplicativo já foi desenvolvido para ser  Web, onde os executivos pudessem simular as admissões e desligamentos, acreditamos que possa ser mais facilmente adaptado para essa finalidade, contudo ele não prevê a possibilidade de promoções e possui uma série de travas que necessitam ser removidas, pois ele foi desenvolvido para trabalhar com um orçamento já pré existente e não para a geração de um novo orçamento. \r\n\r\nVide maiores detalhes das regras de negócio, vigentes nesse aplicativo no e-mail abaixo. \r\n\r\nTambém estou lhe enviando um manual operacional, que acredito possa lhe ajudar no entendimento e na leitura dos programas (Manual Planejamento de Pessoal.doc). \r\n\r\n\r\nA nossa necessidade, reduzida ao mínimo de alterações, resume-se em: \r\n\r\n1- Ampliar a faixa de elegíveis para promoção, com base do SRE/SRD, mantendo o ranking 1 e inluindo o ranking 2, ficando excluido o ranking 3 \r\n\r\n2- As promoção poderão ocorrer com alterções de cargos em todas as carreiras, inclusive na carreira executiva. \r\n\r\n3-Inibir as ações de transferências de saída e entrada (iremos processar esses casos, como admissões e desligamentos) \r\n\r\n4- Remover as travas de limitações orçamentária, pois o que estamos fazendo é a geração da provisão do orçamento para 2007 e não a efetivação da movimentação do pessoal. \r\n\r\nSe avaliar que é possivel, nos atender, necessito de uma proposta com o tempo previsto e o custo, para obter a aprovação antes da execussão. ', NULL),
	(286, 7014, '54000', '57600', '', 3, 0, 'Prospecção num projeto de CHAT', 'Prospecção num projeto de CHAT onde iremos hospedar a aplicação.', '2', '3600', 'carlos.arruda', '2006-08-09 00:00:00', '- Mais de 2 milhões de visitantes / mês, em torno de 100 mil por dia.\r\n\r\n- Desejado para o momento 1:\r\n	- 1 moderado\r\n	- 4 abertas\r\n\r\nPara entrar no www.temmais.com (que está dentro de globo.com)\r\n\r\nA TV Tem atende 47% do estado de SP, cerca de 317 cidades, potencial de 7 milhões de de telespectadores.', NULL),
	(287, 3, '54000', '57600', '', 4, 835, 'Apresentação para o M1 sobre o projeto', 'Apresentação para o M1 sobre o projeto', '2', '7200', 'carlos.arruda', '2006-08-08 00:00:00', 'Apresentado para M1 e Ricardo Munhoz.\r\nLiberado dimensionamento do projeto. Acredito que ficaram ressabiados de como foi tratado o projeto, com levantamento de requisitos completo com a Cris Kato, sem conhecimento deles.', NULL),
	(288, 654, '32400', '43200', '', 3, 0, 'Apresentação da empresa e de solução de SAC', 'Apresentação da empresa e de solução de SAC.\r\nViram o Tirenet Pirelli e ficaram interessados.', '2', '14400', 'carlos.arruda', '2006-08-14 00:00:00', 'Apresentado a solução da Pirelli e o TCC da Toyota.\r\nIniciaremos a prototipagem da solução específica para a Lukscolor e apresentaremos na próxima segunda-feira (21/08).', NULL),
	(289, 654, '50400', '61200', '', 4, 902, 'Apresentação do V0 do SAC On-line', 'Apresentação do V0 do SAC On-line', '2', '7200', 'carlos.arruda', '2006-08-21 00:00:00', 'Poucas alterações, gostaram bastante do que viram, nova visita agendada para 24/08 (quinta).', NULL),
	(290, 0, '50400', '55800', '', 4, 902, 'Atualizado: Apresentação de solução SAC - Versão 2.0', 'Apresentação de solução SAC - Versão 2.0\r\n\r\n', '1', NULL, 'wilfried.schooneman', '2006-08-24 00:00:00', '', NULL),
