	(1, 'A Agence é uma empresa com 7 anos de experiência em consultoria e desenvolvimento de sistemas corporativos para web (internet, intranet e extranets).\r\n\r\nEla hoje está presente em 3 cidades (Campo Grande, Brasília e São Paulo) e possui grandes clientes como Bradesco, Toyota, Pirelli, Vivo, TIM, entre outros. No nosso website (www.agence.com.br) disponibilizamos alguns depoimentos de clientes e um portfolio mais completo.\r\n\r\nGostaria de saber da possibilidade de agendarmos um horário para que possamos apresentar melhor a empresa e as soluções que ela possui para o seu segmento, no caso o de');
