INSERT INTO `cao_diary_report` (`co_diary_report`, `hr_gasta`, `co_atividade`, `ds_assunto`, `co_movimento`, `nu_os`, `co_sistema`) VALUES
	(1, '08:10:00', 24, 'Análise, conversa com Alexandre, Wellington e desenvolvimento', 1120, NULL, NULL),
	(2, '08:30:00', 24, 'Em desenvolvimento', 1124, NULL, NULL),
	(3, '14:00:00', 24, 'Em desenvolvimento', 1124, NULL, NULL),
	(4, '08:00:00', 24, 'Trabalhando na fase de análise, definindo as classes de entidade do sistema.', 1116, NULL, NULL),
	(5, '08:10:00', 30, 'Tratamento de inconsistência.\r\nAo exibir os dados de finalização no Formnet, o usuário, que iniciou-se o serviço de "Recisão contratual", não era o mesmo exibido no Formnet.\r\nEncerrando-se, assim esta OS, que estava no estado Reaberta.', 1115, NULL, NULL),
	(6, '11:30:00', 30, 'Elaboração de consulta que impeça os estados não pertencentes à operadora corrente, de serem exibidos (notadamente no ACRE).\r\nE, também, corrigir anormalidade responsável por não trazer localidades existentes da referente operadora.\r\n', 1115, NULL, NULL),
