	(21, 'marcio.paulino', '2006-05-11', '- Reunião com Bruno discutindo um ajuste a ser realizado no SIS, implementando um script para criptografar todas as senhas de prod do sistema. NO SIS novo, existe uma rotina que criptografa a senha do usuario antes de inserir na base de dados, com isso acarreta problema pois irá ocasionar incompatibilidade dos dados (algumas senhas estarão criptografas, outras não). (01:00)\r\n\r\n- Redigindo e respondendo e-mails à Diretoria da Agence, alegando ajuda de custo. (00:45)\r\n\r\n- Redigindo e-mails a Paula com (1) dúvidas do SVD - fase 2 a respeito da consulta de veiculos faturados / devolvidos; e (2) sobre a disponibilização do novo pacote do SVD p/ Homolog. (00:45)\r\n', '02:30:00'),
