INSERT INTO `cao_help_chamado` (`co_chamado`, `ds_chamado`, `ds_solucao`, `co_status`, `co_motivo`, `co_tela`, `co_autor`, `co_filial`, `co_sistema`, `dt_chamado`, `dt_solucao`) VALUES
	(11, 'Mensagem de erro ao tentar finalizar pedido', 'Erro comunicado ao Analista Rui e corrigido. \r\nUsúario avisado da correção.', 2, 2, 5, 26, 30, 93, '2004-10-15', '2004-09-17'),
	(12, 'mensagem de erro ao tentar finalizar pedido', 'Erro comunicado ao Analista Rui e corrigido.\r\nUsúario avisado da correção.', 2, 2, 5, 27, 53, 93, '2004-10-15', '2004-09-23'),
	(10, 'Mensagem de erro ao finalizar pedido.', 'Erro comunicado ao Analista Rui e corrigido. \r\nUsúario avisado da correção e já conseguiu concluir o pedido.', 2, 2, 5, 25, 41, 93, '2004-10-15', '2004-09-23'),
	(9, 'Usúario informou que não consegue logar no sistema com os dados passados pela Toyota.', 'Foi constatado que os dados passados estavam incorretos, liguei para Luciana da Toyota que confirmou o erro e me passou os dados corretos.Liguei para o usuario e informei os dados.', 2, 1, 1, 23, 20, 93, '2004-10-14', '2004-09-23'),
	(14, 'Usúario não encontrou o banco Sudameris para efetuar o pedido com forma de pagamento CDC e estava tentando concluir o pedido preenchendo manualmente o campo banco.', 'Foi sugerido concluir o pedido informando outro banco qqer e informar na observação do pedido o problema.', 2, 1, 3, 29, 23, 93, '2004-10-17', NULL),
	(15, 'Usúario tentava solicitar carta para nota fiscal anterior a implantação do sistema.', 'Uúsario foi informado que não é possivel efetuar tal operação.', 2, 1, 9, 29, 23, 93, '2004-10-20', NULL),
	(16, 'Usúario não encontrou o banco HSBC para efetuar o pedido com forma de pagamento CDC .', 'Usúario cadastrou o pedido com outro banco e descreveu ocorrencia no campo observação do pedido.', 2, 1, 3, 30, 22, 93, '2004-10-20', NULL),
	(18, 'Usuário enviou email dizendo que ao cancelar um pedido o mesmo continuava a aparecer na listagem de pedidos pendentes.', 'Foi simulado em situação idêntica a relatada pelo usuário e o erro não foi constatado. Foi respondido o email explicando este procedimento e solicitado o contato por telefone para efetuar um passo-a-passo da rotina de cancelar pedidos.', 2, 1, 5, 32, 57, 93, '2004-10-23', NULL),
	(17, 'não consegue logar no sistema', 'foi constatado que o login informado ao usuario estava incorreto, entramos em contato com a Carla que informou o login correto e o usuario foi avisado.', 2, 1, 1, 31, 62, 93, '2004-10-22', NULL),
	(19, 'Usúario informou que não é possivel incluir o item RAV4 pois o sistema acusa que o mesmo nao consta tabela de preço.', 'Entrei em contato com a Toyota que informou que o problema será solucionado no dia seguinte.', 2, 3, 3, 27, 53, 93, '2004-10-23', NULL),
	(20, 'Não conseguia entrar no portal, estava usando endereço errado.(HTTP://)', 'informado endereço correto(HTTPS://)', 2, 3, 1, 33, 48, 93, '2004-10-27', '2004-09-27'),
	(21, 'Usúario estava tentando logar com dados do Dealer online.', 'informado login para o SVD', 2, 1, 1, 34, 40, 93, '2004-10-27', NULL),
	(22, 'usúario tentava buscar nota com o numero de série 001.', 'foi sugerido buscar com o numero de série 041.', 2, 3, 9, 34, 40, 93, '2004-10-27', NULL),
	(23, 'usúario buscava nota com num. de série 001.', 'foi sugerido buscar com mum. de série 041', 2, 3, 9, 31, 62, 93, '2004-10-27', NULL),
	(24, 'usuário informou que ao clicar em relatório o sistema levava para a tela de carta de correção.', 'foi feito um passo a passo com o usuario e o problema nao ocorreu.', 2, 1, 11, 33, 48, 93, '2004-10-29', NULL),
	(25, 'ao tentar incluir o item corolla XL AT usúario informou que o preço do veículo nao aparecia.', 'foi simulado o caso e o problema nao ocorreu. contatei novamente o usuario mas nao tive retorno.', 2, 1, 3, 35, 48, 93, '2004-10-29', '2004-10-04'),
	(26, 'usúario informou que pedido contem alerta para financiamento pendente, e que entrou em contato com Mariana(toyota) e foi informado que o pedido estava aprovado e que deveria entrar em contato com o suporte.', 'foi verificado o pedido tanto com perfil concessionario como com perfil toyota e em ambos o foi comprovado que o pedido esta com status de financiamento pendente. enviei email para Mariana explicando o fato e avisei o usúario.', 2, 3, 6, 36, 65, 93, '2004-10-29', '2004-10-04'),
	(27, 'não conseguia salvar o pedido, sistema informava senha incorreta.', 'desligue o caps lock.', 2, 1, 5, 38, 13, 93, '2004-10-04', NULL),
	(28, 'usuario informou que estava sendo listados nesta tela pedidos duplicados.', 'Foi constatado q os pedidos dobrados se referiam a 1 pedido faturado 1 pedido cancelado. Foi explicado para usuario via fone.', 2, 1, 17, 39, 57, 93, '2004-10-05', NULL),
	(29, 'usuário estava colocando como parametro o numero da nota da toyota para listar suas comissoes.', 'usuario foi instuido a colocar como parametro o numero da nota do dealer, caso seja essa a intenção. E para listar todas as comissoes colocar apenas o periodo.', 2, 1, 14, 40, 16, 93, '2004-10-05', NULL),
	(30, 'Usuário cadastrou um pedido para frotista de corolla fielder à vista e o sistema pediu aprovação bancária na documentação.', '', 1, 2, 4, 41, 52, 93, '2004-10-11', NULL),
	(31, 'login informado ao usuário não permite entrar no SVD', 'login e senha resetados pela toyota', 2, 2, 1, 42, 17, 93, '2004-10-11', '2004-10-13'),
	(32, 'pedido á vista mostra documento de financ. pendente.', 'sugerido colocar ok na guia doc.', 2, 1, 4, 26, 30, 93, '2004-11-01', NULL),
	(33, 'dúvida em como cancelar o pedido', 'passo a passo', 2, 1, 5, 39, 57, 93, '2004-11-01', NULL),
	(34, 'pedido repetido no sistema.', 'toyota comunicado do fato', 2, 1, 6, 44, 74, 93, '2004-11-03', NULL),
	(35, 'deseja cadastrar um modelo de hilux que não está mais disponível no sistema e foi informada que a toyota possui algumas unidades do modelo.', 'foi instruida a entrar em contato com vendas diretas.', 2, 1, 3, 46, 39, 93, '2004-11-04', NULL),
	(36, 'senha incorreta', 'compravado o erro, toyota forneceu a senha correta', 2, 1, 1, 45, 42, 93, '2004-11-04', '2004-11-11'),
	(37, 'senha incorreta', 'informada senha correta', 2, 1, 1, 42, 17, 93, '2004-11-05', NULL),
	(38, 'guia documentacao aparece aprovacao bancaria para pagto a vista', 'sugerido colocar ok no item', 2, 1, 4, 41, 52, 93, '2004-11-08', NULL),
	(39, 'nao encontra nota fiscal', 'informada numero de série correta', 2, 1, 8, 47, 86, 93, '2004-11-08', NULL),
