	(46, 'duvida com campo nao habilitado para cadastrar nota de comissao', 'foi explicado q se o campo nao esta habilitado é porque a comissão ainda nao esta disponivel', 2, 1, 14, 35, 27, 93, '2004-11-17', NULL),
	(47, 'nao sabia como solicitar carta de correcao.', 'passo a passo', 2, 1, 12, 36, 15, 93, '2004-11-18', NULL),
