	(134, 'Não sabia o procedimento para cancelar um pedido.', 'Pedi para entrar em pedidos pendentes entrar com o numero do pedido e clicar na aba finalizar, onde ela teria que colocar a senha e clicar em cancelar pedido.', 2, 1, 7, 92, 45, 93, '2005-03-23', NULL),
	(135, 'A Giovana estava com dificuldades para visualizar os documentos pendentes (quais documentos o cliente faltava entragar)', 'Como ela não estava conseguindo acessar o sistema para acompanhar comigo os passos, eu enviei um e-mail com todos os passos que ela deveria fazer para chqgar ate a documentação pendente.', 2, 1, 4, 93, 77, 93, '2005-03-24', NULL),
	(136, 'Dificuldade em excluir um pedido (enviado por e-mail)', 'Enviei um e-mail com o passo-a-passo para a exclusão do pedido.', 2, 1, 6, 94, 44, 93, '2005-03-28', NULL),
	(137, 'Duvida em saber, quais os documentos que estão pendentes. (enviado por e-mail svd.toyota)', 'Enviei um e-mail com o passo-a-passo para chegar até documentação pendentes.', 2, 1, 4, 54, 67, 93, '2005-03-28', NULL),
