	(140, 'Dificuldade para alterar um CNPJ de um pedido pendente.', 'Como esse campo não pode ser alterado num pedido pendente (campo inativo), pedi para fazer um novo pedido e cancelar o antigo.', 2, 1, 2, 97, 27, 93, '2005-04-04', NULL),
	(141, 'Não está aprecendo o valor do automovel desejado  e não aparece nenhuma mensagem de erro. \r\nOBS: Campos corretamente preenchidos', 'Foi passado para o Joe e para O Fernando.\r\nEstou aguardando um retorno.\r\n\r\nA tabela não tinha sido cadastrada!', 2, 2, 3, 98, 9, 93, '2005-04-04', '2005-04-05'),
	(142, 'Não está aprecendo o valor do automovel desejado  e não aparece nenhuma mensagem de erro. \r\nOBS: Campos corretamente preenchidos', 'Foi passado ao Joe e ao Fernando.\r\nEstou aguardando retorno.\r\n\r\nA tabela de preço não tinha sido cadastrada', 2, 2, 3, 99, 95, 93, '2005-04-04', '2005-04-05'),
	(143, 'Não sabia o que devia preencher em cada campo do formulário.', 'Acompanhei o processo explicando como preencher e pedi p/ ler o manual on-line de comissionamento. (que não tinha lido)', 2, 1, 14, 96, 84, 93, '2005-04-05', NULL),
	(144, 'Queria cadastrar 2 automóveis de cor diferente num mesmo item.', 'expliquei que ele teria que cadastrar em itens diferentes por ser de cores diferentes', 2, 1, 3, 100, 13, 93, '2005-04-05', NULL),
	(145, 'Não estava conseguindo logar no portal. Mensagem de erro dizendo "usuário não cadastrado". Mas no dia anterior ele estava conseguindo logar.', 'Pedi p/ encaminhar um e-mail p/ o dealer pedindo para resetar a senha', 2, 4, 1, 39, 57, 93, '2005-04-06', NULL),
	(146, 'Ela estava com dúvida se a última nota fiscal realmente ficava na cor vermelha e ela não sabia como salvar os comissionamentos', 'Expliquei que realmente ficava na cor vermelha a ultima nota e entrei no comissionamento p/ verificar se ela tinha realmente salvo. Pois ela estava fazendo pela sunda vez, a primeira não salvou.', 2, 1, 14, 101, 30, 93, '2005-04-08', NULL),
	(147, 'Não sabia como verificar os documentos que deviam ser entregues ao VD', 'Informei o procedimento: pedidos pendentes-->relatorio-->codigo com link-->documentação', 2, 1, 4, 102, 16, 93, '2005-04-12', NULL),
	(148, 'Não sabia como pesquisar um comissionamento', 'consulta-->comissionamento-->pesquisa avançada-->numero do chassi-->relatório', 2, 1, 14, 103, 14, 93, '2005-04-12', NULL),
	(149, 'Duvida para verificar comissionamento e preencher relatório', 'Consulta-->comissionamento-->numero do chassi-->relatorio-->clocar data e nf-->atualizar-->emitir nota', 2, 1, 14, 104, 25, 93, '2005-04-13', NULL),
	(150, 'Não estava conseguindo cancelar um pedido, aparecia uma mensagem dizendo: dados incorretos se o problema persistir entre em contato com o administrador"', 'Fiz o passo a passo para excluir o pedido e consegui excluir normalmente.', 2, 1, 6, 101, 30, 93, '2005-04-18', NULL),
	(151, 'Duvida para alterar data e numero da nota fiscal', 'selecionar a opção alterar todos, alterar os campos desejados, clicar em alterar todos e atualizar', 2, 1, 14, 101, 30, 93, '2005-04-27', NULL),
	(152, 'inserir comissionamento ', 'expliquei para acessar a pagina comissionamento e fazer a procura avançada pelo chassi e expliquei como inserir o numero da nota fiscal e a data da mesma', 2, 1, 14, 74, 30, 93, '2005-04-27', NULL),
	(153, 'Como imprimir boleto', 'Expliquei o passo a passo:consultas pedidos-->cod. pedido-->clicar no pedido-->sinal + no campo boleto', 2, 1, 17, 105, 49, 93, '2005-04-28', NULL),
	(154, 'Como verificar se a toyota ja havia verificados os documentos', 'Entrei no sistema e explique p/ ele que fiava dentro de pedidos pendentes e que estava veificado e avisei também qdo que chegou o documento na toyota', 2, 1, 4, 106, 16, 93, '2005-04-28', NULL),
	(155, 'O Problema é que a concessionária mudou de nome de Gattai p/ Comart e eles não conseguiam mais consultar os comissionamentos pendentes que foi iniciaizado na época da gattai', 'Expliquei para o dealer e eles passaram o tel do Responsável para a ativação do login da Gattai', 2, 4, 14, 59, 93, 93, '2005-04-28', NULL),
	(156, 'Verificação dos documentos', 'Explicação passo a passo: pedidos pendentes--> cod. pedido-0-> relatorio-->clicar no  cod pedido-->documentação', 2, 1, 4, 107, 93, 93, '2005-04-28', NULL),
	(157, 'Como concultar o comissionamento', 'Passo-a-passo consulat -->comissionamento-->pes.avançada-->chassi', 2, 1, 14, 108, 27, 93, '2005-05-02', NULL),
	(158, 'Duvida para inserir a nota fiscal do comissionamento', 'Pedi para ela me acompanhar fazendo o que eu falava. Fiz o passi-a-passo com ela ate inserir a nota fiscal e salvar no sistema', 2, 1, 14, 58, 9, 93, '2005-05-02', '2005-05-02'),
	(159, 'Não sabia como fazer se a correção que gostaria de realizar não estava em nenhuma das especificações', 'informei para deixar selecionado na opção de especificações "Nenhuma Abaixo" e descrever a correção no campo Outros', 2, 1, 9, 92, 45, 93, '2005-05-04', NULL),
	(160, 'Não conseguiu efetuar um novo pedido. ERRO: Não foi possível salvar os dados do pedido. O servidor está ocupado no momento. Aguarde alguns minutos e tente novamente.', 'Informei que o servidor está sobrecarregado, muitas pessoas acessando o sistema. Pedi para ela ficar tentando, pois é o único jeito', 2, 4, 3, 110, 27, 93, '2005-05-04', NULL),
	(161, 'Ela não conseguia alterar a forma de pagamento, pois ao modificar aparecia uma mensagem de erro dizendo para alterar a porcentagem de comissão de entrega, sendo que era a mesma taxa. ', 'Como houve alteração na tabela de preço e o pedido foi feito no preço antigo, pedi para fazer a atualização. Deixando o campo cor "zerado", depois definia a forma de pagamento correto e por ultimo selecionava novamente a cor, com isso atualizava o valor e conseguia fazer a alteração da forma de pagamento.', 2, 1, 3, 111, 40, 93, '2005-05-05', NULL),
	(162, 'Ela não conseguia alterar a forma de pagamento, pois ao modificar aparecia uma mensagem de erro dizendo para alterar a porcentagem de comissão de entrega, sendo que era a mesma taxa. \r\n', 'Como houve alteração na tabela de preço e o pedido foi feito no preço antigo, pedi para fazer a atualização. Deixando o campo cor "zerado", depois definia a forma de pagamento correto e por ultimo selecionava novamente a cor, com isso atualizava o valor e conseguia fazer a alteração da forma de pagamento.', 2, 1, 3, 112, 97, 93, '2005-05-05', '2005-05-05'),
	(163, 'Ela queria receber uma comissão do mes de outubro que foi feito manualmente, isto é, não pelo SVD e por isso não constava o comissionamento no sistema.', 'Passei isso p/ a Carla e ela me orientou pedindo para que essa cliente enviasse um e-mail p/ a Carla e Mariana,  pois elas iriam resolver esse problema.', 2, 1, 14, 113, 97, 93, '2005-05-09', NULL),
	(164, 'Não estava conseguindo alterar a forma de pagamento, ao confirmar aparecia uma mensagem dizendo p/ entrar com o valor de porcentagem de comissão de entrega.', 'Como o pedido foi feito antes da atualização da tabela, ocorreu esse erro.\r\nPedi p/ ele ir em itens do pedido-->modificar, zerar a cor dexiando selecionado a palavra "selecione" , depois alterar a forma de pagamento e por ultimo selecionar a cor desejada. O sistema assim calcula o preço atualizado do automovel.\r\n', 2, 1, 3, 27, 53, 93, '2005-05-09', NULL),
	(165, 'Ela estava com dúvida no valor do comissionamento que ela teria que emitir ou de Entrega ou o de Venda', 'Expliquei que era p/ somar o de entrega com e de venda e emitir uma nota com o valor total, que o próprio svd calcula.', 2, 3, 14, 96, 84, 93, '2005-05-11', NULL),
	(166, 'como visualizar o formulário do pedido', 'Pedi para ele entrar em pedidos pendentes--> clicar no código do pedido-->guia finalizar-->colocar senha-->finalizar -->clicar em "Visualizar formulário"', 2, 1, 5, 114, 83, 93, '2005-05-11', NULL),
	(167, 'Ela enviou para a toyota as notas fiscais para receber o comissionamento, mas voltou. Queria saber o motivo. Alegando que tinha colocado todas as nf no svd, fiz cosulta de 2 e estava no sistema', 'Pedi para ela me enviar via e-mail todos os chassis por e-mail, verifiquei um por um e percebi que 2 dos chassis não estavam cadastrados. Retornei um e-mail avisado-a para cadastrar, que com certeza era o motivo da devolução das NFs', 2, 1, 14, 115, 27, 93, '2005-05-11', NULL),
	(168, 'Ela queria cadastrar uma concessionária como se fosse um banco.  ', 'Peguei todas as informações da concessionária (razão social,CNPJ...) passei por e-mail para a Carla e o tiago p/ eles estarem cadastrando.', 2, 1, 14, 96, 84, 93, '2005-05-12', '2005-05-17'),
	(169, 'como pesquisar se a nota fiscal já foi lançada no sistema.', 'Expliquei o passo a passo p/ ela: comissionamento-->concluido-->novo-->numero a nota fiscal-->relatório', 2, 1, 14, 116, 33, 93, '2005-05-12', NULL),
	(170, 'não sabia qual era o valor que precisava emitir na nota fiscal para receber o comissionamento', 'Expliquei o passo a passo: comissionamento-->dados do paramentros-->relatório-->valor total. ', 2, 1, 14, 117, 86, 93, '2005-05-12', '2005-06-27'),
	(171, 'duvida de como imprimir o boleto e qual o prazo de entrega do veículo.', 'Expliquei o passo a passo--> consulta-->pedido-->cod. do pedido-->clicar no numero do pedido--> clicar em boleto no sinal de +. A data por ser um corolla e de 30 a 45 dias.', 2, 1, 17, 118, 17, 93, '2005-05-16', NULL),
	(172, 'alteração na forma de pagamento', 'expliquei como alterar deixando sem a cor do automovel para zerar os valores, seleciona-se a forma de pagamento desejado e selecione a cor novamente--> o sistema tras o preço atualizado.', 2, 1, 3, 119, 68, 93, '2005-05-16', NULL),
	(173, 'alteração forma de pagamento', 'expliquei como alterar deixando sem a cor do automovel para zerar os valores, seleciona-se a forma de pagamento desejado e selecione a cor novamente--> o sistema tras o preço atualizado.', 2, 1, 3, 120, 96, 93, '2005-05-16', '2005-05-16'),
	(174, 'O veículo ja foi faturado e entregue para o cliente, mas o status tava como faturado e não como concluído, portanto ela não consguia fazer a emissão da NF para comissionamento.', 'Entrei em contato com o pessoal da toyota via e-mail e me informaram que a pessoa que poderia estar atualizando isso no sistema era a Fabiola. Enviei um e-mail para ela estar solucionando.', 2, 2, 17, 110, 27, 93, '2005-05-16', NULL),
	(175, 'O veículo ja foi faturado e entregue para o cliente, mas o status tava como faturado e não como concluído, portanto ela não consguia fazer a emissão da NF para comissionamento.\r\n', 'Entrei em contato com o pessoal da toyota via e-mail e me informaram que a pessoa que poderia estar atualizando isso no sistema era a Fabiola. Enviei um e-mail para ela estar solucionando.', 2, 2, 17, 115, 27, 93, '2005-05-16', NULL),
	(176, 'Não sabia que valor colocar na nota fiscal do comissionamento.', 'Pedi para entrar no svd e preencher os campos corretamente do comissionamento parametros e clicar em relatório, onde aparece o valor bruto do comissionamento.', 2, 1, 14, 121, 25, 93, '2005-05-16', NULL),
	(177, 'Duvida para cadastrar a NF no SVD', 'Expliquei para ela passo a passo: consulta-->comissão-->pesquisa avançada-->chassi-->relatório-->NF e data-->Atualizar', 2, 1, 14, 122, 71, 93, '2005-05-17', '2005-05-17'),
	(178, 'Duvida para cadastro de NF no svd.', 'Expliquei para ela passo a passo: consulta-->comissão-->pesquisa avançada-->chassi-->relatório-->NF e data-->Atualizar', 2, 1, 14, 101, 30, 93, '2005-05-17', NULL),
	(179, 'Duvida como cadastrar a nota fiscal no SVD.', 'Pedi p/ ele procurar pelo chassi em busca avançada no comissionamento. Ele entrou com o número da NF e a data e atualizou, encerrando o procedimento.', 2, 1, 14, 123, 68, 93, '2005-05-23', NULL),
	(180, 'naõ sabia como lançar as notas fiscais no svd', 'Expliquei passo-a-passo', 2, 1, 14, 124, 49, 93, '2005-05-31', NULL),
	(181, 'Duvida de como saber o valor total da comissão', 'Expliquei que na tela de comissionamento aparece o valor ja calculado, que era a soma do valor da comissão de entrega com o valor da comissão de venda se forem efetuadas no nome da concessionaria.', 2, 1, 14, 109, 95, 93, '2005-06-01', NULL),
	(182, 'Ao alterar a forma de pagamento o sistema pedia para entrar com a taxa de comissão de entrega.', 'Fiz o passo a passo com ele, que seria zerar a cor do carro, entrar com a forma de pagamento desejado e depois selecionar novamente a cor do carro.', 2, 1, 3, 125, 98, 93, '2005-06-01', '2005-06-01'),
	(183, 'Alteração na forma de pagamento, pediu a percentagem de comissão de entrega.', 'Informei que precisava zerar a cor do automovel, colocar a forma de pagamento, e selecionar a cor novamente.', 2, 1, 3, 106, 16, 93, '2005-06-03', NULL),
	(184, 'Não sabia o significado da situação " Documentos não verificados"', 'Expliquei que significa que a toyota ainda não recebeu ou não verificou ainda se os documentos estavam corretos.', 2, 1, 17, 127, 14, 93, '2005-06-06', NULL),
	(185, 'Ele queria saber como faz para imprimir a carta de insenção pelo SVD.', 'Expliquei que ele não consegue imprimir a carta de insenção pelo SVD. Ele teria somente que fazer a solicitação da carta e aguardar a aprovação do VD  da Toyota e os mesmos estariam emitindo a carta via fax, e-mail para imprimir.', 2, 1, 8, 128, 57, 93, '2005-06-06', NULL),
	(186, 'Para alterar a forma de pagamento, o sistema pedia para entrar com a taxa de comissão de entrega, que ela não sabia', 'Informei que se ela zerasse a cor do automóvel (deixasse selecionado a palavra Selecione), todos os valores iriam zerar, depois entrasse com a forma de pagamento desejada e por fim selecionar novamente a cor do veículo o SVD automticamente já tras o valor correto de todos os campos', 2, 1, 3, 96, 84, 93, '2005-06-17', NULL),
	(187, 'Sempre que ele tentava salvar o pedido aparecia uma mensagem dizendo que ocorre um erro no servidor, para ele tentar mais tarde...', 'Verificamos que  o problema não era no servidor e sim no cadastro do cliente, pois no campo "número" a pessoa entrou com caracteres e não somente com numeros e mesmo assim o svd salvou q quando chegava na hora de finalizar dava erro.', 2, 1, 5, 129, 9, 93, '2005-06-17', NULL),
	(188, 'Não sabia como imprimir o pedido que já havia sido alocado.', 'Informei que era em consulta-->pedido, entrasse com o cód. pedido e depois relatório, clicasse no número do pedido com link para uma janela com tofos os dados do pedido.', 2, 1, 17, 130, 44, 93, '2005-06-17', NULL),
	(189, 'não sabia qual era o status que se encontrava o veiculo, pois já havia sifo alocado e não se encontrava mais em Pedido Pendente', 'Fiz o passo a passo com ela: consulta-->pedido, entre com o codigo do pedido e depois clicar em Relatório, clicar no codigo fo pedido com link para uma nova janela com as informações do pedido, inclusive o statu que se encontrava cada item', 2, 1, 17, 126, 96, 93, '2005-06-17', NULL),
	(190, 'Não conseguia lançar notas fiscais em comissionamento, pois o status do pedido estava como "Faturado" e não como "concluido", e já havia sido entregue o pedido.', 'Entre em contato com a pessoa responsavel pela atualização de status para alterar esses pedidos no SVD', 2, 2, 14, 131, 99, 93, '2005-06-17', NULL),
	(191, 'como verificar se a NF já pode ser lançada no sistema', 'Informei que ele deveria entrar em consulta pedido, entrar com o codigo do pedido-->telatório e clciar no cod. pedido, abrira uma janela e na ultima linha possui um campo Situação, se tivesse concluído poderia efetuar o lançamento.', 2, 3, 17, 106, 16, 93, '2005-06-24', NULL),
	(192, 'não sabia como imprimir o boleto', 'Fiz com ela o passo-a-passo: consulta-->pedido-->entrar com o codigo do pedido--> relatório--> clicar no codigo do pedido-->abrira uma nova janela com um  campo Boleto.', 2, 3, 17, 132, 12, 93, '2005-06-24', NULL),
	(193, 'ela queria cadastrar um consorcio que o SVD não pussuia', 'Peguei todos os dados e envie para o pessoal de vendas diretas para efetuar o cadastro.', 2, 3, 3, 96, 84, 93, '2005-06-24', NULL),
	(194, 'Não sabia como efetuar uma carta de correção, pois não tinha a especificação desejada', 'Expliquei que ele teria que deixar selecionado *Nenhuma abaixo e escrever o que teria que ser alterado no campo outros.', 2, 1, 12, 133, 53, 93, '2005-06-28', NULL),
	(195, 'Não sabia o porque que o sistema não estava salvando a alteração no numero de quantidade de automoveis no pedido.', 'Ela alterava a quandtidade mas não finalizava o processo para o svd salvar essa alteração. Ela não ia ate a aba finalizar e entrava com a senha dela. Informei o procedimento correto.', 2, 1, 3, 134, 80, 93, '2005-06-28', NULL),
	(196, 'Não sabia como verificar o valor da NF para comissionamento', 'Fiz o passo a passo com ela. Informei que o SVD fornecia o total que é a soma do comissão de entrega+comissão de venda (pois foi realizado na mesma distribuidora) e infomei como lançar a nota fiscal no SVD', 2, 1, 14, 135, 86, 93, '2005-06-28', NULL),
	(197, 'ela me passou os dados de um cliente e um modelo de automovel e queria saber se esse cliente algum dia efetuou a compra desse automovel', 'Pelo cpf do cliente fiz a busca, para saber se ele estava cadastrado. E não estava, portanto ele não efetuou a compra pelo SVD', 2, 3, 2, 101, 30, 93, '2005-06-28', NULL),
	(198, 'não sabia como inserir mais de uma especificação na mesma nota fiscal', 'Expliquei que no campo de especificação existe um botão com o simbolo de mais e um outro com o simbolo de menos. O botão de mais é para acrescentar mais de uma especificação e o de  menos para excluir.', 2, 1, 9, 74, 30, 93, '2005-06-30', NULL),
	(199, 'não sabia como lançar as nf de comissão', 'Expliquei o passo a passo junto com o cliente.', 2, 1, 14, 137, 72, 93, '2005-06-30', NULL),
	(200, 'O cliente não consegui lançar as NF\'s no sistema porque não atualizaram a situação do veículo. Em vez de estar como concluído estava como Faturado, mas o pedido já havia sido entregue para o cliente.', 'Encaminhei um e-mail para A Fabiola Ito que ja atualizou o sistema.', 2, 2, 14, 138, 73, 93, '2005-07-01', NULL),
	(201, 'Não sabia se tinha lançado corretamente a nf no SVD', 'Entrei no sistema e verifiquei que ja havua NF lançada e fui perguntando o Numero da NF do dist. e a data de emissão, e tambem o valor da NF para conferir com o do SVD.', 2, 1, 14, 139, 4, 93, '2005-07-01', NULL),
