	(203, 'ao alterar a forma de pagamento o sistema pedia para entrar com a taxa de pocentagem da comissão de entrega', 'Informei que precisava deixar o campo Cor selecionado a palavra Selecione, alterar a forma de pagamento e selecionar novamente a cor do automovel, pois o sistema tras os valores atualoizados', 2, 3, 3, 142, 100, 93, '2005-07-26', NULL),
	(204, 'Ao alterar a forma de pagamento o sistema pedia p/ entrar com a taxa de comissão de entrega', 'informei que precisava tirar a cor do aumotomovel, deixar na palavra selecione e depois alterar a forma de pagamento e selecionar novamente a cor do automovel, o sistema tras o valor atualizado.', 2, 3, 3, 143, 95, 93, '2005-07-27', NULL),
	(205, 'ao tentar alterar a forma de pagamento o sistema mostrava uma mensagem de erro, para entrar com a taxa de comissão de entrega', 'informei que precisava tirar a cor do aumotomovel, deixar na palavra selecione e depois alterar a forma de pagamento e selecionar novamente a cor do automovel, o sistema tras o valor atualizado.', 2, 3, 3, 144, 14, 93, '2005-07-27', NULL),
	(206, 'não sabia como lançar a nota fiscal no SVD', 'expliquei o passo-a-passo para ela acompanhar no SVD o procedimento.', 2, 3, 14, 145, 8, 93, '2005-07-28', NULL),
	(207, 'não sabia excluir pedido que encontrava-se ainda em Pedido Pendente', 'Informei que bastava ela entrar em pedido pendente --> cod. pedido --> relatorio --> finalizar e entrar com a senha e clicar em "Excluir Pedido"', 2, 3, 5, 90, 47, 93, '2005-07-28', NULL),
	(208, 'ela queria saber se existia algum relatório no svd p/ consultar os pedidos que ja foram faturados num determinado mes', 'Infomei que ela podia gerar o Relatorio detalhado em Consulta --> Pedido, onde ela estabelecia o periodo desejado para consulta.', 2, 1, 17, 101, 30, 93, '2005-07-28', NULL),
	(209, 'ao tentar alterar a forma de pagamento, o sistema pedia para entrar com a taxa de comissão de entrega.', 'informei que precisava tirar a cor do aumotomovel, deixar na palavra selecione e depois alterar a forma de pagamento e selecionar novamente a cor do automovel, o sistema tras o valor atualizado.', 2, 1, 3, 146, 11, 93, '2005-07-28', NULL),
	(210, 'Não sabia como lançar a nota fiscal de comissionamento no SVD', 'Informei passo a passo', 2, 3, 14, 147, 37, 93, '2005-08-03', NULL),
