	(212, 'não sabia cancelar um pedido pendente', 'Expliquei que era preciso ir em pedido pendente, entrar com o cod. do pedido a ser cancelado, clicar em relatório, clciar no cod. do pedido em azul e clicar na aba finalizar, entrar com a senha de login e clicar em "Cancelar Pedido".', 2, 3, 5, 149, 78, 93, '2005-08-09', NULL),
	(213, 'não consegue consultar os pedidos de um cliente somente. Ao entrar com o cod. do pedido o sistema informa que ocorreu erro no servidor e se entrar com o cnpj do cliente o sistema informa "Nenhuma Ocorrência".', 'Foi passado para o pessoal da tecnica pois esse erro ja vem ocorrendo a 1 semana', 2, 2, 17, 130, 44, 93, '2005-08-09', '2005-08-23'),
	(214, 'não sabia como lançar a nota fiscal de comissionamento no svd', 'exoliquei o passo a passo por tel', 2, 1, 14, 150, 97, 93, '2005-08-23', NULL),
	(215, 'o sistema dava erro, a pagina sai do ar, qdo clicava em "Confirmar" no item de pedido.', 'Estavam mechendo no sistema e por isso ocorria o erro, ja normalizado.', 2, 2, 3, 149, 78, 93, '2005-08-23', NULL),
	(216, 'quando ela alterava a forma de pagamento de indefinido para definido, o sistema pedia p/ entrar com a taxa da comissão de entrega.', 'Informei que precisava tirar a cor do automovel, entrar com a forma de pagamento e novamente selecionar a cor do automovel e com isso o sistema traz os valores atualizados.', 2, 3, 3, 151, 84, 93, '2005-08-23', NULL),
	(217, 'Ela me pediu para consultar a nf de comissão se havia sido aprovada, pois ela esta sem senha de acesso ao sistema, aguardando retorno do dealer.', 'Conferi e passei a posição que se encontrava a nf (aprovada com data de previsão)', 2, 4, 14, 135, 86, 93, '2005-08-24', NULL),
