	(220, 'não consegue visualizar o boleto de entrada, somente o boleto de financeamento está correto.', 'Foi passado para o pessoal da tecnica.', 1, 2, 17, 124, 49, 93, '2005-08-30', NULL),
	(221, 'Ele não sabia se tinha feito mesmo a solicitação, pois não tem nenhuma confirmação de solicitação no sistema', 'Verifiquei e informei que havia feito a solicitação, pois não tinha o status estava como Pendente! ', 2, 3, 9, 27, 53, 93, '2005-08-30', NULL),
	(222, 'o sistema estava fora do ar! durante varios periodos do dia e da semana!', 'Foi passado para a toyota, mas não sabem o motivo.', 2, 2, 2, 101, 30, 93, '2005-08-31', NULL),
	(223, 'ela queria saber como fazer uma carta de correção, pois havia sido rejeitada', 'Expliquei que ela escreveu no campo Observação em vez do campo outros.', 2, 1, 9, 152, 97, 93, '2005-09-01', NULL),
	(224, 'não sabia como vizualizar o boleto para impressão', 'Informei o passo- a-passo junto com o usuário no sistema', 2, 3, 17, 101, 30, 93, '2005-09-02', NULL),
	(225, 'Não sabia como fazer uma carta de correção para alterar o endereço do banco', 'Informei que era para selecionar em especificação "Endereço", em "de" colocar o endereço que estava na nota fiscal e no campo "Para" colocar o endereço correto.', 2, 1, 9, 148, 49, 93, '2005-09-02', NULL),
	(226, 'Ela disse que não conseguia vizualisar o boleto.', 'Foi efetuado um teste e conseguimos visualizar...o problema é na máquina dela.', 2, 4, 17, 153, 30, 93, '2005-09-02', NULL),
	(227, 'não sabia como alterar uma forma de pagamento', 'Expliquei que ela teria que ir em pedido-->pedido pendente, entrar com o codigo de pedido e clicar em ralatório. Clicar no cod. do pedido, abrirá uma janela com os dados do pedido, clicar em Itens do Pedido e finalmente em Modificar...depois clicar na aba Finalizar e entrar com a senha de acesso ao sistema para que a alteração seja efetuada.', 2, 1, 3, 154, 14, 93, '2005-09-05', NULL),
	(228, 'não saia como fazia para ver a data de entrega do automóvel', 'Informei que em consulta --> pedido, no memo  local que emiti os boletos, tem uma previsão para a entrega do pedido.', 2, 3, 14, 155, 47, 93, '2005-09-09', NULL),
	(229, 'ela tinha emitido uma mona NF de comissão e não sabia como que fazia para substituir a nF errada que estava cadastrada no sistema', 'Informei que ela podia sobrescrever a NF antiga e clicar em Atualizar que já estaria cadastrada a nf nova.', 2, 3, 14, 109, 95, 93, '2005-09-09', NULL),
	(230, 'não sabia como realizar uma solicitação de carta de insenção de ICMS', 'Primeiro ela teria que efetuar o pedido (não havia nenhum pedido ainda), depois informei para que ela fosse em Solicitação-->carta de insenção de ICMS, entrasse com o código, conferia os dados do cliente e fazia a solicitação.', 2, 1, 8, 104, 25, 93, '2005-09-12', NULL),
	(231, 'não conseguia emitir as NF de comissionamento dos pedidos que já foram entregue para os clientes, pois em vez do status do pedido estar como "Concluido" estava como "faturado" no svd.', 'Passei os codigos do pedido para a Carla Martins e ela atualizou o status.', 2, 2, 14, 58, 9, 93, '2005-09-12', NULL),
	(232, 'não sabia onde estava o boleto para impressão', 'Informei o passo-a-passo', 2, 3, 17, 135, 86, 93, '2005-09-13', NULL),
	(233, 'Não sabia como efetuar a carta de insenção de ICMS.', 'Informei que era p/ ir no menu Solicitação-->Carta de insenção de ICMS, entra com o código de controle depois entrar com o número da nota fiscal e por último clicar em Solicitação.', 2, 1, 8, 152, 97, 93, '2005-09-14', NULL),
	(234, 'qdo ela confirmava a alteração na forma de pagamento do pedido, o sistema dizia que precisava alterar o percentual da comissão de entrega', 'Informei que era para zerar a cor do pedido (selecionar a palavra selecione), alterar a forma de pagamento e depois selecionar a cor do automovel novamente, com isso o sistema já carrega os valores atualizados.', 2, 1, 3, 156, 89, 93, '2005-09-16', NULL),
	(235, 'não sabiá pq as notas fiscais de comissão foram devolvidas', 'Pesquisei no svd e verifiquei que tinha chassi que não estava com o numeo da nf cadastrado.', 2, 1, 14, 103, 14, 93, '2005-09-21', NULL),
	(236, 'O status dos chassis 604313, 600579 e 605083 está como "Faturado" em vez de "Concluido" e por isso não consegue lançar a nf de comissão', 'Enviei os chassis para a carla para abrir um chamado e alterar esse status.', 1, 2, 14, 157, 87, 93, '2005-09-21', NULL),
	(237, 'não sabia qual era o codigo de controle para efetuar uma carta de correção', 'Informei que colocando o mouse por cima do campo, o sistema exibi os códigos e que o da hilux (que o cod. que ela queria saber) era 301.', 2, 3, 9, 101, 30, 93, '2005-09-21', NULL),
	(238, 'ao alterar a forma de pagamento o sisitema pede para entrar com a taxa de comissão de entrega', 'Informei que ele precisava tirar a cor do automovel (selecionar a palavra Selecione), entrar com a forma de pagamento, selecionar a cor novamente.', 2, 3, 3, 95, 94, 93, '2005-09-21', NULL),
	(239, 'existem comissões com situação de "Pendente" mas ja foram pagas desde o ano passado', 'Foi passado p/ o pessoal de vendas diretas para que tirem essas nf de comissionamento do svd, já que foram pagas e estão ainda com status de pendente.', 1, 2, 14, 158, 16, 93, '2005-09-26', NULL),
	(240, 'o formulário com os dados do pedido que o cliente deve assinar, vem sem o nome da cidade! No cadastro está correto, somente no formulário que não está puxando a cidade!', 'Foi passado p/ o pessoal da toyota, estou esperando um retorno!', 1, 2, 5, 159, 23, 93, '2005-09-26', NULL),
	(241, 'a carta de correção foi rejeitada pois não estava com o formato certo de solicitação.', 'Informei o jeito certo de solicitar uma carta de correção.', 2, 1, 9, 134, 80, 93, '2005-09-26', NULL),
	(242, 'não sabia como consultar o status do pedido e como visualizar o boleto', 'Expliquei o passo-a-passo em consulta de pedido e informei como verificar o staus e o que cada status indicava.', 2, 1, 17, 160, 43, 93, '2005-09-26', NULL),
	(243, 'não sabia como cancelar um pedido que ainda não tinha sido alocado', 'informei que se não tinha sido alocado, então estava em Pedido Pendente. Entra com o cod. clica em raltório. Depois clicar na aba Finalizar e entrar com a senha de acesso ao sistema e depois clicar em cancelar pedido!', 2, 1, 6, 64, 7, 93, '2005-09-29', NULL),
	(244, 'não sabia qual era a posição da solicitação da carta de insenção de icms', 'informei para ele acessar consulta --> carta de insenção, entrar com o codigo do pedido e clicar em ralatório. ', 2, 3, 11, 161, 37, 93, '2005-09-29', NULL),
	(245, 'não consegue lançar a nota fiscal de comissão de um veiculo que ja foi entregue a semanas, pq o status do pedido está como Liberado Cliente em vez de Concluido!', 'Passei p/ o pessoal de vendas diretas para abrir um chamado e estar alterando esse status.', 1, 2, 14, 58, 9, 93, '2005-09-29', NULL),
	(246, 'não sabia como alterar a nf de comissionamento', 'informei que precisava acessar consulta-->comissionamento, entrar com o chassi, clicar em raletório, alterar a nota fiscal e clicar em "Atualizar"', 2, 3, 14, 23, 20, 93, '2005-09-30', '2005-09-30'),
	(247, 'não sabia como fazer uma carta de correção para razão social', 'expliquei que era p/ acessar solicitação-->carta de correção, entrar com o codigo de controle e o nf e clicar em buscar.\r\nSelecioona Razão Social em especificação e escreve no campo de e para.\r\nClica em solicitar.', 2, 1, 12, 162, 17, 93, '2005-10-04', NULL),
	(248, 'a carta de correção foi rejeitada e ela não sabia o motivo', 'Verifiquei e informei que era uma alienação fiduciária e o campo observação precisa estar em branco e ela deveria escrever no campo outros.', 2, 3, 12, 151, 84, 93, '2005-10-04', NULL),
	(249, 'não conseguia entrar no sistema pois o sistema dava uma mensagem de erro dizendo que a senha era inválida', 'pedi para ela entrar em contato com o dealer para resetarem senha dela', 2, 2, 1, 134, 80, 93, '2005-10-04', NULL),
