INSERT INTO `cao_hist_ocorrencias_os` (`idocorrencia`, `co_os`, `co_usuario`, `data`, `tipo`, `descricao`, `responsavel`, `data_fechamento`) VALUES
	(1, 653, 'carlos.arruda', '2005-12-15 15:18:00', 'Interna', 'Fechamento teste da OS de historico de ocorrências.<br>Novo texto digitado por aqui.<br><br>Um pouco mais de texto, agora com "ASPAS".<br>Att.;<br>Carlos', '', '2005-12-15 15:19:00'),
	(2, 633, 'bruno.freitas', '2005-11-07 09:00:00', 'Externa', 'Disponibilização de uma cópia das bases de homologação para ajuste do ambiente de desenvolvimento e testes.', 'Toyota - Sullivan/Paulo', NULL),
	(3, 633, 'bruno.freitas', '2005-11-25 09:00:00', 'Externa', 'Validação do documento com especificação de alterações necessárias nas bases de dados.', 'Toyota - Alexandre/Cláudia', '2005-12-05 18:00:00'),
	(4, 633, 'bruno.freitas', '2005-12-07 09:00:00', 'Externa', 'Disponibilização de bases de homologação do sistema 2Know.', 'Paulo', '2005-12-09 18:00:00'),
	(5, 633, 'bruno.freitas', '2005-12-07 09:00:00', 'Interna', 'Problema com a máquina de Rodrigo Areco.<br>', 'Rodrigo Areco', '2005-12-09 10:00:00'),
	(6, 633, 'bruno.freitas', '2005-12-05 09:00:00', 'Externa', 'Problema de Produção (Inclusão HILUX) - Esse problema interrompe as atividades do analista Fernando, responsável pelo Upgrade SVD.', 'Leonides Fernando/Francisco Ogatha', '2005-12-12 12:00:00'),
	(14, 633, 'bruno.freitas', '2005-12-19 10:00:00', 'Externa', 'Dúvidas sobre a estrutura e utilização da tabela RAMO-ATIVIDADE.', 'Alexandre', NULL),
	(15, 587, 'bruno.freitas', '2005-12-05 09:00:00', 'Externa', 'Aguardando homologação da versão do sistema com as adequações para o SLT (1.1).', 'Carlos Gaudêncio', NULL),
	(16, 650, 'bruno.freitas', '2005-12-05 09:00:00', 'Externa', 'Aguardando homologação da versão do sistema com as adequações para o SLT (1.1).', 'Carlos Gaudêncio', NULL),
	(17, 665, 'bruno.freitas', '2005-12-05 09:00:00', 'Externa', 'Aguardando homologação da versão do sistema com as adequações para o SLT (1.1), e migração das bases de dados para o Oracle.', 'Carlos Gaudêncio', NULL),
	(18, 633, 'bruno.freitas', '2005-12-22 09:00:00', 'Interna', 'Fernando auxiliando Denis na configuração de ambiente (bases de dados) para implementação e testes das funcionalidades do Upgrade.', 'Fernando/Denis', '2005-12-22 18:00:00'),
	(19, 633, 'bruno.freitas', '2006-01-03 10:00:00', 'Externa', 'Versão 1 da fase 1 do projeto disponibilizada em ambiente de homologação da Toyota.', 'Bruno Freitas', NULL),
	(20, 665, 'bruno.freitas', '2006-01-03 09:00:00', 'Interna', 'Aguardando versão SIS-SLT.', 'Civio', '2006-01-03 15:00:00'),
	(21, 633, 'bruno.freitas', '2006-01-09 09:00:00', 'Externa', '- Depois de realizados acertos para instalação do pacote no ambiente de homologação da Toyota, a fase 1 do projeto foi liberada para testes da Ti Toyota e posterior teste com os usuários.', 'Toyota (Paula)', NULL),
	(22, 194, 'bruno.freitas', '2006-02-14 15:00:00', 'Externa', 'Envio de email alertando sobre proximidade das datas de envio de dados para TMC.', 'ToyotA', NULL),
	(23, 735, 'bruno.freitas', '2006-02-17 18:00:00', 'Interna', 'Envio de documentação de requistos de hardware.', 'Bruno', '2006-02-17 18:00:00'),
	(24, 735, 'bruno.freitas', '2006-02-24 14:00:00', 'Interna', 'Envio de configuração para acesso do IdeasGroup ao CVS - Repositório de fontes', 'Bruno', '2006-02-24 14:00:00'),
	(25, 735, 'bruno.freitas', '2006-02-17 15:00:00', 'Externa', 'Recebimento de documento com especificação geral do projeto OpenKube.<br>Recebimento das classes e sqls da entidade user (Ideas).', 'Tomas - Ideas', '2006-02-17 15:00:00'),
	(26, 735, 'bruno.freitas', '2006-02-22 18:30:00', 'Externa', '- Recebimento do esqueleto (Visio) do módulo KRh', 'Tomás - Ideas', '2006-02-22 18:30:00'),
	(27, 735, 'bruno.freitas', '2006-03-03 19:00:00', 'Externa', '- Recebimento das classes e sqls da entidade endereço.<br>- Recebimento do esqueleto (Visio) do módulo KProject.', 'Tomás - Ideas', '2006-03-03 19:00:00'),
	(28, 735, 'bruno.freitas', '2006-03-07 10:00:00', 'Externa', '- Recebimento de telas do módulo kRh (50%).', 'Marcelo - Ideas', NULL),
	(29, 735, 'bruno.freitas', '2006-03-08 11:00:00', 'Interna', '- Envio de email para Agence e IdeasGroup com relatório de recebimento de documentação.', 'Bruno', '2006-03-08 11:00:00'),
	(30, 790, 'bruno.freitas', '2006-05-03 09:00:00', 'Externa', 'Enviado email com dúvidas sobre a utilização de dados da ANFAVEA já armazenados nas bases Toyota (SqlServer).', 'Alexandre - Toyota', '2006-05-25 17:00:00'),
	(31, 994, 'bruno.freitas', '2007-03-05 16:00:00', 'Externa', 'Problemas de integração do modelo projetado no sistema com as bases Anhanguera.<br><br>A principio, teríamos uma PEA associada a uma matriz e não a uma unidade, porém, a modelagem da base do SIAE impossibilita essa associação, já que todas as matrizes são diretamente relacionadas a uma unidade.', 'NA', '2007-03-05 16:00:00'),
	(32, 994, 'anapaula.chiodaro', '2007-03-14 17:00:00', 'Interna', '- Atualização do protótipo em função de aprimoramento de operação, fruto de reunião de acompanhamento realizada em 13/03/07.', 'Ana Paula F. M. Chiodaro', '2007-03-14 17:34:00'),
	(33, 1057, 'anapaula.chiodaro', '2007-03-16 14:54:00', 'Externa', 'Realizado follow up junto ao departamento de TI do grupo.<br><br>- Informação obtida: A instalação do NBS em São Paulo e na Bahia será concluída no final do mês de abril. Finalizada essa etapa, a empresa deseja retomar contato para conversar sobre outros projetos (Novo follow up agendado para o final do mês de abril).', 'Ana Paula F. M. Chiodaro', '2007-03-16 15:00:00'),
	(34, 938, 'anapaula.chiodaro', '2007-03-19 18:36:00', 'Externa', '- Reativação do projeto: o cliente desisitiu de produzir o site em parceria com o patrocinador e decidiu retomar a cotação com a Agence.', 'Ana Paula F. M. Chiodaro', '2007-03-19 18:40:00'),
	(35, 842, 'anapaula.chiodaro', '2007-03-19 18:38:00', 'Externa', '- Follow up para tentativa de reativação do projeto.', 'Follow up', '2007-03-19 18:40:00'),
	(36, 994, 'anapaula.chiodaro', '2007-04-04 08:00:00', 'Externa', '- Implantação parcial do SAPP (Cadastro de PEA).<br>- Reunião  de Acompanhamento do Projeto (Ana Paula, Bruno, Inês, Marcio Lodis, Franco Pietro, Erik).', 'Ana Paula F. M Chiodaro / Bruno Freitas', '2007-04-04 18:00:00'),
	(37, 994, 'anapaula.chiodaro', '2007-04-09 10:30:00', 'Externa', 'Problemas na preparação do ambiente PHP 5 para realização da implantação parcial do sistema SAPP na Anhanguera:<br><br>* Alinhamento com Marcelo Michelotto acerca da versão da tecnologia PHP utilizada na construção do sistema (conversa telefônica).<br><br>- Ficou estipulado que a  implantação parcial do SAPP (cadastro de PEA) será realizada em servidor provisório (micro normal com ambiente PHP 5 instalado), para posteriormente migrar para um servidor mais adequado ao porte projeto. ', 'Ana Paula F. M. Chiodaro', '2007-04-09 13:00:00'),
	(38, 1074, 'anapaula.chiodaro', '2007-04-11 11:00:00', 'Interna', '- Proposta comercial enviada: ferramenta de comunicação e atendimento ao cliente (Website / Intranet). ', 'Ana Paula F. M. Chiodaro', '2007-04-11 13:00:00'),
	(39, 1074, 'anapaula.chiodaro', '2007-04-10 10:30:00', 'Interna', '* Propostas Comerciais enviadas:<br><br>- Refactoring/ Redesign website dinâmico<br>- Recatoring / redesign website estático<br>- Manutenção Mensal (faturamento mensal de horas livres, valor hora pré-estipulado)', 'Ana Paula F. M. Chiodaro', '2007-04-10 13:00:00'),
	(40, 1049, 'anapaula.chiodaro', '2007-04-13 09:30:00', 'Externa', '- Follow up - Aroldo Galves - posicionamento sobre o andamento do projeto (telefone). <br>- Pendência: enviar cronograma atualizado  e data prevista para a conclusão do projeto. ', 'Ana Paula F. M. Chiodaro', '2007-04-13 10:00:00'),
	(41, 1055, 'bruno.freitas', '2007-05-22 10:00:00', 'Externa', 'Report de erro no sistema SACCES de produção (cadastro de seção).<br><br>Impacto no desenvolvimento das novas funcionalidades.', 'Agence/Toyota', '2007-05-23 17:00:00'),
	(42, 1055, 'bruno.freitas', '2007-05-22 10:00:00', 'Externa', 'Report de erro no sistema SACCES de produção (cadastro de seção).<br><br>Impacto no desenvolvimento das novas funcionalidades.', 'Agence/Toyota', '2007-05-23 17:00:00'),
	(43, 1055, 'bruno.freitas', '2007-05-22 10:00:00', 'Externa', 'Report de erro no sistema SACCES de produção (cadastro de seção).<br><br>Impacto no desenvolvimento das novas funcionalidades.', 'Agence/Toyota', '2007-05-23 17:00:00'),
	(44, 1055, 'bruno.freitas', '2007-05-22 10:00:00', 'Externa', 'Report de erro no sistema SACCES de produção (cadastro de seção).<br><br>Impacto no desenvolvimento das novas funcionalidades.', 'Agence/Toyota', '2007-05-23 17:00:00'),
	(45, 1055, 'bruno.freitas', '2007-05-22 10:00:00', 'Externa', 'Report de erro no sistema SACCES de produção (cadastro de seção).<br><br>Impacto no desenvolvimento das novas funcionalidades.', 'Agence/Toyota', '2007-05-23 17:00:00'),
	(46, 1055, 'bruno.freitas', '2007-05-22 10:00:00', 'Externa', 'Report de erro no sistema SACCES de produção (cadastro de seção).<br><br>Impacto no desenvolvimento das novas funcionalidades.', 'Agence/Toyota', '2007-05-23 17:00:00'),
	(47, 1055, 'bruno.freitas', '2007-05-22 10:00:00', 'Externa', 'Report de erro no sistema SACCES de produção (cadastro de seção).<br><br>Impacto no desenvolvimento das novas funcionalidades.', 'Agence/Toyota', '2007-05-23 17:00:00'),
	(48, 1055, 'bruno.freitas', '2007-05-22 10:00:00', 'Externa', 'Report de erro no sistema SACCES de produção (cadastro de seção).<br><br>Impacto no desenvolvimento das novas funcionalidades.', 'Agence/Toyota', '2007-05-23 17:00:00'),
	(49, 994, 'anapaula.chiodaro', '2007-05-29 15:00:00', 'Externa', '- Reunião Anhanguera (DDE, TI, Diretoria) para redefinição de prazos e prioridades do projeto, em função do atraso gerado pelas alterações de copo e infra-estrutura sofridas na primeira etapa do projeto.', 'Ana Paula F. M Chiodaro / Brno Freitas', '2007-05-29 18:00:00'),
	(50, 1173, 'rodrigo.miranda', '2007-07-03 08:00:00', 'Interna', 'Preparação do desktop deixado aqui para desenvolvimento.', 'Rodrigo Miranda', NULL),
	(51, 1147, 'carlos.arruda', '2007-06-22 12:00:00', 'Externa', 'Ambiente de teste da Support Comm ZION foi solicitado para que pudéssemos dar continuidade ao desenvolvimento.', 'Marcelo / Felipe', NULL),
	(52, 994, 'anapaula.chiodaro', '2007-07-11 09:00:00', 'Interna', '- Implantaçã dos módulos de "Registro de Diário de Classe" e "Consulta de PEA" (visualização e impressão).', 'Ana Paula Chiodaro / Rafael Sierra', '2007-07-13 18:00:00'),
	(53, 1175, 'anapaula.chiodaro', '2007-07-24 13:00:00', 'Externa', 'Retorno ao cliente sobre solicitação de posicionamento quanto ao cronograma do projeto.<br><br>', 'Ana Paula F. M. Chiodaro', '2007-07-24 13:15:00'),
	(54, 994, 'anapaula.chiodaro', '2007-07-30 09:00:00', 'Externa', '- Nova parametrização total de cursos e disciplinas executada pela Ti da Anhanguera (Marcio Lodis). O trabalho foi realizado em função das alterações das matrizes no SIAE (foram alteradas mais de 600 matrizes).<br><br>', 'Ana Paula F. M. Chiodaro / Marcio Lodis', '2007-07-30 20:00:00');
