	(768, 'Cliente já demonstra interesse pelo desenvolvimento do seu web site. Contudo, para o processo ir à diante, depende-se do agendamento com o CEO da empresa, para definir a Pré-ME com ideal detalhamento.\r\nLigar para marcar horário de visita, pois o gest', 6952, 'edy.bruno', '2005-05-31 01:09:30'),
	(769, 'Cliente visitado, com boa aceitação da imagem da Agence. Recebeu material promocional e ficamos de agendar horário para concepção de pré-ME.', 6953, 'edy.bruno', '2005-05-31 01:20:37'),
	(770, 'Marcamos agendamento para o dia 01/06/05, para realizar a Pré-ME, juntamente com um Plano de Negócios para seu web site, pois cliente ainda apresenta dúvidas quanto ao foco mercadológico a ser dado em seu sistema.', 6954, 'edy.bruno', '2005-05-31 23:11:03'),
	(771, 'Cliente tem interesse em fazer website sobre massoterapia, numa espécie de sistema de cooperativa virtual. Já está propenso à compra, contudo, tem orçamento enxuto. Marcamos para realizar a confecção de Pré-ME. Haverá outros profissionais nessa reuni', 6950, 'edy.bruno', '2005-05-31 23:24:55'),
	(772, 'Cliente tem interesse em fazer website sobre massoterapia, numa espécie de sistema de cooperativa virtual. Já está propenso à compra, contudo, tem orçamento enxuto. Marcamos para realizar a confecção de Pré-ME. Haverá outros profissionais nessa reuni', 6950, 'edy.bruno', '2005-05-31 23:25:02'),
	(773, 'Cliente tem interesse em fazer website sobre massoterapia, numa espécie de sistema de cooperativa virtual. Já está propenso à compra, contudo, tem orçamento enxuto. Marcamos para realizar a confecção de Pré-ME. Haverá outros profissionais nessa reuni', 6950, 'edy.bruno', '2005-05-31 23:25:06'),
	(774, 'Visita realizada com boas chances de sucesso. Fiz apresentação da Agence e o responsável solicitou portifólio de websites locais.\r\nCliente enviará por e-mail quais são suas idéias iniciais, para a criação da Pré-ME.', 1433, 'edy.bruno', '2005-06-02 12:50:21'),
	(775, 'Cliente prospectado pela Agence MS. Confirmada visita com a secretária Kelly.', 6955, 'edy.bruno', '2005-06-02 13:17:59'),
	(776, 'Está desenvolvendo seu site em outra empresa, mas já demonstra grande insatisfação por causa do atraso no andamento dos trabalhos. Aguardar até o dia 08/06, que é o prazo para definição da manutenção de contrato. Fazer visita para acompanhar de perto', 6956, 'edy.bruno', '2005-06-02 14:49:27'),
	(777, 'Já está desenvolvendo seu site mas está insatisfeito por causa da demora na entrega. Pediu para retornar em 08/06 para definir posição sobre seu contrato.', 6957, 'edy.bruno', '2005-06-02 14:57:31'),
	(778, 'Cliente visitado com boas chances de negociação. Pediu orçamento para sistema de controle de estoque e vendas. Vamos criar a pre-me para realizar dimensionamento de escopo.', 6955, 'edy.bruno', '2005-06-04 13:04:58'),
	(779, 'Já realizei visita sobre desenvolvimento de web site há cerca de dois meses. Desta vez, não estava na loja porque participava de um curso. Ligar em 07/06 para agendar visita para apresentação da Agence.', 6961, 'edy.bruno', '2005-06-06 23:11:24'),
	(780, 'Já havia realizado orçamento de web site há cerca de três meses. Em conversa via MSN, Pr. Edwin confirmou interesse pelo sistema, e verbalizou detalhes, como a transmissão dos cultos dominicais via site. \r\nVai marcar reunião com diretoria para criaçã', 6962, 'edy.bruno', '2005-06-08 00:28:10'),
