INSERT INTO `cao_os_chamado` (`co_chamado`, `co_sistema`, `co_os`, `ds_chamado`, `co_tipo`, `co_prioridade`, `co_item`, `descricao`, `ds_solucao`, `tempo`, `dt_chamado`, `status`, `co_usuario`, `co_analista`, `email`) VALUES
	(1, 91, 446, 'Problema no cadastro de chamado', 2, 1, 0, 'Problema teste no cadastro de chamado', '', '', '2005-07-04 09:38:04', 3, 'carlos.arruda', 'todos', NULL),
	(2, 91, 460, 'Busca de cliente dá erro', 2, 2, 17, 'Quando busco cliente na combo de cima do cadastro de OS dá erro quando seleciono o cliente desejado.', '', '', '2005-07-04 15:14:27', 2, 'carlos.arruda', 'marcio.lamego', NULL),
	(3, 91, 460, 'Quando chega email nao tenho acesso aos anexos', 2, 1, 17, 'Quando tem uma OS com anexo e chega um email de atualizacao da OS, nesse email tem que ter o link para acesso ao anexo diretamente, sem precisar entrar no sistema.', '', '', '2005-07-04 15:16:03', 2, 'carlos.arruda', 'marcio.lamego', NULL),
	(4, 91, 460, 'Não salva quando altero o consultor', 2, 0, 17, 'Não salva quando altero o consultor', '', '', '2005-07-04 17:39:05', 2, 'carlos.arruda', 'marcio.lamego', NULL),
	(5, 91, 446, 'Não envia e-mail em alterações', 2, 0, 21, 'No momento do cadastro ou mesmo em alterações do chamado, tanto na visão cliente (Web Site) como do próprio CAOL qualquer alteração no chamado deve ser enviado um e-mail.\r\nPara quem cadastrou o chamado, para o consultor responsável e para os analistas envolvidos com a OS.', '', '', '2005-07-05 09:31:26', 2, 'carlos.arruda', 'marcio.lamego', NULL),
	(6, 91, 446, 'Prioridade nao fica selecionada', 2, 4, 21, '- Quando cadastro um chamado dentro de uma prioridade e depois consulto em chamados pendentes para adicionar um comentário, a prioridade perde a seleção da prioridade, tendo eu que selecionar manualmente.\r\n- A descrição do chamado deve ficar como texto HTML mesmo em chamados pendentes, não precisa ficar dentro de campo texto, tá ficando ruim a leitura pois tem que usar o scroll, etc.', '', '', '2005-07-05 10:05:26', 2, 'carlos.arruda', 'marcio.lamego', NULL),
	(7, 91, 460, 'Não envia e-mail em alterações', 2, 1, 0, 'O sistema não está enviando e-mail nas alterações, nem em cadastro de OS nem no cadastro de chamado.', '', '', '2005-07-05 17:20:54', 3, 'carlos.arruda', 'todos', ''),
	(8, 181, 342, 'Padrão nos títulos (em amarelo) nos modelos dos automóveis', 2, 2, 0, 'Sygestão: seguir um padrão nos títulos (em amarelo) nos modelos dos automóveis. Por exemplo: "meriva joy, meriva maxx..." tem alguns veiculos que só tem o nome do modelo e não o tipo, isso acontece com os modelos: blazer, zafira, montana, clasic, celta.', '', '', '2005-07-05 18:02:35', 3, '', 'leandro.caracciolo', 'arruda.carlos@gmail.com'),
	(9, 91, 446, 'Ainda com campo texto na pop do cliente', 2, 2, 0, 'Ainda está com campo texto na pop do cliente em acompanhamento de chamados.', '', '', '2005-07-05 18:07:07', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(10, 84, 5, 'asdasd', 1, 0, 0, 'asdasd', '', '', '2005-07-05 18:14:25', 3, '', 'todos', 'carlos.arruda@agence.8x.com.br'),
	(11, 91, 460, 'Erro de decimais', 2, 1, 7, 'Erro na consulta de bonus, o extrato do Leandro nao tá aparecendo os decimais, veja o anexo.', '', '', '2005-07-05 20:17:03', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(12, 91, 460, 'O drop item de menu nao tá ordenado por ordem alfabética', 2, 2, 21, 'O drop item de menu nao tá ordenado por ordem alfabética', '', '', '2005-07-06 15:15:01', 2, 'carlos.arruda', 'marcio.lamego', ''),
