	(15, 91, 460, 'Erro nos decimais', 2, 0, 25, 'Depois da migração o sistema tá aparecendo os decimais de forma errada.', '', '', '2005-07-06 16:29:12', 2, 'carlos.arruda', 'marcio.lamego', ''),
