	(18, 91, 460, 'Quando eu entro com o DDD do contato tá dando erro', 2, 0, 16, 'Quando eu entro com o DDD do contato tá dando erro de jscript, de forma que nao tá passando para o outro campo texto nem tá salvando qualquer alteração feita nesse cadastro.', '', '', '2005-07-06 16:44:02', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(19, 91, 460, 'Na guia chamados atendidos aparece como pendente', 2, 1, 243, '', '', '', '2005-07-06 17:13:47', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(20, 181, 342, 'Erro no título das guias E320 está igual', 2, 0, 104, 'Home > Mercedes-Benz > 0km > Touring > E\r\nErro no título das guias do E320 está igual', '', '', '2005-07-06 17:24:23', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(21, 181, 342, 'Textos e fotos do flash estão repetidas.', 2, 0, 104, 'Tem uma foto do Classe C repedita ... revisar todos os textos do Touring.', '', '', '2005-07-06 17:30:59', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(22, 181, 342, 'Incluir texto sobre Touring na página inicial do Touring', 2, 1, 104, 'Mercedes Touring, liberdade de movimentos \r\n\r\nOs modelos Touring (station wagons) combinam perfeitamente o conforto típico dos sedãs Mercedes-Benz com um volume de espaço notavelmente superior. Veículos versáteis, confortáveis e espaçosos, eles são especialmente desenvolvidos para pessoas que desfrutam, com muito prazer, de um estilo de vida dinâmico e de grandes aventuras. Para atender a cada exigência do mercado, a Mercedes oferece as versões Touring da Classe C, mais compacta e com personalidade esportiva, e da Classe E, com o prestígio de um sedã de luxo. \r\n', '', '', '2005-07-06 17:51:55', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(23, 181, 342, 'Classe C e E - Tabela de Espec. técnica', 2, 0, 104, 'Revisar a tabela de especificacoes técnicas ... revisar os títulos.', '', '', '2005-07-06 17:55:58', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(24, 181, 342, 'Criar Link para hotsite do Classe C Touring 2005', 2, 1, 104, 'Conforme link no e-mail', '', '', '2005-07-06 17:57:56', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(25, 181, 342, 'Revisar itens de série do Classe E e C touring', 2, 0, 104, 'Intens de série tem que ser conforme e-mail enviado por CH.', '', '', '2005-07-06 18:00:31', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(26, 91, 460, 'Problema na descrição de alguns chamados', 2, 1, 243, '', '', '', '2005-07-07 09:39:34', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(27, 166, 194, 'Ajustes diversos nos Cadastros e Relatórios', 2, 2, 0, '* Cadastro de Célula. Implementar regra: Sub-C/C somente pode ser vinculado a um Centro de Custo de classificação \'Direct Production\'\r\n\r\n* Cadastro de Célula. Implementar regra: Sub-C/C obrigatoriamente tem de estar vinculado a um C/C\r\n	\r\n* Cadastro de Seção. Executar seguintes passos no sistema: \r\n        1. Preencher Grupo C/C e salvar forçando erro (Ex. não colocar \'Classif C/C\')\r\n        2. Corrigir o erro (Ex. Preencher \'Classif C/C\') e salvar novamente sem mudar o Grupo C/C ---->  Lança exceção\r\n\r\n* Cadastro de Seção. Campo radio button "Sacces Sim / Não". Não está funcionando. (Verificar cadastro de Célula, pois lá aparentemente funciona)\r\n    \r\n* Cadastro de Grupo C/C. Se cadastrar \'Depto\' sem escolher \'Planta\' ou  cadastrar \'Seção\' sem escolher \'Planta\' ou cadastrar \'Seção\' sem escolher \'Depto\' ----->  Exibe mensagem de erro incorreta: \'Não existe cadastro de corporação\' ----> Colocar mensagem de erro apropriada ao erro.\r\n         \r\n* Cadastro de Grupo C/C. Se nenhum grupo foi cadastrado e selecionar \'Buscar Grupos\' ao clicar na árvore de grupos -----> Lança exceção \'Null Pointer Exception\'\r\n	\r\n* Relatórios \'Base de Alocação E.H\', \'Custos por C/C\', \'Custos por Sub-C/C\': se "Enviar Consulta para Planilha" então se em seguida tentar visualizar "Relatório" -------> Sempre envia para planilha e não visualiza relatório.\r\n', '', '', '2005-07-07 10:57:21', 2, 'rodrigo.moralles', 'eduardo.botelho', ''),
	(28, 91, 460, 'E-mail recebido não vem com css', 2, 1, 0, 'Os e-mails recebidos do cadastro de OS e do cadastro de chamado estão sem Style (css)', '', '', '2005-07-07 11:49:01', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(29, 91, 460, 'Troca de senha da área do cliente nao funciona', 2, 1, 0, 'Troca de senha da área do cliente nao funciona, aparece que a senha atual não está correta.', '', '', '2005-07-07 18:51:50', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(30, 91, 465, 'Tá aparecendo vários campos em branco de e-mails de acompanhamento', 2, 0, 17, 'Quando vou cadastrar uma OS para um cliente que nao tem e-mails de acompanhamento cadastrados tá aparecendo vários campos em branco de e-mails de acompanhamento. \r\nTeste cadastrando uma OS para o sistema 2know por exemplo.', '', '', '2005-07-07 20:52:21', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(31, 91, 446, 'Pop do DR nao aparece o problema quando é fechado um chamado.', 2, 0, 0, 'Quando é DR automatico de fechamento de chamado na pop do DR não está aparecendo o Problema, apenas a solução. \r\nO problema é a descrição do chamado.', '', '', '2005-07-07 21:17:03', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(32, 91, 446, 'Na guia chamados atendidos nao está ordenado por data', 2, 1, 243, 'Na guia chamados atendidos nao está ordenado por data.\r\nOs chamados tem que estar ordenado por data de última alteração, do mais recente para o mais antigo.', '', '', '2005-07-08 12:09:30', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(33, 91, 465, 'Qualquer atualizacao o sistema envia email', 2, 2, 17, 'Em qualquer atualizacao o sistema está enviando email para o usuario de acompanhamento, mesmo o check do usuario nao estando marcado.\r\nSomente com o check marcado que o usuario de acompanhamento comeca a receber e-mail e a logar no sistema para acompanhar o projeto.', '', '', '2005-07-08 12:30:45', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(34, 91, 446, 'Na guia documentação de sistema está com erro', 2, 1, 16, 'Na Documentação do Sistema no CAOL, a descrição do Documento não permite entrar texto a vontade. \r\nParece estar sendo utilizado um input text em vez de um textarea. ', '', '', '2005-07-11 18:03:11', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(35, 91, 446, 'Erro na descrição completa do chamado do SACCES', 2, 2, 243, 'Erro na descrição completa do chamado do SACCES, quando entro no chamado delegado para o Eduardo Basualdo aparece uns escritos fora da tabela.', '', '', '2005-07-11 18:04:34', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(36, 91, 446, 'Erro na apresentação de layout da consulta', 2, 3, 243, 'Voltou o layout a ficar todo esquisito em chamados pendentes, testar com o meu usuario para constatar.', '', '', '2005-07-11 18:05:56', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(37, 91, 467, 'No e-mail o remetente tem que ser que postou a noticia', 2, 1, 0, 'No e-mail o remetente tem que ser que postou a noticia, hoje tá aparecendo sempre contato@agence.com.br', '', '', '2005-07-12 18:43:43', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(38, 91, 467, 'Envio de E-mail', 2, 0, 0, 'Qdo cadastramos a notícia, não temos um preview de como ela ficará dps de publicada, entao qdo salvamos ele já é enviada para todos os analista e consultores. Creio que deveria ter um Preview com a foto e uma função de confirma publicar a noticia.', '', '', '2005-07-12 18:48:46', 2, 'carlos.carvalho', 'marcio.lamego', ''),
	(39, 91, 467, 'check box da foto', 2, 0, 0, 'dps da msg salva, cliquei na foto e cliquei em salvar e o sistema apagou a foto ( e mandoumais um e-mail)', '', '', '2005-07-12 18:52:41', 2, 'carlos.carvalho', 'marcio.lamego', ''),
	(40, 91, 467, 'Redimensionar fotos', 2, 0, 0, 'coloquei a foto em qq tamanho e o sistema nao redimensionou a foto. há alguma maneira de redimensionar sem distorcer?', '', '', '2005-07-12 18:54:32', 2, 'carlos.carvalho', 'marcio.lamego', ''),
	(41, 91, 468, 'Quando clico no calendário abre página antiga', 2, 0, 25, 'Quando clico no calendário abre página antiga, pop-up do modelo anterior. Tem que abrir os detalhes na mesma página, como está em desenvolvimento.', '', '', '2005-07-13 09:17:00', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(42, 91, 468, 'Quando parcelo os débitos os valores estão perdendo os zeros', 2, 1, 25, 'Quando parcelo os débitos os valores estão perdendo os zeros.\r\nSe lanço 3 parcelas de 1.000,00 o sistema tá lançando 3 vezes nos vencimentos subsequentes só que com valor de 1,00.', '', '', '2005-07-13 09:18:26', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(43, 166, 194, 'Alteração no Cadastro de Item de Custo', 2, 2, 229, '- Mudar o tipo \'Exhausted\' para \'Depreciation\'. E ao selecionar o tipo \'Depreciation\' exibir o dropdown de Tipo de depreciaçao e os radios \'Unexhausted\' e \'Exhausted\'. É obriatório escoher um dos radios e\r\nselecionar um tipo de depreciação para o tipo de item de custo \'Depreciation\'.\r\n    * Adicionar dropdown de tipo de depreciação(DepreciationType) e radio de Unexhausted e Exhausted\r\n    * Gravar em banco as informações, já está mapeado no hibernate CostItem.hbm.xml.\r\n        (Já existem os métodos no data. Atualizar update de CostItem para setar o 	depreciationType quando existir no data. Tem de injetar o DAO DepreciationType no CostItemBO)\r\n    * Alterar método na interface CostItemBO de isExhaustedCost para isDepreciationCost\r\n    * Alterar pontos onde se estava invocando isExhaustedCost e invocar isExhausted\r\n    * Alterar implementação de CostItemType e mudar o que for ExhaustedCost para DepreciationCost', '', '', '2005-07-13 11:08:55', 2, 'alessandro.yamada', 'eduardo.botelho', ''),
	(44, 187, 462, 'Erro na nova atividade da minha agenda', 2, 0, 0, 'Quando seleciono uma atividade ou quando mudo o status tá chamando uma funcao onchange, nao pode.', '', '', '2005-07-13 18:41:14', 2, 'carlos.arruda', 'cristiane.florio', ''),
	(45, 91, 446, 'O e-mail que tá chegando tá com envolvido errado', 2, 1, 21, 'O e-mail que tá chegando após cadastramento de chamado aparece sempre como analista envolvido o primeiro da combo, mesmo quando seleciono um segundo da combo.\r\nAbri um chamado agora de uma OS onde tinha o Marcio e a Cristiane como analista provavel, designei para a Cristiane mas o email chegou escrito na parte "Analistas Envolvidos" o nome do Marcio.\r\nObs.: O e-mail foi certo, para a Cristiane mesmo, o problema é só o nome que tá indo escrito no email.', '', '', '2005-07-13 18:45:28', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(46, 181, 342, 'Retirar todas as cores da Mercedes e só deixar PRETO E CINZA', 2, 0, 79, 'As corres do catálogo da Mercedes estão mesmo erradas e não existem no Brasil. Somente as cores Preto e Cinza são trazidas pro Brasil.', '', '', '2005-07-13 20:47:42', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(47, 181, 342, 'Retirar do ar a notícia de Hilux x Ranger', 2, 0, 180, 'Leandro, retirar a noticia  "Revolução total em xeque" da HOME e hotsite da Toyota. Substituir por alguma outra antiga. Essa notícia fala muito mais da Ford do que da Toyota.\r\n \r\n', '', '', '2005-07-13 20:52:08', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(48, 91, 446, 'Erro em alterar chamado', 2, 0, 21, 'Depois que salvei o chamado, e quero alterar o Resumo e Descrição, qdo salvo as alteracoes, ele confirma que a alteracao esta salta com sucesso mas não muda a alteracao do resumo nem da descricao.', '', '', '2005-07-13 21:10:55', 2, 'carlos.carvalho', 'marcio.lamego', ''),
	(49, 91, 77, 'Erro na emissão de boleto', 2, 1, 18, 'Erro na emissão de boleto, quando clico no boleto abre pop com erro.', '', '', '2005-07-13 21:31:17', 2, 'carlos.carvalho', 'marcio.lamego', ''),
	(50, 166, 194, 'Ajuste cadastros (2)', 2, 2, 0, '1. Na tela inicial de cadastro de Seção existe combobox para procurar pelo Nome da Seção -> Acrescentar combobox para procurar também pelo Código da Seção\r\n\r\n2. Mesma alteração do item 1 para a tela inicial do Cadastro de Célula: Acrescentar combobox para procurar a Seção também pelo Código da Seção\r\n\r\n3. Na tela inicial do cadastro de Célula, existe uma combobox que lista as células pelo nome. Colocar nos itens dessa combobox também o Código da Célula -> Os items da combobox deve ficar com o formato "Código da Célula - Nome da Célula". Ordenar os itens pelo código.\r\n\r\n4. Cadastro de Seção. Checkbox "Gera ficha inventário" não está funcionando.\r\n', '', '', '2005-07-14 10:12:26', 2, 'rodrigo.moralles', 'eduardo.botelho', ''),
	(51, 91, 460, 'O check dos anexos para excluir nao tem label', 2, 1, 17, 'O check para excluir um anexo que existe na OS nao tem um title dizendo que ele serve para isso.\r\n', '', '', '2005-07-14 10:14:25', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(52, 91, 446, 'Analista tem que ver somente os chamados pendentes pra ele.', 2, 1, 243, 'Analista tem que ver somente os chamados pendentes pra ele.\r\nVc logando com o usuario da Cristiane em producao vc percebe uma porcao de chamados pendentes que nao sao pra ela, tem que aparecer para ela somente quando ela for analista responsavel ou que o chamado seja direcionado para "Todos" e ela seja uma das envolvidas com a OS.', '', '', '2005-07-14 11:02:27', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(53, 91, 446, 'Chamado cadastro por outro consultor eu nao enxergo', 2, 1, 243, 'Na guia chamados pendentes eu tenho que poder enxergar os chamados cadastrados por outro consultor, afinal é sistema de minha responsabilidade.\r\nO Carlinhos cadastrou um chamado do CAOL eu tenho que poder enxergar, nao estou enxergando no momento.', '', '', '2005-07-14 11:40:51', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(54, 91, 460, 'Em dia que não tem compromisso nenhum aparece a layer', 2, 1, 4, 'São dois pontos:\r\n\r\n- 1. Em dia que não tem compromisso nenhum tá aparecendo uma layer sem nada. Tem que tirar isso, como é no "cadastro de despesas", quando nao tem compromisso nenhum no dia não aparece nada.\r\n\r\n- 2. Na layer o nome da empresa tá no rodapé, colocar ela no cabeçalho, ou seja, a primeira informação que vem é o nome da empresa, e o nome do consultor é desnecessário porque sempre vai ser o consultor logado.', '', '', '2005-07-14 11:50:41', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(55, 91, 460, 'Erro quando troco de perfil', 2, 2, 24, 'Quando troco o peril para parametrizar outro tipo de analista dá erro jscript.', '', '', '2005-07-14 12:02:50', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(56, 91, 460, 'Erro no upload de foto de analista', 2, 0, 28, 'Erro no upload de foto de analista.\r\nE o analista Alessandro e outros perderam as fotos.', '', '', '2005-07-14 12:37:16', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(57, 91, 249, 'Erro no relatorio detalhado de consulta de horas.', 2, 0, 9, 'Não aparece tudo que a analista escreveu no campo de descrição do trabalho efetuado no dia. Necessito tirar um relatorio da OS da Caltabiano "website - webdesigner offshore - carros 0km" para aprsentar para o cliente e o campos mencionado aparece truncado. ', '', '', '2005-07-14 15:53:00', 2, 'carlos.carvalho', 'marcio.lamego', ''),
	(58, 91, 446, 'Incluir novas opções em TIPOS e STATUS', 2, 4, 21, 'Incluir novas opções em Tipos e Status de chamados:\r\nAdicionar Tipos: Melhoria no Sistema, Nova Funcionalidade, Tarefa\r\nAdicionar Status: Em andamento, Reaberta\r\n', '', '', '2005-07-14 18:15:12', 2, 'carlos.carvalho', 'marcio.lamego', ''),
	(59, 91, 446, 'Erro Parse error: parse error in c:inetpubcaolclassesclass_chamado.php on line 414', 2, 0, 21, 'Resolver ERRO Parse error: parse error in c:\\inetpub\\caol\\classes\\class_chamado.php on line 414\r\nOcorreu várias vezes hj qdo estava cadastrando/salvando chamados', '', '', '2005-07-14 18:16:28', 2, 'carlos.carvalho', 'marcio.lamego', ''),
	(60, 91, 481, 'Status de OS sem prazo nao estao atualizando', 2, 0, 12, 'Status de OS sem prazo nao estao atualizando, todas as OS\'s da tabela de OS sem prazo nao estao sendo atualizadas quando se muda o status de uma delas.', '', '', '2005-07-16 13:29:13', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(61, 91, 446, 'Na área do cliente o usuario nao consegur abrir chamado', 2, 1, 0, 'Na área do cliente o usuario nao consegue abrir chamado.\r\nLoguei com usuario de acompanhamento do TOL da OS de desenvolvimento e implantacao arruda.carlos@gmail.com com a senha raposa e nao aparece nenhuma OS que eu possa abrir chamado.\r\nA OS tá certa no cadastro de OS, exatamente como deve estar para ser liberada a abertura de chamados. Com status "desenvolvimento concluido" e dentro do período de garantia.\r\nNao sei o que está havendo.\r\nOutro ponto importante é que no modo cliente "Area do Cliente" nao pode aparecer as opcoes "Melhoria no sistema" e nem "Tarefa"', '', '', '2005-07-18 20:49:39', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(62, 91, 446, 'Quando cadastro chamado o texto nao tá tratando ENTER.', 2, 2, 21, 'Quando cadastro chamado o texto nao tá tratando ENTER.\r\nTem que tratar ENTER normalmente, tá ficando tudo numa linha só.', '', '', '2005-07-18 20:51:11', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(63, 91, 460, 'Tela de login do CAOL tá muito pra baixo', 2, 3, 0, 'Tela de login do CAOL tá muito pra baixo.\r\nDepois da alteracao do cookie a tela de login tá muito pra baixo, tem que ficar mais pra cima de modo que nao aparece o scroll.', '', '', '2005-07-18 21:35:25', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(64, 91, 446, 'Aumentar o campo descricao', 5, 1, 21, 'Aumentar o campo descricao em 50% a largura e 3X a altura.', '', '', '2005-07-19 10:06:13', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(65, 0, 0, 'Alterar implementação de equals e hashCode', 7, 3, 0, '   Mudar implementação do método \'public boolean equals(Object obj)\' e\r\n\'public int hashCode()\' de todos os objetos persistíveis(hibernate).\r\n   Observar a implementação que está AllocatedCostPart para ter como\r\nexemplo. A idéia é tentar fazer comparação entre a chave primária e\r\nquando não houver utilizar a chave única(unique-key), que está definida\r\nno mapeamento do hibernate.', '', '', '2005-07-19 10:16:50', 1, 'alessandro.yamada', 'eduardo.botelho', ''),
	(66, 177, 299, 'teste de chamado', 2, 0, 0, 'dkajsdkjaskdjkasdkjaksdjk', '', '', '2005-07-19 14:38:49', 2, '', 'marcio.lamego', 'arruda.carlos@gmail.com'),
	(68, 166, 194, 'Cadastro de Célula (Campo "Sacces SIM/NÃO")', 2, 2, 0, 'Cadastro de Célula, campo "Sacces Sim/Não" não está fucionando corretamente:\r\n- O cadastro não está salvando a opção "Sacces SIM"\r\n- O cadastro não está excluindo as informações Sacces quando é colocado "Sacces NÃO"\r\n- O cadastro está pedindo informações Sacces mesmo quando "Sacces NÃO" está selecionada\r\n', '', '', '2005-07-19 15:09:46', 2, 'rodrigo.moralles', 'eduardo.botelho', ''),
	(69, 91, 460, 'Adicionar nos dados do contato mais uma coluna', 5, 1, 15, 'Adicionar nos dados do contato mais a coluna de telefone, contemplando DDD e o telefone mesmo.\r\nEssa alteração deve refletir no cadastro de sistema e no cadastro de OS, ficando assim o usuário uma combo a ser selecionada, e nao mais um campo texto como é atualmente.', '', '', '2005-07-19 16:26:26', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(70, 166, 194, 'Ajustes (3)', 7, 2, 0, '1. Cadastro de Seção e Célula. Incluir restrição: A data inicial não pode ser maior que a data final\r\n\r\n2. Cadastro de Item de Custo. Não aparece nada na tela.\r\n\r\n3. Cadastro de Item de Depreciação. Tela inicial "Enter" não funciona.\r\n\r\n4. Cadastro de Item de Depreciação. Ao inserir novo ativo não aparece o nome do Sub-C/C na lista.\r\n\r\n ', '', '', '2005-07-19 17:38:40', 2, 'rodrigo.moralles', 'rodrigo.moralles', ''),
	(71, 91, 460, 'Adicionar coluna "Cargo" depois do telefone', 5, 1, 15, 'Adicionar coluna "Cargo" depois da coluna  telefone dos usuarios de acompanhamento.\r\nDiminuir a largura da coluna senha.', '', '', '2005-07-19 20:11:15', 2, 'carlos.arruda', 'marcio.lamego', ''),
