	(74, 91, 481, 'Na guia autorizada tá aparecendo OS em desenvolvimento', 2, 1, 12, 'Na guia autorizada tá aparecendo OS em desenvolvimento.\r\nNão só na guia autorizado mas em outros o sistema nao tá respeitando os status certos.', '', '', '2005-07-20 17:09:44', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(75, 166, 194, 'Ajustes Cadastro de Grupos', 7, 2, 0, 'Cadastro de Grupos. Ao selecionar qualquer item da árvore de grupos lança exceção\r\n', '', '', '2005-07-20 17:15:29', 2, 'rodrigo.moralles', 'eduardo.botelho', ''),
	(76, 91, 460, 'Melhoria nas telas onde tem listagem dos analistas Agence', 5, 1, 0, 'Todas as telas onde tem listagem dos analistas Agence colocar o filtro por escritorio, que nem foi feito no Daily Report.', '', '', '2005-07-21 11:13:31', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(77, 166, 194, 'Alterações Seção/Célula', 7, 2, 0, '1. Cadastro de Seção. O campo "Doca" deve ser Read-Only e exibir as docas no formato "Código - Descrição"\r\n\r\n2. Cadastro de Seção. O campo "Data de Alteração" deve ser Read-Only e deve ser atualizado automaticamente pelo sistema. Dica: Setar a data atual no método update do BO\r\n\r\n3. Cadastro de Seção e Célula. Se campo de validade está nulo então lança exceção ao salvar\r\n\r\n4. Cadastro de Seção. As opções "Almoxarifado" e "Produtiva" não podem ser setadas ao mesmo tempo.\r\n\r\n', '', '', '2005-07-21 16:45:12', 2, 'rodrigo.moralles', 'eduardo.botelho', ''),
	(78, 91, 446, 'Não aparecem os analista para criar chamado', 2, 5, 21, 'Impossível de criar chamado, pois a cmbo de analista não aparece', '', '', '2005-07-22 11:53:29', 2, 'marcio.lamego', 'marcio.lamego', ''),
	(79, 166, 194, 'Validação em Cadastros', 7, 2, 0, '1. Cadastro de Seção. Não permitir exclusão de Seção se:\r\n    1.1 Existir movimento no Kardex\r\n    1.2 Existir Roteiro de Produção (Verificar se existe registro para a SECAO na tabela "ITEM-INTERNO-PS")\r\n\r\n2. Cadastro de Célula. Não permitir exclusão de Célula se existir Roteiro de Produção (Verificar se existe registro para a CELULA na tabela "ITEM-INTERNO-PS")\r\n\r\n3. Cadastro de Seção. A opção "Draw-back" só pode ser setada se for "Almoxarifado". Indentar o checkbox de "Draw-brack".\r\n\r\n4. Cadastro de Seção. Incluir seguinte regra de negócio: Se a Seção tem opção "Produtiva" então setar automaticamente o campo "Centro Produtivo" quando usuário setar o campo "Planta".\r\n- Dicas:\r\n- Incluir no objeto PlantaBO o campo "CENTRO_PROD" da tabela "PLANTA" e usá-lo.\r\n\r\n4.1 Tornar "Read-only" o campo "Centro Produtivo" do Cadastro de Seção\r\n', '', '', '2005-07-22 14:12:38', 2, 'rodrigo.moralles', 'alessandro.yamada', ''),
	(80, 166, 194, 'Cadastro de Célula', 2, 2, 0, '1. Ao cadastrar nova Célula o sistema lança exceção, porém mesmo assim cadastra.\r\n\r\n2. Cadastro de Item de Depreciação -> Novo. Fazer o "Enter" funcionar nos campos "Código de Peças" e "Sub-C/C"\r\n', '', '', '2005-07-22 15:15:24', 2, 'rodrigo.moralles', 'rodrigo.moralles', ''),
	(81, 91, 460, 'Erro no clique com a direita', 2, 0, 0, 'Sistema está alimentando negativamente o menu de clique com a direita.\r\n', '', '', '2005-07-26 15:27:11', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(82, 181, 342, 'Alterar a cor do calendário pra escolher a data em "Oficinas"', 5, 5, 143, 'Alterar a cor azul do Calendário para Cinza (combinando com o site) ', '', '', '2005-07-26 17:05:37', 3, 'carlos.carvalho', 'ricardo.rubini', ''),
	(83, 181, 342, 'Acrescentar as informações sobre garantia nos detalhes de veículos seminovos.', 5, 5, 118, 'Alterar página de importação e acrecentar código na página de detalhes.', '', '', '2005-07-26 17:11:25', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(84, 181, 342, 'Padronizar os botoes dos hotsites das marcas.', 5, 5, 0, 'Cada website está com um padrão de botões ... necessita ser padronizado.\r\nEx. O visite o site de alguns acendem qdo passamos o mouse em cima de outros não ... na Landrover varios acendem.', '', '', '2005-07-26 18:11:10', 2, 'carlos.carvalho', 'glauco.sassaki', ''),
	(85, 181, 342, 'Sistema para mensurar e segmentar e-mails enviados do site', 5, 1, 0, 'Verificar se é possível mensurar a qte de e-mails que sao gerados pelo site via locaweb ou via nosso proprio sistema.\r\nTemos que enviar um relatorio dps desses e-mails mensal.', '', '', '2005-07-26 18:14:49', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(86, 181, 342, 'Melhoria dos Textos com fotos do sobre a Marcas', 5, 3, 0, 'Fazer uma melhoria nos hotsites do sobre as marcas pegando como exemplo do sobre a Land rover da Calmac, a GM e a Mercedes.', '', '', '2005-07-26 18:16:25', 2, 'carlos.carvalho', 'glauco.sassaki', ''),
	(87, 181, 342, 'Incluir logos enviados pela Grinter em avaliação de Semi-novos', 5, 5, 119, 'Os logos estão no CD e o Sandro irá definir quais os logos.', '', '', '2005-07-26 18:18:11', 3, 'carlos.carvalho', 'glauco.sassaki', ''),
	(88, 181, 342, 'Colorcar alguns logos do CD da Grinter falando de Venda Direta', 5, 5, 152, 'Colorcar alguns logos do CD da Grinter falando de Venda Direta\r\n', '', '', '2005-07-26 18:32:17', 3, 'carlos.carvalho', 'glauco.sassaki', ''),
	(89, 91, 446, 'Criar mais um filtro no Cadastro de Chamado e incluir status', 5, 3, 21, 'Incluir o COMBO, depois da OS e antes do Chamado com o filtro para selecionar de os Chamados Pendentes, Cancelados e Atenditos.\r\n\r\nIncluir tb o Status do Chamado (Pendente, Cancelado, Atendido) na visualização do chamado no Cadastro de Chamados.', '', '', '2005-07-26 18:43:41', 3, 'carlos.carvalho', 'marcio.lamego', ''),
	(90, 91, 460, 'Pop de acompanhamento - contas a pagar', 5, 1, 0, 'Adicionar "Minhas Cobranças" na pop do cliente.', '', '', '2005-07-27 14:57:34', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(91, 166, 194, 'Implementar Geração do arquivo O12', 7, 3, 0, 'Implementar geração do arquivo de saída O12.\r\n\r\n    Utilizar o método CostService.createCostPartOut para buscar a informação necessária para preencher a interface OutPutRecordPartView. O método que gera o arquivo é o OutPutServiceImpl.buildFileO12. Há de se criar um arquivo de template para o velocity, da mesma forma que foi criado para O07 e O10, seguindo a especificação do arquivo de saída.\r\n\r\n', '', '', '2005-08-01 11:35:24', 2, 'alessandro.yamada', 'eduardo.botelho', ''),
	(92, 166, 194, 'Implementar Alteração de Custo Padrão', 7, 3, 231, '- Implementar classe abstrata para a interface CostChangeBO\r\n- Implementar a interface PartPurchasedCostBO estende a classe abstrata de CostChangeBO\r\n	+ Injetar PartPurchasedDAO(consulta update)\r\n- Implementar a interface RawCostChangeBO estende a classe abstrata de CostChangeBO\r\n	+ Injetar RawMaterialDAO(consulta update)\r\n- Criar Mapeamento CostChange.hbm.xml com a classe abstrata e as subclasses de PartPurchasedCostBO e RawCostChangeBO\r\n	+ subclasse de PartPurchasedCostBo tem mapeamento \'many-to-one\' para PartPurchasedActual(where type=\'PPA\')\r\n	+ subclasse de RawCostChangeBO tem mapeamento \'many-to-one\' para RawMaterialActual(where type=\'ACT\')\r\n- Implementar CostChangeDAO\r\n- Implementar CostChangeService\r\n	+ no insert e update para saber se tem de ser chamado o método boFactory.RawCostChangeBO() ou\r\n	boFactory.createPartPurchasedCostChanbeBO() pelo métodos costChangeData.isRawMaterial() e \r\n	costChangeData.isPartPurchased\r\n- Implementar métodos createRawCostChangeBO e createPartPurchasedCostChangeBO do BOFactory', '', '', '2005-08-02 09:51:53', 2, 'alessandro.yamada', 'eduardo.botelho', ''),
	(93, 0, 0, 'Implementar Importação e Alocação', 7, 3, 230, 'Essa funcionalidade tem por função gerar um agendamento para que tarefas(cargas) sejam executadas. O usuário seleciona as tarefas a serem agendadas e clicar em Agendar. Isso gerará registros que sinalizaram para um serviços quais tarefas devem ser executadas. O usuário poderá \'desagendar\' uma tarefa que foi agendada e não foi executada, indo na tela de agendamento e clicando em desagendar.\r\n\r\nImplementar interface SchedulerBO\r\n	- Ao criar-se um novo Setar no campo isActive como true\r\n	- Injetar TaskDAO para criar map getReasonByTask\r\n	- Injetar BOFactory para criar SchedulerCancelBO e SchedulerExecBO\r\n	- Injetar UserManager para buscar o login do usuário corrente\r\n	- Criar mapeamento do hibernate Scheduler.hbm.xml\r\n	- No map mapReasonByTask implementar um relacionamento igual ao abaixo:\r\n		<map name="mapReasonByTask" lazy="true" cascade="all-delete-orphan" table="SACCES_SCHEDULER_TASK">\r\n			<key column="SCHEDULER_ID"></key>\r\n			<index-many-to-many class="Task" column="TASK_ID"/>\r\n			<element type="text" column="REASON"/>\r\n		</map>\r\n	- Método cancel tem que chamar o boFactory.SchedulerCancelBO e setar com os valores do userManager e data atual\r\n	- Método execute tem que chamar o boFactory.SchedulerExecBO e setar com os valores do userManager e data atual\r\n	\r\nImplementar interface SchedulerCancelBO\r\n	- Criar como componente do SchedulerBO no mapeamento do hibernate\r\n	\r\nImplementar interface SchedulerExecBO\r\n	- Criar como componente do SchedulerBO no mapeamento do hibernate\r\n	\r\nImplementar interface TaskBO\r\n	- Criar classe PersistentEnum\r\n	\r\nImplementar interface TaskGroupBO\r\n	- Criar classe PersistentEnum\r\n\r\nImplementar interface SchedulerDAO\r\n	- Estender o AbstractDAOHibernate\r\nImplementar interface TaskDAO\r\n	- Utilizar métodos estáticos para implementar a interface\r\nImplementar interface TaskGroupDAO\r\n	- Utilizar métodos estáticos para implementar a interface\r\n	\r\nImplementar interface SchedulerData\r\n	- No map getMapReasonByTaskId o indice é o id do TaskBO e o value é o motivo(não obrigatório)\r\n	\r\nImplementar interface SchedulerService\r\n	- o método cancel tem de chamar o método SchedulerBO.cancel e o método SchedulerDAO.update.\r\n	- o método executed tem de chamar o método SchedulerBO.execute e o método SchedulerDAO.update.	\r\n\r\nImplementar método createSchedulerBO, createSchedulerCancelBO, SchedulerExecBO do BOFactory', '', '', '2005-08-02 14:44:33', 1, 'alessandro.yamada', 'todos', ''),
	(94, 166, 194, 'Implementar Importação e Alocação', 7, 3, 230, 'Essa funcionalidade tem por função gerar um agendamento para que tarefas(cargas) sejam executadas. O usuário seleciona as tarefas a serem agendadas e clicar em Agendar. Isso gerará registros que sinalizaram para um serviços quais tarefas devem ser executadas. O usuário poderá \'desagendar\' uma tarefa que foi agendada e não foi executada, indo na tela de agendamento e clicando em desagendar.\r\n\r\nImplementar interface SchedulerBO\r\n- Ao criar-se um novo Setar no campo isActive como true\r\n- Injetar TaskDAO para criar map getReasonByTask\r\n- Injetar BOFactory para criar SchedulerCancelBO e SchedulerExecBO\r\n- Injetar UserManager para buscar o login do usuário corrente\r\n- Criar mapeamento do hibernate Scheduler.hbm.xml\r\n- No map mapReasonByTask implementar um relacionamento igual ao abaixo:\r\n\r\n\r\n\r\n\r\n\r\n- Método cancel tem que chamar o boFactory.SchedulerCancelBO e setar com os valores do userManager e data atual\r\n- Método execute tem que chamar o boFactory.SchedulerExecBO e setar com os valores do userManager e data atual\r\n\r\nImplementar interface SchedulerCancelBO\r\n- Criar como componente do SchedulerBO no mapeamento do hibernate\r\n\r\nImplementar interface SchedulerExecBO\r\n- Criar como componente do SchedulerBO no mapeamento do hibernate\r\n\r\nImplementar interface TaskBO\r\n- Criar classe PersistentEnum\r\n\r\nImplementar interface TaskGroupBO\r\n- Criar classe PersistentEnum\r\n\r\nImplementar interface SchedulerDAO\r\n- Estender o AbstractDAOHibernate\r\nImplementar interface TaskDAO\r\n- Utilizar métodos estáticos para implementar a interface\r\nImplementar interface TaskGroupDAO\r\n- Utilizar métodos estáticos para implementar a interface\r\n\r\nImplementar interface SchedulerData\r\n- No map getMapReasonByTaskId o indice é o id do TaskBO e o value é o motivo(não obrigatório)\r\n\r\nImplementar interface SchedulerService\r\n- o método cancel tem de chamar o método SchedulerBO.cancel e o método SchedulerDAO.update.\r\n- o método executed tem de chamar o método SchedulerBO.execute e o método SchedulerDAO.update.\r\n\r\nImplementar método createSchedulerBO, createSchedulerCancelBO, SchedulerExecBO do BOFactory', '', '', '2005-08-02 14:48:05', 2, 'alessandro.yamada', 'alessandro.yamada', ''),
	(95, 91, 446, 'não cadastra sistema/os', 2, 1, 21, 'Ao gravar o chamado, ele cadastra sem sistema / os', '', '', '2005-08-02 15:54:15', 2, 'marcio.lamego', 'marcio.lamego', ''),
	(96, 149, 453, 'a subconta 205/1993 1ª. Vara de Alta Floresta não aparece no relatório detalhado, apenas no simplificado', 2, 5, 0, 'correção da consulta responsável.', '', '', '2005-08-03 09:18:31', 2, 'marco.malaquias', 'marco.malaquias', ''),
	(97, 149, 453, 'o perfil "normal" e "magistrado" não está habilitado a consulta de processo pelo nome ou pelo número da guia', 2, 5, 0, 'correção da consulta.', '', '', '2005-08-03 09:19:30', 2, 'marco.malaquias', 'marco.malaquias', ''),
	(98, 91, 460, 'Não está sendo possível selecionar escritório', 2, 1, 25, 'O select de escritórios fica desabilitado na opção \'Todos\'.\r\nConforme anexo, o escritório está certo no select 1 e o select 2 deveria trazer o mesmo escritório. \r\nComo o escritório não pôde ser definido, não está sendo possível cadastrar um conta. O vencimento da mesma é dia 09/08.\r\n\r\nAtt.\r\nLuiz Paulo', '', '', '2005-08-04 14:36:00', 2, 'luiz.paulo', 'marcio.lamego', ''),
	(99, 166, 194, 'Cadastro de Grupo C/C', 5, 2, 232, 'No cadastro de Grupo, na Árvore de Grupos, colocar os itens no formato "Código TMC - Nome"\r\nColocar o mesmo formato nas Combo-box "Planta" e "Departamento"\r\n', '', '', '2005-08-04 16:05:43', 2, 'rodrigo.moralles', 'eduardo.botelho', ''),
	(100, 166, 194, 'Campo "Centro Produtivo"', 2, 2, 200, 'Salvar o valor do campo "CENTRO_PROD" da Planta e gravar no campo "CENTRO_PROD" da Seção.', '', '', '2005-08-04 16:07:09', 2, 'rodrigo.moralles', 'eduardo.botelho', ''),
	(101, 166, 194, 'Máscara para "Custo de Aquisição"', 5, 2, 233, 'Cadastro de Itens de Depreciação -> Inserir novo -> Campo "Custo de Aquisição". Restringir a entrada do teclado para "Números" e "." (Ponto decimal)', '', '', '2005-08-05 11:07:36', 2, 'rodrigo.moralles', 'eduardo.botelho', ''),
	(102, 166, 194, 'Implementar geração do arquivo de saída O13', 7, 3, 0, 'Implementar geração do arquivo de saída O13.\r\n\r\nUtilizar o método CostService.createCostWTAOut para buscar a informação necessária para preencher a interface OutPutRecordWTAView. O método que gera o arquivo é o OutPutServiceImpl.buildFileO13. Há de se criar um arquivo de template para o velocity, da mesma forma que foi criado para O12, seguindo a especificação do arquivo de saída.', '', '', '2005-08-10 13:49:55', 2, 'alessandro.yamada', 'eduardo.botelho', ''),
	(103, 166, 194, 'Implementar geração do arquivo de saída O25', 7, 3, 0, 'Implementar geração do arquivo de saída O25\r\n\r\nUtilizar o método CostService.createCostKatashikiOut para buscar a informação necessária para preencher a interface OutPutRecordKatashikiView. O método que gera o arquivo é o OutPutServiceImpl.buildFileO25. Há de se criar um arquivo de template para o velocity, da mesma forma que foi criado para O12 e O13, seguindo a especificação do arquivo de saída.', '', '', '2005-08-10 13:51:31', 2, 'alessandro.yamada', 'eduardo.botelho', ''),
	(104, 166, 194, 'Regra Data de Validade', 7, 2, 200, 'Cadastro de Seção. Quando Sacces "Sim", o campo Data de Validade "De" (data de validade inicial) deve ser obrigatório', '', '', '2005-08-11 09:13:25', 2, 'rodrigo.moralles', 'rodrigo.sousa', ''),
	(105, 91, 460, 'OS´s apenas autorizadas e em desenvolvimento', 2, 1, 4, 'No cadastramento de nova atividade tem que aparecer somente OS´s autorizadas e em desenvolvimento.', '', '', '2005-08-11 10:32:50', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(106, 91, 460, 'Quando vou estimar a data de entrega perco os dados', 2, 1, 17, 'Quando vou estimar a data de entrega perco os dados de horas e analistas envolvidos.', '', '', '2005-08-11 10:36:09', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(107, 166, 194, 'Seção Inativa', 5, 2, 200, '1. Cadastro de Seção. Se Status está \'Inativa\' então o usuário não poderá fazer nenhum tipo de alteração, tanto na parte superior do cadastro (Seção) quanto na parte inferior (Centro de Custo)\r\n\r\n2. O usuário não pode alterar o campo \'Código da Seção\'\r\n\r\n\r\n', '', '', '2005-08-11 17:57:29', 2, 'rodrigo.moralles', 'eduardo.botelho', ''),
	(108, 91, 460, 'Quando clico no link do dia abre imagem quebrada.', 2, 1, 6, 'Quando expandido algum analista e clico no link do dia da atividade abre a pop do DR com imagem quebrada.', '', '', '2005-08-12 09:37:16', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(109, 166, 194, 'Campo "Classific. C/C" em Seção', 7, 2, 200, 'Cadastro de Seção:\r\n\r\n* Mover o campo "Classificação C/C" para a parte Toios do cadastro\r\n\r\n* Salvar essa informação no Toios e no Sacces seguindo a regra:\r\n     Se Sacces "Sim" então salvar no Toios e no Sacces\r\n     Se Sacces "Não" então salvar somente no Toios\r\n\r\n* Exibir os itens da Combobox seguindo a regra:\r\n     Se Sacces "Sim" então exibir somente os itens Sacces (CostCenterType.isSacces == true)\r\n     Se Sacces "Não" então exibir somente os itens Não-Sacces (CostCenterType.isSacces == false)\r\n\r\n\r\n', '', '', '2005-08-12 14:55:09', 2, 'rodrigo.moralles', 'eduardo.botelho', ''),
	(110, 93, 523, 'Validação - Pedidos e Carta de Correção(Itens 2 e 4)', 5, 0, 0, '0 - Antes de mais nada: deixe disponível o SVD rodando  aí em campo grande ( para poder visualizar o que será necessário implementar - veja com o Fernando se demorar mais de 15 min., que eu te ajudo a configurar, não podemos atrasar muito ele )\r\n\r\nQuero que vc veja duas telas: Menu -> Pedido -> Novo Pedido \r\nMenu  \r\nPedido -> Novo Pedido \r\nSolicitação -> Carta de Correção\r\n( so precisa olhar por enquanto )\r\n\r\n1- Baixe todos os projetos ( dss, DSSEJB, DSSHibernate, DSSWeb )dentro de dss/Implementação do repositório Toyota do nosso CVS. Lembre-se que eles tem dependencia do Agence_Java_Lib  (que vc já deve ter na sua máquina)\r\n\r\nPor Enquanto é isso ... na segunda nos falamos.\r\n\r\n2)	Solicitação 2305 - Na Inclusão de Pedidos: (Novo Pedido)\r\n\r\n2.1)Tornar o campo Inscrição Estadual obrigatório quando for informado CNPJ. Incluir mensagem "Inserir número da Inscrição Estadual ou ISENTO". \r\nRODRIGO\r\n\r\n2.2)Tornar o campo RG obrigatório quando for informado CPF.\r\nRODRIGO\r\n\r\nSimples – Somente alteração (nova regra na validação)\r\nImplementar\r\nTestar\r\n\r\n\r\n4)	Solicitação 2307 - (Carta de Correção)\r\nQuando a Dealer solicitar uma carta de correção no SVD e não permitir garvar cartas de correção em branco.\r\nVerificar o que seria uma carta de correção em branco.\r\n\r\n\r\n', '', '', '2005-08-12 18:15:13', 2, 'joe.colombo', 'rodrigo.sousa', ''),
	(111, 91, 460, 'Quando clica no usuario nao tah expandindo os dias do mes', 2, 0, 6, 'Quando clica no usuario nao tah expandindo os dias do mes.', '', '', '2005-08-12 18:33:26', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(112, 91, 460, 'Erro cadastro', 2, 0, 25, 'nao estah cadastrando as despesas e o calendario nao tah navegando entre os meses.', '', '', '2005-08-22 09:32:33', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(113, 91, 3, 'Ao confirmar o cadastro nada acontece', 2, 2, 25, 'Após cadastrar uma despesa o sistema mostra o alert de sucesso mas a despesa não aparece nos lançamentos do mês.\r\nConta vence dia 31/08. Caso não seja possível atender o chamado até o dia 30, favor informar para que o pagamento possa ser feito de outra forma.\r\n\r\nAtt.\r\nLuiz Paulo', '', '', '2005-08-23 14:49:43', 3, 'luiz.paulo', 'luis.morales', ''),
	(114, 91, 460, 'No calendário nao aparece a descricao da despesa', 2, 0, 25, 'No calendário nao aparece a descricao da despesa, nao producao de o caso dos estágios do DF, para o dia 31. \r\nO dia 31 fica vermelho mas quando vc coloca o mouse em cima nao aparece nada.', '', '', '2005-08-24 12:48:14', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(115, 91, 460, 'Está pedindo horas gastas para cadastrar envio de proposta', 2, 1, 4, 'Está pedindo horas gastas para cadastrar envio de proposta, para cadastrar atividade do tipo "evio de proposta" não tem que exigir "horas gastas".', '', '', '2005-08-24 16:20:45', 2, 'carlos.arruda', 'marcio.lamego', ''),
	(116, 149, 453, 'correção de algumas inconscistências do siscondj', 2, 5, 0, '1. Emissão de guia\r\nApós localizar o processo, o campo "Depositante" deverá vir preenchido com o Depositante cadastrado para o processo selecionado.\r\n\r\n2. Emissão de guia retroativa\r\nApós localizar o processo, se este possuir Depositante cadastrado, o programa não recarrega a página.\r\nDurante o teste, após uma longa espera, o browser fechou sozinho. \r\n\r\n3. Alteração de liberação da seqüência\r\nRemover este item do menu Administração e incluí-lo no menu Cancelamento.\r\nAlterar o nome da funcionalidade para Cancelamento de Conciliação.\r\nAlterar o funcionamento do seguinte modo:\r\n- Usuário localiza a subconta, conforme procedimento padrão do sistema;\r\n- O programa lista as liberações já conciliadas e as disponibiliza em uma tabela, para seleção de uma delas;\r\n- Usuário seleciona uma das  liberações listadas.\r\n- O sistema habilita a opção Desconciliar.\r\n- O usuário seleciona a opção Desconciliar.\r\n- O programa solicita confirmação do desconciliamento.\r\n- Caso o usuário confirme, a data de pagamento deve voltar a ser "vazia" e o sistema alimenta uma tabela com o histórico de desconciliações.\r\n\r\n4. Consulta Pedidos de Liberação Efetuados\r\n4.1 Ao restringir a consulta por Comarca, Vara e/ou Usuário, o sistema apresenta uma relação de dados inconsistente.\r\n4.2 Remover reloads desnecessários da página de filtros.\r\n \r\n5. Consulta de Subconta Cadastrada\r\n5.1 Incluir coluna com nome da comarca e da vara.\r\n5.2 Corrigir indexação da tabela das partes do seguinte modo: ao localizar um novo processo, a lista de partes deve sempre aparecer na primeira página.\r\n\r\n6. Consulta de Saldo Consolidado de Subcontas\r\nAlterar a ordem das colunas para: Comarca/Vara/Processo/Ano/Sequencia/Valor\r\n\r\n7. Verificar inconsistencia de liberacao do seguinte processo:\r\nCuiaba 6a Familia 182/2004\r\nA liberacao é do valor 3032,23 [15/07], mas no extrato aparece 3030,54 [18/07].\r\nNo relatório tb aparece a de 3030, quando deveria aparecer a 3032,23.\r\nO alvará está correto.', '', '', '2005-09-23 09:01:33', 2, 'marco.malaquias', 'marco.malaquias', ''),
	(117, 149, 453, 'cancelamento de transferência de subConta', 4, 1, 0, 'Hugo:\r\nestou precisando de uma reparação com urgência\r\nfoi feita uma transferencia entre subcontas e preciso que seja cancelada\r\nProcesso 490/2004 da Vara Única da comarca de Alto Araguai transferido para o processo 343/2005 da 1ª vara da Comarca de Alto Araguaia\r\ntransferencia efetuada em 16/08/2005 pela Emília', '', '', '2005-09-29 16:18:01', 2, 'marco.malaquias', 'marco.malaquias', ''),
	(118, 126, 65, 'erro no sistema (banner e alteração de imóveis)', 2, 2, 0, 'PROBLEMAS COM CMS (RISCALI)\r\n1.	Quando tentamos alterar qualquer informação do imóvel cadastrado e SEM CÓDIGO DBF, ao confirmar o sistema retorna uma mensagem de erro:\r\nSendo que o código do imóvel que estava tentando desativar é 5163!!\r\nClico no “ok” da mensagem e mesmo assim não desativa o imóvel.\r\n\r\n2.	Na aba Banner &#61664; Configurar:\r\nClico em “Trocar Banner”, ao selecionar um outro banner o caminho no campo “Banner Contato” aparece: http://www.agence.or2.net/riscali/upload/banner/f1f34d141d4be2e03e30f06627572405.gif\r\nIsto é não aparece nenhum banner no site da riscali, pois o rastro é do or2.\r\nPor enquanto é só isso!!\r\nMuito obrigada, aguardo retorno,\r\nCyntia\r\n', '', '', '2005-09-29 16:28:28', 2, 'marco.malaquias', 'marco.malaquias', ''),
	(119, 181, 342, 'Colocar mais uma opção em Assuntos', 5, 2, 0, 'Colocar em www.caltabiano.com.br/inc_sac.asp na opção ASSUNTO:\r\nReclamação/Sugestão', '', '', '2005-09-30 14:24:23', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(120, 181, 422, 'Imprimir planilha Excel', 5, 1, 0, 'Desenvolvea função Imprimir / Exportar para Excel:\r\n\r\nCom o Layout desenvolvido pela Leandro, desenvolver a função, utilizando as colunas que já existem na intranet e incluido as seguintes colunas:\r\nVENDEDOR\r\nOPCIONAIS\r\nCOMBUSTÍVEL\r\nOBSERVAÇÕES (do campo acessários)\r\n\r\nObs.: alterar o campo abservações para o OBS de acessórios', '', '', '2005-09-30 14:28:37', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(121, 0, 0, 'cpf na solicitação de liberação', 2, 0, 0, 'Retirada da verificação da existência de cpf nas partes/advogados na solicitação de liberação a pedido do Hugo de MT', '', '', '2005-10-06 16:03:18', 1, 'marco.malaquias', 'marco.malaquias', ''),
	(122, 0, 0, 'cpf na solicitação de liberação', 2, 1, 0, 'retirada da verificação da existência de cpf na solicitação de liberação a pedido do Hugo de MT', '', '', '2005-10-06 16:06:43', 1, 'marco.malaquias', 'marco.malaquias', ''),
	(123, 181, 394, 'Incluir a opção de TODOS no combo de MARCA da Daimiler-Chrysler', 5, 1, 0, 'Incluir a opção de TODOS no combo de MARCA da Daimiler-Chrysler', '', '', '2005-10-11 13:00:39', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(124, 181, 422, 'O detalhe do veículo não está sendo visualisado', 2, 0, 0, 'Qdo clicamos num detalhes do veículo não visualisamos os detalhes. somente qdo tem opcionais cadastrados. (ex. Corcell II)', '', '', '2005-10-11 13:15:43', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(125, 93, 523, 'Dealer nao consegue cadastrar pedido de PPD', 2, 0, 0, 'Paula:\r\n\r\n"Para tipos de cliente que estão parametrizados para aceitar tanto CPF quanto CNPJ (campo: svd_param_bm_modelo.liberado_pedido = 0), o sistema só está aceitado CNPJ, o que está incorreto e inviabiliza muitos tipos de cliente (Taxista, Órgão do Governo...) que funcionam para ambos os casos.\r\n\r\nPrecisamos desta alteração o mais rápido possível, pois temos inúmeras dealers incluindo pedidos de todos os tipos de clientes."\r\n\r\nClaudia:\r\n\r\n"A tabela em questão vincula tipo de cliente X divisão X modelo e se é permitido cadastro do pedido para esta situação se o cliente for CNPF, CPF ou AMBOS.\r\n\r\nNo caso, após a alteração do programa o mesmo não esta respeitando a condição de AMBOS em nenhuma situação.\r\n\r\nPara maiores esclarecimentos, fale com a Paula."\r\n\r\n', '', '', '2005-10-13 10:40:40', 2, 'carlos.arruda', 'lf.oliveira', ''),
	(126, 166, 194, 'Erro ao acesso a dados Oracle (lib)', 2, 1, 0, 'Temos disponível em agence_java_lib 2 libs para o banco Oracle: classes12.zip e ojdbc14.jar\r\n\r\nA "Alocação" só funciona com a classes12.zip (lança exceção com a ojdbc14.jar)\r\n\r\nE a "Geração do Arquivo de Saída O-25" e/ou "Relatório Custo por Parte" só funciona com a ojdbc14.jar (lança exceção com a classes12.zip\r\n\r\nObjetivo: Ajustar para que o sistema execute sem erros com somente uma das libs. Pode ser a classes12.zip, ou a ojdbc14.jar ou outra biblioteca.', '', '', '2005-10-18 11:01:43', 2, 'rodrigo.moralles', 'eduardo.botelho', ''),
	(128, 149, 613, 'erro no CONSOLIDADO DE SALDO POR COMARCAS', 2, 1, 0, 'a pesquisa de indiferente - indiferente no relatório CONSOLIDADO DE SALDO POR COMARCAS não está sendo disponibilizada', '', '', '2005-10-27 15:33:04', 2, 'marco.malaquias', 'marco.malaquias', ''),
	(129, 181, 422, 'Melhoria no Sistema de upload de fotos', 5, 1, 0, 'Rubini,\r\nFavor dimensionar e fazer as seguintes alterações no sistema de up-load de fotos:\r\n1 - Qdo clicar na imagem da camera para incluir/excluir fotos do veículo, abrir uma pop-up e não carregar uma nova página.\r\n2 - Aparecer nessa pop-up o resumo do veículo em quentão. Mostrar o Modelo do veículo para saber qual veículo estamos cadastrando a foto\r\n3 - Colocar 4 Selecionar imagens para selicioar no mínimo 4 imagens de uma só vez e fazer o up-load de uma só vez. Fica difícil selecionar uma imagem de cada vez para up-load.\r\n4 - Mostrar a(s) imagem(s) salva(s) dps de fazer o up-load.\r\n5 - Na listagem do estoque de carros semi-novos mostrar se o veículo já possue foto cadstrada ou ainda não. Pensei em mostrar um número dps da imagem da camera. ', '', '', '2005-11-22 15:02:45', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(130, 187, 629, 'Ajustes geral 1.0', 2, 0, 0, 'Todo sistema:\r\n\r\n- No rastro o "TELA INICIAL" não funciona.\r\n\r\n- O rodapé e as tabelas tem que ficar com 98% de largura, e não com 100% como tenho visto em várias telas, atentar para isso. Dessa forma (com 98%) ele não fica "colado" nas margens. Algumas telas estão ok (cadastro de cliente por exemplo) mas tem outras que não (cadastro de cliente aba historico de ocorrencias, troca de senha, etc). Dar uma revisada.\r\n\r\n- Nos botões deixar com os ícones representativos, botão de salvar com o ícone do disquete por exemplo.\r\n\r\n\r\nVersão admin:\r\n\r\nTELA INICIAL -> CONSULTAS  -> MINHA AGENDA\r\n\r\n- Quando tenho uma atividade agendada o sistema tem que apresentar que nem o CAOL da Agence faz, deixa a data em vermelho quando se tem pelo menos 1 atividade pendente ou em andamento, e deixa em azul qdo se tem 1 ou todas as atividades desse dia atendidas ou canceladas. Lembrando que tem que ter o mesmo recurso da agenda do CAOL da Agence, quando coloco o mouse em cima do dia ele traz uma layer com o resumo das atividades desse dia.\r\n\r\n- Na guia "Atividades" quando eu clico nela ela já deve fazer a consulta automaticamente, com o parâmetro status "pendente" selecionado, daí se o usuário quiser trocar os parâmetros e refazer a pesquisa tudo bem.\r\n\r\n- Em "nova atividade" está aparecendo todos os clientes para qualquer CVV, sem relacionamento algum. O sistema deve relacionar o CVV ao cliente, por isso quando o CVV for agendar uma atividade deve aparecer somente os clientes associados a ele (isso é feito no cadastro de cliente, na combo "CVV Responsável").\r\n\r\n- Em "nova atividade" o sistema tem que já trazer o status "pendente" como selecionado, não existe o "selecione ->".\r\n\r\n- Em "nova atividade" o sistema está me obrigando a preencher o campo "Retorno da Atividade", o que não pode.\r\n\r\n- Em "nova atividade" o sistema está me obrigando a preencher o campo "Tempo gasto", o que não pode. Só deve obrigar o preenchimento desse campo quando o status for "Atendido".\r\n\r\n\r\nTELA INICIAL -> OPERAÇÃO  -> CADASTRO DE NOVO CLIENTE \r\n\r\n- Em "Usuários do Sistema" tá faltando na coluna "Ação" o sinal de -, necessário para deletar um usuário, caso ele já tenha criado uma ocorrência no sistema deve dar um alerta de que o usuário não pode ser excluído e sim desativado, de forma que não quebre a integridade referencial do banco.\r\n\r\n- Em "Usuários do Sistema" não é necessário o campo login, já que o sistema valida o usuário pelo e-mail.\r\n\r\n- Quando salvo um novo cliente sem colocar nenhum usuário de sistema não consigo depois, quando novamente editado o cliente, adicionar, o sinal de + não existe.\r\n\r\n\r\nNova funcionalidade:\r\n\r\nSincronizar CVS e verificar "TELA INICIAL -> OPERAÇÃO  -> CADASTRO DE ATIVIDADE", observe que agora posso criar e editar as atividades refletidas em "TELA INICIAL -> CONSULTAS  -> MINHA AGENDA".\r\n\r\n\r\n\r\nVersão usuário:\r\n\r\n- Quando cadastro um chamado o sistema tem que tratar "pulo de linha", isso foi feito no CAOL e em outros sistemas.\r\n\r\n- Quando cadastro um chamado o sistema não precisa apresentar toda a descrição do chamado no link, quando clico e expando sim, mas quando ele está no link só precisa de uma linha e depois pode colocar "...".\r\n\r\n- Quando cadastro um chamado o sistema tem apresentrar esse chamado na agenda do CVV responsável, já na data que o usuário solicitou o atendimento.', '', '', '2005-11-23 11:54:16', 3, 'carlos.arruda', 'todos', ''),
	(131, 181, 342, 'http://www.caltabiano.com.br/inc_mercedes_0km.asp', 2, 0, 0, 'Cadastro dos Classes M e Classe A em Mercedes 0Km', '', '', '2005-11-24 00:05:34', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(132, 181, 625, 'Melhoria no Sistema', 2, 0, 0, '1 - Colocar uma menssagem de "aguarde" enquanto o sistema faz a consulta;\r\n2 - Tentar otimizar as consultas para melhorar o desempenho do sistema;\r\n3 - Arrumar o "valor total" na totalização no final do reletório;\r\n4 - Retirar os veículos GM (lixo) q aparecem no sistema;\r\n5 - Comparar o relatório online com o excel enviado pela Denise por e-mail em 30/Nov/2005.', '', '', '2005-11-30 15:26:07', 2, 'carlos.carvalho', 'ricardo.martins', ''),
