	(158, 181, 394, 'Revisão na tabela de preços da GM', 5, 1, 0, 'Revisão na tabela de preços da GM conforme alterações solcitadas pelo Sandro em 12/Dez.', '', '', '2005-12-12 10:50:14', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(159, 181, 394, 'Erro na atualização de preços de blindagens.', 2, 0, 0, 'Estou atualizando os preços de blindagens GM na intranet e quando coloco para salvar as informações, aparece uma mensagem de erro.\r\nIsso aconteceu nas outras marcas também, mas as informações ficaram gravadas.\r\nPorque após algum tempo as informações dos preços de blindagens desaparecem e precisam ser lançadas novamente?\r\n', '', '', '2005-12-12 10:51:49', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(160, 181, 342, 'Alterar os textos de "preço disponível" para "preço sugerido"', 7, 2, 0, 'Alterar os textos de "preço disponível" para "preço sugerido". Colocar em todos os veículos "consulte-nos", somente nos casos que o gerente solicitar para colocar o preço que colocaremos e sempre manteremos atualizados.', '', '', '2005-12-12 15:20:15', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
