	(162, 181, 342, 'Concluir área de acessórios da Freelander', 7, 0, 120, '- Traduzir Menu modelos de doors para portas\r\n- Tirar o modelo 3 Doors SelfBack\r\n- Alterar a foto acionamento de travas automarico ao ligar o veiculo\r\n  (Flavio vai enviar outra foto)\r\n- Friso Lateral Preto (retirar)\r\n- Barra de rolagem descer até o final no Menu (para ter menos scrool)\r\n- Incluir - adicionar a cesta', '', '', '2005-12-12 16:22:40', 2, 'carlos.carvalho', 'glauco.sassaki', ''),
	(163, 181, 342, 'Concluir área de acessórios da Freelander', 7, 0, 120, '- Estribo Chapa Original Cromado (inverter a imagem a parte para fora é ref. a  porta traseira)\r\n- Descansa braço original fixo no console (Foto errada pegar no catalogo)\r\n  Vai mandar a foto como exemplo pra saber o que é\r\n- Incluir - ICONE', '', '', '2005-12-12 16:24:00', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(164, 181, 394, 'Alterar tabela de preços de blindados', 5, 1, 0, 'Conforme solicitação do Alessandro, alterar tabela de preços de blindados:\r\n1 - Cadastro de preços de blindados por modelo, indepedente se tenha cadastrado na tabela de preço;\r\n2 - Não vincular o preço do veículo ao preço da blindagem (apenas no preço do carro no estoque)\r\n3 - Na tabela de preço de blindagem em CONSULTA, somente apresentar o preço da blindagem (e não co veículo + blindagem)\r\n4 - No cadastro apresentar TODOS os veículos do Tab_veic. (e não apenas os com preços cadastrados).\r\n5 - Arrumar ERRO: Erro durante a exibição da página.\r\nADllPrecosBlindadosGer.cGravarPrecosGer|gravarTabelaPrecos - Erro durante a gravação dos dados. \r\nMotivo: ORA-01400: cannot insert NULL into ("AGENCE"."VEIC_BLINDADOS_PRECO"."PRECO_MINIMO_BLINDAGEM");\r\n6 - Incluir nova regra na tabela de Estoque: QDO O VEÍCULO 0KM DA TABELA DE ESTOQUE FOR BLINDADO E NÃO TIVER PREÇO DE BLINDAGEM CADASTRADO NA TABELA, NÃO APRESENTA NENHUM PREÇO DO VEÍCULO.', '', '', '2005-12-13 11:26:06', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(165, 181, 394, 'Automatizar Aniversariiantes do Mês na HOME da Intranet', 7, 5, 0, 'Levantar com o Leandro as planilhas dos aniversariantes do mês, desenvolver uma base de dados e uma tela de cadastro/manutenção de Aniversariantes por lojas e apresentar na HOME da Intranet. (poderíamos colocar fotos do funcionário tb)\r\nA Teresa do RH do grupo será quem fará a manutenção dos funcionários, fotos e aniversariantes.', '', '', '2005-12-13 12:05:50', 2, 'carlos.carvalho', 'dimas.junior', ''),
