	(167, 181, 394, 'Atualização da Notícia na Intranet', 7, 0, 0, 'Atualização da Notícia na Intranet:\r\n\r\n1 - Entrega da Cesta de Natal para os funcionários apenas no dia 19/12:\r\n- Cesta de Natal Surpresa;\r\n- Retirada na sua loja somente no dia 19/12;\r\n\r\n2 - Festa de Final de Ano da Caltabiano 22/12:\r\n- Conforme imagem em anexo.\r\n- Rua Olga, 246 ... das 18:30 às 22:30\r\n\r\nAtualizar hoje no final do dia.', '', '', '2005-12-15 11:55:57', 2, 'carlos.carvalho', 'glauco.sassaki', ''),
	(168, 181, 342, 'Atualizações de 0km da Mercedes, Chrysler, Jeep e Dodge', 5, 0, 0, 'Mercedes: \r\n- Retirar o modelo Classe ML 320 CDI (não disponível no Brasil);\r\n- Incluir novo modelo C 200 K (favor nos enviar informações sobre esse novo modelo);\r\n- Alterar o modelo C 320 para o C 350;\r\n- Alterar os modelos Classe CLK 320 para CLK 350 (em todos os veículos).\r\n- Atualizar o S 500\r\n \r\nChysrler:\r\n- Incluir o PT Cruiser Classic; \r\n- Retirar o Caravan LX (suspender por um tempo).\r\n \r\nDodge:\r\n- Incluir a versão de Cabine Simples.\r\n ', '', '', '2005-12-15 17:23:14', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
