	(191, 181, 394, 'Criar opção de escolha do período do vendedor do mês', 5, 0, 267, 'Rubini, criar um campo com a opção de selecionar o período do vendedor do mês;\r\nSempre no começo do mês não se tem muitos veículos para mensurar quem é o vendedor do mês. Seria interessante que até o dia 10 de cada mês, ainda pudesse se visualizar o vendedor do mês anterior.\r\nPor exemplo, hj dia 3/Jan, não se tem muitos veículos vendidos; seria melhor se tivesse mostrando o vendedor do mês anterior ... até +/- dia 10/jan.\r\n\r\nOu criar um combo com uma lista de todos os últimos meses, ou dois calendários com para selecionar o período.', '', '', '2006-01-03 21:43:20', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
