	(224, 181, 704, 'Unificar a atual consulta de F&I com o cadastro', 5, 0, 267, '- Unificar a atual consulta de F&I com o cadastro ... facilitando o cadastramento de seguros e financiamento e consulta pela intranet.\r\n\r\n', '', '', '2006-03-09 21:40:02', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(225, 181, 704, 'Desenvolver a Consulta Gerencial do F&I', 5, 0, 267, 'Acrescentar totais de vendidos,Financiado e comissões.', '', '', '2006-03-09 21:41:02', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(226, 181, 578, 'Conferir relatorio de Recebíveis', 2, 0, 267, '1 - Do relatorio de SUMARIO, arrumar (ou retirar) todos os links de TOTAIS (A vencer), porque estao errados.\r\n2 - Filtrar Forma de pagamento "carteira" do sumario de Seguradora.\r\n3 - Resolver erro com valores da Calpac Clelia (R$ 675 - Seguradora) e Calmac (R$ 675 - Seguradora). Valores incorretos, deveria ser 0 (zero).\r\n', '', '', '2006-03-13 18:47:10', 2, 'carlos.carvalho', 'alessandro.yamada', ''),
	(227, 181, 704, 'Resolver problema de duplicidade de cadastro no F&I', 2, 0, 267, 'Rubini, necessito que vc dê um pulo na Calpac (GM) e converse com a Soraya (Seguros) e Micheli (Financiamento). Elas estão com problema nop cadastro de F&I, segundo elas o nosso sistema duplica o cadastro. Favor resolver isso urgente.', '', '', '2006-03-14 08:43:16', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(228, 181, 718, 'Alterar valores de RECEBIDOS na GM', 5, 0, 267, 'Somente na Calpac e Calpac Clelia temos valores incorretos para veículos recebidos:\r\nA Valor correto seria:\r\nPara Calpac Ltda = Valor atual da Calpac Ltda - valor da Clélia\r\nPara TODOS = Valor atual da Calpac Ltda ( e não a soma das duas lojas)\r\nPara Clélia = continua valor da Clélia', '', '', '2006-03-15 16:39:16', 2, 'carlos.carvalho', 'alessandro.yamada', ''),
	(229, 181, 704, 'Novo layout de consulta de F&I com indice de penetração', 7, 1, 267, '- Alterar o novo layout da consulta de F&I conforme conversamos.\r\n- Alterar o "Indiferente ->"', '', '', '2006-03-15 16:42:37', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(230, 181, 705, 'Colocar um script de R$ XX.XXX,XX (MascaraDigitado)', 5, 1, 267, 'Colocar um script de R$ XX.XXX,XX na tabela de cadastro de metas.', '', '', '2006-03-15 16:56:35', 2, 'carlos.carvalho', 'alessandro.yamada', ''),
	(231, 181, 342, 'Incluir 300 C Touring', 7, 0, 80, 'Incluir 300 C Touring no website e na proposta de intranet.', '', '', '2006-03-15 18:22:50', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(232, 181, 394, 'Incluir informação na intranet qdo o servidor Oracle estiver em manutenção/fora do ar', 5, 2, 267, 'Rubini, Incluir informação na intranet qdo o servidor Oracle estiver em manutenção/fora do ar.\r\nAcredito que a melhor maneira será uma msg na HOME (onde aparece usuário inválido) qdo o Oracle está fora do ar.\r\nColocar um "oracle em manutenção" tb no aniversariante da semana (para não ficar com erro)', '', '', '2006-03-16 09:42:10', 1, 'carlos.carvalho', 'ricardo.rubini', ''),
	(233, 181, 394, 'Alteração dos nomes das Lojas nas listas de Ramais', 2, 0, 267, 'Existem duas lojas com o nome incorreto na lista. São elas:\r\n\r\n1) Escrito: Daymler Chrysler -> Correto: Daimler Chrysler\r\n2) Escrito: Land Rover -> Correto: Calmac Land Rover\r\n', '', '', '2006-03-16 10:31:18', 2, 'fernando.marinho', 'alessandro.yamada', ''),
	(234, 181, 394, 'Retirar o link que está no submenu RELATORIOS no menu PÓS-VENDAS', 2, 1, 267, 'Retirar o link que está no submenu RELATORIOS no menu PÓS-VENDAS. ', '', '', '2006-03-17 14:41:45', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(235, 181, 394, 'Arrumar erro no estoque de novos na aba TODOS', 2, 0, 267, 'Menu NOVOS - CONSULTA - ESTOQUE\r\nNa Aba TODOS\r\nConsultar tudo indiferente (ou seja, todos o estoque do grupo)\r\n\r\nErro durante a exibição da página.\r\n\r\nADllEstoqueNovos.cListarEstoqueNovos|listarEstoque - Erro durante a recuperação de dados. \r\nMotivo: Type mismatch', '', '', '2006-03-17 14:48:34', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(236, 181, 394, 'Arrumar lista de lojas no estoque de novos', 5, 0, 267, 'Menu NOVOS - CONSULTA - ESTOQUE\r\nNa Abas da TOYOTA/LEXUS e da GM aparacem a lista de TODAS as lojas.\r\nNa da Toyota devera aparecer apenas Calwest e Autos e Indiferente\r\nNa da GM devera aparecer Pacaembu e Clélia e Indiferente.', '', '', '2006-03-17 14:51:55', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(237, 181, 704, 'Arrumar os veículos Faturados para Vendidos', 2, 0, 267, 'No relatório de consulta F&I, arrumar os valores e nome de FATURADOS para VENDIDOS.', '', '', '2006-03-17 18:30:14', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(238, 181, 718, 'Alteração para fonte em negrito das linhas mestres do relatório de F&I', 5, 2, 267, 'As linhas que estão com fundo mais escuro, que possuem subtítulos, deverão ter a fonte em negrito.', '', '', '2006-03-17 18:31:41', 2, 'fernando.marinho', 'alessandro.yamada', ''),
	(239, 181, 342, 'Desenvolver Banner para "Express Maintenance" no hotsite da Toyota', 7, 0, 178, 'Desenvolver Banner dpara "Express Maintenance" no hotsite da Toyota:\r\n1 - Primeiro desenvolver um layout do banner para aprovação.\r\n2 - Dps colocar na área da Toyota e de Officina\r\n\r\nObs.: Desenvolver layout seguindo informações do e-mail enviado em 21/Mar/2006.\r\n___________________________________________________________________________________\r\nExpress Maintenance, um novo serviço desenvolvido pela Toyota para melhor atender seus clientes.\r\n\r\nO serviço de EM, hoje só realizado pela Caltabiano Berrini, conta com 2 BOX exclusivos para esse sistema, a certificação foi realizada em fevereiro de 2006 pela Toyota do Japão, a Caltabiano Berrini é a 14 do mundo certificada com uma pontuação de 94 pontos.\r\n\r\nCom o sistema de agendamento podemos programar o trabalho dos consultores de serviço no atendimento aos clientes agendados e também programar a oficina. Os técnicos utilizando equipamentos diferenciados e de alta qualidade e novos procedimentos desenvolvidos para que os dois técnicos trabalharem ao mesmo tempo abrangendo todos os itens de revisão, mantendo a qualidade, temos 2 Box de lavagem exclusivos que possibilitam uma estagnação 0 entre os processos garantindo a entrega do veículo em até 1 hora.\r\n\r\n\r\nFaça o seu agendamento pelo telefone: 11 5502-2538/39 ou e-mail: agendaberrini@caltabiano.com.br\r\n', '', '', '2006-03-21 22:57:35', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(240, 181, 342, 'Incluir banner de Pronta Entrega do CLS 500', 7, 0, 184, 'Desenolver banner de divulgação no website que a Caltabiano tem em estoque (Pronta Entrega) o CLS 500.', '', '', '2006-03-21 23:08:14', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(241, 181, 342, 'Atualizar RAV4 no website e na Intranet', 7, 0, 97, 'Atualizar RAV4 no website e na Intranet', '', '', '2006-03-23 17:07:12', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(242, 181, 394, 'Incluir a Calcenter (Nissan) na Intranet', 7, 1, 267, '- Incluir na Tabela de Preços de 0km e blindados;\r\n- Incluir abas da NISSAN como motadora;\r\n- Incluir Calcenter em todos os combos de loja;\r\n- Revisar todo menu e submenu de NOVOS/USADOS/F&I/FINACEIRO/ADMINISTRACAO.\r\n- Aniversariantes do mês\r\n', '', '', '2006-03-27 11:57:44', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(243, 181, 394, 'Retirar aviso de Campos Obrigatórios', 2, 3, 267, 'No menu: ADM -> Cadastro -> Envio de Relatórios\r\n\r\nRetirar o aviso de Campos obrigatórios, pois somente há um campo a ser preenchido.', '', '', '2006-03-28 09:15:57', 2, 'fernando.marinho', 'ricardo.rubini', ''),
