	(248, 181, 342, 'Retirar inauguração da loja Nissan de Março/2006', 7, 1, 166, 'Retirar inauguração da loja Nissan de Março/2006', '', '', '2006-03-28 22:36:21', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(249, 181, 342, 'Incluir NISSAN no final do texto da Caltabiano', 7, 1, 165, 'Incluir NISSAN no final do texto da Caltabiano:\r\n\r\n"Portanto, forma-se assim uma nova estrutura do GRUPO CALTABIANO, dirigida pela quarta geração da família, representando as seguintes marcas: Toyota, GM, Mercedes-Benz, Chrysler, Jeep, Dodge e Land Rover. Um grupo de sucesso num ramo tão competitivo da economia brasileira."\r\n\r\n"Portanto, forma-se assim uma nova estrutura do GRUPO CALTABIANO, dirigida pela quarta geração da família, representando as seguintes marcas: Toyota, GM, Mercedes-Benz, Chrysler, Jeep, Dodge, Land Rover e Nissan. Um grupo de sucesso num ramo tão competitivo da economia brasileira."\r\n', '', '', '2006-03-28 22:41:43', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(250, 181, 342, 'Alterar o Meta Description do site e incluir Nissan', 7, 3, 0, 'Veículos novos, seminovos, importados, blindados, peças e serviços das marcas, GM, Toyota, Lexus, Chrysler, Mercedes, Dodge, Jeep, Land Rover e Nissan.\r\n', '', '', '2006-03-28 23:00:11', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(251, 181, 717, 'Erro na contagem de veículos faturados', 2, 0, 267, 'Erro na contagem de veículos faturados no perfil vendedor (ex. marlene) e no perfil gerente (ex. berea).', '', '', '2006-03-29 10:27:29', 2, 'carlos.carvalho', 'camila.candido', ''),
