	(253, 181, 342, 'Atualizar modelos da Lexus conforme propostas comerciais da Intra', 5, 1, 78, 'Atualizar modelos da Lexus conforme propostas comerciais da Intra.\r\nRetirar preços.\r\nhttp://www.caltabiano.com.br/inc_lexus_0km.asp', '', '', '2006-03-29 17:20:47', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(254, 181, 437, 'Retirar a proposta do Lexus de dentro da Toyota', 5, 2, 267, 'Nas propostas comrciais de eículos na Intranet, retirar a proposta do Lexus de dentro da Toyota. Abrir um novo grupo de marca Toyota e colocar o ES 330 (o outro modelo o Leandro esta desenvolvendo)', '', '', '2006-03-29 17:26:48', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(255, 187, 678, 'Alterações no protótipo', 5, 0, 0, 'Página de anunciar caminhao: \r\n\r\n- Em multiplos anuncios quando adicionado o segundo item ao anuncio deixar uma das linhas com mais de uma origem e mais de um destino, tipo 3 origens e 2 destinos, nas células deixa uma do lado da outra separada por /.\r\n\r\nPágina de consulta frete:\r\n\r\n- Nos tipos de caminhoes colocar a primeira opcao como "selecionar tudo", e adicionaro tipo "Transporte maior que 4000kg"\r\n\r\nPágina de anunciar carga: \r\n\r\n- Colocar os tipos de caminhos sozinhos tb, os 5 passados.', '', '', '2006-03-29 18:14:56', 2, 'carlos.arruda', 'cyntia.nakamura', ''),
	(256, 181, 394, 'Alterar botão OK do login para padrão e mudar índice de tab deste', 5, 1, 267, 'Colocar o botão OK, como padrão, para que, quando se inserir o usuário e senha, ao se pressionar Enter, este já efetuar o login automático, ou então, colocar este como próximo, na lista de tabulação, para, ao se inserir usuário e senha, ao apertar Tab, já dar o foco no botão de OK.', '', '', '2006-03-29 18:19:22', 2, 'fernando.marinho', 'ricardo.rubini', ''),
	(257, 187, 678, 'Novas melhorias', 5, 0, 0, '- Em busca avancada colocar o + nos tipos de caminhoes\r\n\r\n- Em anunciar carga / multiplos anuncios, colocar X para excluir e tirar o - e +\r\n\r\n- No resultado da busca avancada alterar a frase logo acima do resultado para "clique aqui para alterar sua busca".', '', '', '2006-03-30 12:44:09', 2, 'carlos.arruda', 'cyntia.nakamura', ''),
	(258, 181, 394, 'Inclusão dos modelos da Toyota/Lexus na tabela de precos blindagem.', 2, 0, 267, 'Inclusão dos modelos da Toyota/Lexus na tabela de precos blindagem.\r\nCorolla\r\nFielder\r\nSW4\r\nHilux', '', '', '2006-03-30 15:05:45', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(259, 181, 342, 'Atualizar Range Rover Sport HST', 7, 5, 117, 'Incluir modelo: Range Rover Sport HST no website e intranet.\r\nAguardar material e aprovação da Dani (MKT)', '', '', '2006-03-31 10:55:19', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(260, 181, 718, 'Alterar modo como detalhes são mostrados na Performance Comercial', 5, 2, 267, 'Alterar modo como detalhes são mostrados na Performance Comercial\r\n\r\nAo clicar no botão de +, do lado esquerdo da tela, os detalhes devem aparecer na parte de baixo do item, e não na parte de cima, como acontece agora.', '', '', '2006-03-31 15:13:06', 2, 'fernando.marinho', 'camila.candido', ''),
	(261, 208, 770, 'Alterar a fonte da LOGO.', 5, 0, 0, 'Glauco,\r\nFavor alterar a fonte do logo da Riscali para: Palace Script MT', '', '', '2006-04-03 18:51:26', 2, 'carlos.carvalho', 'glauco.sassaki', ''),
	(262, 93, 633, 'Homolog - 04/04/2006', 2, 0, 264, '1) Combo de Volume de Compras:\r\n\r\n- Faixas devem ficar: Indiferente / 1 / 2 a 10 / 11 a 20 / 21 a 30 / 31 a 50 / Acima de 50 \r\n\r\n2) PDF: palavras faltando no arquivo gerado conforme print de tela anexado.', '', '', '2006-04-04 11:38:24', 2, 'bruno.freitas', 'marcio.paulino', ''),
	(263, 93, 633, 'Carteira de Pedidos - Homolog - 04/04/2006', 5, 2, 265, '1) Relatório/Excel:\r\n\r\n- Coluna tempo pedido fim mes -> para pedidos de CORPO DIPLOMATICO, GOVERNO, PPD e TAXISTA considerar para o cálculo a DATA TOYOTA. Para os demais, utilizar a DATA DO PEDIDO.\r\n', '', '', '2006-04-04 11:42:24', 2, 'bruno.freitas', 'marcio.paulino', ''),
	(264, 93, 633, 'Pedido Pendente de Aprovação - Homolog 04/04/2006', 2, 0, 0, '1) Não está aparecendo a combo de tipo de cliente (conforme print de tela anexado).\r\n\r\n2) Erro ao gerar o relatório - aparece uma TELA EM BRANCO e não exibe nada (conforme print anexado). Obs: Esse erro já aconteceu na Fase1e foi solucionado.\r\n\r\n', '', '', '2006-04-04 11:47:20', 2, 'bruno.freitas', 'marcio.paulino', ''),
	(265, 93, 633, 'Cadastro de Preços - Homolog 04/04/2006', 2, 0, 0, 'Ao clicar em gerar tabela não acontece nada. Não dá erro na tela, mas a tabela não é gerada.', '', '', '2006-04-04 12:06:24', 2, 'bruno.freitas', 'marcio.paulino', ''),
	(266, 93, 633, 'Parametrização de Cores - Homolog - 04/04/2006', 2, 0, 0, 'Não está trazendo a lista de cores nas combos. Dúvida: Isso deveria ter sido alimentado no banco de dados?', '', '', '2006-04-04 12:08:26', 2, 'bruno.freitas', 'rodrigo.sousa', ''),
	(267, 93, 633, 'Acompanhamento Mes - Homolog 04/04/2006', 2, 0, 0, '1) Gráfico está sendo gerado com legenda estranha (lado esquerdo) conforme arquivo anexado.\r\n\r\n2) Gráfico gerado está sempre igual, independente do consultor filtrado. De onde estão sendo buscados os dados?', '', '', '2006-04-04 12:13:19', 2, 'bruno.freitas', 'marcio.paulino', ''),
	(268, 93, 633, 'Historico de Clientes - Homolog 04/04/2006', 2, 0, 0, '- Os dados retornados estão diferentes do TOIOS. Verificar como estão sendo feitos os filtros.\r\n\r\nEx: Periodo Janeiro/2006 a Marco/2006\r\n\r\nSVD - Somente traz Corolla - 39 veiculos (em todas as colunas do relat).\r\nTOIOS - 59 veiculos sendo 1 SW4.', '', '', '2006-04-04 12:18:46', 2, 'bruno.freitas', 'rodrigo.areco', ''),
	(269, 93, 633, 'Alteração do Pedido - Homolog 04/04/2006', 2, 0, 0, '- Erro no sistema conforma log enviado (erro de parse de data).', '', '', '2006-04-04 12:21:28', 2, 'bruno.freitas', 'marcio.paulino', ''),
	(270, 93, 633, 'VD x Rede x Estoque', 2, 1, 0, 'Erro no servidor ao gerar relatório.\r\n\r\nObs: pode ser a falta de criação de algum campo na base de dados?', '', '', '2006-04-04 13:54:23', 2, 'bruno.freitas', 'rodrigo.sousa', ''),
	(271, 93, 633, 'Resumo Gerencial', 7, 0, 0, '1) Alterar título da tela para Resumo Mensal - alterar tb nos lugares em que aparece Resumo Gerencial.\r\n\r\n2) Especificação dos cálculos do relatório:\r\n\r\nVendidos = Faturados\r\nMTD = Faturados - Cancelados\r\nTO GO = Target - MTD\r\n\r\n3) Agrupar o resultado da consulta por CATEGORIA (Corolla, Fielder, Hilux, SW4, CBU) e não por divisão. Para isso, utilizar o seguinte campo: \r\n\r\nTABELA PS - CAMPO sigla_categ\r\nObs: Para pegar a descrição, utilizar a tabela WS_CATVEICULO', '', '', '2006-04-04 13:59:06', 2, 'bruno.freitas', 'rodrigo.sousa', ''),
	(272, 93, 633, 'Resumo Gerencial', 2, 0, 0, '- Dados do relátorio Excel não estão sendo calculados. Os valores ficam zerados (menos o campo Firm Order).', '', '', '2006-04-04 14:33:18', 2, 'bruno.freitas', 'rodrigo.sousa', ''),
	(273, 208, 770, 'Erro na busca de imóveis (paginação)', 2, 0, 0, 'Erro na busca de imóveis (paginação)', '', '', '2006-04-04 15:16:48', 2, 'carlos.carvalho', 'rodrigo.toledo', ''),
	(274, 93, 633, 'Resumo Gerencial - Filtro Situação DOC', 7, 2, 0, 'Deixar o filtro de situação de documentação no mesmo formato da CARTEIRA DE PEDIDOS (listando todos os tipos de cliente para selecionar individulamente a situação de documentação).', '', '', '2006-04-04 15:23:37', 2, 'bruno.freitas', 'rodrigo.sousa', ''),
	(275, 93, 633, 'Acerto de itens do Menu', 7, 1, 0, 'Acertar os itens de menu (SCRIPT + HOMOLOG). Os itens que devem ser ajustados são:\r\n\r\n"Pedidos Pendentes de Aprovação" - No script está associado ao menu GESTÃO -> AJUSTAR.\r\n"Pedidos Pendentes de Aprovação (Dealer)" - No script está associado ao menu GESTÃO -> AJUSTAR.\r\n"Preços e Fretes" - Mudar nome para "Preços".\r\n"Relatório Gerencial" - incluir no SCRIPT e HOMOLOG.\r\n', '', '', '2006-04-04 15:31:29', 2, 'bruno.freitas', 'lf.oliveira', ''),
	(276, 93, 633, 'Acerto de Scripts', 7, 2, 0, 'Acertar scripts de alteração no banco de dados para setar valores para campos novos.\r\n\r\nUm exemplo são os campos da tabela SVD_TIPO_CLIENTE: REQUER_APROVACAO_CONSULTOR,\r\nREQUER_RAMO_ATIVIDADE, REQUER_NUMERO_ABLA que necessitam ser incializados para o correto funcionamento do sistema.', '', '', '2006-04-04 15:35:59', 2, 'bruno.freitas', 'lf.oliveira', ''),
	(277, 181, 704, 'Criar opção de Renovação na Parte de seguros', 5, 3, 267, 'Criar opção de Renovação no cadastro de seguros', '', '', '2006-04-05 10:55:58', 2, 'fernando.marinho', 'ricardo.rubini', ''),
	(278, 181, 342, 'Colocar barra de progressão ao carregar fotos.', 5, 0, 79, 'Inserir a barra de progressão na hora de carregar as fotos dos carros nos Hotsites.', '', '', '2006-04-07 13:02:06', 2, 'fernando.marinho', 'leandro.caracciolo', ''),
	(279, 208, 770, 'Colocar todos os imóveis com código AP como tipo de imóel APARTAMENTO', 5, 0, 0, 'A maioria dos apartamentos cadastrados no website da Riscali está ainda cadastrada como CASA (antigo Residencial). Necessita fazer a alteração de todos os imóveis com Cód AP de CASA para APARTAMENTO. Já fizemos alguns aqui. Faltam alguns outros.\r\n', '', '', '2006-04-07 16:11:09', 2, 'carlos.carvalho', 'rodrigo.toledo', ''),
