	(291, 177, 798, 'Adequação de leitura do campo PRIORIDADE', 5, 1, 0, 'Alteração do sistema para adequação de leitura do campo PRIORIDADE. O novo campo considerado pelo TOL deve ser nu_prior_tol. Chamadas a procs tb devem ser alteradas para passar o novo campo.', '', '', '2006-04-25 10:29:00', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
