	(293, 177, 798, 'Coluna ocorrência/módulo - Ordenar por Código de Ocorrência', 5, 3, 268, 'A ordenação das ocorrências pela coluna "Ocorrência/Módulo" deve ordenar as ocorrências pelo CÓDIGO da ocorrência. Hoje está ordenado pelo nome do módulo.', '', '', '2006-04-25 10:31:31', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(294, 177, 798, 'Filtro por tipo de ocorrência', 5, 1, 268, 'Separar os SUPORTES dos demais tipos de ocorrência (filtro) - pensar em\r\ntrazer os suportes por default, e o cara filtra as demais se desejar. Para isso, deve ser criada uma combo na tela principal que lista os tipos de ocorrência e permite que usuário filtre a consulta por tipo de ocorrência (tratamento o SUPORTE como default).', '', '', '2006-04-25 10:33:38', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(295, 208, 770, 'Incluir contatos na Avaliação de imóveis', 5, 1, 0, 'Incluir em SEU IMOVEL -> AVALIE\r\n(http://www.riscali.com.br/index.php?act=avalie)\r\n\r\nCONTATO DO PESSOA QUE ESTÁ AVALIANDO:\r\nNOME:\r\nE-MAIL:\r\nTEL.:\r\n\r\nE INCLUIR ESSAS INFORMAÇÃO NO E-MAIL QUE É ENIADO PARA O GILBERTO RISCALI.\r\n', '', '', '2006-04-25 16:33:52', 2, 'carlos.carvalho', 'rodrigo.toledo', ''),
	(296, 91, 789, 'Busca pelo assunto', 2, 1, 273, 'Na busca pelo assunto tem que considerar todas as palavras digitadas no campo "Assunto". Qualquer uma que encontrar tem que trazer o resultado que se tem cadastrado no banco de dados.\r\n\r\nOu seja, tem que ser "or" e não "and".', '', '', '2006-04-25 17:38:52', 2, 'carlos.arruda', 'rodrigo.toledo', ''),
	(297, 91, 789, 'URL de demonstração', 2, 2, 273, 'No campo de url de demonstração retirar o http:// porque muitas vezes cadastramos a URL completa e daí o sistema duplica a informação de http.', '', '', '2006-04-25 17:41:10', 2, 'carlos.arruda', 'rodrigo.toledo', ''),
	(298, 91, 792, 'Permissão apenas para GE', 2, 0, 277, 'A permissão para visualizar essa opção de menu deve ser somente para GE.', '', '', '2006-04-25 17:47:21', 3, 'carlos.arruda', 'rodrigo.toledo', ''),
	(299, 91, 792, 'Gravar informação do escritório relacionado', 5, 1, 276, 'O sistema não precisa gravar a informação de qual usuário cadastrou o ombudsman mas precisa ser gravado em qual escritório ele está alocado, para mais tarde podermos extrair estatísticas por escritórios.', '', '', '2006-04-26 07:28:35', 2, 'carlos.arruda', 'rodrigo.toledo', ''),
	(300, 177, 798, 'Desabilitar botão [Salvar Andamento]', 5, 0, 271, 'Desabilitar botão [Salvar Andamento] enquanto o inclusão está sendo processada para que usuário não possa incluir o mesmo andamento várias vezes.', '', '', '2006-04-26 12:00:00', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(301, 181, 342, 'Atualização da área de 0Km da GM', 7, 2, 76, 'Atualizar aos poucos toda a estrutura de 0Km da GM atendento ao novo padrão do Celta Geração 2007:\r\nAtualizar os veículos conforme e-mail do Márcio Mota.\r\n', '', '', '2006-04-28 09:15:16', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(302, 181, 717, 'Melhorias Gerais', 5, 0, 267, '1. Inclusão dos valores de Serviços em Acessórios, que passará a chamar Peças e Serviços;\r\n2. Criação de um novo tipo de vendedor em cada loja, chamado Outros que incluirá as vendas das de todas as outras pessoas que não são vendedores daquela loja, mas que efetuaram vendas para ela, nas 4 categorias (veículos, financiamentos, seguros e acessórios)\r\n3. Verificar por que há vendedores com 0 (zero) acessórios vendidos. Acredito que possa ser por que estes não venderam peças, e sim serviços.\r\n4. Alterar para que a parte amarela do gráfico fique até 99%, e o verde vá de 100 a 120%\r\n5. Incluir legandas explicando o que significa cada relogio e grupo.', '', '', '2006-05-03 19:19:01', 2, 'fernando.marinho', 'camila.candido', ''),
	(303, 91, 789, 'Erro de acentuação e duplicidade de uploads', 2, 1, 274, 'Erro de acentuação e duplicidade de uploads. \r\nQuando cadastro um conhecimento com acento o sistema está apresentando caracteres estranhos.\r\nE quando seleciono um arquivo para upload ele está duplicando o mesmo quando eu salvo.', '', '', '2006-05-10 09:31:43', 2, 'carlos.arruda', 'rodrigo.toledo', ''),
	(304, 91, 460, 'Apresentação sem BR nos textos que pulam linha.', 2, 1, 6, 'Quando clico nos detalhes do usuarios para ver os referidos DR\'s o sistema não está apresentando pulo de linha, ou seja, está sem formatação BR.', '', '', '2006-05-10 09:34:03', 2, 'carlos.arruda', 'rodrigo.toledo', ''),
	(305, 91, 460, 'Website Agence - Área do cliente', 2, 1, 0, 'Revisar formatações de BR (pulo de linha) nos relatórios apresentados na área do cliente.\r\n\r\nVerificar também a questão de horas zeradas quando apresentados os minutos, deve ficar exatamente igual ao CAOL.', '', '', '2006-05-10 09:38:22', 2, 'carlos.arruda', 'rodrigo.toledo', ''),
	(306, 181, 342, 'Alterar os horários da Oficina', 2, 0, 143, 'Colocar os  horários correto da oficina. No link http://www.caltabiano.com.br/inc_oficinas.asp o texto está errado com informações erradas e duplicadas.', '', '', '2006-05-20 10:06:24', 2, 'carlos.carvalho', 'leandro.caracciolo', ''),
	(307, 181, 810, 'Correções 1', 2, 1, 267, 'Correções:\r\n1 - Na DATA INICIAL e na DATA FINAL deixar como padrão ao carregar página o primeiro dia do mes atual (DATA INICIAL) e a data atual para a DATA FINAL;\r\n2 - Carregar os PARÂMETROS (filtros escolhidos) para todas as abas selecionadas. Sempre precisamos redefiir os filtros qdo escolhemos os parâmetros.\r\n\r\n\r\nExtra:\r\n3 - Incluir função EXPORTAR PARA EXCEL e IMPRIMIR PÁGINA.', '', '', '2006-05-29 14:37:31', 2, 'carlos.carvalho', 'camila.candido', ''),
	(308, 181, 810, 'Correções 2', 5, 1, 267, 'Correções:\r\n1 - Na seção de Veículos Seminovos: Onde aparece Proprietário/Vendedor e Nome ou Endereço Identidade deve-se aparecer o Nome/endereço e RG do antigo proprietário do veículo e não do Vendedor.\r\n\r\n2 - Para todos os clientes (compradores e vendedores) q são PJ (Pessoa Jurídica), o campo Identidade deverá ser o CNPJ da empresa.\r\n\r\n3 - TODOS os campos de HORA deverá ser retirado da Hora de Entrada e Hora de Saída do veículo no sistema.\r\n\r\n', '', '', '2006-05-29 15:44:01', 2, 'carlos.carvalho', 'camila.candido', ''),
	(309, 91, 460, 'No item consultor de negocios aparecer os CPTI tb.', 5, 1, 17, 'No item do formulário onde pede o nome do consultor de negocios listar também os coordenadores de projetos/TI.\r\nHoje tá aparecendo os CNs e GEs nessa combo, aparecer tb os CPTIs.', '', '', '2006-05-30 08:38:59', 2, 'carlos.arruda', 'rodrigo.toledo', ''),
