	(340, 181, 810, 'Correções 3', 5, 0, 267, '1- Alterar o cabeçalho de "Indentidade" para "Identidade (CNPJ/RG)" em todas as páginas;\r\n\r\n2- No Campo "Observação" colocar o nome de quem liberou o veículo (apenas para os veículos liberados pela Intranet. (para novos/usados e oficina)\r\n\r\n3- Para os veículos liberados manualmente pelo oracle (e nao pela Intranet) alterar as horas de 00:00 e maquear com horas aleatórias no horário comercial. Mesmo que o veículo não tenha sido liberado naquela hora. Isso é para evitar que fique 00:00 no sistema... fazer isso para tudo que for passado. (esse relatório é para o Detran) ... dessa semana em diante fica valendo a hora da intranet.\r\n\r\n4 - Alterar o filtro de data para: \r\n- Alterar Data Inicial e Data Final para Data de entrada até dia XX/XX/XXXX e/ou Data de Saída até dia XX/XX/XXXX\r\n- Incluir filtro Data de Liberação (data inicial e final) para mostrar apenas os veículos veículos liberados no intervalo;\r\n\r\n5 - No Exportar para o Excel, exportar TODO o resultado do filtro e não apenas o da paginação;\r\n\r\n6 - MÓDULO LIBERAÇÃOO: (AMD - CADASTRO - LIBERACAO)\r\n6.1 - em oficina, incluir a placa do veículo na consulta; (ficará a busca por OS ou Placa);\r\n6.2 - o vendedor SOMENTE pode visualisar (e portanto liberar) o que for venda dele;\r\n6.3 - o consultor SOMENTE pode liberar o que for OS dele;\r\n6.3 - o gerente e diretor pode liberar de todos da loja;\r\n', '', '', '2006-06-27 18:20:53', 2, 'carlos.carvalho', 'camila.candido', ''),
	(341, 181, 394, 'Incluir texto de liberação de veículos novos e seminovos', 7, 0, 267, 'Incluir texto de liberação de veículos novos e seminovos.\r\n- para o gerente ver sua loja;\r\n- para o vendedor ver suas vendas;\r\n- o diretor ver o grupo todo.\r\n\r\nfazer em conjunto com a camila', '', '', '2006-06-27 20:57:16', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
