	(345, 181, 394, 'Verificar usuário na Intranet', 2, 0, 267, 'Verificar usuário DIEGOS senha SOUZA na Intranet.\r\nNão aparace o texto de propostas pendentes e/ou em andamento\r\ne no sistema de acompanhameto de proposta da o seguinte erro:\r\n\r\n"Erro de Servidor no Aplicativo \'/\'.\r\n--------------------------------------------------------------------------------\r\n\r\nReferência de objeto não definida para uma instância de um objeto. "\r\n\r\n\r\nAlém de que não aparece  flash de vendas para ele.', '', '', '2006-06-28 19:33:04', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(346, 181, 358, 'Incluir os veículos em PEDIDOS do NBS', 5, 0, 267, 'Incluir os veículos inclídos do NBS com a DATA DE PREVISAO.\r\nSITUAÇÂO: PEDIDO\r\nFiltrar apenas STATUS "E" de Efetivo\r\n', '', '', '2006-06-29 18:57:56', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
