	(348, 181, 394, 'Alterar ordem do CADASTRO e CONSULTA no menu ADM', 2, 0, 267, 'Alterar ordem do CADASTRO e CONSULTA no menu ADM q está invertido', '', '', '2006-06-29 19:05:56', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(349, 181, 657, 'Incluir URGENTE Calmotors - Filial', 7, 0, 267, 'Incluir URGENTE Calmotors - Filial', '', '', '2006-06-30 11:19:13', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(350, 181, 578, 'Incluir a empresa Calcenter Veiculos Ltda no relatorio de', 5, 1, 267, 'TELA INICIAL ->  FINANCEIRO ->  CONSULTAS ->  POSIÇÃO DE RECEBÍVEIS \r\nIncluir a empresa Calcenter Veiculos Ltda no relatorio de "Posição de Recebiveis", esta empresa não  esta aparecendo no "sumario" ,  que fica na Intranet, segue o caminho:\r\n\r\nOBS1: Também não podera aparecer no relatorio as montadoras, ex: Calcenter Veiculos, no relatorio não pode aparecer a montadora Nissan do Brasil Automoveis.\r\n ', '', '', '2006-07-03 09:27:48', 2, 'carlos.carvalho', 'camila.candido', ''),
	(351, 181, 717, 'Incluir os veículos de Venda Direta do NBS', 5, 0, 267, 'Incluir os veículos de Internet e Frotista do NBS na contagem de veículos. Aparecer nos relógios e no relatório Vendas X período.\r\n\r\nConversar com o Rubini q eu expliquei para ele por telefone.', '', '', '2006-07-05 13:44:32', 2, 'carlos.carvalho', 'camila.candido', ''),
	(352, 181, 394, 'Incluir os veículos de Venda Direta do NBS na intranet', 5, 0, 267, 'Incluir os veículos de "Internet e Frotista" do NBS na intranet ... no flash de vendas e nos relatórios de vendas (Vendas por vendedor e Vendas por período).\r\nColocar no TIPO = VENDA DIRETA\r\n', '', '', '2006-07-05 13:48:22', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(353, 181, 394, 'Estoque de Novos - Reservados - Colocar link para vendedor, cliente, data, obs.', 5, 1, 267, 'Estoque de Novos - Reservados - Colocar link para vendedor, cliente, data, obs.', '', '', '2006-07-05 18:03:35', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(354, 181, 810, 'Alterar a Frase de liberação de veículos', 5, 0, 267, 'Alterar a frase de liberação de veículos SOMENTE para os funcionários definidos como CONSULTORES e GERENTESPOS-VENDAS.\r\n\r\nNova Frase: "Clicar aqui para liberar seu veículo para o cliente"\r\n\r\nColocar um link para a liberação de oficina ... nos perfis acima!', '', '', '2006-07-06 12:16:05', 2, 'carlos.carvalho', 'camila.candido', ''),
	(355, 181, 394, 'Incluir texto do final do estoque de novos 0m', 5, 0, 267, 'Incluir texto do final do estoque de novos 0m.\r\n\r\nNa legenda colocar um "*" depois de Pedidos: X\r\n\r\nDps da listagem do estoque colocar a seguinte frase:\r\n\r\n"* - Os veículos em pedidos estão sujeitos a confirmação de chegada e cor pela montadora"', '', '', '2006-07-06 12:50:21', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(356, 181, 394, 'Desenvolver sistema de troca de senha para todos os usuários.', 7, 1, 267, '- Desenvolver sistema de troca de senha para todos os usuários na intranet.\r\n- A cada 60 dias haverá a troca da senha.\r\n- Qdo o usuário tentar logar pedira a atual, nova senha e confirmação.\r\n- Se o usuário trocou a senha smente dps de 60 dias.\r\n- Seria possivel na repetir as ultimas senhas?\r\n', '', '', '2006-07-13 12:46:07', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(357, 181, 394, 'Revisar todos os RASTRO da Intranet', 2, 2, 267, 'TELA INICIAL-> NOVOS-> CONSULTA-> VENDAS X PERÍODO\r\nTELA INICIAL-> NOVOS-> CONSULTA-> VENDAS X VENDEDOR\r\n', '', '', '2006-07-13 13:44:50', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
