	(361, 166, 194, 'Processo de importação modularizado por tarefas', 7, 4, 230, 'Elaborar uma forma de realizar o processamento por FASES, indicando o Inicio/Fim de cada uma permitindo assim continuar de onde parou. \r\n', '', '', '2006-07-19 15:34:05', 3, 'bruno.freitas', 'felipe.correa', ''),
	(362, 166, 194, 'Otimização na geração das Os', 7, 3, 0, 'Verificar se da para reduzir o uso de memória no servidor. Erro - ao processar arquivo - Foi testado com 256Mb no servidor Jboss. Solicitado A e B na geracao do arquivo.\r\n', '', '', '2006-07-19 15:35:45', 2, 'bruno.freitas', 'rodrigo.sousa', ''),
