	(372, 181, 394, 'Revisão no relatorio de veículos faturados em aberto', 2, 1, 267, 'Só para informar: A Denise me informou que não está conseguindo visualizar os veículos da CMPac em "valores de veículos faturados em aberto", mas ainda não vi o que pode ser.\r\nAcredito que seja a grande quantidade de registros, talvez tenha que refazer esta parte.\r\n', '', '', '2006-08-10 17:32:08', 1, 'carlos.carvalho', 'camila.candido', ''),
	(373, 175, 860, 'Email enviado com usuário errado ao rejeitar solicitação', 2, 1, 0, 'Quando uma solicitação é rejeitada, o nome do usuário reponsável (no email enviado ao usuário que criou a solicitação) está incorreto. Está sendo enviado o nome do analista de suporte no lugar do nome do responsável pela rejeição.', '', '', '2006-08-18 16:39:28', 2, 'bruno.freitas', 'paulo.moacir', ''),
	(374, 175, 860, 'Erro ao gerar Relatório Mensal', 2, 1, 0, 'Ao gerar relatório mensal o sistema gera um erro ("Ocorreu um erro no sistema..."). \r\n\r\nObs: Parâmetros utilizados: Jan 2006 - Ago 2006.', '', '', '2006-08-18 16:40:14', 2, 'bruno.freitas', 'paulo.moacir', ''),
	(375, 175, 860, 'Alteração de AUDITOR/RESPONSAVEL MODULO', 2, 1, 0, 'O sistema não está salvando atualizações de AUDITOR/RESPONSAVEL MODULO para chamados de solicitação de acesso.', '', '', '2006-08-18 16:42:17', 2, 'bruno.freitas', 'paulo.moacir', ''),
	(376, 181, 657, 'retirar "caltin" e "calmotors - filial" do acompanhamento de propostas', 5, 0, 267, 'retirar "caltin" e "calmotors - filial" do acompanhamento de propostas', '', '', '2006-08-23 18:56:54', 2, 'carlos.carvalho', 'ricardo.rubini', ''),
	(377, 175, 860, 'Falha ao salvar Observação em chamado PENDENTE', 2, 1, 0, 'O sistema não  salva Observações para chamados no estado PENDENTE.\r\n\r\nA correção deve permitir que sejam salvas Observações para os chamados do tipo "solicitação de acesso", além de permitir a troca de AUDITOR/RESPONSAVEL MODULO.', '', '', '2006-08-30 10:04:33', 2, 'bruno.freitas', 'paulo.moacir', ''),
	(378, 166, 194, 'Alteração da chamada ao processo de Alocação/Alocação Acumulada', 5, 0, 230, 'Alteração da chamada ao processo de Alocação/Alocação Acumulada, eliminando a dependência com o objeto Quartz.', '', '', '2006-08-31 14:21:10', 2, 'bruno.freitas', 'felipe.correa', ''),
	(379, 222, 890, 'Documentação de Especificação', 7, 1, 0, 'Gerar os seguintes documentos de especificação para o projeto:\r\n\r\nSistema:\r\n\r\n1) Documento de Visão do Projeto (Intruções CAOL Agence - Documentos)\r\n2) Documentos de Caso de Uso (Intruções CAOL Agence - Documentos)\r\n3) Documentos de Regra de Negócio (Intruções CAOL Agence - Documentos)\r\n4) Glossário do Sistema (Intruções CAOL Agence - Documentos)\r\n\r\nBase de Dados\r\n\r\n4) MER (Gerar utilizando o DBDesigner) \r\n5) Dicionario de Dados (Intruções CAOL Agence - Documentos)', '', '', '2006-09-05 08:33:19', 2, 'bruno.freitas', 'eric.shibayama', ''),
	(380, 175, 860, 'Criação de botão para cancelamento de Solicitação de Acesso', 5, 2, 0, 'Criar um botão na tela de visualização de dados do chamado (ao lado do botão Atualizar Chamado) que permita o seu cancelamento. Ao clicar nesse botão deve ser exibido um ALERT para a confirmação da operação de cancelamento do chamado.\r\n\r\nObs: Esse botão só deverá aparecer para chamados que forem do tipo SOLICITACAO DE ACESSO.', '', '', '2006-09-05 20:38:35', 2, 'bruno.freitas', 'paulo.moacir', ''),
