	(393, 175, 860, 'Workaround para a duplicação de usuários na base do SOS', 7, 0, 0, 'Workaround para o problema de duplicação de usuários na base do SOS.\r\n\r\n1) Acesso ao sistema.\r\n2) Pesquisa de CHEFE - Chamados de solicitação de acesso.\r\n3) Pesquisa de AUDITOR e RESPONSÁVEL MÓDULO - Chamados de solicitação de acesso.\r\n4) Métodos do sistema que fazem consultas de usuários.', '', '', '2006-10-04 15:06:02', 2, 'bruno.freitas', 'felipe.correa', ''),
	(394, 207, 735, 'Carga de usuários na base do sistema', 7, 1, 0, 'Carga de usuários na base do sistema de acordo com a listagem abaixo.\r\n\r\nObs: Deve ser criado perfis de usuários no sistema conforme a categorização da listagem (sócio/diretor/gerente/assistente).\r\n\r\nSócios:\r\nlyo.marques\r\nlyodegar.marques\r\nalexander.lucinski\r\nclaudio.cifali\r\nricardo.quintana\r\n \r\nDiretor:\r\nluiz.renato\r\n\r\nGerentes:\r\ncarlos.valezi\r\ncelia.reis\r\ndaniel.florence\r\nines.caressato\r\njoana.moni\r\nlilian.oliveira\r\nmarcos.rodrigues\r\nmarcos.oliveira\r\nnelson.neto\r\nclaudemir.osmarini\r\nrigoberto.costa\r\nrita.rodrigues\r\n \r\nAssistentes:\r\nkarina.pinotti\r\nricardo.dannemann', '', '', '2006-10-04 15:36:57', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(395, 207, 735, 'Proposta > Erro ao fazer upload de arquivo', 2, 1, 0, 'Ao fazer upload de arquivo para uma proposta acontece um erro. O que deve ser tratado:\r\n\r\n1) Verificar por que aconteceu o erro.\r\n2) Caso ocorra um erro, informar o usuário e voltar o sistema para o estado normal (Atualmente o sistema fica em um estado de carregando aquivo...).', '', '', '2006-10-04 17:09:27', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
