	(400, 166, 937, 'Cadastro de Seção > Exibir CostCenters em Grupo CC', 7, 0, 0, 'Exibir CostCenters para todos os nós da árvore de Grupo CC e não somente os nós de SECT.', '', '', '2006-10-19 16:54:06', 2, 'bruno.freitas', 'felipe.correa', ''),
	(401, 139, 936, 'Detalhes de produto - Retirar SEM FOTO', 7, 0, 0, 'Para cada produto do site - como por exemplo um Hotel - é possível o cadastramento de até 4 fotos (cms). Atualmente, na visualização de um produto pelo site, ele mostra todos os 4 "espaços" para ao foto e, caso a foto não exista (por exemplo, quando o usuário só cadastrou 2 das 4) ele exibe uma imagem . O que deve ser alterado é: Na visualização de detalhes de um produto (Ex: Detalhes do HOTEL ASPEN BELO HORIZONTE - http://www.powertravel.com.br/produtos3.php?produtoId=10) - onde são mostradas as 4 fotos - só exibir as fotos efetivamente cadastradas.', '', '', '2006-10-19 17:46:58', 2, 'bruno.freitas', 'alex.wassano', ''),
	(402, 210, 785, 'Ajustes Gerais', 5, 0, 0, 'Descrição das tarefas relacionadas a esse chamado:\r\n- Múltiplos Anúncios de Carga deve ficar com mesma aparência de  Multiplos Anúncios de Caminhão.\r\n- Traduzir para português as ações em janelas de Multiplos Tipos de Caminhão. \r\n- No BackEnd, um tipo de caminhão será armazenado como Grupo-Tipo (Exemplo: Caçamba-Toco)\r\n- Na Boleta, quando Origem e/ou Destino contiverem todas as cidades do estado, deixar de mostrar o grupo inteiro de cidades e mostrar o texto "Todas as cidades do <<sigla estado>>".\r\n- Verificar a consulta de caminhão (campo data final está causando erro na consulta)\r\n- No ranking, ao haver empate, anuncios com datas mais antigas \r\nde inicio devem aparecer antes de anúncio com data mais recente.\r\n- Substituir campo Companhia pelo campo Nome nos resultados das consultas\r\n-Trocar Botão Multiplos Anuncios por Vários Anuncios.\r\n- Trocar texto do botão Editar em Meus Anuncios por Atualizar\r\n- Revisar o menu dinâmico. Há momentos em que ocorre erros no  sub-menu\r\n- O Carregando... com travamento de tela não foi aprovado. Voltar ao formato anterior (carregando.. em vermelho no canto superior esquerdo da tela)\r\n', '', '', '2006-10-23 15:35:31', 1, 'liana.duenha', 'rodrigo.areco', ''),
	(403, 181, 943, 'Desenvolvimento do relatório de lucro bruto.', 7, 0, 267, 'Desenvolvimento do relatório de lucro bruto, informando receitas, custos, impostos, lucro.', '', '', '2006-10-24 19:34:56', 2, 'camila.candido', 'camila.candido', ''),
