	(405, 210, 785, 'Documentação Projeto - Dicionário de Dados', 7, 1, 0, 'Documentação Projeto - Dicionário de Dados', '', '', '2006-11-07 15:42:21', 2, 'bruno.freitas', 'todos', ''),
	(406, 222, 963, 'Resumo Programadora - Alterações', 7, 1, 0, 'Alterações em Resumo Programadora.\r\n\r\n1. Item "PARTES" deve fazer parte do Resumo Executivo. \r\n2. Trocar "Validade do contrato" por "Vencimento do contrato". \r\n3. Trocar "dia de pagamento" por "prazo de pagamento". \r\n4. Trocar "observações" por "considerações gerais". \r\n5. Tirar "empactamento" do resumo executivo. \r\n6. Passar o item "condições de renovação" para cima, imediatamente abaixo de "vencimento do contrato". \r\n7. No cadastro, no campo "carriage", aumentar o tamanho do campo, deixá-lo como o campo de "Observações". Alterar o nome desse campo para "Empacotamento" e o atual campo "Empacotamento" que hoje tem na aba "Dados do Contrato" excluir do banco de dados. \r\n8. Como o campo observações mudará para condições gerais, criar um campo "observações" no cadastro, porém SEM incluir no resumo executivo. \r\n', '', '', '2006-11-23 14:26:19', 2, 'bruno.freitas', 'eric.shibayama', ''),
	(407, 222, 963, 'Operadoras - Alterações', 7, 1, 0, 'Operadoras - Alterações\r\n\r\n1. Tirar o item "desconto por volume (comissão)" do resumo e do cadastro, pois estaria incluso em condições comerciais. \r\n2. Mesmas observações dos itens 1, 3, 5, 6, acima ref. a programadoras. \r\n3. Tirar "tributos de comissão/marca" do resumo executivo. \r\n', '', '', '2006-11-23 14:27:01', 2, 'bruno.freitas', 'eric.shibayama', ''),
	(408, 222, 963, 'Alterações Gerais no Sistema', 7, 2, 0, 'Alterações Gerais no Sistema\r\n\r\n1. Aumentar o nome da Operadora ou programadora no Resumo para ficar mais visível. \r\n2. Aonde tiver escrito "Condições de Inadimplências", onde Inadimplências está com um s no final, alterar para o correto que é Inadimplência, sem s, ficando então "Condições de Inadimplência". \r\n', '', '', '2006-11-23 14:27:45', 2, 'bruno.freitas', 'eric.shibayama', ''),
	(409, 222, 963, 'Relatório > Contratos Geral', 7, 3, 0, 'Relatório > Contratos Geral\r\n\r\n1. Criação de novo relatório, já sincronizado no CVS. O link abaixo se encontra atualizado. Chamamos de "Relatórios -> Contratos Geral" \r\n\r\nExistem alguns filtros e o botão de "consultar" (relatório detalhado) e "ranking" (contador apenas). \r\n\r\nhttp://www.agence.com.br/propostas/netbrasil/sgc/rel_geral.htm', '', '', '2006-11-23 14:28:58', 2, 'bruno.freitas', 'eric.shibayama', ''),
	(410, 207, 934, 'Listo os chamados para o produto "Eclipse"', 2, 1, 298, 'Quando listo os chamados para o produto "Eclipse" não aparece nenhum resultado, e eu tinha acabado de registrar um chamado para esse produto.', '', '', '2006-11-30 18:24:03', 2, 'carlos.arruda', 'bruno.freitas', ''),
	(411, 207, 934, 'Listo os chamados para o produto "Indiferente"', 2, 0, 298, 'Quando listo os chamados para o produto "Indiferente", na segunda coluna o sistema não está apresentando o nome do produto, somente o cliente, o caminho, o tipo e o título.\r\n', '', '', '2006-11-30 18:27:57', 2, 'carlos.arruda', 'bruno.freitas', ''),
	(412, 207, 934, 'Pop de detalhes e clico no link do anexo', 2, 0, 298, 'Na pop de detalhes eu clico no link do anexo dá página não pode ser encontrada.\r\n', '', '', '2006-11-30 18:28:54', 2, 'carlos.arruda', 'bruno.freitas', ''),
	(413, 207, 934, 'Pop de detalhes - Layout', 2, 2, 298, 'Linhas e textos desconexos. Layout estranho.\r\n', '', '', '2006-11-30 18:29:34', 2, 'carlos.arruda', 'bruno.freitas', ''),
	(414, 207, 934, 'Listo de chamados - coluna de status', 2, 0, 298, 'Quando listo os chamados para o produto "Indiferente", na coluna "status/responsável" A data/hora tem que ser da última interação, está sendo do momento que o usuário assumiu o chamado.\r\n', '', '', '2006-11-30 18:30:41', 2, 'carlos.arruda', 'bruno.freitas', ''),
	(415, 207, 934, 'Busca de cliente', 2, 1, 291, 'Quando busca no campo cliente pela palavra chave "w" aparece "CINEMA" e "Agence", duas empresas que não tem w no nome.\r\n', '', '', '2006-11-30 18:31:34', 2, 'carlos.arruda', 'bruno.freitas', ''),
	(416, 207, 934, 'Tela pela metade', 2, 0, 299, 'A visualização da tela está pela metade, não tem nem o botão consultar.\r\n', '', '', '2006-11-30 18:32:15', 2, 'carlos.arruda', 'bruno.freitas', ''),
	(417, 207, 934, 'Erro ao acessar o OpenKube', 2, 2, 0, 'Erro ao acessar o OpenKube com um usuário novo, criado diretamente na base, tabela ro_user.\r\n\r\nFatal error: Call to a member function getCurrentProposalFile() on a non-object in C:\\sokkit\\site\\OpenKube\\KSales\\init_tpl\\index.php on line 44.', '', '', '2006-12-01 09:43:07', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(418, 181, 943, 'Ajustes no design de páginas', 5, 1, 267, 'Alteração de cores de itens, sub-total, total e cabeçalho da consulta e cadastro.', '', '', '2006-12-01 18:35:41', 2, 'camila.candido', 'camila.candido', ''),
	(419, 126, 956, 'Acertos -', 7, 3, 0, '1 - TELA INICIAL (Encontre Seu Imóvel):\r\n\r\n- Nos itens “Quarto Simples”, “Suítes” e “Garagens”, a última opção da combo deve ser “5 ou mais”, não simplesmente a palavra “mais” (esta opção deverá trazer todos os imóveis com 5 ou mais de cada item...). \r\n- No item “Área Útil” , inserir os m2 (metros quadrados dentro da combo, como estavam inicialmente) o número 2 não deve ficar para fora da combo. A última opção das duas combos deve ser “500 m² ou mais”, não simplesmente a palavra “mais” (esta opção deverá trazer todos os imóveis com 500 m² ou mais).\r\n- No item “Valor” &#61664; a combo “De:”: deve ser igual a inserida na combo “Até”, atualmente só aparece a opção “indiferente”. A última opção das duas combos deve ser “R$ 500.000,00 ou mais”, não simplesmente a palavra “mais” (esta opção deverá trazer todos os imóveis de valor equivalente a R$ 500.000,00 ou mais).\r\n---------------------- \r\n\r\n2 - TELA INICIAL (Box Animado Com Destaques de Ofertas de Imóveis)\r\n- Os botons devem ser inserido no box animado e não nos destaques de imóveis estáticos na parte de baixo. Os botões devem conter a nomenclatura de : “anterior”, “próximo” e “pausa” , como no box de fotos da UOL. \r\n---------------------- \r\n\r\n3 – Checar tamanho do banner destaque, na tela inicial, para enviar ao cliente (ele está confeccionando banners que expandem a home)\r\n\r\n---------------------- \r\n\r\n4 - TELA INICIAL \r\n- Ajustar os elementos da home para que fiquem simétricos (explicarei via google-talk)\r\n- O Item “Quartos Simples” do menu de busca está escrito errado, falta um “s”.\r\n- O Item “Quartos Simples” do menu de busca está escrito errado, falta um “s”.\r\n- O “Como Chegar” está abrindo uma página com os dizeres “Como Encontrar”. O texto da página deve ser “Como Chegar” para ficar igual ao título do menu. \r\n- Todos os Itens da coluna direita devem ser administráveis. O cliente poderá inserir o título e o link na administração, e o item deverá aparecer no box à direita da home. Os links enviados pelo cliente não apontavam para página inicial dos websites em questão, mas sim para as páginas internas onde o item desejado está disponível (pode verificar?).\r\n   • No item Dicas de Lazer da Riscali (cada link deverá gerar uma página com indicações de links que estarão subdivididos em regiões (Taboão, embu, etc..) o cliente deverá poder administrar os links e os  submenus.\r\n', '', '', '2006-12-06 12:52:43', 2, 'anapaula.chiodaro', 'raphael.araujo', ''),
	(420, 152, 947, 'Erro ao clicar no link da OS', 2, 0, 302, 'Erro ao clicar no link da OS', '', '', '2006-12-07 08:51:44', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(421, 103, 965, 'Erro ao clicar no item de menu', 2, 0, 303, 'Erro ao clicar no item de menu\r\n---------------\r\n\r\nOcorreu um problema no servidor. \r\nO administrador do sistema já foi notificado por e-mail.\r\nTente mais tarde. ', '', '', '2006-12-07 09:11:29', 2, 'bruno.freitas', 'felipe.correa', ''),
	(422, 152, 947, 'Problema nas abas', 2, 0, 302, 'Quando navego pelas abas Últimas Trocas, Histórico do Veículo e Dados da Venda aparece um risco abaixo da aba, como se ela não estivesse ativa. O correto é ficar como em Dados Gerais e Ultimas Manutencoes.', '', '', '2006-12-07 09:19:47', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(423, 152, 947, 'Ordenação na aba Histórico de Veículo', 5, 1, 302, 'Deve ser ordenado da mais recente alteração para a mais antiga.', '', '', '2006-12-07 09:24:35', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(424, 152, 947, 'Erro no log de alterações de Frota', 2, 0, 302, 'Alterei a frota para "designado" e não registrou essa alteração na aba "Histórico de Veículos"', '', '', '2006-12-07 09:26:50', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(425, 152, 947, 'Aba Dados da Venda - Valor Financeiro', 5, 1, 302, 'Na Aba Dados da Venda alterar o campo "Valor da Residual" para "Valor Residual". ** Cancela isso, é "Valor da Residual" mesmo. :)\r\n\r\nNos dois campos financeiros (Valor da Venda e Valor Residual) colocar formatação financeira, tem no CAOL em consulta biblioteca, só colocar como TAG "formatação financeira".', '', '', '2006-12-07 09:34:47', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(426, 152, 947, 'Apresentação em destaque de veículo inativo no Drop-down', 5, 1, 302, 'Apresentar em destaque o veículo que está inativo no Drop-down de veículo.\r\nColocar em vermelho, apenas adicione a TAG abaixo dentro da option do veículo inativo. Isso deve ser feito para todos os drops carregados que tenham valores inativos, não somente para o cadastro de veículo, mas para o de ramo de atividade, fornecedores, etc.\r\n\r\noption value="5" style=color:red', '', '', '2006-12-07 09:41:16', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(427, 207, 959, 'Ajustes - Empresas', 7, 0, 324, '1) Os nomes na tela. Ex: Quando estamos em Prospects, não tem que aparecer Clientes no titulo e sim Prospects. Tem que aparecer tb no botao: Novo Prospect. E quando for para a tela de cadastro, o tipo Prospect já tem que vir selecionado.\r\n\r\n2) Quando a tela for carregada, deve trazer somente os Pendentes (e o check tem que vir marcado).\r\n\r\n3) Acho que para essa busca não é necessario a aba "Resultado da Busca". pode ser se aba mesmo. O ideal seria dividirmos os registros em pendentes/baixados. Para essa divisao acho que o melhor é usar Um linha divisoria com os Titulos (pendente/baixado).. como as secoes do cadastro de cliente (Dados gerais / Endereço ...).', '', '', '2006-12-07 09:43:30', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(428, 152, 947, 'Alterações no protótipo', 5, 1, 310, 'Favor sincronizar o protótipo e verificar a nova tela.\r\nNessa nova tela ajustada perceba que entramos com um novo campo e adequamos a arquitetura da informação.\r\n\r\nPercebemos que o preço das peças/lubrificantes podem variar de acordo com a divisão, por isso alteramos a arquitetura da informação para suportar isso.\r\n\r\nA quantidade é um novo campo pois percebemos que não basta vc colocar que a unidade é em "litros" só que não sei que aquele preço é para 1, 2, 3 litros, etc.', '', '', '2006-12-07 10:14:47', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(429, 152, 947, 'Só aparece 1 modelo na listagem', 2, 0, 304, 'No momento que seleciono a divisão do veículo só aparece 1 modelo na listagem, com diversos anos mas apenas 1 modelo.', '', '', '2006-12-07 10:22:48', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(430, 152, 947, 'Erro no cadastramento de CNH', 2, 0, 325, 'Quando cadastro uma CNH válida (00285533016) o sistema dá um erro:\r\n\r\ntype Exception report\r\n\r\nmessage \r\n\r\ndescription The server encountered an internal error () that prevented it from fulfilling this request.\r\n\r\nexception \r\n\r\njavax.servlet.ServletException: For input string: ""\r\n	org.apache.struts.action.RequestProcessor.processException(RequestProcessor.java:545)\r\n	org.apache.struts.action.RequestProcessor.processActionPerform(RequestProcessor.java:486)\r\n	org.apache.struts.action.RequestProcessor.process(RequestProcessor.java:274)\r\n	org.apache.struts.action.ActionServlet.process(ActionServlet.java:1482)\r\n	org.apache.struts.action.ActionServlet.doPost(ActionServlet.java:525)\r\n	javax.servlet.http.HttpServlet.service(HttpServlet.java:709)\r\n	javax.servlet.http.HttpServlet.service(HttpServlet.java:802)\r\n	br.com.toyota.fleet.web.filter.FleetUserFilter.doFilter(FleetUserFilter.java:81)\r\n	org.springframework.orm.hibernate.support.OpenSessionInViewFilter.doFilterInternal(OpenSessionInViewFilter.java:117)\r\n	org.springframework.web.filter.OncePerRequestFilter.doFilter(OncePerRequestFilter.java:73)\r\n\r\n', '', '', '2006-12-07 11:23:43', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(431, 152, 947, 'Quando utilizo o enter dá erro', 2, 0, 325, 'Quando coloco o começo de uma nome e ao invés de clicar na setinha eu dou um <enter> dá erro no sistema:\r\n\r\nHTTP Status 500 - Action[/userManager] does not contain method named findByLogin\r\n\r\n--------------------------------------------------------------------------------\r\n\r\ntype Status report\r\n\r\nmessage Action[/userManager] does not contain method named findByLogin\r\n\r\ndescription The server encountered an internal error (Action[/userManager] does not contain method named findByLogin) that prevented it from fulfilling this request.\r\n', '', '', '2006-12-07 11:25:16', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(432, 152, 947, 'Novo item aparecendo para todos', 5, 1, 0, 'O novo item Cadastro de unidade de medida deve aparecer somente para Administrador', '', '', '2006-12-07 12:05:32', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(433, 126, 956, 'Acertos2 - Upgrade - OS 007', 7, 4, 0, 'Raphael, por favor atente aos seguintes detalhes:\r\n\r\nAcertos 2 -  Upgrade no Website Riscali Imóveis\r\n\r\n1 - TELA INICIAL (Encontre Seu Imóvel) \r\n- No item “Valor” &#61664; as combos “De:”: e “Até” deveriam estar alinhadas à direita e no entanto estão alinhadas à esquerda. Não visualizo o conteúdo de nenhuma das duas, apenas a opção “indiferente” nas duas combos. \r\n---------------------- \r\n2 - TELA INICIAL (Box Animado Com Destaques de Ofertas de Imóveis)\r\n- Os botões para navegação nos banners animados devem conter a nomenclatura de : “anterior”, “próximo” e “pausa” , como no box de fotos da UOL. \r\n---------------------- \r\n3 – TELA INICIAL – COMO CHEGAR?\r\n- Na minha tela (resolução 1024) a coluna do centro está empurrando a coluna da direita para fora da faixa amarela do topo. Ela só se ajusta perfeitamente na resolução de 800X600.\r\n- Checar tamanho do mapa a ser inserido pelo cliente, para que a tela não seja expandida (ele está confeccionando banners que expandem a home)\r\n---------------------- \r\n4 - TELA INICIAL -> DICAS DE LAZER DA RISCALI\r\n- As páginas geradas para os itens “Shoppings”, “Cinemas” e “Parques” devem conter o título idêntico ao Menu (tirar a expressão “da Região” (até porque cada página conterá mais de uma região). A ortografia deverá ser exatamente igual a citada acima. Favor trocar “Shopping´s” por “Shoppings” .\r\n- Favor preencher a administração desta área com os links de exemplo enviados pelo cliente (Peciso mostrar um menu preenchido quando for mostrar o protótipo ao cliente).\r\n- Os links devem estar dispostos exatamente como enviei no e-mail (Sem descrição, nome do item com link embutido)\r\n', '', '', '2006-12-07 15:22:44', 2, 'anapaula.chiodaro', 'raphael.araujo', ''),
	(434, 152, 947, 'Aba de selecao de veiculos', 5, 1, 326, 'Quando administrador eu posso selecionar o veículo e no drop de "disponíveis" deve aparecer o veículo com toda especificação, não somente o final da placa.\r\n\r\nTem que aparecer que nem aparece na combo do cadastro de veículo quando vc busca uma placa.\r\n\r\nAinda não está ok. Não está aparecendo a especificação completa dentro da combo, somente o final da placa.', '', '', '2006-12-07 17:45:51', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(435, 152, 947, 'Não estou vendo os veículos solicitados para autorização', 2, 0, 327, 'Não estou vendo os veículos solicitados para autorização.\r\nExistem veículos solicitados para o período só que não aparece a listagem deles para autorização.', '', '', '2006-12-07 18:28:15', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(436, 181, 943, 'Criação de botões de impressão e exportar para excel', 7, 0, 267, 'Criação de botões de impressão e exportar para excel no relatório de consulta de lucro bruto.', '', '', '2006-12-07 19:30:45', 2, 'camila.candido', 'camila.candido', ''),
	(437, 207, 959, 'Filtrar Prospects que tenham Proposta', 7, 0, 328, 'Na busca de Prospects, exibir apenas os que ainda NÃO tenham uma proposta cadastrada.', '', '', '2006-12-11 15:19:31', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(438, 207, 959, 'Criar Filtros na busca de Propostas', 7, 0, 329, 'Na busca de propostas, criar os filtros [] Pendentes, [] Aprovadas, [] Recusadas.\r\n\r\nAo abrir a página, deve ser trazidos os itens [] Pendentes (o check tb deve vir marcado).', '', '', '2006-12-11 15:22:35', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(439, 207, 959, 'Separar os campos de telefone em prefixo/fone', 7, 1, 324, 'Alterar a separação atual dos campos de telefone para Prefixo / Telefone.\r\n\r\nAtualmente, existe um campo para código de país, código de estado e outro para o telefone.\r\n\r\nCom a atualização, os campos código de pais e código de estado passam a ser um só (PREFIXO). Dessa forma, iremos possibilitar que um outro valor (por exemplo, codigo de cidade) possa ser adicionado ao prefixo do telefone. ', '', '', '2006-12-11 15:26:39', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(440, 222, 963, 'Excluir nas ocorrências', 5, 1, 0, 'Adicionar botão de excluir na listagem de ocorrências de Operadora / Programadora e PPV.', '', '', '2006-12-11 17:49:05', 2, 'carlos.arruda', 'eric.shibayama', ''),
	(441, 181, 980, 'Desenvolvimento relatório lucros e perdas', 7, 0, 267, 'Criação do relatório de lucros e perdas, comparando com o relatório de lucro bruto correspondente. \r\nDesenvolvimento do cadastro de ítens e do relatório. \r\nDesenvolvimento da consulta do relatório.', '', '', '2006-12-11 19:20:56', 4, 'camila.candido', 'camila.candido', ''),
	(442, 207, 959, 'Ao clicar na proposta não vai para tela de visualização', 2, 0, 329, 'Ao clicar na proposta (tela de busca) não vai para tela de visualização.\r\n\r\nDeve ser algo errado relacionado ao permissionamento.', '', '', '2006-12-12 10:20:33', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(443, 152, 947, 'Foto distorcida em DETALHES DO USUÁRIO', 2, 1, 0, 'Quando clico em DETALHES DO USUÁRIO a foto do usuário fica distorcida, tá fixo a altura e largura da imagem, tem que deixar liberado e de alguma forma manter um tamanho aceitável.', '', '', '2006-12-13 14:18:27', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(444, 152, 947, 'Veículo aparecendo mas sem disponibilidade', 2, 0, 326, 'Quando consulto como administrador um veículo eu enxergo ele, consultando diretamente pela placa, no entanto quando tento salvar o pedido dá a mensagem "veículo selecionado não está mais disponível.". \r\n\r\nO ideal é que eu nem possa encontrar um veículo que não poderá ser solicitado.', '', '', '2006-12-13 14:22:55', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(445, 152, 947, 'Não está conforme prototipado', 2, 0, 330, 'Essa página de saída de veículos não está conforme foi prototipada. Não é para ser mais em combo-box e sim numa listagem conforme protótipo.', '', '', '2006-12-13 14:39:13', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(446, 152, 947, 'Sempre com mensagem de data de Vencimento Inválida', 2, 0, 334, 'O sistema está sempre apresentando mensagem de data de Vencimento Inválida.\r\n\r\nColoquei vencimento "14/02/2007" e não consigo salvar.', '', '', '2006-12-13 15:14:41', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(447, 152, 947, 'Erro na apresentação da página', 2, 0, 339, 'Erro na apresentação da página, anexo com detalhes do que é apresentado.', '', '', '2006-12-13 15:23:49', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(448, 152, 947, 'Erro na apresentação dos detalhes da OS', 2, 0, 340, 'Mesmo erro de quando entro na página de solicitacao de OS, só que agora na pop-up de detalhes da solicitacao:\r\n\r\ntype Exception report\r\n\r\nmessage \r\n\r\ndescription The server encountered an internal error () that prevented it from fulfilling this request.\r\n\r\nexception \r\n\r\njavax.servlet.ServletException\r\n	org.apache.struts.action.RequestProcessor.processException(RequestProcessor.java:545)\r\n	org.apache.struts.action.RequestProcessor.processActionPerform(RequestProcessor.java:486)\r\n	org.apache.struts.action.RequestProcessor.process(RequestProcessor.java:274)\r\n	org.apache.struts.action.ActionServlet.process(ActionServlet.java:1482)\r\n	org.apache.struts.action.ActionServlet.doGet(ActionServlet.java:507)\r\n	javax.servlet.http.HttpServlet.service(HttpServlet.java:689)\r\n	javax.servlet.http.HttpServlet.service(HttpServlet.java:802)\r\n	br.com.toyota.fleet.web.filter.FleetUserFilter.doFilter(FleetUserFilter.java:81)\r\n	org.springframework.orm.hibernate.support.OpenSessionInViewFilter.doFilterInternal(OpenSessionInViewFilter.java:117)\r\n	org.springframework.web.filter.OncePerRequestFilter.doFilter(OncePerRequestFilter.java:73)\r\n\r\n\r\nroot cause \r\n\r\njava.lang.NullPointerException', '', '', '2006-12-13 15:27:35', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(449, 152, 947, 'Apresentação do Termo de Infração', 2, 1, 334, 'No momento da apresentação do termo de infração a pop-up apresenta sempre o valor a vista e o valor em 3x, tem que ser dinâmico, de acordo com a qtde de vezes selecionado no drop-down de "Parcelamento".\r\n\r\n', '', '', '2006-12-13 15:45:55', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(450, 181, 943, 'Gerar relatório por período dentro do mês', 5, 1, 267, 'Possibilidade de salvar o relatório por períodos.', '', '', '2006-12-14 19:25:22', 2, 'camila.candido', 'camila.candido', ''),
	(451, 126, 956, 'Ajustes - Busca, Mapa de Localização e Botões da Home', 7, 3, 0, 'Raphael, enviei o upgrade para aprovação do cliente e discuti o conteúdo. Ainda existem alguns ajustes necessários. São eles:\r\n\r\n1 - A busca de imóveis ainda apresenta problemas. Quando feita uma busca para imóveis de 3 dormitórios, aparecem imóveis de 4 ou mais dormitórios na lista dos resultados. Precisamos acertar.\r\n\r\n2 - Sobre os Botões que controlam os destaques de imóveis:"Anterior", "]]" e "Próximo" - O Botão "pause" funciona perfeitamente para interromper o looping, mas quando apertado novamente não reverte a operação. Quando este botão for utilizado para pausar a imagem, deve ficar sombreado, para que o usuário perceba que os banners estão pausados. Quando acionado novamente, deve liberar a troca dos banners e retornar a sua cor inicial. Cada banner deve permanecer 30 segundos na tela.\r\n\r\n3 – A área do mapa de localização ficou muito pequena, quase não é possível entender o desenho. O cliente deseja inserir um mapa tamanho A4, que será compactado para caber na página, no entanto, deve haver a opção de clicar no desenho ou em algum link visível para que o usuário possa abrir o mapa em tamanho natural. \r\n\r\nEstou a disposição para eventuais esclarecimentos. Obrigada.\r\n', '', '', '2006-12-19 12:30:11', 2, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(452, 210, 785, 'Quando re-utilizo um anúncio antigo', 2, 0, 281, 'Quando re-utilizo um anúncio antigo, ou seja, clico no "Modificar" de meus anúncio e atualizo datas para re-publicar um anúncio vencido ele começa a sumir a origem novamente, o mesmo erro que estava no anúncio do zero.', '', '', '2006-12-20 10:24:03', 1, 'carlos.arruda', 'marco.malaquias', ''),
	(453, 210, 785, 'Itens carregados em combo via Ajax aparecendo dentro da combo', 5, 1, 0, 'Apresentar "Carregando..." dentro da combo que está sendo carregada, para travar o usuário e explicar pra ele o que está acontecendo naquele momento com o sistema.\r\n', '', '', '2006-12-20 10:33:01', 1, 'carlos.arruda', 'marco.malaquias', ''),
	(454, 152, 947, 'Erro no cadastramento', 2, 0, 314, 'Após cadastrar um ítem, ao tentar cadastar um novo, o sistema apresenta tela de mensagem de erro e informa que um e-mail foi enviado ao administrador.', '', '', '2006-12-21 11:57:36', 2, 'alexandre.rodrigues', 'jefferson.silva', ''),
	(455, 152, 947, 'Mudar os labels DIVISÃO e MODELO', 5, 2, 0, 'Alterar os labels de "Divisão" e "Modelo" em todo o sistema conforme abaixo:\r\n\r\nDivisão --> Modelo\r\nModelo --> Versão', '', '', '2006-12-21 12:00:46', 2, 'alexandre.rodrigues', 'jefferson.silva', ''),
	(456, 152, 947, 'Duplicidade de ítens', 2, 0, 323, 'Ao cadastrar uma unidade (por exemplo "LITROS"), o sistema apresenta 2 ítens idênticos. \r\nAo tentar renomear um deles, o sistema renomeia ambos.', '', '', '2006-12-21 12:03:48', 2, 'alexandre.rodrigues', 'jefferson.silva', ''),
	(457, 152, 947, 'Incluir opção 24:00', 5, 1, 322, 'Sistema só disponibiliza período de 00:00 as 23:00. \r\nIncluir opção 24:00.\r\n\r\nTentamos parametrizar de 08:00 as 00:00 e o sitema informa que algo do tipo "data final menor que a inicial".', '', '', '2006-12-21 12:07:22', 2, 'alexandre.rodrigues', 'jefferson.silva', ''),
	(458, 152, 947, 'Aba "Últimas Manutenções" não abre', 2, 0, 302, 'Ao clicar nesta aba, apresenta tela de erro como se a URL fosse inválida e apresenta mensagem de página não pode ser exibida.', '', '', '2006-12-21 12:09:46', 2, 'alexandre.rodrigues', 'jefferson.silva', ''),
	(459, 152, 947, 'Criar campo Ano Fabricação', 7, 0, 302, 'Incluir campo Ano Fabricação no cadastro de veículo.\r\nO label do campo atual na tela passa a ser Ano Modelo.', '', '', '2006-12-21 12:11:55', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(460, 152, 947, 'Remover obrigatoriedade de preenchimento do RENAVAN', 5, 1, 302, 'Remover obrigatoriedade de preenchimento do RENAVAN', '', '', '2006-12-21 12:13:29', 2, 'alexandre.rodrigues', 'jefferson.silva', ''),
	(461, 126, 956, 'Ajustes - Mapa (Flash) e Administração', 7, 2, 0, 'Bruno, seguem os ajustes solicitados pelo cliente:\r\n\r\n1 - Permitir a inserção de mapas de localização em Flash\r\n\r\n2 - Retirar da Administração a área que gerenciava o destaque de imóveis à direita da Home, retirado recentemente.\r\n\r\n\r\nAbnexado arquivo Flash do Mapa.', '', '', '2006-12-21 12:17:18', 2, 'anapaula.chiodaro', 'raphael.araujo', ''),
	(462, 152, 979, 'Adicionar novo drop down de "ANO MODELO"', 5, 1, 302, 'Hoje no cadastro de veículos, só existe o drop down de ANO DE FABRICAÇÃO.\r\nConstatou-se a necessidade de disporem de um segundo drop down de ANO DE MODELO (ao lado do ano de fabricação).\r\n\r\nLembrando que deverá ser verificado em todo o sistema e seus relatórios para apresentar esta segunda informação (ANO). No prótipo Consultas -> MULTAS, pode-se perceber na aba RELATÓRIO, como deve ser apresentado o ANO com esta nova informação.\r\n\r\nEsta alteração irá causar impacto diretamente no cadastro -> Preços FIPE, pois lá deverá trazer as informações todas relacionadas somente ao ANO MODELO (Como apresentado no Label do protótipo).\r\n\r\n', '', '', '2006-12-21 12:22:29', 2, 'alexandre.rodrigues', 'jefferson.silva', ''),
	(463, 152, 947, 'Mudar Label Motivo de DESATIVAÇÃO para Motivo de INFRAÇÃO', 5, 1, 319, 'Mudar Label Motivo de DESATIVAÇÃO para Motivo de INFRAÇÃO', '', '', '2006-12-21 12:31:05', 2, 'alexandre.rodrigues', 'jefferson.silva', ''),
	(464, 152, 947, 'Não está funcionando', 2, 0, 333, 'Quando acho o veículo pela placa o sistema dá um reload e nada acontece.', '', '', '2006-12-21 13:41:36', 2, 'carlos.arruda', 'jefferson.silva', ''),
