	(466, 152, 947, 'Erro quando acesso a página', 2, 0, 327, 'Quando entrou nesse link apresenta logo de início a seguinte mensagem:\r\n\r\n"Ocorreu um problema no servidor. O administrador do sistema já foi comunicado por e-mail." ', '', '', '2006-12-21 13:59:14', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(467, 152, 947, 'Usuário solicitando fora do horário', 2, 0, 326, 'O sistema está permitindo solicitar um veículo com horário de "turno saída" no passado.\r\n\r\n21/12/2006 no intervalo de 10:00 às 12:00.\r\n\r\nAdicionado anexo para melhor explicação.', '', '', '2006-12-21 14:03:21', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(468, 152, 947, 'Campos de busca acionados por ENTER', 5, 1, 0, 'Nos campos de pesquisa permitir entrada de palavra-chave e aceitar <ENTER>, hoje só funciona no clique da setinha.', '', '', '2006-12-21 14:47:57', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(469, 152, 947, 'Sistema permitindo solicitação em horários conflitantes', 2, 0, 326, 'O sistema atualmente está permitindo 2 solicitações em horários conflitantes, nao respeitando a tela de parametrizacao de tempo e indisponibilidade.\r\n\r\nEssa trava tem que existir para solicitacao pendente.', '', '', '2006-12-21 14:50:12', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(470, 152, 979, 'Usuario do tipo adm frota tem que consultar somente da própria frota', 5, 1, 326, 'Usuario do tipo adm frota tem que poder consultar por placa, como já tá fazendo hoje, só que tem que ser somente da frota associada a ele.', '', '', '2006-12-21 14:52:30', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(471, 152, 979, 'Em todas as consultas adicionar campo PLACA', 5, 1, 0, 'Em todas as consultas adicionar campo PLACA para ser entrado.\r\nO usuário irá digitar como palavra-chave parte ou inteiro.', '', '', '2006-12-21 15:04:06', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(472, 152, 947, 'Erro no link "Tela Inicial"', 2, 1, 0, 'Quando clico no rastro do sistema no item "Tela Inicial" o sistema não está indo para a tela inicial e sim apresentando o seguinte erro:\r\n\r\nHTTP Status 500 - \r\n\r\n--------------------------------------------------------------------------------\r\n\r\ntype Exception report\r\n\r\nmessage \r\n\r\ndescription The server encountered an internal error () that prevented it from fulfilling this request.\r\n\r\nexception \r\n\r\njavax.servlet.ServletException\r\n	org.apache.struts.action.RequestProcessor.processException(RequestProcessor.java:545)\r\n	org.apache.struts.action.RequestProcessor.processActionPerform(RequestProcessor.java:486)\r\n	org.apache.struts.action.RequestProcessor.process(RequestProcessor.java:274)\r\n	org.apache.struts.action.ActionServlet.process(ActionServlet.java:1482)\r\n	org.apache.struts.action.ActionServlet.doGet(ActionServlet.java:507)\r\n	javax.servlet.http.HttpServlet.service(HttpServlet.java:689)\r\n	javax.servlet.http.HttpServlet.service(HttpServlet.java:802)\r\n	br.com.toyota.fleet.web.filter.FleetUserFilter.doFilter(FleetUserFilter.java:81)\r\n	org.springframework.orm.hibernate.support.OpenSessionInViewFilter.doFilterInternal(OpenSessionInViewFilter.java:117)\r\n	org.springframework.web.filter.OncePerRequestFilter.doFilter(OncePerRequestFilter.java:73)\r\n\r\n\r\nroot cause \r\n\r\njava.lang.NullPointerException\r\n	br.com.toyota.fleet.hibernate.bo.Turn.all(Turn.java:58)\r\n	br.com.toyota.fleet.hibernate.bo.Turn.fromDate(Turn.java:176)\r\n	br.com.toyota.fleet.hibernate.bo.Vehicle.isAvailableNow(Vehicle.java:351)\r\n	br.com.toyota.fleet.service.impl.VehicleServiceImpl.findAllAvailableNow(VehicleServiceImpl.java:150)\r\n	br.com.toyota.fleet.service.impl.VehicleServiceImpl.findAllAvailableNow(VehicleServiceImpl.java:164)\r\n	sun.reflect.NativeMethodAccessorImpl.invoke0(Native Method)\r\n	sun.reflect.NativeMethodAccessorImpl.invoke(NativeMethodAccessorImpl.java:39)\r\n	sun.refle