	(473, 152, 979, 'Retirar informação da tela inicial', 5, 1, 0, 'Quando logo no sistema na tela inicial tem uma tabela chamada "Veículos Disponíveis", deixar apenas a tabela de "Solicitacoes" e de "Historico de Multas".', '', '', '2006-12-21 18:38:53', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(474, 152, 979, 'Adicionar novos filtros', 5, 1, 341, 'Hoje nessa página na aba "Parâmetros" tem apenas 2 filtros, adicionar os seguintes:\r\n\r\n- Período (campos de calendário, como o do "consulta->multas")\r\n- Frota (drop-down de frota, primeiro valor indiferente)\r\n- Unidade (drop-down de unidade, primeiro valor indiferente)', '', '', '2006-12-21 18:56:23', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(475, 152, 947, 'Permitindo duplicidade de códigos', 2, 0, 314, 'O sistema está permitindo eu criar dois departamentos distintos com o mesmo código de centro de custo.', '', '', '2006-12-22 11:16:03', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(476, 152, 947, 'Quando entro na página o drop nao está no "selecione"', 2, 1, 309, 'Quando entro na página o drop nao está no "selecione", ou seja o drop-down não está com o "Selecione -->" selecionado e sim o último item cadastrado.', '', '', '2006-12-22 11:21:02', 2, 'carlos.arruda', 'jefferson.silva', ''),
