	(478, 152, 979, 'Alterações do layout do relatório', 5, 1, 342, 'Atualizado o protótipo no CVS.\r\nQuando clico na aba relatório é agora apresentado um novo layout com novos campos.', '', '', '2006-12-22 11:54:39', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(479, 152, 947, 'Ajuste no permissionamento do usuário tipo "operador"', 2, 0, 0, 'O usuário tipo "operador" pode acessar somente os seguintes links:\r\n\r\n- Serviços -> Saída de Veículos\r\n- Serviços -> Entrada de Veículos\r\n\r\nLembrando que enxergando apenas os veículos da mesma unidade de empresa do cadastro dele.', '', '', '2006-12-22 12:39:07', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(480, 152, 947, 'Pop-up muito pequena e sem poder re-dimensionar', 2, 0, 330, 'Quando clico no link "Liberar Saída do Veículo" o sistema tá abrindo uma pop-up muito pequena, e travada o re-dimensionamento, nao permitindo a leitura clara dos dados.', '', '', '2006-12-22 12:40:38', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(481, 152, 947, 'Quando tento salvar dá "Data de Vencimento Inválida"', 2, 0, 334, 'Entrei com os dados da multa, coloquei a data de vencimento no dia 12/01/2007 e o sistema dá mensagem de "Data de Vencimento Inválida". Não permite salvar.\r\n\r\nAnexo de tela para ajudar no entendimento.', '', '', '2006-12-22 12:48:42', 2, 'carlos.arruda', 'jefferson.silva', ''),
