	(483, 152, 947, 'Quando parametrizado hora útil até 24:00 o sistema muda para 01:00', 2, 0, 322, 'Parametrizei o horário útil de 06:00 às 24:00 e salvei.\r\nQuando voltei na página o sistema apresentou 06:00 às 01:00.', '', '', '2006-12-22 13:10:00', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(484, 152, 947, 'Campo preço some quando edito um item', 2, 0, 310, 'Cadastrei inicialmente um item sem preço, somente com "KM de troca".\r\nQuando tentei editar esse item mais tarde os campos de preço sumiram.', '', '', '2006-12-22 13:12:08', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(485, 235, 969, 'Permissão de usuário', 2, 0, 0, 'Ajuste no sistema:\r\n\r\nPagina de agendamento - fornecedor deve aparecer de acordo com o login (interno ve todos, fornecedor ve apenas sua empresa).', '', '', '2006-12-22 15:33:36', 2, 'bruno.freitas', 'felipe.correa', ''),
	(486, 235, 969, 'Data na tela de agendamento', 2, 1, 0, 'Incluir data na pagina de agendamento, porem nao permitir agendar retroativo, e permitir informar so para usuarios internos.', '', '', '2006-12-22 15:34:20', 2, 'bruno.freitas', 'felipe.correa', ''),
	(487, 235, 969, 'Tela de Status de Agendamento', 2, 1, 0, 'Na Tela de Status de Agendamento de ser verificado se o fornecedor so ve suas agendas e usuarios internos vejam tudo que foi agendado.', '', '', '2006-12-22 15:35:21', 2, 'bruno.freitas', 'felipe.correa', ''),
	(488, 235, 969, 'Conexão com o banco via thread', 2, 0, 0, 'No momento estou tentando descobrir porque a conexao com bancos via Thread nao esta funcionando aqui.', '', '', '2006-12-22 15:35:57', 2, 'bruno.freitas', 'felipe.correa', ''),
	(489, 152, 947, 'Label de versão está como divisao', 2, 1, 302, 'Aonde tinha que estar "versão" por escrito está "divisão"', '', '', '2006-12-25 18:38:32', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(490, 152, 947, 'Versao que nao existe na frota aparece na listagem', 2, 1, 304, 'Cadastrei 3 veículos com versoes distintas de Corolla, dessa forma apareciam as 3 na listagem do cadastro fipe, até aí OK.\r\nDepois mudei a versao de um deles para a do outro, continuou assim mesmo aparecendo as 3 versoes, mesmo que agora os 3 veiculos estejam distribuidos em apenas 2 versoes.', '', '', '2006-12-25 19:30:27', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(491, 152, 947, 'Permissionamento - Usuario tipo operador', 5, 0, 0, 'Usuario do tipo operadora só enxerga os itens:\r\n\r\n- Servicos -> Saída de Veículo\r\n- Servicos -> Entrada de Veículo\r\n\r\nHoje ele está vendo tb o item "Cadastros -> Veículo"', '', '', '2006-12-25 19:54:29', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(492, 152, 947, 'Pop-up de detalhes da solicitacao incompleta', 5, 1, 0, 'Quando clico no link de detalhes da solicitacao e abre a pop-up, nelatá faltando a informacao "destino". \r\n\r\nTem estado, cidade e até observação mas nao tem o campo "Destino"', '', '', '2006-12-25 19:57:30', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(493, 152, 947, 'Qdo clico no link liberar veiculo dá erro', 2, 0, 330, 'Quando clico no link "LIBERAR SAÍDA DE VEÍCULO" abre pop-up com mensagem: \r\n\r\n"O acesso a este recurso não está autorizado para o seu perfil. "', '', '', '2006-12-25 19:59:57', 2, 'carlos.arruda', 'jefferson.silva', ''),
