	(496, 152, 947, 'Falta campo de busca no Centro de Custo', 5, 2, 339, 'O campo centro de custo está com um drop-down direto, sem antes ter um campo de palavra-chave para procurar.\r\nA Toyota tem mais de 200 centro de custo, o drop-down ficaria muito extenso para uma procura sem pesquisa.\r\n\r\nLembrar de dar uma revisada no sistema, aonde tem "Centro de custo" como filtro adicionar campo de busca de palavra-chave.', '', '', '2006-12-26 07:30:39', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(497, 152, 979, 'Adicionar jscript de calendário no campo data', 5, 2, 340, 'No campo "Data Prevista para Entrega" adicionar jscript de calendário para facilitar a entrada de data.', '', '', '2006-12-26 08:10:34', 2, 'carlos.arruda', 'jefferson.silva', ''),
