.doFilter(OncePerRequestFilter.java:73)\r\n\r\n', '', '', '2006-12-26 08:18:03', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(499, 152, 947, 'Não retorna nada no relatório', 2, 1, 344, 'Tem uma multa cadastrada normalmente e quando consulta por esse relatório aparece a mensagem: \r\n\r\n"Nenhuma multa encontrada com os parâmetros fornecidos"\r\n\r\nEstou fazendo a consulta com tudo indiferente, deixando inclusive sem data nos campos de período. Mesmo eu colocando período nao acha.', '', '', '2006-12-26 14:04:37', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(500, 152, 979, 'Alteração na tela inicial', 5, 1, 0, '- Alterar página inicial dos usuários para que quando uma solicitação tiver sido autorizada apresentar o formulário de saída para ser impresso. O protótipo foi atualizado no CVS.', '', '', '2006-12-26 20:26:25', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(501, 152, 947, 'Formulário de saída errado', 2, 0, 0, '- Alterar formulário de saída para conter todas as informações do formulário prototipado. Já estava assim no CVS, não sei por que não foi implementado igual. Estou falando dos dados, as imagens dos veículos estão certos.\r\n\r\n- Formulário de saída atualmente está com os itens de check-list fixos em HTML, tem que consultar do BD.\r\n\r\n- As imagens dos veículos estão distorcidas, com a largura e altura forçada no HTML, as imagens "Entrada do Veículo", as de "Saída do Veículo" estão normais.', '', '', '2006-12-26 20:29:23', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(502, 152, 947, 'Otimização na hora de solicitar veículo', 5, 2, 326, '- Na aba "Seleção do Veiculo" aparecer somente modelos que tem na frota do usuário logado, pra não precisar ele selecionar o modelo e depois procurar uma versão e não encontrar.', '', '', '2006-12-26 20:30:43', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(503, 152, 947, 'Ajuste na apresentação das versões disponíveis', 2, 0, 326, '- Na aba "Seleção do Veiculo" quando seleciono um modelo e não encontro uma versão disponível estou voltando para a aba "Período De Permanência" para alterar o período, quando clico de volta para a aba "Seleção do Veiculo" ele já está trazendo o modelo selecionado mas o drop-down de "Versão" não está sendo recarregado com as versões disponíveis para aquele novo período parametrizado.', '', '', '2006-12-26 20:31:39', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(504, 152, 947, 'Ajuste em pop-up de troca de veículo', 2, 0, 327, '- Quando clico em "troca" a pop-up tá apresentando todos os veículos para a unidade/frota do usuário solicitante, isso é correto porém tem que filtrar também a disponibilidade para o período/turno solicitado, atualmente tá sem filtro de período/turno.', '', '', '2006-12-26 20:33:53', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(505, 152, 979, 'Retirar campo de dt pagamento', 5, 1, 334, '- Corrigir o comportamento dos campos, está correto mas as labels não condizem, segue o correto:\r\n	Data de Vencimento -> Data de Pagamento\r\n	Data de Pagamento -> Data de Vencimento\r\n\r\nE "data de pagamento" tem que sair, ficando apenas "Data de Vencimento" porque a partir da data de vencimento as datas de pagamento são automaticamente calculadas conforme regra de negócio passada por e-mail.', '', '', '2006-12-26 20:35:26', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(506, 152, 947, 'Erro no parcelamento', 2, 0, 334, 'Corrigir a questão do parcelamento, estou selecionando 4x, salvando e quando clico em "Clique aqui para imprimir e assinar o Termo de infração." o termo sai sempre fixo 3x.', '', '', '2006-12-27 09:57:41', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(507, 152, 979, 'Alteração em labels', 5, 2, 334, 'Alterar labels da seguinte forma:\r\n\r\nData -> Data da Infração\r\nQuantidade de pontos -> Pontuação\r\nNúmero da Infração -> Número AIT\r\nDescrição -> Descrição da Infração', '', '', '2006-12-27 19:58:28', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(508, 152, 979, 'Trazer fixo o Centro de Custo', 5, 1, 339, 'Quando seleciono um veículo já deve trazer o "Centro de Custo" fixo, o que tá relacionado ao veículo naquele momento.\r\n\r\nLembrando que se hoje o "Centro de Custo" é MARKETING e faço uma solicitação hoje tem que registrar MARKETING e se amanhã eu mudo esse veículo para o "Centro de Custo" FINANCEIRO não pode perder o histórico, na época que eu fiz a OS era MARKETING então fica MARKETING para efeito de consulta histórica.', '', '', '2006-12-27 20:05:22', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(509, 152, 979, 'Alteração na lógica de geração de número da solicitação', 5, 1, 326, '- No "Formulário de Saída" implementar lógica de numeração seguindo a seguinte regra:\r\n	- XXX00001/06\r\n		- XXX é a sigla da unidade relacionada\r\n		- 00001 é um sequencial começando do 1 sendo que cada unidade tem seu sequencial separado da outra. Lembrando que são 5 dígitos.\r\n		- 06 que significa o ano, a cada ano zero o sequencial e começa do 1 novamente.\r\n\r\n	Exemplo de como ficaria a terceira solicitação feita por um usuário de São Bernardo do Campo do ano de 2006: "SBC00003/06".\r\n	Veja que isso impacta em todos os relatório e quadros que apresentam a numeração de solicitação de veículo. \r\n	Para ver melhor como fica no formulário de saída bem como nos quadros (saída de veículos, entrada de veículos, autorização de veículos, etc) bastas acessar o protótipo sincronizado no CVS.', '', '', '2006-12-27 20:06:33', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(510, 152, 979, 'Alteração na OS na lógica de geração de números', 5, 2, 339, '- Nas solicitações de OS também implementar nova lógica de numeração seguindo a seguinte regra:\r\n	- 0001/06\r\n		- 0001 é um sequencial começando do 1. Nesse caso não tem preocupação com unidade visto que somente a unidade SBC abre OS. Lembrando que nesse caso são 4 dígitos.\r\n		- 06 que significa o ano, a cada ano zero o sequencial e começa do 1 novamente.\r\n\r\n	Exemplo de como ficaria a terceira OS feita por um usuário qualquer no ano de 2006: "0003/06".\r\n	Veja que isso impacta em todos os relatório e quadros que apresentam a numeração de OS. \r\n	Para ver melhor como fica no formulário de saída bem como nos quadros (saída de veículos, entrada de veículos, autorização de veículos, etc) bastas acessar o protótipo sincronizado no CVS.', '', '', '2006-12-27 20:07:20', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(511, 152, 979, 'Permissionamento Geral', 5, 2, 0, '- Administrador de Sistema\r\n\r\nAcesso total\r\n\r\n------------------------------\r\n\r\n- Administrador de Unidade (* Novo perfil)\r\n\r\nAcesso somente a:\r\n	- Solicitação de Veículo (Aparecer somente veículo pertencente a unidade dele, pertencente a qualquer frota)\r\n	- Autorização de Veículo (Aparecer somente veículo pertencente a unidade dele, pertencente a qualquer frota)\r\n	- Saída de Veículo (Aparecer somente veículo pertencente a unidade dele, pertencente a qualquer frota)\r\n	- Entrada de Veículo (Aparecer somente veículo pertencente a unidade dele, pertencente a qualquer frota)\r\n	- Liberação de Veículo Entrados (Aparecer somente veículo pertencente a unidade dele, pertencente a qualquer frota)\r\n	- Consultas (Todas as consultas, porém, restringindo à Unidade relacionado no cadastro de usuário. Ou seja, trava os drop-downs de filtros em cima da unidade do usuário logado. Os relatórios que não possuem esse filtro tem que fixar em regra de negócio mesmo, trazendo somente informação relacionada a unidade do usuário logado).\r\n\r\n------------------------------\r\n\r\n- Administrador de Frota\r\n\r\nAcesso somente a:\r\n	- Solicitação de Veículo (Aparecer somente veículo pertencente a unidade/frota dele)\r\n	- Consultas (Todas as consultas, porém, restringindo à Unidade e Frota relacionado no cadastro de usuário. Ou seja, trava os drop-downs de filtros em cima da unidade e frota do usuário logado. Os relatórios que não possuem esse filtro tem que fixar em regra de negócio mesmo, trazendo somente informação relacionada a unidade/frota do usuário logado).\r\n	- Solicitação de Veículo (Aparecer somente veículo pertencente a unidade dele, pertencente a qualquer frota)\r\n	- Autorização de Veículo (Aparecer somente veículo pertencente a unidade dele, pertencente a qualquer frota)\r\n	- Saída de Veículo (Aparecer somente veículo pertencente a unidade dele, pertencente a qualquer frota)\r\n	- Entrada de Veículo (Aparecer somente veículo pertencente a unidade dele, pertencente a qualquer frota)\r\n	- Liberação de Veículo Entrados (Aparecer somente veículo pertencente a unidade dele, pertencente a qualquer frota)\r\n\r\n------------------------------\r\n\r\n- Operador\r\n\r\nAcesso somente a:\r\n	- Saída de Veículo (Aparecer somente veículo pertencente a unidade dele, pertencente a qualquer frota)\r\n	- Entrada de Veículo (Aparecer somente veículo pertencente a unidade dele, pertencente a qualquer frota)\r\n\r\n------------------------------\r\n\r\n- Comum\r\n\r\nAcesso somente a:\r\n	- Solicitação de Veículo (Aparecer somente veículo pertencente a unidade/frota dele)\r\n', '', '', '2006-12-27 20:08:01', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(512, 126, 956, 'Ajustes solicitados em 28/12/2006', 7, 3, 0, 'Raphel, precisamos ajustar os seguintes itens com relação ao mapa de localização do Website da Riscali Imóveis:\r\n\r\n1 - Quando aberto em nova janela o mapa deve assumir seu tamanho orginial (página A4)\r\n2 - Inserir um botão de impressão para que o mapa possa ser impresso depois de visualizado em nova janela.\r\n\r\nEstou a disposição para eventuais esclarecimentos. ', '', '', '2007-01-02 09:50:21', 2, 'anapaula.chiodaro', 'raphael.araujo', ''),
	(513, 152, 947, 'Alertas com nomenclatura antiga', 2, 1, 326, 'Alertas com mensagem de erros ainda considerando a nomenclatura antiga (divisão e modelo) ao invés de modelo e versão.', '', '', '2007-01-02 19:24:34', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(514, 152, 979, 'Formulário de saída com numeração', 5, 1, 0, '- No "Formulário de Saída" apresentar o número do documento, já com a nova lógica de numeração. Otimizar também as informações para que caiba em uma folha apenas, utilizar o print preview para isso. Lembrando ser um papel A4. Veja que no protótipo abaixo foi alterado o "nível de combustível" para aumentar a área útil.\r\n\r\nhttp://www.agence.com.br/propostas/toyota/FleetControl/ser_solicitacao_veiculo_form_pop.htm', '', '', '2007-01-02 19:25:30', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(515, 152, 979, '"Data de vencimento" sem ser obrigatório', 5, 1, 334, 'Deixar o campo "Data de vencimento" sem ser obrigatório.', '', '', '2007-01-02 19:26:14', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(516, 152, 979, 'Centro de custo com número', 5, 1, 339, 'Apresentar no campo centro de custo o número do centro de custo também.\r\n\r\nhttp://www.agence.com.br/propostas/toyota/FleetControl/ser_nota_servico.htm\r\n', '', '', '2007-01-02 19:27:14', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(517, 152, 979, 'Alinhar relatórios', 5, 1, 343, '- Nas consultas todas, nos relatórios apresentados, alinhar a largura das colunas para que fiquem iguais, atualmente estão desalinhadas, no caso de "Consultas -> Solicitação De Veículos" cada agrupamento (por modalidade de servico) está com uma largura no resultado.', '', '', '2007-01-02 19:28:04', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(518, 152, 947, 'Regra de indisponibilidade', 2, 0, 326, 'A nova regra implementada relacionada a disponibilidade de veículos não está funcionando para veículos solicitados anteriores aos já solicitados, somente funciona para veículos posteriores. \r\n	Ex.: Existe uma solicitação para o veículo DLP-6053 para o dia 10/01/2007 iniciando às 15:00, nesse caso não consigo solicitar enxergar esse mesmo veículo caso eu queira pegá-lo no dia 10/01/2007 às 05:00 e entregar às 12:00, mesmo sendo o tempo de indisponibilidade 01:00.', '', '', '2007-01-02 19:28:42', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(519, 152, 979, 'Permissionamento Adm Frota', 5, 1, 0, '	- Adm Frota: Esse usuário tá enxergando veículos de outras unidades, não pode. O certo é ele só enxergar veículos da frota/unidade relacionada a esse usuário.\r\n\r\n	- Adm Frota: Tirar o acesso às seguintes páginas: Autorização de Veículo, Saída de Veículo, Entrada de Veículo e Liberação de Veículo Entrados.', '', '', '2007-01-02 19:29:19', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(520, 152, 979, 'Campo "previsão de entrega"', 5, 1, 340, 'O campo "previsão de entrega" tem que impactar em solicitações de veículos, hoje quando se abre uma OS para um determinado veículo ele some da lista dos disponíveis, tem que sumir mesmo só que até a data de previsão de entrega, se tiver vazio some pra sempre, até fechar a OS, mas se tiver preenchido tem que respeitar essa data.\r\n\r\n	Ex.: O veículo DLP-6053 tá com uma OS aberta com previsão de entrega para o dia 10/01/2007, ou seja, até  o dia 10/01/2007, último turno 24:00, não tem como enxergar esse veículo no momento das solicitações, ou na lista dos disponíveis, a não ser a partir do dia 11/01/2007 no primeiro turno disponível (00:00 por exemplo).', '', '', '2007-01-02 19:30:20', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(521, 207, 986, 'Padronização - Campo Telefone', 7, 2, 0, 'Em todos os campos do tipo telefone deixar padrão no seguinte formato: 3 campos, sendo o primeiro de 3 dígitos, o segundo de 4 dígitos e o terceiro de 9 dígitos.\r\n\r\nLocais que devem ser alterados: Cadastro de Empresa - Cadastro de Contato.', '', '', '2007-01-05 00:01:33', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(522, 207, 986, 'Painel de Controle - Padronizar pop-ups', 7, 3, 0, 'No item "Painel de Controle" deve haver ordenação alfabética (Pelo nome do Cliente) em todas as pop-ups. Essa regra vale para o Painel de Controle e também Painel de Propostas.', '', '', '2007-01-05 00:04:51', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(523, 207, 986, 'Link para Empresas', 7, 5, 0, 'Ao exibir uma listagem de Proposta, caso seja exibido o nome da Empresa, deixar um link no nome da empresa para acesso ao cadastro da empresa.', '', '', '2007-01-05 00:06:14', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(524, 207, 986, 'Oportunidades de Negócios (SUSPECT/PROSPECT/PROPOSTA)', 7, 0, 0, 'Alterar lógica no sistema em relação ao cadastramento de clientes. As empresas não terão mais status no sistema (suspect/prospect/client). Essa classificação em suspect/prospect/proposta passa a ser associada a uma Oportunidade de Negócio - ON. \r\n\r\nInformações:\r\n\r\n1) Ao criar uma ON, selecionar Empresa (no formato de busca por nome).\r\n2) Utilizar a tela de cadastro de Proposta para a ON adicionando a tela os campos: Interesse (terc./consult./assessoria), Status (suspect - default, prospect, proposta).', '', '', '2007-01-05 00:12:28', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(525, 207, 986, 'Ajustes no histórico do sistema - Painel de Controle', 7, 0, 0, 'Analisar como está sendo gravado o histórico no sistema e ajustá-lo para as novas regras de status para ON e não mais para EMPRESAS.\r\n\r\nLembrando que esse histórico é DIRETAMENTE ligado ao Painel de Controle.', '', '', '2007-01-05 00:18:04', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(526, 207, 986, 'Criar popup para CONTATOS', 7, 1, 0, 'Criar uma popup única para o cadastro e edição de contatos de uma empresa.\r\n\r\nEssa popup poderá ser chamada tanto no cadastro de EMPRESA quanto no cadastro de ON.\r\n\r\nOBS: Todos os contatos devem estar associados a uma EMPRESA. No cadastro de ON, os contatos poderão ser "associados" a ON e tb deve haver um link para o cadastro de um novo contato (analisar o melhor formato de tela para isso).\r\n\r\nOBS2: Tanto no cadastro de EMPRESAS quanto no cadastro de ON deverá existir a aba CONTATOS.', '', '', '2007-01-05 00:22:01', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(527, 207, 986, 'Totais no Painel de Controle e Painel de Propostas', 7, 1, 0, 'Exibir Totais (com links) no Painel de Controle e Painel de Propostas.\r\n\r\nOBS: ESSE Total deve ser uma linha (Total) e NÃO uma coluna. NÃO DEVE existir uma coluna TOTAL nos painéis de Controle e Propostas.', '', '', '2007-01-05 00:23:31', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(528, 207, 986, 'Campo TOTAL no POPUP de Painel de Propostas', 7, 1, 0, 'Criar na POPUP do Painel de Propostas, uma sexta coluna de "TOTAL", totalizando a linha.', '', '', '2007-01-05 00:27:13', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(529, 207, 986, 'Possibilitar que N arquivos sejam anexados', 7, 2, 329, 'No item "Propostas", aba "Arquivos", permitir adicionar "n" arquivos, em relação aos revisores nada muda.', '', '', '2007-01-05 00:28:27', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(530, 207, 986, 'Arquivos de Propostas - Criar tipo OUTROS', 7, 3, 329, 'No item "Propostas", aba "Arquivos", adicionar novo grupo de arquivos chamado "Outros", sem necessidade de revisores.', '', '', '2007-01-05 00:29:08', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(531, 207, 986, 'Painéis (CONTROLE - PROPOSTAS) na mesma tela', 7, 4, 0, 'Colocar Painel de Controle e Painel de Propostas na mesma tela (um embaixo do outro).', '', '', '2007-01-05 00:30:04', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(532, 207, 986, 'Alterar Lógica de Geração de Número de Proposta', 7, 5, 0, 'Alterar lógica de geração de número de proposta para [ano][mês][dia][número sequencial começando de 1 até terminar o ano, começando de 1 novamente em novo ano].\r\n\r\nObs: Precisamos conversar sobre a melhor forma de fazer isso.', '', '', '2007-01-05 00:31:44', 3, 'bruno.freitas', 'rodrigo.toledo', ''),
	(533, 207, 986, 'Cadastro de Empresas - ABA Oportunidades', 7, 1, 324, 'Criar ABA Oportunidades no cadastro de empresa.\r\n\r\nNessa Aba deverão ser listados todos as ON cadastradas para aquela empresa (Suspesct/Prospect/Proposta).', '', '', '2007-01-05 00:33:36', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(534, 152, 979, 'Adicionar novo filtro', 5, 2, 343, 'Adicionar novo filtro na aba "Parâmetros" de "Unidade". Adicionar também nova coluna na aba "Relatório" desse mesmo campo, "Unidade".', '', '', '2007-01-08 11:11:08', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(535, 152, 979, 'Adicionar novo filtro', 5, 2, 344, 'Adicionar novo filtro na aba "Parâmetros" de "Unidade". Adicionar também nova coluna na aba "Relatório" desse mesmo campo, "Unidade".', '', '', '2007-01-08 11:12:48', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(536, 152, 979, 'Adicionar novo filtro em todas as consultas', 5, 1, 0, 'Adicionar novo filtro na aba "Parâmetros" de "Unidade" e "Frota". Adicionar também nova coluna na aba "Relatório" desses mesmos campos, "Unidade" e "Frota". \r\n\r\nEsse chamado anula praticamente o 534 e 535 que tinham a ver com isso também.', '', '', '2007-01-08 11:39:48', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(537, 152, 947, 'Erro quando seleciono alguns filtros', 2, 1, 344, 'Quando seleciono o parâmetro do campo \r\n"Vencimento" = "A Vencer"  e \r\n"Mês" = "Março" e clico em relatório aparece:\r\n\r\ntype Exception report\r\n\r\nmessage \r\n\r\ndescription The server encountered an internal error () that prevented it from fulfilling this request.\r\n\r\nexception \r\n\r\njavax.servlet.ServletException: Bad SQL grammar [null] in task \'HibernateAccessor\'; nested exception is java.sql.SQLException: ORA-00904: nome inválido de coluna\r\n\r\n	org.apache.struts.action.RequestProcessor.processException(RequestProcessor.java:545)\r\n	org.apache.struts.action.RequestProcessor.processActionPerform(RequestProcessor.java:486)\r\n	org.apache.struts.action.RequestProcessor.process(RequestProcessor.java:274)\r\n	org.apache.struts.action.ActionServlet.process(ActionServlet.java:1482)\r\n	org.apache.struts.action.ActionServlet.doPost(ActionServlet.java:525)\r\n	javax.servlet.http.HttpServlet.service(HttpServlet.java:709)\r\n	javax.servlet.http.HttpServlet.service(HttpServlet.java:802)\r\n	br.com.toyota.fleet.web.filter.FleetUserFilter.doFilter(FleetUserFilter.java:81)\r\n	org.springframework.orm.hibernate.support.OpenSessionInViewFilter.doFilterInternal(OpenSessionInViewFilter.java:117)\r\n	org.springframework.web.filter.OncePerRequestFilter.doFilter(OncePerRequestFilter.java:73)\r\n\r\n\r\nroot cause \r\n\r\norg.springframework.jdbc.BadSqlGrammarException: Bad SQL grammar [null] in task \'HibernateAccessor\'; nested exception is java.sql.SQLException: ORA-00904: nome inválido de coluna\r\n\r\n	org.springframework.jdbc.support.SQLStateSQLExceptionTranslator.translate(SQLStateSQLExceptionTranslator.java:79)\r\n	org.springframework.orm.hibernate.HibernateAccessor.convertJdbcAccessException(HibernateAccessor.java:238)\r\n	org.springframework.orm.hibernate.HibernateAccessor.convertHibernateAccessException(HibernateAccessor.java:219)\r\n	org.springframework.orm.hibernate.HibernateTemplate