	(538, 113, 957, 'Ajustes - Upload de E-mails - Admin Webstie Orbe Investimentos', 2, 3, 0, 'Olá Raphael, seguem algumas dúvidas e erros apontados pelo cliente com relação ao upload/administração de e-mails. Pode me ajudar?\r\n\r\n1 - Na tela de administração, subitem "Outros Itens", tem dois itens "Cadastrados". Por que? O que significa cada um deles. \r\n2 - O upload deveria enviar os e-mails para uns dos dois itens "Cadastrados", onde estão todos os e-mails, para  utilização da ferramenta de e-mail marketing\r\n- Entrando no "Cadastro de Grupo de E-mails" e clicando em algum grupo para tentar organizar os e-mails acrescentados, aparece uma mensagem de erro. A imagem da tela que o cliente enviou foi anexada a este chamado (erro.jpg).\r\n', '', '', '2007-01-09 17:53:14', 2, 'anapaula.chiodaro', 'raphael.araujo', ''),
	(539, 152, 947, 'Erro quando abro OS para novo modelo', 2, 0, 339, 'Quando abro uma OS para um veículo cujas "Peças / Lubrificantes" e "Serviços de Manutenção" ainda não foram parametrizados dá pau no sistema. Tem que apresentar uma frase de alerta amigável, do tipo "Modelo / Versão sem "PEÇAS / LUBRIFICANTES" parametrizados." ou ""Modelo / Versão sem "SERVIÇOS DE MANUTENÇÃO" parametrizados" dependendo da situação.\r\n\r\nOutra coisa que nas páginas de SERVIÇOS DE MANUTENÇÃO e PEÇAS / LUBRIFICANTES não está aparecendo esses novos modelos para itens já cadastrados, somente para novos itens.', '', '', '2007-01-09 18:15:02', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(540, 152, 947, 'Adm Frota e Adm Sistema enxergando veículos em manutenção', 2, 1, 326, '- Permissionamento:\r\n\r\n	- Adm Frota e Adm Sistema: Na solicitação de veículo esse usuário tá enxergando veículos que estão com OS aberta pra eles, não pode, tem que ser que nem usuário comum, se tiver OS aberta tem que ver somente a partir da data posterior a data de "previsão de entrega".', '', '', '2007-01-09 18:48:43', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(541, 152, 979, 'Novo perfil no sistema', 5, 2, 0, '- Permissionamento:\r\n\r\n	- Criar novo tipo de usuário, o tipo "Oficina" com acesso somente ao Quadro de OS (Serviços -> Quadro De OS) e seus pop-ups. Esse usuário terá acesso a todos os veículos com OS aberta, independente de unidade ou frota. Aproveita e cria um usuário no script SQL, mesmo nome do tipo de usuário "oficina".', '', '', '2007-01-09 18:49:53', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(542, 152, 947, 'Ajustes em campos', 5, 1, 325, '- Deixar CNH e Data de Vencimento sem ser obrigatório. \r\n\r\n- Alterar label de "departamento" para "Centro de Custo" e colocar sistema de busca nesse campo, como está em todo sistema.', '', '', '2007-01-10 17:18:21', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(543, 152, 947, 'Sem poder salvar quando é serviço externo', 2, 0, 340, '- Quando coloco na pop-up o status "Serviço Externo" e tento salvar dá a mensagem "Serviço Externo necessita obrigatoriamente Status e Fornecedor Externo", mas mesmo selecionando um fornecedor externo o sistema não permite salvar.', '', '', '2007-01-10 17:19:42', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(544, 152, 947, 'Solicitação no passado', 2, 0, 326, '- Estou podendo solicitar veículo em horário no passado, agora são 17:36 solicitei para o intervalo (10:00 - 12:00) de início até amanhã.', '', '', '2007-01-10 17:38:46', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(545, 152, 947, 'Identificação de multa paga', 2, 1, 334, '- Agora percebi que a data de pagamento é uma flag para multas pagas, mas mudamos o conceito, data de pagamento sao as datas para pagamento do infrator em folha. Então temos que criar um outro mecanismo para sinalizar multas pagas, imagino um drop-down logo depois de termo de infração de "Pagamento" com as opcoes "Não Pago" e "Pago", como é no "CONSULTAS -> MULTAS".\r\n\r\nDessa forma lembrar que essa alteração irá refletir diretamente o CONSULTAS -> MULTAS.', '', '', '2007-01-10 18:40:13', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(546, 152, 979, 'Erro quando troco de estado', 2, 1, 313, '- Quando seleciono um Estado que já tenha uma cidade cadastrada e depois seleciono a cidade em questão e depois seleciono outro Estado o sistema não limpa o campo "descrição" com a cidade relacionada ao outro estado, dando pane no sistema.', '', '', '2007-01-12 16:03:09', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(547, 152, 979, 'Em todos drop-downs de Centro de Custo do Sistema', 5, 3, 0, '- Apresentar na seguinte ordem "Número do Centro de Custo - Nome do Departamento", atualmente em várias páginas que utiliza esse drop-down está apresentando na ordem inversa, primeiro nome do departamento e depois número do centro de custo.', '', '', '2007-01-12 16:03:52', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(548, 152, 979, 'Pop-up de "Troca" permitindo outros modelos', 5, 2, 327, '- Na pop-up de "Troca" colocar na linha disponíveis o drop-down de modelo antes do drop-down de veículos, porque se o usuário quiser ele pode mudar o modelo solicitado para selecionar outros disponíveis. \r\n	\r\nEx.: O usuário solicitante pediu um veículo modelo corolla de versão SEG A/T, se não tiver mais outro corolla disponível para trocar o admin tem que poder trocar o modelo nesse caso, para uma Hilux por exemplo.', '', '', '2007-01-12 16:25:11', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(549, 152, 979, 'Mensagem de alerta', 5, 3, 325, '- Alterar mensagem de erro para "Centro de Custo é obrigatório", atualmente está "Departamento é obrigatório" para quando eu salvar sem "Centro de Custo".', '', '', '2007-01-12 16:25:48', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(550, 152, 979, 'Topo do formulário de saída', 5, 3, 0, '- Ver possibilidade de tirar o topo, para ganhar mais espaço, começando o formulário a partir do Número da Solicitação com a logomarca da Toyota ao lado.', '', '', '2007-01-12 16:26:34', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(551, 152, 979, 'Campo "Liberador" obrigatório', 5, 2, 0, '- Deixar campo "Liberador" obrigatório em SAÍDA DE VEÍCULOS e ENTRADA DE VEÍCULOS .', '', '', '2007-01-12 16:27:33', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(552, 152, 979, 'Retirar página', 5, 1, 332, '- Retirar essa página, os veículos agora serão liberados a partir da entrada dos mesmos na ENTRADA DE VEÍCULOS, e ficando disponíveis para solicitação a partir do horário parametrizado para solicitação.\r\n\r\n	Ex.: Vamos supor que na tela (CADASTROS -> PARAMETRIZAÇÃO DE TEMPO E INDISPONIBILIDADE DE VEÍCULO) tá parametrizado o "Tempo de Indisponibilidade do Veículo" em 01 h. \r\n	Numa solicitação de saída para ->s 08:00 e de entrada para ->s 18:00 esse veículo está liberado para solicitação a partir das 19:00. Tudo certo. Mas se ele entrou ->s 16:00 no ENTRADA DE VEÍCULOS ele se liberará automaticamente para solicitações a partir das 17:00 agora, e não mais somente a partir das 19:00.', '', '', '2007-01-12 17:38:13', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(553, 152, 979, 'Alteração de layout', 5, 2, 342, '- No relatório apresentar ano-modelo, atualmente só tá apresentando 1 ano.\r\n- Quando for frota designado apresentar o nome do usuário pra qual está designado, somente o nome.\r\n- No campo centro de custo apresentar somente o número, não precisa do nome do departamento.\r\n- Deixar a parte de conteúdo tudo em cinza, o modelo e o valor estão em branco atualmente.\r\n- Alinhamento do conteúdo de frota a esquerda.\r\n- Alinhamento do conteúdo de valor a direita.\r\n- Alinhamento do conteúdo do resto centralizado.\r\n- Ordenação das colunas conforme protótipo atualizado no CVS.', '', '', '2007-01-12 17:39:47', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(554, 152, 979, 'Alteração de layout', 5, 2, 342, '- No relatório apresentar ano-modelo, atualmente só tá apresentando 1 ano.\r\n- Quando for frota designado apresentar o nome do usuário pra qual está designado, somente o nome.\r\n- No campo centro de custo apresentar somente o número, não precisa do nome do departamento.\r\n- Deixar a parte de conteúdo tudo em cinza, o modelo e o valor estão em branco atualmente.\r\n- Alinhamento do conteúdo de frota a esquerda.\r\n- Alinhamento do conteúdo de valor a direita.\r\n- Alinhamento do conteúdo do resto centralizado.\r\n- Ordenação das colunas conforme protótipo atualizado no CVS.', '', '', '2007-01-12 17:56:49', 2, 'carlos.arruda', 'jefferson.silva', ''),
	(555, 207, 986, 'Somente exibir STATUS quando for PROPOSTA', 2, 0, 0, 'Na visualização dos dados de uma ON, somente exibir o status se o tipo da ON for PROPOSTA.\r\n', '', '', '2007-01-15 08:47:56', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(556, 207, 986, 'Somente exibir VALIDADE quando for PROPOSTA', 2, 0, 0, 'Tanto na visualização quanto na edição de uma ON, somente exibir o campo VALIDADE quando o tipo for PROPOSTA.', '', '', '2007-01-15 08:49:18', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(557, 207, 986, 'Adicionar botão para REMOVER arquivos', 7, 0, 0, 'Colocar a data e o botão para remoção de arquivos de proposta (da mesma forma que o PROPOSTA TÉCNICA).', '', '', '2007-01-15 10:10:02', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(558, 207, 986, 'Criar botao cancelar na edicao de Empresas/ON', 7, 1, 0, 'Criar botao cancelar na edicao de Empresas e de Oportunidade de negocios. Através desse botão o usuário pode cancelar a edição dos dados sem precisar salvar. O clique no botão deve levar o usuário para a tela de visualização do objeto editado. Caso seja um NOVO objeto, o clique no "Cancelar" deve levar a tela inicial da respectiva entidade (Emrpesas ou ON).\r\n', '', '', '2007-01-15 15:33:39', 2, 'bruno.freitas', 'raphael.araujo', ''),
	(559, 207, 986, 'Criar link para Visualização/Edição de Contatos', 7, 1, 0, 'Criar links para a visualização/edição de contatos nos seguintes pontos do sistema (esse link deve utilizar a popup de contatos):\r\n\r\n- Tela Principal de Empresas: client_main.php\r\n- Tela de visualização de ON: proposal_view.php\r\n', '', '', '2007-01-15 15:38:40', 2, 'bruno.freitas', 'raphael.araujo', ''),
	(560, 207, 986, 'Erro Javascript ao Cadastrar NOVO Contato', 2, 0, 324, 'Depois de clicar no botão SALVAR CONTATO do novo Contato, aparece um erro Javascript na Tela.\r\nObs: A tela é a client_view.php', '', '', '2007-01-24 11:39:51', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(561, 207, 986, 'Erro ao clicar no botão Adicionar Contato', 2, 0, 350, 'Ao criar uma nova ON, quando clicamos no botao Adicionar (Contato) o sistema dá um erro de "Empresa ainda não selecionada" mesmo quando a empresa já está selecionada.', '', '', '2007-01-24 11:42:06', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(562, 207, 986, 'Responsavel não vem selecionado ao Editar Empresa', 2, 0, 324, 'Ao editar uma empresa, o sistema não trás selecionado o campo RESPONSAVEL.', '', '', '2007-01-24 11:43:39', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(563, 207, 986, 'Erro JS ao visualizar uma ON', 2, 0, 350, 'Erro JS ao visualizar uma ON.\r\n\r\nURL do teste: http://10.100.200.13/OpenKube/KSales/init_tpl/proposal_view.php?proposal_id=194 ', '', '', '2007-01-24 11:47:10', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(564, 207, 986, 'Botao REMOVER Empresas não está aparecendo', 2, 0, 324, 'Botao REMOVER Empresas não está aparecendo.', '', '', '2007-01-24 11:49:52', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(565, 103, 965, 'Problemas ao atualizar o chamado para  "Serv. Ext"', 2, 0, 0, 'Ao editar um chamado:\r\n\r\nAo alterar os chamados para "Serv. Ext." o campo fornecedor não é ativado.', '', '', '2007-01-24 12:03:57', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(566, 126, 956, 'Erro de Sistema - Cadastro de Imóveis', 2, 0, 0, 'Raphael,\r\nPoderia indicar os arquivos ao Bruno para que possamos já alterar no servidor de produção?\r\nPor tratar-se de um problema antigo, eu gostaria de autalizar o mais rápido possível.\r\nAbs. Ana\r\n\r\n- x - x - x - x - x - x - x - x - x - x - x - x - x - x - x\r\n\r\nRaphael, conforme você recordou mais cedo, este chamado diz respeito a uma falha antiga no cadastro de imóveis do Website. \r\n\r\n- Quando um novo imóvel é cadastrado no Website, deve entrar no banco de dados com status "inativo" e um e-mail de aviso deve ser enviado ao gerente, Sr. Gilberto Riscali. Depois de analisado e aprovado pelo gerente, o cadastro do imóvel em questão deve ser ativado, manualmente, para que passe a ser visualizado nas buscas de imóveis realizadas pelos usuários do site.\r\n\r\nPode me ajudar a solucionar a questão?\r\n', '', '', '2007-01-30 09:36:16', 2, 'anapaula.chiodaro', 'todos', ''),
	(567, 103, 965, 'Restrição impede que usuários "CHEFE" vejam chamados', 2, 0, 352, 'Alguma restrição do sistema está impedindo que usuários do tipo "CHEFE" vejam os chamados.\r\n\r\nSegundo a Patrícia, eles configuraram os "CHEFES" como usuários de help-desk e os chamados passaram a ser visualizados.', '', '', '2007-02-06 15:14:09', 2, 'bruno.freitas', 'felipe.correa', ''),
	(568, 103, 965, 'Adequação da Tela - Separar Chamados Pendentes', 7, 0, 353, 'Tarefas:\r\n\r\n1) Retirar coluna "Pendente de Autorizacao".\r\n2) Retirar busca de Autorizador.', '', '', '2007-02-13 16:20:49', 2, 'bruno.freitas', 'felipe.correa', ''),
	(569, 103, 965, 'Desenvolvimento de Funcionalidade', 7, 0, 354, 'Essa tela deve ser semelhante a tela de Chamados Abertos e em Andamento. As diferenças são:\r\n\r\n1) Deve existir a busca por Autorizador.\r\n2) Deve existir a coluna "Pendente de Autorização"\r\n3) NÃO deve ser possível a busca por status (a tela só exibe chamados que estejam com status "PENDENTE").\r\n', '', '', '2007-02-13 16:23:04', 2, 'bruno.freitas', 'felipe.correa', ''),
	(570, 152, 947, 'Ajuste Fornulário de Saida de Veículos', 7, 1, 330, 'Incluir os campos Modelo/Versão e Placa no formulário de saída de veículo.\r\n\r\nAbs, Bruno.', '', '', '2007-02-23 15:36:40', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(571, 207, 1036, 'Acrescentar informações no email de abertura de chamado', 7, 0, 288, 'Acrescentar mais informações sobre o chamado no email de abertura conforme exemplo do sistema atual:\r\n\r\nTarefa: 14802\r\nProduto: Administrativo\r\nStatus: Não iniciado\r\nNatureza: Atendimento\r\nCaminho: Arquivo/Solicitação de Caixa\r\n\r\nTítulo da tarefa: Solicitação de caixa\r\n\r\nDescrição: CX 1 - 1191767\r\nCX2 - 1191767\r\n\r\nPrevisão de solução: 28/02/2007 15:32:00\r\n', '', '', '2007-02-28 11:12:45', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(572, 207, 1036, 'Permitir que o usuário que abriu o chamado assuma-o', 7, 1, 298, 'Alteração na regra de negócio:\r\n\r\nPermitir que o usuário que abriu o chamado assuma-o.', '', '', '2007-02-28 11:14:27', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(573, 113, 1013, 'Problemas com as ferramentas de Administração', 2, 0, 0, 'Bruno,\r\n\r\nMais dois problemas com as ferramentas de Administração:\r\n\r\n- Problemas com a ferramenta de envio de e-mail marketing: o editor html não abre e a ferramanta não conclui o envio do e-mail.', '', '', '2007-03-07 09:36:22', 2, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(574, 113, 1013, 'Cotas - Coluna de Patrimônio Líquido e Layout para Onvestidores Estrangeiros', 7, 1, 0, 'Caros,\r\n\r\n1 - O layout para investidores estrangeiros foi aprovado. Já podemos finalizar a página e publicar.\r\n\r\n2 - Na coluna de patrimônio do fundo, todos os valores deverão aparecer com duas casas decimais, mesmo os  que possuem valores redondos (Ex: 12,08 - 13,00 ...).\r\n\r\nAbs, Ana', '', '', '2007-03-19 15:37:55', 2, 'anapaula.chiodaro', 'todos', ''),
	(575, 113, 1063, 'Problemas - Adaptação para Firefox', 2, 1, 0, 'Pessoal,\r\n\r\nTestei o site no Firefox e obtive os seguintes resultados:\r\n\r\n- Página Inicial - OK\r\n- Página Inicial Português - Busca Cotas - OK\r\n- Pagina de Cadastro, Contato e outras páginas internas:\r\n* layout desconfigurado (distribuição dos elementos na página)\r\n* cor do texto diferente da versão original\r\n* pontilhado da página com problemas em função do layout desconfigurado\r\n* quadrado lateral (direita) com tamanho diferente do original\r\n\r\nFico a disposição para explicar os pontos mencionados. Abs, Ana\r\n', '', '', '2007-03-29 18:57:31', 2, 'anapaula.chiodaro', 'raphael.araujo', ''),
	(576, 240, 994, 'Pontos de observação - SAPP - cadastro de PEA', 5, 1, 0, 'Bruno, seguem os pontos de observação do cadatro de PEA. Achei interessante registrar para não esquecermos de ajustar antes de enviar o pacote.\r\n\r\n1 - Cadastro de PEA -> Cadastro de Bibliografia (Abas 2 e 3)\r\n2 - Cadastro de PEA -> Cadastro de Bibliografia -> Cadastro de Livros: tornar não obrigatório campo "Volume"\r\n3 - Cadastro de Usuários: cadastrar os usuários Inês, Erika, Bruna, Juliana e Gilliard\r\n4 - Cadastro de PEA -> Aba 1 - Carga Horária da Disciplina - pode estar sendo lida do SIAE de forma errada\r\n\r\nAbs, Ana', '', '', '2007-04-05 14:15:35', 2, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(577, 234, 977, 'Permitir a busca selecionando apenas a UF e Cidade;', 5, 2, 0, 'Permitir a busca selecionando apenas a UF e Cidade;', '', '', '2007-04-05 16:49:23', 2, 'bruno.freitas', 'saulo.coelho', ''),
	(578, 234, 977, 'Colocar o cursor pointer nos campos do formulário de pesquisa;', 5, 3, 0, 'Colocar o cursor pointer nos campos do formulário de pesquisa;', '', '', '2007-04-05 16:49:48', 2, 'bruno.freitas', 'saulo.coelho', ''),
	(579, 234, 977, 'Alterar a cor das opções dos campos (option) tipo do imóvel na pesquisa;', 5, 2, 0, 'Alterar a cor das opções dos campos (option) tipo do imóvel na pesquisa;', '', '', '2007-04-05 16:50:15', 2, 'bruno.freitas', 'saulo.coelho', ''),
	(580, 234, 977, 'Corrigir alinhamento dos resultados da pesquisa;', 2, 1, 0, 'Corrigir alinhamento dos resultados da pesquisa;', '', '', '2007-04-05 16:50:37', 2, 'bruno.freitas', 'saulo.coelho', ''),
	(581, 234, 977, 'Corrigir a data das cotações', 2, 1, 0, 'Corrigir a data das cotações', '', '', '2007-04-05 16:51:25', 2, 'bruno.freitas', 'saulo.coelho', ''),
	(582, 113, 1063, 'Problemas - Página "News"', 2, 2, 0, 'Bruno,\r\n\r\nA página "News" (Menu do topo) não está devidamente adptada para o Firefox. As fontes estão desconfiguradas. Pode dar uma olhada?\r\n\r\nAbraços, Ana', '', '', '2007-04-09 12:32:26', 2, 'anapaula.chiodaro', 'raphael.araujo', ''),
	(583, 113, 889, 'Ferramenta de E-mail Marketing - ferramente indisponível desde a implantação', 2, 2, 0, 'Oi Bruno,\r\n\r\nO cliente ainda não coneguiu utilizar a ferramenta de e-mail marketing. \r\nSugerimos o monitoramento do próximo envio, ele deverá entrar em contato.\r\nSegue Prt Scr do erro enviado por ele em 19/03/07.\r\n\r\nAbs.\r\n\r\nAna', '', '', '2007-04-09 14:29:18', 4, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(584, 240, 994, 'Alteração de PEA - registro de login, data, hora da alteração', 2, 1, 355, 'Bruno,\r\n\r\nDeverá ficar registrado na tela de pendências do cadastro de PEA, o login, a data e a hora do usuário que realizou a operação, nos seguintes casos:\r\n\r\n- Criação e edição de PEA\r\n- Alteração de Status \r\n\r\nO sistema está registrando estas informações apenas quando criado o PEA.\r\n\r\nPoderia verificar?\r\n\r\nAbs,\r\n\r\nAna', '', '', '2007-04-16 19:27:31', 2, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(585, 240, 994, 'Cadastro de PEA - Citação Bibliográfica', 2, 1, 355, 'Bruno,\r\n\r\nNo cadastro de PEA, abas Bibliografia e Bibliografia Complementar, a citação bibliográfica está incompleta, falta a edição.\r\n\r\nPrecisamos ajustar o formato. O padrão deverá ser:\r\n\r\nSOBRENOME, Nome. Título da obra : subtítulo : número da edição , Cidade : Editora, ano.\r\n\r\nAbs,\r\n\r\nAna', '', '', '2007-04-16 19:45:26', 2, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(586, 240, 994, 'Tela de cadastro de livros - busca de editoras cadastradas', 2, 0, 0, 'Bruno,\r\n\r\nNo cadastro de livros, campo editora, existe uma busca para procurar por registros já cadastrados. \r\n\r\nA busca não está funcionando e trava a tela, impedindo a finalização do cadastro de livros e da área de bibliografia dos PEA.\r\n\r\nPrecisamos checar o erro, pois o pessoal da Anhanguera está aguardando esse ajuste para finalizar os cadastros dos PEA do segundo semestre.\r\n\r\nAbs,\r\n\r\nAna', '', '', '2007-04-17 14:46:18', 2, 'anapaula.chiodaro', 'tiago.stutz', ''),
	(587, 240, 994, 'Cadastro de livros - registros idênticos', 2, 0, 0, 'Bruno / Tiago,\r\n\r\nApenas para efeito de registro, abri este chamado para listar nas pendências o ajuste que precisamos realizar no cadastro de livros, de forma a impossibilitar o registro de livros idênticos.\r\n\r\nAbs,\r\n\r\nAna', '', '', '2007-04-17 18:20:51', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(588, 240, 994, 'Cadastro de Usuários - erros', 2, 1, 355, 'Bruno, precisamos ajustar alguns pontos no cadastro de usuários. São eles:\r\n\r\n- Correção: não permitir que o usuário seja cadastrado sem senha de acesso.\r\n\r\n- Correção: não permitir que dois usuários sejam cadastrados com o mesmo nome.\r\n\r\n- Correção: permitir ativação e desativação dos usuários. \r\nAtualmente o sistema não permite, entende como um novo cadastro com os mesmos dados (não permitie que a ativação / desativação seja salva).\r\n\r\n- Correção: permitir a edição de um usuário.\r\n Atualmente o sistema não permite, entende que é um novo cadastro com os mesmos dados e não aceita salvar. Só permite a edição quando alterados um dos dados obrigatórios.  \r\n\r\n- Todos os espaços imputados nos campos transformam-se no símbolo % (porcentagem).\r\n\r\n', '', '', '2007-04-18 19:40:55', 2, 'anapaula.chiodaro', 'tiago.stutz', ''),
	(589, 240, 994, 'Cadastro de Avisos - um ponto a ajustar', 2, 1, 0, 'Bruno, precisamos ajustar um ponto no cadastro de avisos. \r\n\r\n- Quando alterei a data de validade de um chamado ativo  (data limite, não a inicial) e escolhi aleatóriamente uma data mais para o futuro, o sistema não me permitiu salvar o aviso, exibindo uma mensagem "A data de validade deve ser igual ou maior do que a atual". O parâmetro estava fora de propósito porque a data selecionada era bem maior do que a atual.', '', '', '2007-04-18 19:47:29', 2, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(590, 243, 1005, 'Arrumar Casa > Editar RSS', 2, 0, 0, 'Segue erro anexado.', '', '', '2007-04-20 11:53:31', 2, 'bruno.freitas', 'raphael.araujo', ''),
	(591, 254, 1085, 'Página quebrada ao entrar com texto longo.', 2, 0, 0, 'Página quebrada ao entrar com texto longo.', '', '', '2007-04-20 14:11:00', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(592, 254, 1085, 'Problema upload de arquivos', 2, 0, 0, 'QUando fazemos o upload o nome e caminho do arquivo são gravados na base, porém o upload não é realizado com sucesso. Observar a tela enviada o caminho /"file"/x/nome_do_arquivo.\r\n\r\nBuscando no server, só esncontramos a pasta /"file"/tmp.', '', '', '2007-04-20 14:13:09', 2, 'bruno.freitas', 'rodrigo.toledo', ''),
	(593, 248, 1042, 'Admin > Rredimensionar as imgs', 7, 0, 0, 'Admin > Redimensionar as imgs', '', '', '2007-04-25 12:41:45', 2, 'bruno.freitas', 'saulo.coelho', ''),
	(594, 240, 994, 'Criação dos Tipos de Usuário', 7, 1, 0, 'Bruno,\r\n\r\nPrecisamos criar e implantar os tipo de usuários, pois estão aumentando consideravelmente o número de usuários efetivos do SAPP já neste momento inicial.\r\n\r\nSeria interessante que os próximos módulos já fossem implantandos com os níveis de acessos atribuidos para cada tipo de usuários.\r\n\r\nAbs, Ana\r\n', '', '', '2007-04-26 15:07:03', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(595, 240, 994, 'Nova prioridade de Desenvlvimento', 7, 0, 355, 'Bruno,\r\n\r\nEm função da crescente utilização do sistema por parte dos coordenadores e supervisores, precisaremos priorizar o desenvolvimento do relatório "Consulta - Plano de Ensino e Aprendizagem". \r\n\r\nEles ainda estão inseguros com o sistema, pois em função de alguns problemas de conexão, alguns deles não tiveram suas alterações salvas e realizaram a mesma operação duas vezes. Como também não verificaram o registro do login/data/hora na tela de pendências do cadastro de PEA, estão com medo de perder as informações e não poder comprovar o trabalho.\r\n\r\nAbs, Ana', '', '', '2007-04-26 15:14:35', 3, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(596, 240, 994, 'Tela de Pendências do cadastro de PEA - regostro do Login', 2, 0, 0, 'Bruno,\r\n\r\nConforme imagem enviada pelo DDE, depois da atualização de ontem, não aparece mais o login dos usuários no quadro de pendências, do cadastro de PEA.\r\n\r\nAcredito que tenha alguma coisa a ver com a estrutura da tabela de usuários que tbm foi atualizada.\r\n\r\nAbs,\r\n\r\nAna', '', '', '2007-04-26 16:30:20', 2, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(597, 223, 898, 'o catálogo dos produtos está fora de diagramação', 2, 0, 0, 'o catálogo dos produtos está fora de diagramação', '', '', '2007-04-26 17:48:37', 2, 'fabiano.pontes', 'saulo.coelho', ''),
	(598, 240, 994, 'Cadastro de Usuários', 2, 0, 0, 'Bruno,\r\n\r\nConforme imagem enviada, o cadastro de usuários implantado na Anhanguera não está mais funcionando. Os usuários recebem um erro de conexão com o banco de dados.\r\n\r\nPode me ajudar?  Abs, Ana', '', '', '2007-04-26 17:57:07', 2, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(599, 240, 994, 'Desenvolvimento da Funcionalidade', 7, 0, 356, 'Desenvolvimento da Funcionalidade Consulta de PEA.', '', '', '2007-04-27 15:23:31', 2, 'bruno.freitas', 'rafael.sierra', ''),
	(600, 103, 965, 'Funcionamento inadequado dos filtros', 2, 0, 352, 'Na última opção do menu chamados, quando é feito um filtro por usuário nenhum registro aparece na lista e após isso nenhum dos outros filtros funciona.', '', '', '2007-04-27 18:17:03', 2, 'saulo.coelho', 'saulo.coelho', ''),
	(601, 240, 994, 'Citação Bibliográfica - ABNT', 7, 3, 0, 'Bruno,\r\n\r\nPrecisamos ajustar novamente a citação bibliografica. Quando mencionamos a edição, não parece a referência "ed."\r\n\r\nSolicitei um exemplo prático de como devrá ficar o padrão da citação.\r\n\r\nRODRIGUES, Silvio. Direito Civil: Parte Geral. 32 ed. São Paulo : Saraiva, 2003\r\n\r\n(não esquecendo de manter o título do livro em negrito)\r\n\r\nAbs, Ana.', '', '', '2007-04-27 18:46:02', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(602, 240, 994, 'Cadastro de PEA - Bibliografia / Bibli. Complementar - Citação', 2, 1, 0, 'Bruno,\r\n\r\n- Cadastro de PEA - Cadastro de Bibliografia / Bibliografia Complementar:\r\n\r\nQuando um livro cadastrado / selecionado é incluido no quadrinho de bibliografia do curso, a citação bibliográfica permanece errada.\r\n\r\nEla aparece correta na combo para seleção do livro (área de cadastro de bibliografia), mas aparece incompleta (falta edição e editora, etc) nas citações presentes no quadrinho que resume a bibliografia indicada para o curso.\r\n\r\nQualquer dúvida, estou a disposição.\r\n\r\nAbs,\r\n\r\nAna', '', '', '2007-05-02 15:59:58', 2, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(603, 240, 994, 'Cadastro de PEA - Exportar indicação de bibliografia', 7, 1, 0, 'Bruno,\r\n\r\nPrecisaremos gerar, em 15/05, uma planilha com toda a bibliografia indicada no cadastro de PEA.\r\n\r\nUtilizaremos planilha enviada pelo professor Adauto Damásio como referência.\r\n\r\nFavor me contatar para os detalhes.\r\n\r\nAbs, Ana', '', '', '2007-05-02 17:19:37', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(604, 113, 1013, 'Página para investidores estrageiros - Arquivos para Download', 2, 0, 0, 'Bruno / Raphael,\r\n\r\nQuando inserido um arquivo para dowload na descrição do fundo voltado aos investimento para investidores estrangeiros, o link gerado para o arquivo leva a outro lugar totalmente inadequado com conteúdo em português.\r\n\r\nPor favor me procurem, se precisarem de um explicação melhor. Encaminhei o e-mail com as telas enviadas pelo Fábio.', '', '', '2007-05-03 12:08:58', 2, 'anapaula.chiodaro', 'todos', ''),
	(605, 240, 994, 'Cadastro de Usuários - Combo de resultados - Ordem alfabética', 2, 1, 0, 'Meninos,\r\n\r\nQuando realizada a busca por um usuário, no módulo de Cadastro de Usuários do SAPP, a combo de resultados deveria listar os nomes em ordem alfabética. Não está acontecendo isso on sistema em produção (arquivo anexo). \r\n\r\nPoderiam corrigir isso na próxima atualização?\r\n\r\nAbs, Ana.', '', '', '2007-05-03 12:20:41', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(606, 232, 962, 'Parse error na página de contato', 2, 3, 0, 'Na página http://www.pinheiraomadeiras.com.br/contato.php está ocorrendo o erro:\r\nParse error: syntax error, unexpected $end in /home/pinheiraomadeira/www/form_contato.php on line 75\r\nquando uma opção é selecionada.', '', '', '2007-05-08 14:54:26', 2, 'saulo.coelho', 'bruno.freitas', ''),
	(607, 240, 994, 'Cadastro de PEA - não permite salvar', 2, 0, 0, 'Não conseguimos salvar PEA no ambiente produção.', '', '', '2007-05-11 17:59:45', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(608, 254, 1085, 'Ajustes Solicitados pelo Cliente - Layout', 5, 0, 0, 'Olá Rodrigo,\r\n\r\nSeguem os ajustes de layout solicitados pelo cliente:\r\n\r\n1 - Torcar o fundo rosa por branco.\r\n2 - Recortar a parte superior da imagem (acima da primeira prateleira de livros) centralizando a imagem da sala na tela.\r\n3 - Remover a "bordinha preta da imagem".\r\n4 - Substituir o branco do logo pelo rosa (pink) utilizado nas florzinhas, títluos e outros marcadores do site.\r\n5 - Ao carregar o site, manter os objetos clicáveis coloridos por um pouco mais de tempo para que o usuário memorize aonde deverá clicar, antes da tela se tornar P&B por inteiro.\r\n', '', '', '2007-05-14 16:39:11', 2, 'anapaula.chiodaro', 'rodrigo.toledo', ''),
	(609, 254, 1085, 'Ajustes solicitados pelo cliente - Informações (telefone)', 5, 1, 0, 'Rodrigo,\r\n\r\nNa área de Informações, o cliente deseja inserir hyperlinks em algumas palavras/frases do conteúdo inserido na administração. Por exemplo, ao mencionar o Teatro Alpha para compra de ingressos, ele deseja inserir hyperlink para o teatro.\r\n\r\nQualquer dúvida, estou a disposição.\r\n\r\nAbs, Ana', '', '', '2007-05-14 16:47:52', 2, 'anapaula.chiodaro', 'rodrigo.toledo', ''),
	(610, 254, 1085, 'Ajustes solicitados pelo clientes - Músicas (gramofone menor)', 5, 1, 0, 'Rodrigo,\r\n\r\nNesta área o cliente realmente deseja que o usuário possa ouvir os trechos das músicas (30 segundos de cada música).\r\n\r\nMe avise se precisar de eventuais esclarecimentos.\r\n\r\nAbs, Ana.\r\n\r\n', '', '', '2007-05-14 16:51:19', 2, 'anapaula.chiodaro', 'rodrigo.toledo', ''),
	(611, 254, 1085, 'Dúvidas do cliente', 5, 1, 0, 'Rodrigo,\r\n\r\nO cliente me pediu indicação de software para fazer proteção de tela e converter imagem em ícone. Pode me indicar alguma coisa?\r\n\r\nAbs,\r\n\r\nAna', '', '', '2007-05-14 16:55:18', 2, 'anapaula.chiodaro', 'rodrigo.toledo', ''),
	(612, 254, 1085, 'Browser - SAFARI', 5, 1, 0, 'Oi Rodrigo,\r\n\r\nO cliente utiliza MAC e acabou testando o website no SAFARI. É muito complicado adaptá-lo para que fique legal neste navegador também?\r\n\r\nAbs, Ana', '', '', '2007-05-14 16:57:40', 2, 'anapaula.chiodaro', 'rodrigo.toledo', ''),
	(613, 254, 1085, 'Ajuste dos Marcadores', 2, 1, 0, 'Rodrigo,\r\n\r\nNos layers de informações e downloads, tem uma florzinha como marcador para os títulos. Algumas estão bem desalinhadas em relação ao título (mais para baixo ou mais para cima).\r\n\r\nPoderia ajustá-las.\r\n\r\nAbs. Ana\r\n', '', '', '2007-05-16 15:49:41', 2, 'anapaula.chiodaro', 'rodrigo.toledo', ''),
	(614, 254, 1085, 'Layer direcionado ao Elenco', 5, 1, 0, 'Rodrigo,\r\n\r\nPrecisamos ajustar este layer para receber descrição de elenco com texto e sem texto, sem prejudicar a distribuição da informação no quadro.\r\n\r\nAbs, Ana.', '', '', '2007-05-16 15:51:04', 2, 'anapaula.chiodaro', 'rodrigo.toledo', ''),
	(615, 254, 1085, 'Layer de fotos', 5, 1, 0, 'Rodrigo,\r\n\r\nEu gostaria de centralizar o quadrinho com as fotos na vertical para dar um distanciamento do título.\r\n\r\nAbs. Ana\r\n\r\n\r\n', '', '', '2007-05-16 15:53:23', 2, 'anapaula.chiodaro', 'rodrigo.toledo', ''),
	(616, 254, 1085, 'Fonte do Texto e dos Títulos', 5, 1, 0, '\r\nEncontrar uma fonte Web mais próxima do layout original. ', '', '', '2007-05-16 15:55:54', 2, 'anapaula.chiodaro', 'rodrigo.toledo', ''),
	(617, 126, 989, 'Substituir Logo', 7, 1, 0, 'Caros,\r\n\r\nSegue novo logo da Riscali me arquivo de melhor qualidade. Favor substituir.\r\n\r\nAbs, Ana', '', '', '2007-05-20 22:22:08', 2, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(618, 240, 994, 'Cadastro de PEA - Aba Cronograma', 7, 3, 0, '\r\nRetirar o limite de caracteres estipulado para o cadastro das semanas dos cronogramas dos PEAs.', '', '', '2007-05-21 09:04:32', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(619, 240, 994, 'Cadastro de PEA - Carga Horária', 2, 1, 0, 'Rafael,\r\n\r\nOs PEAs estão lendo de forma errada a Carga Horária das disciplinas do SIAE. Eu cheguei a conferir algumas com a TI, durante a implantação do primeiro módulo do sistema e, de fato, estavam corretas no SIAE e erradas  no SAPP.\r\n\r\nPoderia verificar, por favor?\r\n\r\nAbs, Ana', '', '', '2007-05-21 09:22:47', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(620, 240, 994, 'Cadastro de PEA - Cursos Inativos', 5, 1, 0, '\r\nAlterar a query para que os cursos inativos não apareçam  na lista de cursos nas unidades.', '', '', '2007-05-21 09:33:38', 3, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(621, 254, 1085, 'Layer de Informações - Tabulação', 7, 1, 0, '\r\n- Alustar a tabulação do layer de informações (telefone). O item localização está com a tabulação desalinhada. Acho interessante revisar a tabulação de toda esta área.', '', '', '2007-05-21 11:36:27', 1, 'anapaula.chiodaro', 'rodrigo.toledo', ''),
	(622, 249, 1049, 'Ordenar por espessura', 7, 0, 360, 'Ordernar preços por espessura. Ordem crescente.', '', '', '2007-05-22 16:07:55', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(623, 249, 1049, 'Listagens Tipo Empresa', 7, 1, 0, 'Para todas as listagens de Tipo de Empresas (COMBOS), trzae por ordem alfabética (crescente).', '', '', '2007-05-22 16:10:10', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(624, 249, 1049, 'Usuários com tipo diferente de Padrão não possuem empresa', 2, 0, 363, 'Caso o tipo escolhido seja diferente de Padrão, não é necessário selecionar EMPRESA. A COMBO de empresas não deve ser exibida.', '', '', '2007-05-22 16:16:39', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(625, 249, 1049, 'Somente usuários Padrão podem fazer pedidos', 7, 0, 357, 'Somente usuários Padrão podem fazer pedidos. Ajustar permissões no sistema.', '', '', '2007-05-22 16:42:07', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(626, 113, 1013, 'Site portugues - Tabela de fundos página inicial', 2, 0, 0, 'Caros,\r\n\r\nNa tabela de fundos da página inicial do site da Orbe (versão em português), na coluna patrimônio Líquido (última da direita), o cliente inseriu atribui o valor "100"para o fundo "Orbe Value FIA (aberto até 23/05/07)". Tal valor é exibido acompanhado de um ponto. \r\n\r\nPrecisamos remover este ponto e permitir que o cliente insira números com três dígitos, exibindo-os corretamente.\r\n\r\nFico à disposição para esclarecer.\r\n\r\nAbs, Ana', '', '', '2007-05-23 10:13:57', 2, 'anapaula.chiodaro', 'todos', ''),
	(627, 258, 1102, 'Title e Logout forçado', 2, 0, 0, '- Title errado, está “Sac Online”, alterar para “Portal UFI - Backend”.\r\n- Se demoro um pouco no sistema sem ação e volto a fazer alguma coisa dá mensagem de "Usuário inválido" e me remete à tela de login.', '', '', '2007-05-24 09:42:34', 2, 'carlos.arruda', 'raphael.araujo', ''),
	(628, 258, 1102, 'Carregar concessionárias', 2, 0, 365, '- Quando seleciono um Estado o drop-down de Concessionária tem que carregar de acordo com o estado selecionado.', '', '', '2007-05-24 09:43:14', 2, 'carlos.arruda', 'raphael.araujo', ''),
	(629, 258, 1102, 'Troca de senha não funciona', 2, 0, 366, '- Não está funcionando.', '', '', '2007-05-24 09:43:48', 2, 'carlos.arruda', 'raphael.araujo', ''),
	(630, 258, 1102, 'Manu Concessionárias - Erros diversos', 2, 0, 367, '- Quando desmarco a opção Ativo de alguma concessionária e tento salvar o sistema não salva essa alteração.\r\n- No campo CNPJ quando coloco um número maior como por exemplo 03.999.951/0001-04 e salvo ele não salva essa alteração.\r\n- Os campos Telefone de Contato não estão sendo atualizados na base de dados também.\r\n- Quando quero criar uma nova concessionária e não habilito o Ativo ele não tá cadastrando essa concessionária.\r\n', '', '', '2007-05-24 09:44:22', 2, 'carlos.arruda', 'raphael.araujo', ''),
	(631, 258, 1102, 'Manu Vídeos - Erros diversos', 2, 0, 368, '- Quando desmarco a opção Ativo de algum vídeo e tento salvar o sistema não salva essa alteração.\r\n- Quando quero criar um novo vídeo e não habilito o Ativo ele não tá cadastrando.\r\n- O "Ver Arquivo" nesse caso terá que ser um esquema similar ao Youtube onde eu possa ver o vídeo no browser. Isso vai precisar para o frontend, caso não saiba como fazer entre em contato com o Rafael Jorge Sierra Gonçales daqui do SP, ele me parece que sabe. Cadastrei um arquivo lá .AVI e quando clico no Ver Arquivo o sistema quer salvar na minha máquina.\r\n\r\n', '', '', '2007-05-24 09:44:59', 2, 'carlos.arruda', 'raphael.araujo', ''),
	(632, 258, 1102, 'Manu Links - Erros diversos', 2, 0, 369, '- Quando quero criar um novo treinamento e não habilito o Ativo ele não tá cadastrando.\r\n- O tipo Ver Todos não precisa, sei que foi pra editar mas confunde o usuário na hora de cadastrar, e o sistema está permitindo eu cadastrar um treinamento com o tipo "Ver Todos".', '', '', '2007-05-24 09:45:36', 2, 'carlos.arruda', 'raphael.araujo', ''),
	(633, 258, 1102, 'Qdo não ativo não cadastra', 2, 0, 370, '- Quando quero criar um novo tutorial e não habilito o Ativo ele não tá cadastrando.', '', '', '2007-05-24 09:46:09', 2, 'carlos.arruda', 'raphael.araujo', ''),
	(634, 258, 1102, 'Manu Notícias - Erros diversos', 2, 0, 371, '- Quando quero criar uma nova notícia e não habilito o Ativo ele não tá cadastrando.\r\n- Quando coloco uma notícia com uma descrição um pouco mais longa ele não tá cadastrando.\r\n- Aumentar o campo descrição, aumentar para 3x o tamanho em altura dele.', '', '', '2007-05-24 09:46:53', 2, 'carlos.arruda', 'raphael.araujo', ''),
	(635, 258, 1102, 'Manu Enquetes - Erros diversos', 2, 0, 372, '- Quando quero criar uma nova enquete e não habilito o Ativo ele não tá cadastrando.\r\n- Quando adiciono uma resposta, sem antes de salvar, tem que aparecer o sinal de "-" na anterior e o "+" é sempre na última acompanhado por um "-" também, o protótipo tá bem claro quanto a isso. É para que eu possa excluir uma resposta em qualquer dos campos.', '', '', '2007-05-24 09:47:24', 2, 'carlos.arruda', 'raphael.araujo', ''),
	(636, 0, 0, 'Exibir o resultado da enquete no admin', 4, 2, 0, 'A Emeline ligou hoje solicitando que o resultado da enquete do site seja exibido na área administrativa. Verificar e dar retorno pelo número 3321-0067.', '', '', '2007-05-29 10:53:16', 1, 'saulo.coelho', 'todos', ''),
	(637, 0, 0, 'A enquete não aparece na área administrativa', 2, 2, 0, 'A Emeline ligou notificando o problema.', '', '', '2007-05-29 18:42:45', 1, 'saulo.coelho', 'saulo.coelho', ''),
	(638, 113, 1128, 'Inclusão de Fichas de Cadastro', 2, 1, 0, 'Bruno,\r\n\r\nIncluí fichas de cadastro na administração e elas não apareceram na página do fundo.\r\n\r\nDe resto, está tudo ok. Conforme você mencionou, só precisa mudar o título do fundo no layout.\r\n\r\nAbs,\r\n\r\nAna\r\n\r\n', '', '', '2007-06-04 11:07:01', 2, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(639, 240, 994, 'Relatório - livros indicados nos PEA', 7, 1, 0, 'Rafael,\r\n\r\nPrecisamos gerar a segunda planilha com os livros indicados nos PEA do SAPP ainda esta semana.\r\n\r\nSe possível, incluir a indicação das séries das disciplinas nas planilhas dos cursos.\r\n\r\nDesta vez, enviarei as planilhas dos cursos sem formatação. Eles realizarão todo o trabalho por lá.\r\n\r\nAbs,\r\n\r\nAna', '', '', '2007-06-04 12:10:53', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(640, 240, 994, 'Relatório- Disciplinas não parametrizadas', 7, 1, 0, 'Bruno,\r\n\r\nO Márcio Lodis / Rodrigo tem como extrair este relatório de disciplinas não parametrizadas ou precisa necessariamente ser feito por aqui?\r\n\r\nPrecisamos gerar este relatório para que eles terminem de parametrizar os cursos. Eu gostaria de delegar esta tarefa para a Ti da Anhanguera, se possível, pois, provavelmente, tornará a se repetir mais para frente.\r\n\r\nAbs,\r\n\r\nAna ', '', '', '2007-06-04 12:15:12', 3, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(641, 254, 1085, 'Publicação - Problemas', 2, 0, 0, 'Bruno,\r\n\r\nNaveguei pelo link da locaweb (http://myfairlady1.tempsite.ws/), encontrei os seguintes problemas:\r\n\r\n1 - O layer "Informações" (telefone) - teve seus marcadores e espaçamento desconfigurados.\r\n2 - O Layer "Elenco" (caixinha dourada) - espaçamento desconfigurado.\r\n3 - O layer "Downloads" (vitrola maior) - espaçamento e marcadores desconfigurados\r\n4 - O layer "Fotos" (mapa) - espaçamento e marcadores desconfigurados\r\n\r\nPodemos acertar isso ainda hoje?\r\n\r\nAbs, Ana\r\n ', '', '', '2007-06-11 15:38:05', 2, 'anapaula.chiodaro', 'todos', ''),
	(642, 0, 0, 'Solicitação de Alterações', 5, 0, 0, 'Hoje, a Emeline ligou solicitando as alterações abaixo:\r\n  - Retirar a página com o flash de abertura e direcionar diretamente para a home\r\n  - Incluir o número de pessoas que responderam a enquete', '', '', '2007-06-14 09:23:40', 1, 'saulo.coelho', 'saulo.coelho', ''),
	(643, 240, 994, 'Relatórios', 7, 1, 0, 'Rafael,\r\n\r\nPrecisamos gerar relatório para os dois cursos abaixo, que ficaram faltando:\r\n\r\n- Superior de Tecnologia em Gestão de Recursos Humanos\r\n- Superior de Tecnologia em Segurança Pessoal e Patrimonial\r\n\r\nAbs, Ana\r\n\r\n\r\n', '', '', '2007-06-15 18:59:16', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(644, 152, 1135, 'Itens (Check) não estão sendo carregados', 2, 0, 0, 'Os itens de check devem ser carregados na tela para que o usuário possar visualizar e editar o que foi registrado.\r\n', '', '', '2007-06-18 08:44:13', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(645, 254, 1085, 'Locaweb - desconfiguração do Layout', 2, 0, 0, 'Caros,\r\n\r\nApenas registrando o chamado para o ajuste acerca do layout desconfigurado na Locaweb.\r\n\r\nAbs, Ana', '', '', '2007-06-18 16:36:21', 2, 'anapaula.chiodaro', 'todos', ''),
	(646, 254, 1085, 'Ícones - erro nos arquivos para download', 2, 0, 0, 'Rodrigo,\r\n\r\nApenas registrando chamado para ajuste dos ícones para download. Os arquivos estão corretos na administração, no entanto, quando clicamos nos ícones a caixa de download apresenta o arquivo errado.\r\n\r\nAbs, Ana\r\n\r\n', '', '', '2007-06-18 16:39:56', 2, 'anapaula.chiodaro', 'todos', ''),
	(647, 240, 994, 'Consulta de PEA - testes - problemas / dúvidas', 7, 0, 0, 'Oi Marcelo,\r\n\r\nTestando a consulta de PEA, observei:\r\n\r\n1 - A consulta deveria considerar "Ano Letivo"e "Semestre Letivo", não "Ano de Criação" e "Semestre de Criação"\r\n\r\n2 - Na consulta para impressão, por que a formatação da parte de bibliografia e cronograma não aparece ou apresenta mensagem de erro?\r\n\r\n3 - O último ícone deveria permitir edição do conteúdo? Não consegui visualizar um exemplo...os campos aparecem vazios e não aparece a parte de bibliografia e cronograma.\r\n\r\nPoderia revisar esses pontos comigo?\r\n\r\nAbs, Ana\r\n', '', '', '2007-06-19 15:43:20', 3, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(648, 254, 1085, 'Dados - CMS - My Fair Lady', 7, 1, 0, 'Oi Bruno,\r\n\r\nPor falta de comunicação interna do cliente, a Kelly, da Pineapple. alterou diversos dados nas áres de fotos, mapa e criadores do website My Fair Lady, no CMS do nosso servidor.\r\n\r\nPreciso migrar os dados para a Locaweb. Pode me ajudar?\r\n\r\nAbs, Ana', '', '', '2007-06-19 16:29:00', 2, 'anapaula.chiodaro', 'bruno.freitas', ''),
	(649, 252, 1079, 'Cadastro de Usuários - Diversos', 2, 1, 377, '- Problemas de acentuação (ver cadastro do Carlos Flávio Girão de Arruda)\r\n- Telefone de contato não foi colocado como apresentado no protótipo, com campo para DDD e ramal, no BD pode até deixar tudo num campo só, concatenado. Mas na interface para o usuário precisa separar, se não o usuário esquece de colocar DDD e ramal quando necessário.\r\n- Campo de cidade está como o protótipo porém percebemos que o melhor mesmo é ter uma tabela de cidades pra ser carregada a partir da seleção do Estado. Como no sistema da Sadiaclub, pode aproveitar a mesma tabela e recurso Ajax pra carregar.\r\n- Quando cadastro um usuário a senha colocada não fica válida ainda, tem que editar o usuário e entrar novamente com os dados da senha.\r\n- Campo para permitir armazenamento de foto não está aparecendo, foi retirado por solicitação da Márcia ou foi postergado essa implementação propositalmente?\r\n', '', '', '2007-06-21 12:51:34', 2, 'carlos.arruda', 'saulo.coelho', ''),
	(650, 240, 994, 'SAPP - Cadastro de PEA - erros', 2, 0, 0, 'Caros,\r\n\r\nPrecisamos ajustar dois pontos no SAPP em produção:\r\n\r\n1 - O curso Nutrição, em Anápolis, não permite  salvar as informações na 1a aba do PEA, apenas livros e cronograma normalmente. Quando o botão salvar da primeira aba é acionado, o sistema permanece apenas "carregando" idefinidamente ou exibe a mensagem "object error".\r\n\r\n2 - Ao salvar o PEA, aparece a mensagem "Plano de Ensino e Avaliação cadastrado com sucesso!!", quando deveria ser "Plano de Ensino e Aprendizagem cadastrado com sucesso!!" Precisamos corrigir a mensagem.\r\n\r\nPermaneço a disposição para o caso de dúvidas, Ana.', '', '', '2007-06-22 14:33:34', 2, 'anapaula.chiodaro', 'marcelo.luz', ''),
	(651, 262, 1143, 'Cadastro de Usuários - Diversos', 2, 0, 379, '- Quando tem um campo errado preenchido o sistema dá o aviso só que está apagando todo o formulário preenchido, dando muito trabalho para o preenchimento total.\r\n- Campo de CPF tem que permitir o preenchimento com pontuação ou sem, e fazer a validação de CPF correto. Temos um script pronto que faz isso, só ir no CAOL em "Projetos -> Conhecimento -> Consulta", só colocar no campo TAGS a palavra-chave "valida".\r\n- Nos campos Tel. Comercial e Tel. Celular colocar o jscript que passa de campo automaticamente quando digita o DDD. Ex.: Qdo digito 11 no campo DDD ele passa automaticamente para o outro campo. Temos um script pronto que faz isso, só ir no CAOL em "Projetos -> Conhecimento -> Consulta", só colocar no campo TAGS a palavra-chave "auto".\r\n- Não tá salvando os telefones, preenchi normalmente e cliquei no salvar, apareceu a mensagem de cadastro salvo mas quando editei não tinha salvo.\r\n- Quando edito um usuário existente e tento salvar com alguma informação incompleta ele dá mensagem e depois se perde, não podendo preencher as informações faltantes e tentar salvar de novo, pois ele acha que é novo usuário.', '', '', '2007-06-25 23:11:38', 2, 'carlos.arruda', 'ricardo.perez', ''),
	(652, 262, 1143, 'Nova operadora', 2, 0, 380, '- Não está funcionando criar uma nova operadora, dá erro.', '', '', '2007-06-25 23:12:13', 2, 'carlos.arruda', 'gabriel.verta', ''),
	(653, 262, 1143, 'Territórios - Diversos', 2, 0, 381, '- Na opção "Escolha a Operadora" tem a opção "*Novo" que não existe, pode tirar.\r\n- Quando seleciono uma operadora e seleciono a opção NOVO TERRITÓRIO e preencho o campo texto e salvo, o sistema está desmarcando a operadora selecionada, tem que manter preenchida pois muitas vezes queremos fazer o cadastramento de N territórios.', '', '', '2007-06-25 23:13:21', 2, 'carlos.arruda', 'gabriel.verta', ''),
	(654, 262, 1143, 'PDV - Erros diversos', 2, 0, 382, '- O campo CONTATO PRINCIPAL está como campo de telefone, com DDD. Tinha errado isso no protótipo mas já arrumeir, falta arrumar aí no sistema.\r\n- Tem dois campos CUSTCODE, o segundo na realidade é campo de telefone comercial e o outro é de celular.\r\n- Quando tento salvar um novo PDV dá mensagem "Campo(s) de telefone inválido(s)!".\r\n- Quando tento salvar um novo PDV e ainda tem alguma informação pendente o sistema perde as informações de EStados, Cidade e Território.', '', '', '2007-06-25 23:14:53', 2, 'carlos.arruda', 'ricardo.perez', ''),
	(655, 262, 1143, 'Sem setas no menu', 2, 0, 0, '- As setas do menu está faltando.', '', '', '2007-06-25 23:15:45', 2, 'carlos.arruda', 'gabriel.verta', ''),
	(656, 240, 994, 'Diário de Classe - Ajustes', 2, 0, 0, 'Bruno / Rafael,\r\n\r\nTestei o diário de classe (Máquina Rafael) e encontrei os seguintes problemas:\r\n\r\n1 - Se inserido um formato de data inválido, o sistema não fornece um aviso ao usuário. Se este clica no botão "salvar", utilizando um formato inválido no campo "data", o sistema entende como solicitação para abrir mais uma caixinha. Ele salva o conteúdo atual, apaga a data e abre mais uma caixinha de tema.\r\n\r\n2 - Quando selecionada a porcentagem "100%" para um tema e solicitada a ação "Deseja salvar este item e adicionar outro?", um novo drop down de assuntos é aberto, mas o drop com o assunto de 100% some da página. Isto vai deixar o usuário confuso, uma vez que ele não salvou definitivamente o registro da data. Ele provavelmente entenderá que o tema simplesmente sumiu do sistema. \r\n\r\n3 - Quando o usuário inicia o registro pela data, e prossegue imputando as outras informaçoes, ele perde a data registrada toda vez que um tema é salvo com a ação "Deseja salvar este item e adicionar outro?"\r\n\r\nPrecisamos ajustar esses itens ainda hoje e disponibilizar no ambiente de testes para a Prof. Inês, da Anhanguera, pois a reunião acadêmica é na quinta e ainda podemos ter problemas no ambiente de produção.\r\n\r\nAbs, Ana', '', '', '2007-06-26 09:51:13', 2, 'anapaula.chiodaro', 'marcelo.luz', ''),
	(657, 262, 1143, 'Erro Jscript', 2, 0, 383, '- Quando clico na questão tem que liberar para edição, para eu mudar o texto e se salvar alterar a descrição da pergunta. Tá dando erro de jscript.', '', '', '2007-06-26 23:05:49', 2, 'carlos.arruda', 'gabriel.verta', ''),
	(658, 262, 1143, 'Informação em vermelho para informação inativa', 2, 2, 0, '- Nos drop-downs, para os itens que estão inativos, tem que aparecer com o style vermelho. Pra sinalizar o item inativo.', '', '', '2007-06-26 23:08:12', 2, 'carlos.arruda', 'gabriel.verta', ''),
	(659, 262, 1143, 'Valor máximo dos pilares.', 2, 2, 385, 'O sistema não pode permitir que a soma dos pilares seja superior a 100%. \r\nSe dois pilares com valor de 50% estiverem cadastrado, o sistema aceita que um terceiro pilar receba um valor qualquer, inferior a 1%.', '', '', '2007-06-28 15:24:18', 2, 'fernanda.barbosa', 'gabriel.verta', ''),
	(660, 262, 1143, 'Pilares com nomes iguais.', 2, 2, 385, 'O sistema não pode permitir dois pilares cadastrados com o mesmo nome.', '', '', '2007-06-28 15:33:02', 2, 'fernanda.barbosa', 'gabriel.verta', ''),
	(661, 262, 1143, 'Pilares com valor nulo.', 2, 2, 385, 'O sistema não pode permitir que um pilar ativo tenha porcentagem igual a 0%.', '', '', '2007-06-28 15:34:56', 2, 'fernanda.barbosa', 'gabriel.verta', ''),
	(662, 262, 1143, 'Falta de continuidade nos percentuais.', 2, 2, 384, 'O valor de uma próxima classificação deve ser sempre igual ao último valor da classificação anterior acrescido de 1.\r\nEx: class1: de  0%  a  30%\r\n      class2: de  31%  a   60%\r\n      class3: de  61%  a   100%', '', '', '2007-06-28 15:47:30', 2, 'fernanda.barbosa', 'gabriel.verta', ''),
	(663, 262, 1143, 'Qdo seleciono pilar não muda', 2, 1, 383, 'Quando seleciono um outro pilar não dá reload no sistema para re-carregar as questões.', '', '', '2007-06-28 22:33:28', 2, 'carlos.arruda', 'gabriel.verta', ''),
	(664, 262, 1143, 'Duplicidade de CPF', 2, 2, 0, 'O Sistema não pode permitir que duas pessoas sejam cadastradas com o mesmo CPF.', '', '', '2007-06-29 09:09:35', 2, 'fernanda.barbosa', 'ricardo.perez', ''),
	(665, 262, 1143, 'Editar questão', 2, 0, 383, 'O sistema permite apagar uma questão e salvar.', '', '', '2007-06-29 09:43:31', 2, 'fernanda.barbosa', 'gabriel.verta', ''),
	(666, 262, 1143, 'Requisição', 2, 3, 383, 'Sistema não está fazendo requisição quando altera o valor dos combos.', '', '', '2007-06-29 10:04:24', 2, 'fernanda.barbosa', 'gabriel.verta', ''),
	(667, 0, 0, 'Desabilitar combos', 2, 3, 383, 'Quando estiver cadastrando uma nova questão de avaliação, manter os combos desabilitados', '', '', '2007-06-29 15:01:29', 1, 'fernanda.barbosa', 'ricardo.perez', ''),
	(668, 0, 0, 'editar classificação', 2, 1, 384, 'O sistema acusa erro ao tentar editar uma classificação.', '', '', '2007-07-03 10:25:41', 1, 'fernanda.barbosa', 'ricardo.perez', ''),
	(669, 0, 0, 'Cadastro P', 2, 0, 382, 'Sistema não permite visualizar o cadastro do PDV.', '', '', '2007-07-03 10:28:31', 1, 'fernanda.barbosa', 'ricardo.perez', ''),
	(670, 0, 0, 'Cadastro de critérios iguais.', 2, 2, 386, 'O sistema não pode permitir o cadastro de critérios iguais para o mesmo pilar.', '', '', '2007-07-03 10:38:43', 1, 'fernanda.barbosa', 'ricardo.perez', ''),
	(671, 0, 0, 'Duplicidade de territórios', 2, 2, 381, 'O sistema permite cadastrar dois territórios iguais para a mesma operadora.', '', '', '2007-07-03 16:19:08', 1, 'fernanda.barbosa', 'ricardo.perez', ''),
	(672, 0, 0, 'Território único', 2, 2, 381, 'O sistema não pode permitir o cadastro de territórios com o mesmo nome. ', '', '', '2007-07-03 16:25:13', 1, 'fernanda.barbosa', 'ricardo.perez', ''),
	(673, 0, 0, 'Duplicidade de territórios', 2, 1, 381, 'O sistema não pode permitir que uma operadora possua dois territórios cadastrado com o mesmo nome.', '', '', '2007-07-04 11:37:06', 1, 'fernanda.barbosa', 'ricardo.perez', ''),
	(674, 166, 1055, 'Em caso de erro, não conseguimos mudar o estado do sistema', 2, 1, 235, 'Quando os arquivos estão sendo gerados e ocorre um erro, não conseguimos mudar o estado do sistema.\r\n\r\nEx de Erro: Exception in thread "Thread-33" java.lang.RuntimeException: java.io.FileNotFoundException: \\u01\\ftpdata\\sacces\\FAFZGK62.DGKF012D.X0000001 (O sistema não pode encontrar o caminho especificado)\r\n	at br.com.toyota.sacces.output.service.impl.OutPutServiceImpl.createFiles(OutPutServiceImpl.java:225)\r\n	at br.com.toyota.sacces.output.service.impl.OutPutServiceImpl.generateFiles(OutPutServiceImpl.java:159)\r\n	at br.com.toyota.sacces.output.service.impl.OutPutServiceImpl.run(OutPutServiceImpl.java:121)', '', '', '2007-07-06 08:47:49', 2, 'bruno.freitas', 'felipe.correa', ''),
	(675, 166, 1055, 'Erro ao salvar', 2, 2, 387, 'Depois de buscar uma conta contábil e clicar em salvar o sistema apresenta um erro de violação de PK. Parece que o sistema não está entendendo que é um UPDATE e não um INSERT.', '', '', '2007-07-06 08:50:58', 2, 'bruno.freitas', 'felipe.correa', ''),
	(676, 166, 1055, 'Erro ao buscar Grupo CC', 2, 5, 232, 'Passos:\r\n\r\n1 - Clicar em Buscar Grupo - a popup é aberta\r\n2 - Selecionar um Grupo CC na popup de busca\r\n3 - Erro no sistema', '', '', '2007-07-06 09:02:06', 2, 'bruno.freitas', 'felipe.correa', ''),
	(677, 166, 1055, 'Erro js ao executar Alocação Acumulada', 2, 0, 230, 'Ao clicar em executar Alocação acontece um erro js e o sistema não realiza a operação.', '', '', '2007-07-06 09:09:47', 2, 'bruno.freitas', 'felipe.correa', ''),
	(678, 166, 1055, 'Alocacao Acumulada - Erro ao agendar', 2, 0, 230, 'Erro ao clicar no Agendar Alocacao.', '', '', '2007-07-06 09:14:27', 2, 'bruno.freitas', 'felipe.correa', ''),
	(679, 240, 994, 'SAPP -> Registro de Diário de Classe -> PEA', 2, 0, 0, 'Rafael,\r\n\r\nTestando o diário notei que:\r\n\r\n1 - O diário não encontra nenhum PEA cadastrado em 2007/2 e já existem vários consolidados.\r\n\r\n2 - O diário não encontra as PEAs corretas, mesmo que estejam consolidadas. Verificar em produção o exemplo:\r\n\r\nFA4 -> Comunicação Social - Habilitação em Publicidade e Propaganda -> Promoção e Merchandising \r\n\r\nDiário: FA4 -> Prof. Carlos Fernando Bosco -> Comunicação Social - Habilitação em Publicidade e Propaganda -> Promoção e Merchandising - NTN - A\r\n\r\nEm resumo, o diário não encontra suas PEAS correspondentes.\r\n\r\nFavor ajustar. Abs, Ana.\r\n\r\n\r\n', '', '', '2007-07-11 13:14:11', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(680, 240, 994, 'Caonsulta de PEA - pendência 1 - Exportação para Word', 7, 0, 0, 'Rafael,\r\n\r\nFavor desenvover funcionalidade de exportação para o Word.\r\n\r\nAbs, Ana', '', '', '2007-07-13 10:05:43', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(681, 240, 994, 'Consulta de PEA -> Pendeência 2 -> Exportação para PDF', 7, 0, 0, 'Rafael,\r\n\r\nFavor desenvolver funcionalidade de exportação do PEA para PDF.\r\n\r\nAbs, Ana\r\n', '', '', '2007-07-13 10:07:26', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(682, 240, 994, 'Consulta de PEA -> Pendência 3 -> Edição (permissões)', 7, 0, 0, 'Rafel,\r\n\r\nFavor desenvolver funcionalidade de edição, apenas para os tipos de usuários: colaborador do DDE, supervisor de curso e coordenador de curso.\r\n\r\nAbs, Ana', '', '', '2007-07-13 10:09:12', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(683, 126, 1156, 'Destaques (Banner da página Inicial) - Controle das animações', 2, 0, 0, '\r\nSaulo,\r\n\r\nExiste um pequeno problema com os banners (ofertas de imóveis) em destque na página inicial.\r\n\r\nO cliente não consegue ativá-los na administração:\r\n\r\nhttp://201.6.119.176:8020/riscali/cms/adm.php\r\n\r\nPag Inicial -> Destaque -> Visualizar\r\n\r\nQuando os banners são selecionados e clica-se em "salvar" , aparece o erro:\r\n\r\n"You have an error in your SQL syntax; check the manual that corresponds to your MySQL server version for the right syntax to use near \'WHERE destaqueid = 1\' at line 1\r\n\r\nUPDATE tb_destaque SET imovelid = WHERE destaqueid = 1"\r\n\r\nPode me ajudar a verificar o que acontece?', '', '', '2007-07-13 15:03:53', 4, 'anapaula.chiodaro', 'andre.bandera', ''),
	(684, 240, 994, 'Diário de classe em produção', 2, 0, 0, 'Rafael,\r\n\r\nEstamos com problemas em alguns caracteres do Diário de Classe em produção:\r\n\r\nO texto aparece no diário com algumas distorções. Exemplos:\r\n\r\n1 - "Vistas da Avaliação Oficial %u2013 Revisão"\r\n2 - "Noções de Anátomo %u2013 Histologia e Fisiologia do Sistema Tegumentar"\r\n\r\n(Planos de enfermagem da FA4)\r\n\r\nPoderia verificar?\r\n\r\nAbs, Ana\r\n', '', '', '2007-07-17 11:57:23', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(685, 240, 994, 'Diário de Classe - últimos ajustes', 7, 0, 0, 'Oi Rafael,\r\n\r\nDepois de avaliado e aprovado pelos professores, foram solicitados dois ajustes no Diário de Classe.\r\n\r\n1 - Impedir queo professor registre duas vezes a mesma data em semanas diferentes (já que o ele poderá incluir várias caixas de conteúdo na mesma semana).\r\n\r\n2 - Inserir um aviso que alerte o professor caso restem conteúdos não registrados, depois que ele tiver preenchido todas as semanas. Se isso ocorrer, ele poderá justificar no campo das observações.', '', '', '2007-07-18 09:25:37', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(686, 240, 994, 'Cadastro / Consulta de PEA - citação biliográfica', 2, 0, 0, 'Oi Rafael,\r\n\r\nEu e a  prof. Ines acabamos de checar em produção e, no cadastro e consulta de PEA, não aparece editora na citação bilbiográfica da bibliografia complementar.\r\n\r\nPrecisamos ajustar.\r\n\r\nAbs, Ana', '', '', '2007-07-18 16:07:04', 2, 'anapaula.chiodaro', 'rafael.sierra', ''),
	(687, 166, 1056, 'Melhoria no filtro de partes', 5, 0, 241, 'Permitir deixar o campo "Part Number" em branco, para fazer busca como "indiferente" quando na tela abaixo for selecionado "IN HOUSE" apenas.\r\nOBS: Para esse caso, deve ser informado (obrigar) os parametros "Divisao" e "C/C", além dos filtros orbrigatórios atuais.', '', '', '2007-07-19 10:54:03', 2, 'bruno.freitas', 'felipe.correa', ''),
	(688, 240, 994, 'Cadastro de  PEA - Bibliografia / Bibliografia Complementar', 2, 0, 0, 'Caros,\r\n\r\nEm alguns casos, quando incluída a bibliografia de um curso, o sistema inclui, "do nada",  automaticamente, uma outra indicação junto com a realizada pelo usuário.\r\nPrecisamos resolver. Podem me ajudar? Abs, Ana\r\n\r\n\r\n* Casos concretos enviados pelos usuários:\r\n\r\n-> CASO 1- Aba Bibliografia:\r\n\r\nPEA - 2007/1 - FA3 - Tecnologia em Programação de Computadores - Análise Orientada a Objetos\r\n\r\nLivros incluídos: \r\ntexto -  MATOS, A. V., UML - Prático e Descomplicado. Editora Érica. 2002.\r\nsubstituto - MEDEIROS, E. Desenvolvendo software com UML 2.0: definitivo. Pearson Makron Books. São Paulo. 2004.\r\n\r\nLivros que surgiram do nada, depois de clicar em "Incluir Livro":\r\ntexto -  JUNQUEIRA, Luiz Carlos. UML - Prático e Descomplicado. 1.ed. São Paulo: Erica, 2002. \r\nsubstituto - MEDEIROS, Ernani. DESENVOLVENDO SOFTWARE COM UML 2.0 - DEFINITIVO. 1.ed. : Makron Books, 2004. \r\n\r\n-> CASO 2 - Aba Bibliografia Complementar:\r\n\r\nPEA: ano letivo 2007 / 1 -> Pedagogia - matriz 2007 / 1 -> disciplina: Pesquisa e Atividades Dirigidas I \r\n\r\nLivro incluído: \r\ntexto -  GOLDSCHMIDT, Ronaldo. Do Texto ao Texto - Curso Prático de Leitura e Redação. 6.ed. São Paulo, 2001. \r\nunidade: FAI\r\n\r\nLivro que surgiu do nada, depois de clicar em "Incluir Livro":\r\ntexto -  INFANTE, ULISSES. Do Texto ao Texto - Curso Prático de Leitura e Redação. 6.ed. São Paulo, 2001. \r\nunidade: FAI', '', '', '2007-07-19 17:38:58', 2, 'anapaula.chiodaro', 'todos', ''),
	(689, 126, 1156, 'Website Riscali - Erro no upload de imagens dos imóveis', 2, 0, 0, 'André,\r\n\r\nOutro probleminha com a Riscali. Poderia verificar para mim, por favor?\r\nAbs, Ana\r\n\r\n- O cliente tentou inserir uma foto em um imóvel já cadastrado e não obteve êxito. As imagens são inseridas aparentemente com êxito, mas não parecem na tela de exibição dos detalhes do imóvel.\r\n \r\nConsultar exemplo em produção, imóvel ativo de código CA 1777 (as imagens foram inseridas, no entanto não aparecem, e no lugar delas aparece uma imagem transparente com um "X" - elas também na são exibidas no frontend, na tela de apresenáção do imóvel). ', '', '', '2007-07-24 13:33:40', 1, 'anapaula.chiodaro', 'todos', ''),
	(690, 126, 1156, 'Riscali CMS - Criação de Agrupadores', 2, 0, 0, 'André / Saulo,\r\n\r\nA funcionalidade do CMS de criação de agrupadores não está funcionando (CMS -> Conteúdos Riscali -> Utilidades::Agrupadores). \r\n\r\nEu já havia testado isso no servidor de testes e estava funcionando perfeitamente bem.\r\n\r\nPor favor, verifiquem o que está acontecendo com o site, pois, desde o upload, tenho recebido e-mails diários do cliente alertando para funcionalidades com problemas.\r\n\r\nAtenciosamente, Ana', '', '', '2007-07-25 14:08:31', 1, 'anapaula.chiodaro', 'todos', ''),
	(691, 240, 994, 'Aplicação das permissões', 7, 0, 355, 'Rafael,\r\n\r\nPodemos considerar como próximo passo a aplicação das permissões.\r\n\r\nAbs, Ana', '', '', '2007-07-25 14:57:43', 2, 'anapaula.chiodaro', 'todos', ''),
	(692, 126, 1156, 'Fechamento da OS', 7, 1, 0, 'Caros,\r\n\r\nPreciso tratar mais dois pontos pendentes com o cliente para encerrarmos esta OS. São eles:\r\n\r\n1 - Retirar do menu e do website a página "Diferenciais Riscali" (a Riscali -> Diferenciais Riscali).\r\n\r\n2 - O cliente achou que o logo está embaçado. Tratamos esta imagem. Anexei o arquivo em boa resolução enviado pelo cliente.\r\n\r\nAbs, Ana', '', '', '2007-08-01 15:09:23', 1, 'anapaula.chiodaro', 'todos', ''),
	(693, 271, 1167, 'Energia Online - Script para notificação de encerramento de curso', 7, 1, 0, 'Caros,\r\n\r\nO cliente solocitou dois ajustes no script para notificação de encerramento de curso:\r\n\r\n1 - No corpo do e-mail é necessário aparecer também o nome da empresa do treinando, e não somente  o nome do treinando.\r\n\r\n2 - Verificar a possibilidade de ajustar o script pra notificar o enceramento do treinamento em todos os novos cursos e não somente para o curso de NR10.\r\n\r\nQualquer dúvida, estou a disposição. Abs, Ana', '', '', '2007-08-06 11:11:58', 1, 'anapaula.chiodaro', 'gustavo.buquio', ''),
	(694, 126, 1156, 'CMS Riscali -> Imóvel -> Consultar', 2, 0, 0, 'Caros,\r\n\r\nFavor verificar com urgência.\r\n\r\nMesmo depois de parametrizado um corretor para o imóvel, a combo permece mostrando a opção "Não Cadastrado".\r\n\r\nFavor acessar o CMS (CMS Riscali -> Imóvel -> Consultar), realizar uma busca de imóveis selecionando o consultor "Antonio José" e clicar em um dos dois imóveis apresentados.\r\n\r\nSe verificarem a combo que apresenta o nome do corretor parametrizado, notarão que ela apresenta a opção "Não cadastrado".\r\n\r\nIsto acontece para todos os imóveis.\r\n\r\nPermaneço a disposição e aguardo retorno. Abs, Ana', '', '', '2007-08-07 17:23:11', 1, 'anapaula.chiodaro', 'todos', ''),
	(695, 175, 1194, 'Alteração de Unidade de Veículo', 5, 1, 0, 'Implementar nova regra de negócios para alteração de Unidade. A nova regra é a seguinte:\r\n\r\n1) Só permitir alteração Unidade se o veículo estiver fora do pátio.\r\nObs: Essa alteração deve ser feita no Cadastro de Veículo.\r\n\r\n2) Para a Entrada de Veículos considerar Unidade do Veículo e não a Unidade da Solicitação.', '', '', '2007-08-28 17:05:42', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(696, 240, 994, 'PEA - Funcionalidade de Cópia', 7, 0, 0, 'Implementar a funcionalidade de cópia de PEA de acordo com a regra:\r\n\r\n- Manter Curso\r\n- Manter Disciplina\r\n- Utilizar Ano/Semetre Anteriores (Ex: Para 2007/1, carregar PEA de 2006/2).\r\n\r\nEx: PEA - Computação/Calculo 1/2007-1 > Carregar os dados de PEA - Computação/Calculo 1/2006-2', '', '', '2007-08-28 17:15:39', 2, 'bruno.freitas', 'ricardo.perez', ''),
	(697, 166, 1055, 'Erro ao atualizar seção', 2, 1, 200, 'Erro ao editar uma seção (ativo/inativo) e salvar.\r\n\r\n==========\r\n\r\n---- Begin backtrace for Nested Throwables\r\njava.lang.NumberFormatException: For input string: "I"\r\nat java.lang.NumberFormatException.forInputString(NumberFormatException.java:63)\r\nat java.lang.Integer.parseInt(Integer.java:481)\r\nat java.lang.Integer.<init>(Integer.java:654)\r\nat br.com.toyota.sacces.hibernate.dao.DivisionDAOHibernate.findById(DivisionDAOHibernate.java:23)\r\nat br.com.toyota.sacces.hibernate.bo.Section.update(Section.java:150)\r\nat br.com.toyota.sacces.toios.service.impl.SectionServiceImpl.update(SectionServiceImpl.java:77)\r\nat br.com.toyota.sacces.struts.action.CostCenterManagerAction.save(CostCenterManagerAction.java:218)\r\nat sun.reflect.NativeMethodAccessorImpl.invoke0(Native Method)', '', '', '2007-08-29 17:39:10', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(698, 166, 1055, 'Erro na Alocação', 2, 0, 230, 'Erro ao clicar em Executar Alocação. Tela em anexo.', '', '', '2007-08-29 17:41:22', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(699, 166, 1055, 'Erro ao desagendar Importação', 2, 0, 230, 'Erro ao desagendar Importação.', '', '', '2007-08-29 17:59:58', 2, 'bruno.freitas', 'jefferson.silva', ''),
	(700, 240, 1161, 'PEA > Permitir a alteração de status CONSOLIDADO', 7, 0, 0, 'Permitir que os perfis abaixo alterem o status de um PEA, mesmo depois de consolidado.\r\n\r\n- Supervisor do DDE    \r\n- Coordenador do DDE', '', '', '2007-09-11 14:21:41', 2, 'bruno.freitas', 'ricardo.perez', ''),
	(701, 240, 994, 'Implementação Cadastro do PPC', 7, 1, 0, 'Implementação de funcionalidade Cadastro do PPC de acordo com o documento de regras de negócio e protótipo do sistema.', '', '', '2007-09-11 14:22:52', 1, 'bruno.freitas', 'ricardo.perez', ''),
	(702, 240, 1161, 'Parametrização de Disciplinas -> Novas Unidades', 4, 0, 355, 'Olá Ricardo,\r\n\r\nNa tela de parametrização de disciplinas, a busca não está listando as disciplinas das unidades mais recentes da Anhanguera (combos da parte inferior da página). É necessário rever a busca para trazer as disciplinas de todas as unidades corretamente. \r\n\r\nFavor verificar também se o mesmo está acontecendo com a tela de parametrização de cursos.\r\n\r\nPermaneço a disposição em caso de dúvidas.\r\n\r\nAna', '', '', '2007-09-12 12:16:20', 2, 'anapaula.chiodaro', 'todos', ''),
	(703, 240, 1161, 'Consolidar PEA', 7, 0, 0, 'Ricardo,\r\n\r\nPrecisamos alterar o sistema para permitir que os tipos de usuários Colaborador do DDE, Supervisor do DDE e administrador possam consolidar os planos. Eles não tem esta permissão atualmente.\r\n\r\nAbs,\r\n\r\nAna', '', '', '2007-09-17 16:33:57', 2, 'anapaula.chiodaro', 'ricardo.perez', '');
