	(1, 1, 'carlos.arruda', 'O desenvolvimento deve seguir o protótipo aprovado pelo cliente.', '2004-10-29 16:08:57'),
	(2, 2, 'carlos.arruda', 'Alteração/Inclusão nos seguintes módulos:\r\n<p>\r\n- Ordenação por Responsável<br>\r\n- Alteração de Responsável<br>\r\n- Filtro por data > Chamados Aberto e andamento<br>\r\n- Busca no. chamado > Rastreamento de chamados<br>', '2004-10-29 18:02:08'),
	(3, 1, 'rui.hayashi', 'teste de comentário', '2004-11-03 15:50:56'),
	(4, 1, 'carlos.arruda@agence.com.br', 'teste de comentário do cliente', '2004-11-05 12:16:28'),
	(5, 1, 'carlos.arruda', 'Teste de comentário pelo usuário consultor.\r\nE apresentando ENTERs normais.\r\n\r\nAtt.;\r\nCarlos', '2004-11-05 14:25:32'),
	(6, 1, 'carlos.arruda', 'Por favor agora inseri dados com enter através do usuário do cliente.\r\n\r\nQualquer dúvida avisem.\r\nAtt.;\r\nSpirit', '2004-11-05 14:31:15'),
	(7, 1, 'spirit_nasa@hotmail.com', 'Entrei agora, novamente, com dados com enter através do usuário do cliente. \r\n\r\nQualquer dúvida avisem. \r\nAtt.; \r\nSpirit', '2004-11-05 14:32:47'),
	(8, 3, 'luis.morales', 'qweqweqweqew', '2004-11-10 15:10:37'),
	(9, 5, 'gustavo.gomes', 'Precisamos da entrega dessa OS no máximo nesse dia 15.', '2004-11-12 14:41:07'),
	(10, 5, 'gustavo.gomes', 'Precisamos disso pro dia 15 sem falta!\r\n\r\nAtt.;\r\nArruda', '2004-11-12 14:50:49'),
	(11, 6, 'gustavo.gomes', ' kjhjsddhajh jkhcjh hjchjks hj h jh jchjh jhj sjhjh jkh', '2004-11-12 18:08:57'),
	(12, 4, 'carlos.arruda', 'Esse sistema nao tem data de solicitacao?\r\nAguardo que adicionem a data d esolicitaocao.\r\n\r\nAtt.;\r\nCliente SA', '2004-11-16 11:05:42'),
	(13, 4, 'carlos.arruda', 'observacao adicionada pelo cadastro de OS do CAOL', '2004-11-16 11:17:44'),
	(14, 4, 'carlos.arruda', 'Teste de mensagem publicada para todos os envolvidos.\r\n\r\nQualquer dúvida ainda falar com Alexandre.\r\nAtt.;\r\nSetor de Cobrançca.', '2004-11-16 16:32:25'),
	(15, 4, 'carlos.arruda', 'Novo teste por caiusa do proeblkema de ter aparecido..\r\n\r\nQualquer dúvida ainda falar com Alexandre. \r\nAtt.; \r\nSetor de Cobrançca. ', '2004-11-16 16:36:03'),
	(16, 4, 'arruda_carlos1@hotmail.com', 'teste de mensagem ´publçicada por mim, usuario de acompanhamento.\r\n\r\nRespondam por favor.\r\nAbrs.\r\nArruda Carlos1.', '2004-11-16 17:02:50'),
	(17, 4, 'carlos.arruda', '+ Um teste de atualizacao com email auytomatico.\r\n\r\nQualquer problema ainda.\r\nAvisar.\r\n[]s\r\nCarlos Arruda', '2004-11-16 17:30:36'),
	(18, 4, 'arruda_carlos1@hotmail.com', 'Comentario adicionado pelo usuario de acompanhmento.\r\n\r\nAbrs.\r\narruda', '2004-11-16 17:33:40'),
	(19, 8, 'teste.usuario', 'Desenvolvimento de algumas funcionalidades no COL para que o atendente/consultor consiga vincular o serviço de intra-grupo de forma especifica para cada cenário.', '2004-11-16 19:05:05'),
	(20, 12, 'carlos.arruda', 'Permitir que os novos Planos Tempo, Equipe e Zero possam realizar a ativação do serviço INTRA-REDE unidirecional e bidirecional (total e parcial) no sistema COL.', '2004-11-16 19:12:49'),
	(21, 3, 'carlos.arruda', '- Item "Cadastro de OS": (Ex.: Sistema web "CAOL" e OS "Novo cadastro de OS")\r\n	- Imagens quebradas (sinal de - e o sinal de excluir anexo)\r\n	- O sistema nao esta conseguindo fazer o upload do anexo.\r\n	- Quando clico no anexo nao abre.\r\n	- Quando tiver já um e-mail de acompanhamento cadastrado deixá-lo num campo texto disable, sem permitir alterações no e-mail, somente na senha.\r\n	\r\n- Item consulta "Acompanhamento de Sistema":\r\n	- Mais de 2 itens dá pau no pisca-pisca\r\n	- Quando entro no detalhe da OS o DR do analista fica logo abaixo do analista anterior, dar um br para dar espaco.\r\n	\r\n- Item consulta "Horas Trabalhadas - Por usuarios"\r\n	- Quando explodo o dia do analista para ver o DR ele está aparecendo em 100% de largura, tem q ser 98% centralizado.\r\n\r\n\r\n- Item "Pop de acompanhamento de sistema - Visao Cliente (Web Site)"\r\n	- Quando entro no modo ingles o sistema tá validando no lugar errado. Testar com carlos.arruda@agence.or2.net e senha raposa, em port entra normal, em ingles nao entra.\r\n\r\n- Problemas de seguranca geral, posso colocar o endereco diretamente no browser (http://www.agence.com.br/caol/consulta_acompanhamento_sis.php) que eu entro sem restricao nenhuma.', '2004-11-17 15:48:16'),
	(22, 3, 'arruda_carlos1@hotmail.com', 'Segue observações em ordem de prioridade:\r\n\r\n** Item "Pop de acompanhamento de sistema - Visao Cliente (Web Site)" \r\n- Quando logo como cliente (arruda_carlos1@hotmail.com e senha raposa) o sistema está apresentando o menu de opcoes do sistema permitindo a entrada em páginas restritas.\r\n- Quando entro no modo ingles o sistema está apresentando páginas como DR da fase e OS em portugues, tem que ter a versao ingles tb.\r\n\r\n** Problemas de seguranca geral, posso colocar o endereco diretamente no browser (http://www.agence.com.br/caol/consulta_acompanhamento_sis.php) que eu entro sem restricao nenhuma.\r\n\r\n** Item consulta "Acompanhamento de Sistema": \r\n- Mais de 2 itens dá pau no pisca-pisca \r\n\r\n** Item "Cadastro de OS": (Ex.: Sistema web "CAOL" e OS "Novo cadastro de OS") \r\n- Quando tiver já um e-mail de acompanhamento cadastrado deixá-lo num campo texto disable, sem permitir alterações no e-mail, somente na senha. ', '2004-11-18 12:27:52'),
	(23, 3, 'arruda_carlos1@hotmail.com', '** Item "Pop de acompanhamento de sistema - Visao Cliente (Web Site)" \r\n- Quando logo como cliente (arruda_carlos1@hotmail.com e senha raposa) o sistema está apresentando o menu de opcoes do sistema permitindo a entrada em páginas restritas.\r\n- Quando entro no modo ingles o sistema está apresentando páginas como DR da fase e OS em portugues, tem que ter a versao ingles tb.\r\n\r\n** Item e-mail que chega com alteracoes do CAOL\r\n- Quando atualizo a OS atraves da pop de acompanhamento, ou seja, pelo cliente, o e-mail tem q chegar com o remetente do e-mail do cliente, tá chegando somente "CAOL - ".\r\n\r\n** Problemas de seguranca geral, posso colocar o endereco diretamente no browser (http://www.agence.com.br/caol/consulta_acompanhamento_sis.php) que eu entro sem restricao nenhuma.\r\n\r\n** Item consulta "Acompanhamento de Sistema": \r\n- Mais de 2 itens dá pau no pisca-pisca \r\n\r\n** Item "Cadastro de OS": (Ex.: Sistema web "CAOL" e OS "Novo cadastro de OS") \r\n- Quando tiver já um e-mail de acompanhamento cadastrado deixá-lo num campo texto disable, sem permitir alterações no e-mail, somente na senha. ', '2004-11-18 12:34:22'),
	(24, 3, 'arruda_carlos1@hotmail.com', '** Item e-mail que chega com alteracoes do CAOL \r\n- Quando chegar o e-mail para os usuarios envolvidos devido alteracoes na OS a última OBS publicada deve ir com a fonte na cor preta, veja bem, vao todas as obs mas somente a mais recente que vai com a cor preta, para dar destaque pra ultima atualizacao.', '2004-11-18 13:56:02'),
	(25, 3, 'carlos.arruda@agence.or2.net', '** Item e-mail que chega com alteracoes do CAOL \r\n- Quando chegar o e-mail para os usuarios envolvidos devido alteracoes na OS o campo "Analistas Envolvidos" vem com um 0 apenas, sem o nome dos analistas.\r\n', '2004-11-18 18:37:52'),
	(26, 3, 'carlos.arruda', 'Segue os ajustes em ordem de prioridade, aí estão todos de uma vez.\r\n\r\n** Item consulta "Acompanhamento de Sistema": \r\n- Mais de 2 itens dá pau no pisca-pisca \r\n\r\n\r\n** Item "Cadastro de OS": (Ex.: Sistema web "CAOL" e OS "Novo cadastro de OS") \r\n- Quando tiver já um e-mail de acompanhamento cadastrado deixá-lo num campo texto read-only, sem permitir alterações no e-mail, nem na senha. \r\n\r\n\r\n** Item "Pop de acompanhamento de sistema - Visao Cliente (Web Site)" \r\n- Na versao em portugues/ingles quando tento adicionar um comentário o sistema nao faz nada, como se o botao nao tivesse action alguma.\r\n\r\n\r\n** Item e-mail que chega com alteracoes do CAOL \r\n- Quando atualizo a OS atraves da pop de acompanhamento, ou seja, pelo cliente, o e-mail tem q chegar com o remetente do e-mail do cliente, tá chegando somente "CAOL - ". \r\n\r\n- Quando chegar o e-mail para os usuarios envolvidos devido alteracoes na OS a última OBS publicada deve ir com a fonte na cor preta, veja bem, vao todas as obs mas somente a mais recente que vai com a cor preta, para dar destaque pra ultima atualizacao. Testei e tá ficando com fonte preta mas só no sistema, nos emails ainda está do mesmo jeito.\r\nDeixar tb os titulos "Por arruda_carlos1@hotmail.com, 18/11/2004 às 12:34:22" em negrito, <b>bold</b>.\r\n\r\n- Quando chegar o e-mail para os usuarios envolvidos devido alteracoes na OS o campo "Analistas Envolvidos" vem com um 0 apenas, sem o nome dos analistas. \r\n\r\n\r\n** Item "Pop de acompanhamento de sistema - Visao Cliente (Web Site)" \r\n- Quando entro no modo ingles o sistema está apresentando a troca de senha em portugues, tem que ter a versao ingles tb. Nas fases do deadline e nas labels (Horas / Envolvidos / Total de horas) tb tá em portugues.', '2004-11-18 19:04:23'),
	(27, 39, 'gustavo.gomes', 'Desfazer o conciliamento do alvará no valor de 3006,85, do processo 275/2004, da comarca de Cuiabá/17th Vara Civel, por solicitação da Sra Aifa.', '2004-11-19 19:30:45'),
	(28, 3, 'luis.morales', 'teste', '2004-11-22 10:30:23'),
	(29, 3, 'arruda_carlos1@hotmail.com', 'teste de comentário', '2004-11-22 15:27:40'),
	(30, 41, 'carlos.arruda', '** TELA INICIAL\r\n\r\n- Quando eu clico na seta de busca no campo de cliente o sistema tem que ordenar por nome e não por ordem de entrada como está hoje.\r\n- Colocar contador (jscript enviado em anexo) em todo o site do tempo de timeout de forma sinalizar o usuário do tempo restante, e tentar aumentar esse tempo no servidor para 5 minutos.\r\n- No detalhes do cliente adicionar no grupo "Contatos" uma linha com o e-mail do cliente.\r\n- Na combo com os clientes cadastrados deve apresentar entre parênteses o nome do usuário que cadastrou esse cliente.\r\n- No detalhes do cliente adicionar no topo ao lado do cliente entre parenteses o nome do usuário que cadastrou esse cliente.\r\n\r\n\r\n** TELA INICIAL -> ADMINISTRAÇÃO -> CADASTRO DE CLIENTE \r\n\r\n* (Aba Contato)\r\n- Em "Observações" fazer o cálculo de ano (Contato com 34 anos e com 2 anos e 2 meses na função).\r\n\r\n* (Aba Diretoria)\r\n- Alterar posição das informações para o protótipo seguinte (http://www.agence.com.br/clientes/toyota/2know/adm_cad_cliente_aba3.htm). Tanto na visão de usuário interno como na visão do cliente (Acessado pelo convite e-mail).\r\n\r\n* (Aba Frota)\r\n- Trocar o a label "Registro" por "Observação"\r\n\r\n* (Aba Compra)\r\n- Em participantes quando há 2 contatos iguais o sistema nao está deixando salvar, emite a mensagem "contato duplicado" quando na realidade tem que poder. Um contato pode fazer parte do processo de compra na sequencia 1 e depois na sequencia 3.\r\n- O sistema tem que ordenar dentro desse bloco "participantes" por ordem de sequencia.\r\n\r\n* (Aba Administracao da Frota)\r\n- Nas combos "manutencao" e "servico rapido" tem 1 item chamado "por conta do usuario", retirar do banco de dados essa opcao.\r\n\r\n\r\n** TELA INICIAL -> CONSULTAS -> ESTRATÉGICA\r\n\r\n* (Aba Parametros)\r\n- Toda vez que eu entrar guardar em cookie ou outra forma os parâmetros da última consulta, facilitando para o usuário a não precisar marcar mais quais colunas quer apresentar etc.\r\n- Adicionar o filtro "Cadastrado pelo usuário".\r\n\r\n* (Aba Relatorio)\r\n- Abrir em pop-up os detalhes do cliente de modo conseguir colocar o esquema de ordenacao de pagina que nem tem no consulta agendamento.\r\n\r\n* (Aba E-mail MKT)\r\n- Alterar forma de apresentação do "seu email" e "nome", agora será um unico campo e em drop-down (http://www.agence.com.br/clientes/toyota/2know/cons_estrategica_emailmkt.htm).\r\n\r\n\r\n** TELA INICIAL -> ADMINISTRAÇÃO -> CADASTRO DE E-MAILS (E-MAIL MKT)\r\n\r\n- http://www.agence.com.br/clientes/toyota/2know/adm_cad_email_mkt.htm\r\n\r\n\r\n** TELA INICIAL -> ADMINISTRAÇÃO -> CADASTRO DE MARCAS E MODELOS\r\n\r\n- Adicionar um check de ativo para modelos trazendo como default marcado para novos modelos  (http://www.agence.com.br/clientes/toyota/2know/adm_cad_marca_modelo_novo.htm)', '2004-11-22 16:07:22'),
