	(46, 3, 'carlos.arruda', '** Item "Encerrar jornada analista"\r\n- No encerramento com preenchimento do DR, programar o sistema para que a partir da alteracao do status de todas as fases válidas para a OS para "Desenvolvimento concluido" passe automaticamente o status da OS tb para "Desenvolvimento concluido". \r\n', '2004-11-23 14:05:36'),
	(47, 48, 'marco.malaquias', 'Quando o login do usuário está expirado, o aplicativo direciona o usuário para a página de alteração de senha.                            Ao tentar efetuar a alteração da senha, o aplicativo fica informando a toda tentativa que a senha atual está incorreta, sendo que a senha foi a mesma utilizada na página anterior.                            Verificar o que está ocorrendo.', '2004-11-24 16:57:27'),
	(48, 51, 'marco.malaquias', 'Venda dos aparelhos Samsung Ligth ao preço de R$ 99,00 (Noventa e nove reais) para Pós-Pago para os planos acima VIVO pós 55 minutos- Para o pré-pago, não há impacto sistêmico- Clientes pessoa física, que realizarem altas ou trocas de aparelhos.- Período de Adesão a Promoção: 20/11 à 04/12 (Possível prorrogação)- Somente poderão participar desta promoção os novos clientes pós-pagos/pré-pago, ou os clientes pós-pagos/pré-pago, atuais que queiram trocar de celular mediante aquisição de novo aparelho, desde que habilitados em um dos planos participantes da promoção. - Cada cliente terá direito a somente 1 (um) aparelho habilitado. O controle destas habilitações deverá ser feita pelo CPF do cliente. Em nenhuma hipótese poderá ser vendido mais de um aparelho para um mesmo CPF como titular da linha nesta promoção.', '2004-11-24 18:37:59'),
