	(53, 41, 'carlos.arruda', 'Rui,\r\n\r\nVerifiquei todos os itens, todos estão ok com exceção da listagem abaixo:\r\n\r\n** TELA INICIAL \r\n\r\n- No detalhes do cliente adicionar no grupo "Contatos" uma linha com o e-mail do cliente. \r\n- No detalhes do cliente adicionar no topo ao lado do cliente entre parenteses o nome do usuário que cadastrou esse cliente. \r\n\r\nR: Nao deu pra verificar. Quando seleciono empresa para aparecer os detalhes do cliente dá o seguinte erro: "[ServletException in:/customerData.jsp] An error occurred while evaluating custom action attribute "value" with value "${mainContact.workingSinceMonths}": Unable to find a value for "workingSinceMonths" in object of class "br.com.agence.prime2know.hibernate.bo.Contact" using operator "."\' "\r\n\r\n\r\n** TELA INICIAL -> ADMINISTRAÇÃO -> CADASTRO DE CLIENTE \r\n\r\n* (Aba Contato)\r\n- Aonde está o texto "Deseja assinatura da One Aim (Revista da Equipe Toyota Fórmula 1)?" alterar para "Deseja receber como cortesia a One Aim (Revista da Equipe Toyota Fórmula 1)?"\r\n\r\n\r\n* (Aba Diretoria) \r\n- Aonde está o texto "Deseja assinatura da One Aim (Revista da Equipe Toyota Fórmula 1)?" alterar para "Deseja receber como cortesia a One Aim (Revista da Equipe Toyota Fórmula 1)?"\r\n- Adicionar opção para o usuário entrar com o ramal do diretor e da secretária no campo telefone. Que nem tem em contato.\r\n\r\n\r\n** TELA INICIAL -> CONSULTAS -> ESTRATÉGICA \r\n\r\n* (Aba Parametros) \r\n- Toda vez que eu entrar guardar em cookie ou outra forma os parâmetros da última consulta, facilitando para o usuário a não precisar marcar mais quais colunas quer apresentar etc. \r\n\r\n* (Aba Relatorio) \r\n- Quando tento mover uma coluna de um lado pro outro dá pau, nao tá conseguindo fazer. Esse esquema acontece por causa de espaço entre as tags de html, normalmente nao pode ter nada. Se ficar muito chato de mexer com isso larga mão.\r\n\r\n\r\n** TELA INICIAL -> ADMINISTRAÇÃO -> CADASTRO DE E-MAILS (E-MAIL MKT) \r\n\r\n- Tem que deixar a tabela com 98% centralizada, ela tá colando nas laterais do browser.', '2004-11-24 20:43:25'),
