	(60, 55, 'marco.malaquias', 'Os usuários estão sem acesso à segunda via de conta no Vivo Empresas.', '2004-11-25 19:02:48'),
	(61, 63, 'carlos.arruda', 'No CMS o campo "título da pop-up" não está funcionando, pode até estar salvando no banco mas quando o usuário visita o site o title da pop-up tá fixo com o nome "título".', '2004-12-01 14:43:12'),
	(62, 63, 'victor.rades', 'Problema resolvido.', '2004-12-01 15:40:27'),
	(63, 67, 'marco.malaquias', 'Lançar em todas as regionais vivo, um plano promocional de valor nacional com pacotes de minutos adaptados a cada regional. (vivo pós turbinado)', '2004-12-01 16:51:51'),
	(64, 77, 'victor.rades', 'Informações para gerar boleto compatível com o banco HSBC', '2004-12-03 17:30:51'),
	(65, 78, 'marco.malaquias', 'Que a comercialização deste pacote seja válida apenas para novas altas/trocas de aparelhos com compra de novo aparelho, e migrações de pré-pago para pós-pago (Pessoa Física), em um dos planos participantes. Além disso, que sejam válidas apenas para as habilitações avulsas de pós e, no caso de migração pré-pós, com compra de aparelho.', '2004-12-03 18:54:21'),
	(66, 81, 'marco.malaquias', 'Descrição Breve\r\n\r\nP&S - 1) Ajuste da solução implementada para o ¿Projeto Planos de Retenção¿ para inclusão do novo Plano 15 (XX - VIVO 15 MINUTOS ¿ RET).\r\n2) Item descrito no documento.', '2004-12-06 17:59:20'),
	(67, 91, 'marco.malaquias', 'Problemas nas habilitações dos novos planos, TURBINADO.	A string de serviços está indo com um serviço duplicado, select * from ativa_cliente_fila    where CO_SITUACAO = 1310724 and IN_PROCESSADO = \'N\'1728#1#1,1728#1#2,1728#1#4,1728#1#6,1728#1#7,1728#1#8,1728#1#9,1728#1#10,1728#1#11,1728#1#12,1728#1#13,1728#12#19,1728#1#28,1728#1#29,1728#1#64,1728#1#66,1728#7#78,1728#7#81,1728#3#57,1728#12#3,1728#12#19,1728#14#5,1728#83#162,1728#83#63,1728#3#154,1728#3#155,/	Peço que me procure para verificarmos e corrigir este problema. Estamos com 29 habilitações pendentes.', '2004-12-08 16:54:15'),
	(68, 95, 'luciano.silva', 'Já trabalhamos bastante nesse problema. Entretanto, só nos foi aberta OS hoje.\r\nAssim, estamos colocando as horas do dia de hoje. Mas, também, deixando observação que a mesma se relaciona à horas cadastradas em outra OS (521).', '2004-12-08 18:28:23'),
	(69, 96, 'rui.hayashi', '- Login "Multi-Empresa" para contatos relacionados a mais de um cliente\r\n- Lembrete de atividades (Agenda Consultor)\r\n- Aviso (e-mail) de que o cliente desmarcou lembrete de preenchimento de cadastro', '2004-12-09 10:39:53'),
	(70, 127, 'gustavo.gomes', 'Aguardando autorização para desenvolvimento', '2004-12-29 18:43:12'),
	(71, 128, 'victor.rades', 'Ao cadastrar ou alterar uma OS, caso o campo hora/analista tivesse mais que dois caracteres, somente um era exibido no e-mail.\r\nExemplo:\r\nEm um projeto com tempo de análise previsto para 32 horas, somente o número 3 era exibido no e-mail.', '2004-12-29 18:49:09'),
