	(77, 155, 'carlos.arruda', 'Temos três propostas de layout para apreciação dos srs. \r\nEstão nos seguintes links: \r\n\r\nhttp://www.agence.com.br/propostas/portalsul/index.htm\r\nhttp://www.agence.com.br/propostas/portalsul/index2.htm\r\nhttp://www.agence.com.br/propostas/portalsul/index3.htm\r\n\r\nAguardamos as impressões dos srs para dar continuidade ao processo. \r\nAtt.;\r\nCarlos', '2005-01-13 17:08:02'),
	(78, 156, 'nivaldo.junior', 'A promoção incentivo ao 15 já está em produção com término previsto para 31/12/2004. Foi desenvolvida uma funcionalidade do save team para COL DCR 584 com algumas restrições', '2005-01-13 17:25:37'),
	(79, 169, 'jesliel.rocha', 'Por nao ter conhecimento em Perl, o Daniel esta colaborando.', '2005-01-21 17:49:28'),
	(80, 171, 'victor.rades', 'Problemas ao editar um custo, aparentemente o valor é deletado.\r\nRevisar formato de exibição dos valores.', '2005-01-24 17:15:01'),
	(81, 175, 'jesliel.rocha', 'OS em status de suporte. Houve retorno pra accenture devido a documentacao estar confusa. A Accenture ja retornou pra vivo.', '2005-01-26 17:56:40'),
	(82, 179, 'nivaldo.junior', 'Criação do banco de dados e pagina php de inserção dos dados.', '2005-01-26 18:54:01'),
