	(86, 188, 'nivaldo.junior', 'Criação do Módulo de resgate de bônus  ', '2005-02-04 17:54:11'),
	(87, 155, 'carlos.arruda', 'Segue nova proposta de layout, ficando agora 4 opções:\r\n\r\nhttp://www.agence.com.br/propostas/portalsul/index4.htm\r\n\r\nAguardamos as impressões dos srs para dar continuidade ao processo. \r\nAtt.; \r\nCarlos', '2005-02-11 12:18:05'),
	(88, 200, 'carlos.arruda', '- Na página de detalhes do imóvel (resultado_busca_detalhes.php) apresentar o código DBF ao invés do código web, caso o imóvel não tenha um código DBF daí sim apresentar o código Web, mas em segunda opção.\r\n\r\n \r\n\r\n- Criar no CMS uma página de consulta imóveis sem código DBF, listando os imóveis sem cod. DBF por ordem de entrada (do mais recente para o mais antigo), essa listagem tem que ser clicável, ou seja, o usuário pode clicar num imóvel específico abrindo os detalhes dele. Essa listagem tem que ter paginação, apresentar de 10 e 10.', '2005-02-15 13:29:28'),
	(89, 204, 'nivaldo.junior', 'Atualização de informçaões da empresa como telefone, fax etc na página em inglês.  Criação da página de Regulamento de Fundo, Prospecto de Fundo e Relatórios de Fundo todos gerenciavéis pelo CMS. Exibição dos Fundos que serão cadastrados pelo CMS na HOME, quando clicados abrem uma tela de filtros para exibir em outra tela ralatório de variação do valor desses fundos.\r\n', '2005-02-16 18:09:22'),
	(90, 208, 'carlos.arruda', '- Alteração no sistema de contagem de tempo dos chamados para ignorar fins de semana e feriados (cadastrados pelo usuário)\r\n- Possibilidade de anexar arquivos após a abertura do chamado.\r\n- Adição dos filtros por responsável, por período e por status no Rastreamento de Chamado\r\n- Inclusão de filtro por especialidade no relatório de estatítisca de chamados', '2005-02-17 22:35:30'),
	(91, 226, 'carlos.arruda', 'Detalhes das funcionalidades do sistema será entregue em mão pois o cliente só tinha impresso.', '2005-02-23 13:08:25'),
	(92, 1, 'carlos.arruda', '** Em CADASTROS -> VEÍCULOS \r\n\r\n- Quando for selecionado o tipo de frota "designado" deverá aparecer 2 novos objetos:\r\n	- Check. Para ser marcado caso o usuário deseje receber alertas via e-mail. Nesse e-mail conterá um campo solicitando o preenchimento da kilometragem atual do veículo que ele está utilizando.\r\n	\r\n	- Campo texto. Para ser preenchido com qual frequencia o usuário deseja receber o alerta. Nesse campo ele indicará de quantos e quantos meses o sistema enviará o alerta.\r\n\r\n- Serão enviados no máximo 3 e-mails para o usuário, 1 por semana. Obviamente só será enviado o seguinte caso o usuário não se manifeste da forma esperada. O primeiro e o segundo e-mail só serão enviados para ele, já o terceiro será enviado para ele e para o administrador do sistema da unidade onde se encontra cadastrado o veículo.\r\n\r\n\r\n** Em SERVIÇOS -> SOLICITAÇÃO DE VEÍCULO \r\n\r\n- Os veículos pertencentes da frota "Comum" serão enxergados e solicitados por todos os usuários.\r\n- O sistema somente apresentará os veículos cadastrados na mesma "Unidade da Empresa" do usuário.\r\n- Os usuários pertencentes a frota "Comum" deverão responder "SIM" a pergunta "Vai haver transporte de carga?" para que apareça os veículos da divisão Hilux.\r\n- Em "Disponíveis" os veículos que pertencerem a frota "Comum" será apresentado somente o último número da placa. Os veículos que pertencerem a frota em que o usuário está cadastrado aparecerá entre parênteses o modelo do veículo também.\r\n\r\n\r\n** SERVIÇOS -> AUTORIZAÇÃO DE VEÍCULO \r\n\r\n- Somente listará os veículos cadastrados na mesma "Unidade da Empresa" do usuário.', '2005-02-24 21:12:12'),
