	(109, 283, 'carlos.arruda', 'A penhora tem a finalidade de impedir que seja feita liberação para seqüências penhoradas.\r\n\r\nNa tela de solicitação de liberação, após o usuário selecionar uma seqüência de uma determinada subconta, se a seqüência estiver penhorada, o juiz deverá receber uma mensagem dizendo que a liberação não pode ser feita porque a seqüência selecionada está penhorada, e o sistema deve impedir a solicitação da liberação. Já existe uma validação semelhante, relativa a subcontas canceladas. Hoje o sistema faz uma validação que impede que sejam feitas solicitações de liberação para subcontas canceladas.\r\n\r\nSerá necessário uma interface para que o usuário penhore e “despenhore” uma seqüência de uma subconta.\r\n\r\nÉ necessário armazenar o histórico, com início e o término e usuário responsável por cada penhor.\r\n\r\nApenas usuários administradores devem ter acesso a esta funcionalidade.\r\n\r\n- Alteração de dados de liberações.\r\n- Adicionar no relatório consolidado de saldo por comarcas a coluna com o ano do processo e o tipo de procedimento.', '2005-03-23 16:33:29'),
