	(116, 295, 'guimas@targetsis.com.br', 'Segue a crítica à primeira proposta de layout do site Target:\r\n\r\nHOME:\r\n\r\n- No topo, o fundo do retângulo onde está o slogan está muito poluído, com aqueles círculos cinzas; favor trocar por algo mais limpo\r\n\r\n- Ainda neste retângulo, ao invés da foto da mulher de telemarketing, seria melhor colocar uma foto relativa a distribuição, como um depósito moderno por exemplo.\r\n\r\n- O box ‘Produto’ está muito bom, porém tem que ficar mais para cima: favor inveter sua posição com a do box ‘notícias’\r\n\r\n- Na lateral direita, as barras azul-escura e azul-clara (onde tem um pequeno link para a Home) não agradaram; preferimos que o conteúdo do site vá até encostar-se ao lado direito, removendo estes recortes\r\n\r\n- Acertar o alinhamento inferior do box de acesso ao TOL com o box ‘A Empresa’ (sobrou um degrauzinho ali)\r\n\r\n- No menu, todos os links estão com letra minúscula, porém o ‘Junte-se a nós’ está com maiúscula; favor padronizar\r\n\r\n- A barra azul que exibe a DATA está muito larga, o que faz com que o conteúdo importante acabe descendo um pouco, desnecessariamente\r\n\r\nPÁGINA INTERNA:\r\n\r\n- Fazer as mesmas alterações acima. Fora isso, está muito boa.', '2005-04-01 09:56:36'),
	(117, 295, 'contato', 'seguindo as considerações levantadas segue o novo layout\r\nhttp://www.agence.com.br/propostas/target', '2005-04-01 16:19:09'),
	(118, 295, 'guimas@targetsis.com.br', 'Ficou muito boa a atualização.\r\nApenas um ponto não foi alterado:\r\n- A barra azul que exibe a DATA está muito larga, o que faz com que o conteúdo importante acabe descendo um pouco, desnecessariamente.\r\nQueria somar outra coisa nisso:\r\n- Aquela barrinha azul no topo do site, acima do logo e do slogan, deu uma harmonizada, mas tb gostaria que fosse mais estreita, digamos 1/3 do tamanho atual.\r\nApós estas alterações, passarei pelo crivo do Rafael (Target).\r\n', '2005-04-01 16:36:17'),
	(119, 295, 'guimas@targetsis.com.br', 'Uma outra alteração:\r\n\r\n- Mudar o nome do box "ACESSO AO TOL" para "ÁREA DO CLIENTE".\r\n\r\n- Dentro deste box, mudar o texto para "Entre com seu login e senha para acessar o TOL"', '2005-04-01 17:01:12'),
	(120, 295, 'contato', 'Feita as alterações...\r\nwww.agence.com.br/propostas/target\r\n\r\nabs.', '2005-04-01 18:50:44'),
	(121, 295, 'guimas@targetsis.com.br', 'Foram enviadas ao Nixon novas fotos para o site. Abaixo indicarei onde deve ficar cada uma delas:\r\n\r\nPÁGINA         /        LOCAL      /         FOTO\r\n\r\nHOME            /       TOPO        /        22237826\r\nEMPRESA      /       TOPO        /        22218663\r\nPROD/SERV. /       TOPO        /        22325914\r\nCLIENTES      /       TOPO        /        22178956\r\nFALE C/ TGT  /       TOPO        /        22237828\r\nJUNTE-SE      /       TOPO        /        22203947\r\n\r\nHOME         /  BOX \'EMPRESA\' /        22537116\r\n\r\nAlém disso, o slogan que aparece no TOPO também irá variar de página para página.\r\nAmanhã enviarei o slogan que deve ir em cada uma delas.\r\n\r\nUma pequena alteração na HOME:\r\nMudar o título do box \'ULTIMAS NOTICIAS\' para \'NOTICIAS\' (tirar o \'últimas\')', '2005-04-05 16:56:50'),
	(122, 306, 'nivaldo.junior', 'Disponibilizar o plano 180 minutos para clientes pós-pagos, pessoa física, clientes que realizarem altas ou trocas de aparelhos.', '2005-04-05 17:58:38'),
	(123, 295, 'guimas@targetsis.com.br', 'Bom dia, seguem os slogans que devem ficar no TOPO de cada página do site:\r\n\r\nPÁGINA / SLOGAN\r\n\r\nHOME: "TECNOLOGIA DA INFORMAÇÃO APLICADA AO DISTRIBUIDOR"\r\n\r\nEMPRESA: "DISTRIBUIR PRODUTOS, MULTIPLICAR VALORES"\r\n\r\nPRODUTOS E SERVICOS: "MOINHO: ÁGIL, PRECISO E OBJETIVO, COMO DEVE SER O DISTRIBUIDOR"\r\n\r\nCLIENTES: "SOFTWARES DESENVOLVIDOS POR QUEM VIVE DISTRIBUIÇÃO"\r\n\r\nFALE COM A TARGET: "A EFICÁCIA DA SUA EMPRESA É O NOSSO ALVO"\r\n\r\nJUNTE-SE A NÓS: "A MELHOR TECNOLOGIA E A MELHOR EQUIPE FOCADOS EM DISTRIBUIÇÃO"\r\n', '2005-04-06 10:09:48'),
	(124, 312, 'nivaldo.junior', 'Disponibilizar o plano vivo 180 minutos .', '2005-04-06 18:39:21'),
	(125, 295, 'guimas@targetsis.com.br', 'A proposta de layout tá aprovada. Podem seguir com a construção do site e CMS.\r\n', '2005-04-07 08:56:51'),
	(126, 295, 'guimas@targetsis.com.br', 'Apenas atentem para o seguinte detalhe:\r\nNa proposta de layout, a página \'A EMPRESA\' não tem nenhuma foto intercalada ao texto. Mas na Matriz de Escopo eu havia citado que esta página teria uma foto intercalada ao texto. Não se esqueçam de incluir a foto (gerenciável pelo CMS) durante a construção do site.\r\nObrigado.', '2005-04-07 09:09:50'),
	(127, 317, 'carlos.arruda', '- Inclusão de Fechamento de chamado por horário, em relatórios.\r\n- Criação de envio de email, a um determinado endereço, com um resumo dos chamados com 24 horas para cima.\r\n- Criação de uma funcionalidade de envio de email de pesquisa de satisfação. \r\n- Gráficos mensais', '2005-04-08 09:13:01'),
	(128, 319, 'nivaldo.junior', 'Configuração do bônus campanha do dia das mães.', '2005-04-08 18:41:54'),
	(129, 300, 'carlos.arruda', '\r\nATA DA REUNIÃO DO DIA 24/02/2005 do Sistema Fleet Control\r\n\r\n** Em CADASTROS -> VEÍCULOS \r\n\r\n- Quando for selecionado o tipo de frota "designado" deverá aparecer 2 novos objetos:\r\n	- Check. Para ser marcado caso o usuário deseje receber alertas via e-mail. Nesse e-mail conterá um campo solicitando o preenchimento da kilometragem atual do veículo que ele está utilizando.\r\n	\r\n	- Campo texto. Para ser preenchido com qual frequencia o usuário deseja receber o alerta. Nesse campo ele indicará de quantos e quantos meses o sistema enviará o alerta.\r\n\r\n- Serão enviados no máximo 3 e-mails para o usuário, 1 por semana. Obviamente só será enviado o seguinte caso o usuário não se manifeste da forma esperada. O primeiro e o segundo e-mail só serão enviados para ele, já o terceiro será enviado para ele e para o administrador do sistema da unidade onde se encontra cadastrado o veículo.\r\n\r\n\r\n** Em SERVIÇOS -> SOLICITAÇÃO DE VEÍCULO \r\n\r\n- Os veículos pertencentes da frota "Comum" serão enxergados e solicitados por todos os usuários.\r\n- O sistema somente apresentará os veículos cadastrados na mesma "Unidade da Empresa" do usuário.\r\n- Os usuários pertencentes a frota "Comum" deverão responder "SIM" a pergunta "Vai haver transporte de carga?" para que apareça os veículos da divisão Hilux.\r\n- Em "Disponíveis" os veículos que pertencerem a frota "Comum" será apresentado somente o último número da placa. Os veículos que pertencerem a frota em que o usuário está cadastrado aparecerá entre parênteses o modelo do veículo também.\r\n\r\n\r\n** SERVIÇOS -> AUTORIZAÇÃO DE VEÍCULO \r\n\r\n- Somente listará os veículos cadastrados na mesma "Unidade da Empresa" do usuário.\r\n\r\n\r\n\r\nATA DA REUNIÃO DO DIA 01/03/2005 do Sistema Fleet Control\r\n\r\n** Em SERVIÇOS -> SAÍDA DE VEÍCULOS\r\n\r\n- Adicionar campo texto com a descrição do "Liberador", funcionário Toyota que muitas vezes nem tem acesso ao sistema mas que é o responsável pela check geral do veículo para sua saída.\r\n\r\n\r\n** Em SERVIÇOS -> ENTRADA DE VEÍCULOS \r\n\r\n- Adicionar campo texto com a descrição do "Liberador", funcionário Toyota que muitas vezes nem tem acesso ao sistema mas que é o responsável pela check geral do veículo para sua entrada.\r\n\r\n- Em caso de existir a falta de algum objeto de check-list no veículo o usuário permitirá a entrada do veículo mas o sistema automaticamente irá enviar um e-mail para os administradores do sistema dentro da unidade de empresa em questão.\r\n\r\n- Caso o veículo demore mais que o esperado para retornar deve ser enviado um e-mail para os administradores do sistema dentro da unidade de empresa em questão. Deverá ser enviado 1 e-mail por dia de atraso para a administração.\r\n\r\n\r\n** Em SERVIÇOS -> ENTRADA IPVA E SEGURO OBRIGATÓRIO \r\n\r\n- Deve ser enviado e-mail para os administradores do sistema da unidade de empresa em questão 10 dias antes de vencer qualquer documento relacionado aos veículos. Ex.: IPVA, Seguro Obrigatório, Multa, Licensiamento, etc.\r\n\r\n\r\n** Em CADASTROS -> VEÍCULOS \r\n\r\n- Identificar cadastros de placas especiais, as chamadas "Placa Azul". Check-box identificando esse tipo de placa.\r\n\r\n\r\n** Em SERVIÇOS -> ENTRADA SINISTRO\r\n\r\n- Nova página para guardar informações de sinistro de veículos batidos ou roubados. Guardando informações como data, usuário, histórico e local onde se encontra o veículo. Adicionar também a informação "Identificado Terceiro" com "sim/não" como resposta.\r\n\r\n\r\n** Em CONSULTAS -> SINISTRO\r\n\r\n- Nova página para listar os sinistros acontecidos dentro de um período de tempo. Deve ser feito um protótipo para validação do usuário do que deve ser feito.', '2005-04-11 11:05:11'),
	(130, 319, 'nivaldo.junior', 'Correção da pagina de permissões de usuário.', '2005-04-11 19:14:15'),
	(131, 324, 'nivaldo.junior', 'Implantação do site.', '2005-04-13 18:24:44'),
	(132, 296, 'carlos.arruda', 'Site finalizado publicado em http://www.targetsis.com.br/novo\r\n\r\nAguardando homologação do cliente.', '2005-04-19 09:01:43'),
	(133, 296, 'guimas@targetsis.com.br', 'Parabéns pelo site. Ele ficou realmente muito bonito e funcional.\r\n\r\nEm minha primeira navegada, e comparando o que foi feito com o que estava na Matriz de Escopo, levantei os seguintes pontos a corrigir:\r\n\r\nALTERAÇÕES GERAIS NO SITE:\r\n\r\n1) Endereço da Target, exibido em todas as páginas:\r\n	- Trocar a fonte, pois está muito simples. Se possível, usar a mesma fonte usada nos títulos das páginas internas (em tamanho menor, claro).\r\n	- Segundo a ME, este endereço todo seria um link para um mapa de localização fornecido pela Target. Isso está previsto? O mapa pode ser inserido via CMS, ou será fixo?\r\n\r\n2) O logo da Target, no canto superior esquerdo, deve ser um link para a HOME do site (isso não estava na ME - verificar se é simples ou se terá acréscimo antes de fazer).\r\n\r\n3) O \'title\' da página, que aparece lá na barrinha do Windows, está "=====TARGET SYSTEM=====". Favor trocar para "TARGET SISTEMAS" e tirar todos os símbolos de "=" (deixar só o nome mesmo).\r\n\r\n4) A barra de scroll do site está muito clarinha. Favor colocar um cinza mais escuro ou mesmo um azul.\r\n\r\n5) Páginas Internas: os títulos não estão posicionados no mesmo lugar. Basta clicar em uma por uma, rapidamente, e reparar que os títulos sobem ou descem um pouquinho. Eu sei que essa é meio "Dieta e Saúde", mas vê se vocês conseguem melhorar isso um pouco.\r\n\r\n6) HOME:\r\n	- Na parte de Produtos, apenas o "Saiba Mais" é um link para a página de produtos. Favor colocar o link também no título e na imagem.\r\n	- Dúvida: ao clicar neste link, ele abre a página de produtos já exibindo um determinado produto. Este produto é escolhido no CMS ou é fixo?\r\n	- Na parte de Clientes, apenas o "Saiba Mais" é um link para a página de clientes. Favor colocar o link também no título e na imagem.\r\n	- Ao abrir uma notícia, favor colocar um link "Voltar" ao final do texto, que volte para a HOME.\r\n\r\n7) EMPRESA: a ME previa 3 imagens da empresa, intercaladas ao texto. O CMS permite 3?\r\n\r\n8) PRODUTOS E SERVIÇOS:\r\n	- O título desta página está apenas "Produtos", mas deve ser "Produtos e Serviços".\r\n	- A ME previa 2 imagens de produto, intercaladas ao texto. O CMS permite 2?\r\n	- A ME previa até 10 guias de produtos. O CMS permite 10?\r\n\r\n9) CLIENTES: A página ficou ótima, porém cada logomarca de cliente está ocupando muito espaço, desnecessáriamente. Favor alterar a página para caber 3 logos de clientes em cada linha (hoje está com apenas 1).\r\n\r\n10) FALE COM A TARGET:\r\n	- Na combo de escolha de setor da mensagem, está escrito "Escolha A setor". Corrigir.\r\n	- O pessoal não gostou da ilustração "caixa de correio". Favor retirá-la ou trocá-la por outra, mais moderna.\r\n\r\n11) JUNTE-SE A NÓS:\r\n	- Ao clicar em \'enviar\', a página tem que consistir uma das duas situações (e isso está na ME): se existe um arquivo 	anexado OU se as informações obrigatórias foram digitadas. Hoje não faz nem uma nem outra.\r\n	- O pessoal não gostou da ilustração "maleta". Favor retirá-la ou trocá-la por outra, mais moderna.', '2005-04-19 15:03:46'),
	(134, 331, 'nivaldo.junior', 'Configuração da Promoção do Dia Das Mães', '2005-04-20 17:40:47'),
	(135, 296, 'carlos.arruda', 'Respostas:\r\n\r\n1) Endereço da Target, exibido em todas as páginas: \r\n- Trocar a fonte, pois está muito simples. Se possível, usar a mesma fonte usada nos títulos das páginas internas (em tamanho menor, claro). \r\nR: Será alterado para a mesma fonte da proposta de layout.\r\n\r\n- Segundo a ME, este endereço todo seria um link para um mapa de localização fornecido pela Target. Isso está previsto? O mapa pode ser inserido via CMS, ou será fixo? \r\nR: Será fixo, estamos aguardando o mapa para publicação com link.\r\n\r\n2) O logo da Target, no canto superior esquerdo, deve ser um link para a HOME do site (isso não estava na ME - verificar se é simples ou se terá acréscimo antes de fazer). \r\nR: Já está OK.\r\n\r\n3) O \'title\' da página, que aparece lá na barrinha do Windows, está "=====TARGET SYSTEM=====". Favor trocar para "TARGET SISTEMAS" e tirar todos os símbolos de "=" (deixar só o nome mesmo). \r\nR: Já está OK.\r\n\r\n4) A barra de scroll do site está muito clarinha. Favor colocar um cinza mais escuro ou mesmo um azul. \r\nR: Já está OK.\r\n\r\n5) Páginas Internas: os títulos não estão posicionados no mesmo lugar. Basta clicar em uma por uma, rapidamente, e reparar que os títulos sobem ou descem um pouquinho. Eu sei que essa é meio "Dieta e Saúde", mas vê se vocês conseguem melhorar isso um pouco. \r\nR: Já está OK.\r\n\r\n6) HOME: \r\n- Na parte de Produtos, apenas o "Saiba Mais" é um link para a página de produtos. Favor colocar o link também no título e na imagem. \r\nR: Já está OK.\r\n\r\n- Dúvida: ao clicar neste link, ele abre a página de produtos já exibindo um determinado produto. Este produto é escolhido no CMS ou é fixo? \r\nR: Não. O sistema apresenta sempre o último produto cadastrado.\r\n\r\n- Na parte de Clientes, apenas o "Saiba Mais" é um link para a página de clientes. Favor colocar o link também no título e na imagem.\r\nR: Já está OK.\r\n\r\n- Ao abrir uma notícia, favor colocar um link "Voltar" ao final do texto, que volte para a HOME. \r\nR: Já está OK.\r\n\r\n7) EMPRESA: a ME previa 3 imagens da empresa, intercaladas ao texto. O CMS permite 3? \r\nR: O CMS permite quantas fotos quiser.\r\n\r\n\r\n8) PRODUTOS E SERVIÇOS: \r\n- O título desta página está apenas "Produtos", mas deve ser "Produtos e Serviços". \r\nR: Já está OK.\r\n\r\n- A ME previa 2 imagens de produto, intercaladas ao texto. O CMS permite 2? \r\nR: O CMS permite quantas fotos quiser.\r\n\r\n- A ME previa até 10 guias de produtos. O CMS permite 10? \r\nR: O CMS permite quantos produtos quiser.\r\n\r\n9) CLIENTES: A página ficou ótima, porém cada logomarca de cliente está ocupando muito espaço, desnecessáriamente. Favor alterar a página para caber 3 logos de clientes em cada linha (hoje está com apenas 1). \r\nR: Já está OK.\r\n\r\n10) FALE COM A TARGET: \r\n- Na combo de escolha de setor da mensagem, está escrito "Escolha A setor". Corrigir. \r\nR: Já está OK.\r\n\r\n- O pessoal não gostou da ilustração "caixa de correio". Favor retirá-la ou trocá-la por outra, mais moderna. \r\nR: Já está OK.\r\n\r\n11) JUNTE-SE A NÓS: \r\n- Ao clicar em \'enviar\', a página tem que consistir uma das duas situações (e isso está na ME): se existe um arquivo anexado OU se as informações obrigatórias foram digitadas. Hoje não faz nem uma nem outra. \r\nR: Já está OK.\r\n\r\n- O pessoal não gostou da ilustração "maleta". Favor retirá-la ou trocá-la por outra, mais moderna.\r\nR: Já está OK.', '2005-04-22 16:36:06'),
	(136, 333, 'carlos.arruda', '- Verificar a relação do saldo consolidado das comarcas e acrescentar a soma total de todas as comarcas e de todas as varas e também apresentar a relação de comarcas e varas em ordem alfabética. \r\n\r\n- O cancelamento do alvará deverá ter um histórico que aparecerá no extrato de sub-conta, isto caso, o alvará já tenha sido autorizado a sua liberação. \r\n\r\n- A correção do valor estornado no extrato de sub-conta deverá reiniciar no momento da data de cancelamento, isto também se for o caso de alvarás já autorizados. \r\n\r\n- A correção não deve sofrer nenhuma mudança se o alvará não tiver sido autorizado. \r\n\r\n- Consulta de extratos para os advogados\r\n\r\n- Emissão de Guia ou seja os próprios advogados emitir as guias nos seus escritórios.', '2005-04-25 10:05:17'),
	(137, 296, 'carlos.arruda', 'Ajustes:\r\n\r\n- Endereço da Target:\r\n\r\n	a) Alterar para maiúsculas\r\n	R: Ok.\r\n\r\n	b) Alterar de "cj.25/26" para "2ºANDAR"\r\n	R: Ok.\r\n\r\n\r\n- Topo das páginas (foto + slogan):\r\n\r\n	a) As páginas \'CLIENTES\' e \'FALE COM A TARGET\' estão com o mesmo topo.\r\nFavor colocar como na proposta de layout\r\n	R: Ok.\r\n\r\n	b) Inserir uma animação em flash no topo. Pode ser a mesma para todos. Algo\r\nbonito, de bom gosto, que não fique 	enjoativo com o tempo. Algo parecido\r\ncom a animação do site da agence.\r\n	R: Enviaremos um orçamento contemplando essa solicitação.', '2005-04-26 17:12:31'),
	(138, 340, 'jesliel.rocha', 'Foi efetuado uma execucao de script para popular tabelas. Ocorreu muito inconsistencia pois os dados repitiam muito a mesma coisa com descricao diferente ou com espaços. ', '2005-04-27 18:50:43'),
	(139, 334, 'carlos.arruda', 'rese', '2005-04-28 10:26:42'),
	(140, 295, 'guimas@targetsis.com.br', 'O orçamento para incluir uma animação nas fotos do TOPO do site está aprovado.\r\n\r\nA animação deve ser colocada após a troca das fotos atuais pelas novas (em duas páginas apenas).\r\n\r\nEstou mandando por e-mail para o Cezar as fotos em DUAS RESOLUÇÕES:\r\n	- Uma delas tem a resolução mais baixa, mas não possui marca d\'agua;\r\n	- A outra tem melhor resolução, mas possui a marca d\'agua.\r\nPeça para o pessoal fazer o mesmo que antes: recortar e tratar as fotos para não mostrar a marca d\'agua.\r\n\r\n\r\nAbaixo explicarei a relação PÁGINA / SLOGAN / FOTO: \r\n\r\n\r\nPÁGINA / SLOGAN / FOTO\r\n\r\nHOME / "TECNOLOGIA DA INFORMAÇÃO APLICADA AO DISTRIBUIDOR" / MANTER A FOTO ATUAL\r\n\r\nEMPRESA / "DISTRIBUIR PRODUTOS, MULTIPLICAR VALORES" / 22335297\r\n\r\nPRODUTOS E SERVICOS / "MOINHO: ÁGIL, PRECISO E OBJETIVO, COMO DEVE SER O DISTRIBUIDOR" / MANTER A FOTO ATUAL\r\n\r\nCLIENTES / "SOFTWARES DESENVOLVIDOS POR QUEM VIVE DISTRIBUIÇÃO" / MANTER A FOTO ATUAL\r\n\r\nFALE COM A TARGET / "A EFICÁCIA DA SUA EMPRESA É O NOSSO ALVO" / 22556384\r\n\r\nJUNTE-SE A NÓS / "A MELHOR TECNOLOGIA E A MELHOR EQUIPE FOCADOS EM DISTRIBUIÇÃO" / MANTER A FOTO ATUAL\r\n\r\nAguardo a primeira proposta de animação para análise. Grato.\r\n', '2005-05-03 14:11:34'),
	(141, 347, 'carlos.carvalho', 'Desenvolvimento da Matriz de Escopo do website atual da Lucio Engenharia para confecção de um novo layout (redesign) do site utilizando as mesmas informações do site atual.', '2005-05-03 17:27:25'),
	(142, 348, 'nivaldo.junior', 'Limitar o acesso a funcionalidade “Roaming Internacional”  que será implementada no COL somente para usuários cadastrados no COL com os seguintes perfis: \r\n\r\n- Administrador de Holding \r\n- Retaguarda.\r\n- Save Team\r\n', '2005-05-04 11:09:12'),
	(143, 296, 'guimas@targetsis.com.br', 'A publicação do novo site Target está APROVADA. Se possível, favor colocá-lo no ar hoje, quinta-feira, 05/05/05, à noite. Favor guardar o site antigo. Grato.', '2005-05-05 16:36:41'),
	(144, 296, 'guimas@targetsis.com.br', 'Foi detectado um erro no site, na resolução 800 X 600 (página de lientes). Favor segurar a publicação até a correção do mesmo. A Cristiane está atrás da resolução do problema com urgência.', '2005-05-05 16:51:50'),
