	(150, 361, 'carlos.arruda', 'Atividades requeridas da OS:\r\n\r\nTodos - Validação das queries de todos os relatórios\r\nTodos - Modelagem de dados para geração de relatórios Sales Performance / Sales Follow Up e Sales Distribution Status em modo batch\r\nTodos - Reescrita dos relatórios Sales Performance / Sales Followup / Sales Distribution Status utilizando modo batch (será realizado estudo para definir número de atualizações diárias das informações que não comprometa performance do sistema)\r\nTodos - Alteração de queries para exibir concessionárias inativas em relatórios antigos\r\nTodos - Inclusão de caixa de texto nas telas de parâmetros para permitir entrar código de concessionárias inativas\r\nTodos - Exibição de resultado de outras regiões para consultor\r\nManutenção de Objetivos - Validação da fórmula de cálculo dos objetivos\r\nManutenção de Objetivos - Opção de importação e exportação para arquivo excel (sujeito a estudo de viabilidade técnica)\r\nSales Distribution Status - Inclusão das colunas Faturamento Antecipado / Faturamento Mês / Faturamento Posterior / Varejo no relatório Sales Distribution Status\r\nSales Distribution Status - Remodelagem das telas de detalhes do Sales Distributions Status para exibir quadro com totais por modelo e cor\r\nSales Distribution Status - Inclusão dos campos Data de Previsão e Data de Faturamento nas telas de detalhes para veículos atendidos ou faturados\r\nPreços - Exibição da data de vigência da tabela de preços\r\nPreços - Exibição da cotação do dólar FOB e nacionalização na tabela de preços de CBU (informação não disponível no sistema, sujeito a alimentação da toyota)\r\nSales Follow Up - Modificação da coluna Confirmado para Atendido - exibindo veículos atendidos do pedido mensal\r\nSales Follow Up - Totais das concessionárias na tela de detalhes (visão região)\r\nSales Follow Up - Links nos totais parciais do Whole Sales Diário e Retail Sales Diário\r\nSales Performance - Tela de detalhes do Sales Performance ordenado por Pedido e Dta. Faturamento\r\nSales FollowUp - Back Order - Tela detalhes não aparece nada\r\nSales FollowUp - Erros para exportacao para planilha\r\nVeículos Disponíveis - Testes de alocação.\r\n\r\n------------------------\r\n\r\nAta de reunião com Divanildo no dia 11/05:\r\n\r\n* Sales Performance\r\n\r\n- Em detalhe dos veículos apresentar chassi e cor\r\n- Deixar janela podendo sempre maximizar\r\n\r\n\r\n* Sales Distribution Status\r\n\r\n- Relatório -> Nos faturados adicionar data de faturamento\r\n- Clicou na quantidade faturada aparecer chassi, cor e data de faturamento.\r\n\r\n\r\n* Sales Follow Up\r\n\r\n- Detalhes dos faturados -> Tanto no atacado como no varejo apresentar sempre cor do veículo.\r\n- Clicou no chassi apresentar os dados do cliente que comprou.\r\n- Clicou na quantidade faturada aparecer chassi, cor e data de faturamento.', '2005-05-17 10:09:02'),
