	(177, 420, 'carlos.arruda', 'Márcio, acesse o protótipo e dimensiona mais uma vez esse projeto, agora observando o protótipo.\r\n\r\nCVS\r\nPasta do repositório: d:/cvsrepo/prototipos\r\nMódulo: marmo_protótipo', '2005-06-17 10:53:36'),
	(178, 429, 'carlos.arruda', '- NR e NF dentro do CEI colocar também na pop de detalhes de INF.\r\n- Tela de Relatório: Adicionar MTBF (Medium Time Between Failure) na tela de relatório. Tempo médio entre as aberturas de chamados. Deve aparecer nas opções INF, USUÁRIO e DEPARTAMENTO.\r\n- Tela de Relatório: Adicionar na guia "Parâmetros" mais um filtro, "Por INF".\r\n- Tela de Relatório: Adicionar na guia "Parâmetros" check nos filtros para o usuário escolher o que quer ver na página de relatórios, melhorando dessa forma a performance e a poluição visual.\r\n- Manutenção de sub-problemas: Adicionar sub-categorias para os sub-problemas, tem que ter mais 2. E tem que ter um check para "Alta criticidade". Essas sub-categorias devem estar disponíveis somente para o backoffice, usuário nao enxerga.\r\n- Cadastro de feriados: Ler direto o calendário anual do Toios.', '2005-06-17 13:36:32'),
