	(186, 365, 'carlos.arruda', 'Alterações no sistema SVD (Protótipo atualizado no CVS):\r\n\r\nItem de menu: Pedido -> Novo Pedido\r\n\r\n- Na guia "Documentação" deve entrar uma nova coluna, coluna "Vencimento" que deve aparecer somente para o documento tipo "Requerimento de Isenção do IPI". Esse campo irá guardar a data de vencimento desse documento de forma que a partir de 60 dias antes do vencimento comece a aparecer uma pop-up no momento do login do sistema avisando sobre o vencimento desse documento desse pedido. Deve aparecer o número do pedido e a data de vencimento do documento.\r\n\r\n- Na guia "Documentação" deve haver um link "Marcar Todos para SIM" na última linha da coluna "Verificado", esse link deve alterar todas as combos dessa coluna para "SIM" de uma vez só.\r\n\r\n\r\nItem de menu: Pedido -> Pedidos Pendentes\r\n\r\n- Na guia "Relatório" ao clicar na "casinha" aparecerá uma pop pedindo a confirmação do recebimento dos documentos só que agora com a possibilidade de alterar a data de recebimento, para que fique registrado no sistema de forma retroativa. Quando abre a pop é necessário que já traga a data do dia do sistema, para nao ter que selecionar sempre.\r\n\r\n\r\nItem de menu: Pedido -> Pedidos Pendentes de Aprovação (Nova página)\r\n\r\n- Página que servirá como filtro dos pedidos para os clientes do tipo Frotista, Locadora e Governo. Os consultores serão responsáveis pela liberação desses pedidos, o relacionamento será feito pela página "Cadastro de Consultores/Dealer".\r\n\r\n- Na guia "Parâmetros" vai selecionada o consultor logado, mas pode-se selecionar outros ou indiferente.\r\n\r\n- Na guia "Relatório" os pedidos deverão ser aprovados ou não, as opções serão: \r\n	- Sempre: Nesse caso é um sim permanente, ou seja, todo pedido que vier desse cliente não passará mais por essa página "Pedidos Pendentes de Aprovação".\r\n	- Sim: Nesse caso o pedido é autorizado nesse momento, indo assim para o fluxo normal.\r\n	- Não: Nesse caso o pedido é cancelado nesse momento, para salvar um pedido com essa situação é obrigatório o preenchimento do campo de observações. O dealer deve poder enxergar o pedido cancelado normalmente, incluindo a observação colocada pelo consultor.\r\n\r\n\r\nItem de menu: Consultas -> Preços\r\n\r\n- Na guia "Parâmetros" deve ter agora o botão de exportar a tabela de preços para um PDF, facilidade para o dealer que poderá clicar nesse botão para emitir tabela de preços.\r\n\r\n- Na guia "Relatório" foi adicionado agora a vigência da tabela e retirado o frete (não existe mais).\r\n\r\n\r\nItem de menu: Consultas -> Carteira de Pedidos \r\n\r\n- Na guia "Parâmetros" agora tenho o novo filtro "Situação da Documentação" onde poderei selecionar a situação da documentação do tipo do cliente. Nessa guia poderei agora enviar a consulta para o excel, sem precisar listar relatório.\r\n\r\n- Na guia "Relatório" entraram novas colunas, entre elas a "Previsão" que será uma combo onde o perfil da Carla poderá alterar. As opçoes dessa combo serão "Sem previsão", "Mes corrente", "Mês seguinte" e "Mês seguinte".\r\n\r\n- Na guia "Relatório" agora todos os títulos do relatório, "Pedido - Item Cliente Dist. Venda Tipo de Cliente, etc" serão link para ordenação do relatório.\r\n\r\n\r\nItem de menu: Gestão -> Resumo Gerencial\r\n\r\n- Na guia "Parâmetros" agora tenho o novo filtro "Situação da Documentação" onde poderei selecionar a situação da documentação do tipo do cliente. Nessa guia poderei agora enviar a consulta para o excel, sem precisar listar relatório.\r\n\r\n\r\nItem de menu: Gestão -> Cadastro de Consultores (Nova página)\r\n\r\n- Cadastro de consultor normal, dados prototipados.\r\n\r\n\r\nItem de menu: Gestão -> Cadastro de Consultores/Dealer (Nova página)\r\n\r\n- Nesse página será feito o relacionamento do consultor com o dealer de forma que apareça para o dealer, quando logado no SVD, um link na parte superior direita do sistema, para os dados do consultor responsável. Como prototipado.\r\n\r\n\r\nItem de menu: Gestão -> Parametrização de Objetivos (Nova página)\r\n\r\n- Página para parametrizar o objetivo dos consultores por mês para cada divisão dos veículos Toyota. Essa parametrização deve ser feita em valores percentuais. A quantidade total do objetivo deve ser trazido do SGV, informação já existente.\r\n\r\n\r\nItem de menu: Gestão -> Relatório Performance SVD (Nova página)\r\n\r\n- Página para medir performance do grupo de VD, ou de um consultor específico dentro de um período de tempo.\r\n\r\n\r\nItem de menu: Gestão -> Histórico de Clientes (Nova página)\r\n\r\n- Página que serve para se extrair informações de um cliente específico, quantidade de veículos faturados, alocados, pendentes, etc.\r\n\r\n\r\nItem de menu: Gestão -> Cadastro de Desconto (Nova página)\r\n\r\n- Página que serve para cadastrar a quantidade de veículos comprados por um cliente específico, esse cadastro irá afetar o desconto do cliente em novo pedido, fará com que o cliente entre na faixa de desconto de clientes com o total de veículos comprados cadastrado nessa página mais o novo pedido.', '2005-06-24 20:16:14'),
	(187, 449, 'carlos.arruda', '- Recurso sonoro em caso de falhas nos devices.\r\n- Tela de parametrização desse som, podendo ser trocado on demand.', '2005-06-27 14:54:43'),
	(188, 441, 'nivaldo.junior', 'Analise das condições de inclusão do plano 45 minutos.', '2005-06-27 15:50:04'),
	(189, 451, 'edy.bruno', 'Pré e Matriz de Escopo já foram enviadas para TI. Aguardando dimensionamento de tempo e preço.', '2005-06-27 17:39:33'),
	(190, 365, 'lf.oliveira', '\r\nNo CVS na pasta docs está a primeira versão do arquivo ES-estimativa de implementcao.doc.\r\n\r\nAbaixo estão algumas dúvidas que eu tive.\r\n\r\n. carteira de pedidos:\r\n  o novo filtro, "Situação da Documentação" que será\r\n  adicionado, levará em consideração somente os tipos\r\n  de clientes presentes no protótipo ?\r\n\r\n. relatório de gestão mensal:\r\n  no protótipo não existe botão/link que simule\r\n  a exportação do relatório para o excel, mas no texto\r\n  que vc escreveu com as alterações diz que será possível\r\n  exportar esse relatório para o excel a partir da tela\r\n  de parâmetros. Isso está correto ? Posso dimensionar essa\r\n  funcionalidade ?\r\n\r\n\r\n. cadastro de consultor:\r\n  no protótipo o link para exibir as informações resumidas\r\n  do consultor tb está disponível. Isso está correto ? Qual\r\n  consultor deveria aparecer nesse caso ?\r\n\r\n. relatório de performance:\r\n  a janela de detalhes do protótipo exibe a situação do veículo,\r\n  isso está correto ? Já lhe perguntei isso no 1 protótipo e vc\r\n  me disse para não exibir a situação, mas nesse protótipo ela\r\n  (a situação do veículo) está visível novamnte, por isso estou\r\n  t perguntando novamente.\r\n\r\n  deve se considerar todos tipos de clientes da Toyota e não\r\n  apenas os levantados no protótipo(frotista, ppd e taxista),\r\n  correto ?', '2005-06-27 18:39:45'),
	(191, 365, 'carlos.arruda', 'Segue respostas:\r\n\r\n. carteira de pedidos: \r\no novo filtro, "Situação da Documentação" que será adicionado, levará em consideração somente os tipos de clientes presentes no protótipo? \r\n\r\nR: Nao, ele é dinamico, nao colocamos todos porque nao lembramos de todos. Mas se no filtro anterior "Tipo de Cliente" o usuário selecionar um tipo específico nao tem sentido apresentar todos nesse filtro "Situação da Documentação", apresenta somente o que ele selecionou em "Tipo de cliente".\r\n\r\n\r\n. relatório de gestão mensal: \r\nno protótipo não existe botão/link que simule a exportação do relatório para o excel, mas no texto que vc escreveu com as alterações diz que será possível exportar esse relatório para o excel a partir da tela de parâmetros. Isso está correto? Posso dimensionar essa funcionalidade? \r\n\r\nR: Faz o seguinte Fernando, eles validaram essas telas mas eu coloquei no texto que teria, veja por favor o tempo de adicionar essa exportacao em todos os relatorio na aba "parâmetros". Se for um tempo expressivo para fazer isso em todos (a partir de 4 dias úteis a mais) desencana. Faz apenas aonde o protótipo mostrou que tem.\r\n\r\n\r\n. cadastro de consultor: \r\nno protótipo o link para exibir as informações resumidas do consultor tb está disponível. Isso está correto? Qual consultor deveria aparecer ness e caso? \r\n\r\nR: Se vc está falando do link superior direito da tela ele tem que aparecer somente para os dealers, nao tem sentido nenhum aparecer para o usuario interno. Foi deixado no protótipo para que vc pudesse entender que ele deve aparecer dessa forma para o usuario dealer.\r\n\r\n\r\n. relatório de performance: \r\na janela de detalhes do protótipo exibe a situação do veículo, isso está correto? Já lhe perguntei isso no 1 protótipo e vc me disse para não exibir a situação, mas nesse protótipo ela (a situação do veículo) está visível novamnte, por isso estou t perguntando novamente. \r\n\r\nR: No caso nao tem sentido mesmo porque vc só vai trabalhar com os veiculos faturados, pode tirar.\r\n\r\ndeve se considerar todos tipos de clientes da Toyota e não apenas os levantados no protótipo(frotista, ppd e taxista), correto?\r\n\r\nR: Isso. Correto.', '2005-06-28 10:55:56'),
	(192, 365, 'lf.oliveira', 'Não sei se entendi bem, mas estou vendo o cadastro de desconto como o histórico de\r\ncompras do cliente alimentado manualmente. Por isso, vejo este cadastro como um cadastro\r\nperigoso. Além de causar um grande impacto no cálculo de preços, pois muda a atual\r\nforma de cálculo de desconto. É uma coisa perigosa, pois a princípio o usuário pode\r\ncolocar o valor que ele quiser, pode informar que o cliente identificado por um\r\ndeterminado CPF/CNPJ já comprou "N" carros Toyota.\r\nE o sistema vai aceitar e dar tal desconto para esse cliente. Porém o sistema sempre\r\ntrabalha com margens de desconto, valor máximo e valor mínimo, mas o simples fato de permitir\r\nque uma entrada de dados do usuário influencie diretamente no preço de um veículo é algo que eu\r\nparticularmente não faria. Ainda mais que se algum problema acontecer(desconto excessivo indevido)\r\npor conta disso, o usuário jogará a culpa no sistema, ou seja, na Agence. Podemos pensar em um esquema\r\nde log que informe data hora e usuáro que fez estas alterações, isso nos resguarda se algum problema\r\nvir ocorrer.\r\n\r\nQuero apenas mostrar que a implementação dessa funcionalidade além de ser perigosa vai requerer tempo.\r\nEm uma primeira análise as tarefas a serem feitas seriam:\r\n\r\n1. criar estrutura no banco para armazernar esta informação\r\n2. alterar as classes envolvidas neste processo\r\n3. alterar forma do cálculo de desconto\r\n4. conferência do cálculo de preços\r\n\r\n\r\n\r\n>Segue respostas:\r\n>\r\n>. carteira de pedidos:\r\n>o novo filtro, "Situação da Documentação" que será adicionado, levará em consideração somente os tipos de clientes presentes no protótipo?\r\n>\r\n>R: Nao, ele é dinamico, nao colocamos todos porque nao lembramos de todos. Mas se no filtro anterior "Tipo de Cliente" o usuário selecionar um tipo específico nao tem sentido apresentar todos nesse filtro "Situação da Documentação", apresenta somente o que ele selecionou em "Tipo de cliente".\r\n>\r\n\r\nFernando: Ok, entendido e sem problemas.\r\n\r\n>\r\n>. relatório de gestão mensal:\r\n>no protótipo não existe botão/link que simule a exportação do relatório para o excel, mas no texto que vc escreveu com as alterações diz que será possível exportar esse relatório para o excel a partir da tela de parâmetros. Isso está correto? Posso dimensionar essa funcionalidade?\r\n>\r\n>R: Faz o seguinte Fernando, eles validaram essas telas mas eu coloquei no texto que teria, veja por favor o tempo de adicionar essa exportacao em todos os relatorio na aba "parâmetros". Se for um tempo expressivo para fazer isso em todos (a partir de 4 dias úteis a mais) desencana. Faz apenas aonde o protótipo mostrou que tem.\r\n>\r\n\r\nFernando: Certo Carlos, acho que vai ser possível adicionar a exportação para o excel para os outros relatórios sem\r\nacréscimo de tempo. E se isso vier a causar um atraso, eu sigo a sua instrução e aborto essa implementação.\r\nEstava pensando em fazer a exportação destes relatórios da seguinte forma: se ao término da implementação\r\nde cada relatório ainda houver tempo suficiente para fazer essa exportação eu faço se não vejo se ao final de todas as\r\nimplementações, sobrou tempo pra fazer isso.\r\n\r\n>\r\n>. cadastro de consultor:\r\n>no protótipo o link para exibir as informações resumidas do consultor tb está disponível. Isso está correto? Qual consultor deveria aparecer ness e caso?\r\n>\r\n>R: Se vc está falando do link superior direito da tela ele tem que aparecer somente para os dealers, nao tem sentido nenhum aparecer para o usuario interno. Foi deixado no protótipo para que vc pudesse entender que ele deve aparecer dessa forma para o usuario dealer.\r\n>\r\n\r\nFernando: Ok, eu tb ao havia visto sentido esse link no cadastro de consultor.\r\n\r\n>\r\n>. relatório de performance:\r\n>a janela de detalhes do protótipo exibe a situação do veículo, isso está correto? Já lhe perguntei isso no 1 protótipo e vc me disse para não exibir a situação, mas nesse protótipo ela (a situaçã o do veículo) está visível novamnte, por isso estou t perguntando novamente.\r\n>\r\n>R: No caso nao tem sentido mesmo porque vc só vai trabalhar com os veiculos faturados, pode tirar.\r\n\r\nFernando: Ok, fechado.\r\n\r\n>\r\n>deve se considerar todos tipos de clientes da Toyota e não apenas os levantados no protótipo(frotista, ppd e taxista), correto?\r\n>\r\n>R: Isso. Correto.\r\n\r\nFernando: Ok.', '2005-06-28 16:15:54'),
	(193, 365, 'carlos.arruda', 'A idéia desse cadastro era realmente de afetar o desconto concedido no momento do pedido do cliente, o ideal mesmo seria on-line o sistema consultar a quantidade de veículos faturados para aquele CPF/CNPJ específico, somar com os pedidos que estão sendo feitos no momento, encontrar a faixa de desconto do cliente e conceder o desconto permitido para aquela faixa, tudo on-line, como achei que seria algo pesado (consulta pesada) achei que dessa forma seria menos onerosa para o Banco de Dados. Se vc achar que dá para fazer essa consulta sem pesar tanto e que o esforço em horas no final vai acabar sendo o mesmo visto as atividades citadas abaixo sugiro que nao considere essa tela de cadastro de desconto e já faça on-line.', '2005-06-28 17:33:10'),
	(194, 452, 'nivaldo.junior', 'Promoção Dia Dos Pais.', '2005-06-28 18:02:01'),
	(195, 454, 'edy.bruno', 'Cliente está situado na Praia do Forte, BA. Também solicitou orçamento para sistema administrativo.', '2005-06-29 15:37:45'),
	(196, 455, 'carlos.arruda', '- Link para reabertura de chamado no e-mail para usuário\r\n- Link para reabertura na tela de chamados fechados - usuário\r\n- Tela para reabertura de chamado com opção de observação\r\n- Cálculo do tempo desconsiderando tempo em que o chamado ficou fechado\r\n- Opção de relatório para chamados reabertos\r\n\r\n- Inclusão NR/NF na pop do CEI\r\n- Inclusão MTBF nas caixas Usuário/Departamento/INF\r\n- Adicionar Filtro Relatório Estatísticas por INF\r\n- Check\'s na aba parâmetros do Rel. Estatísticas para filtrar caixas\r\n- Consulta de Feriados no Toios\r\n- Manutenção de sub-categorias de subproblemas', '2005-06-30 09:23:31'),
	(197, 365, 'lf.oliveira', ' Eu acrescentei uma descrição sobre\r\no histórico de clientes, mas ainda não dimensionei o tempo(veja minhas\r\nperguntas) e adicionei tb alguns comentários detalhamento da \r\nfuncionalidade 2.1.1.1. Gostaria que vc olhasse e me dissesse se\r\nposso é algo assim que vc estava esperando.\r\nEu acho que assim o documento está razoável.\r\n\r\n\r\nTambém estive conversando com o Joe sobre o esquema de histórico\r\nde compras de clientes e ficamos com dúvidas, sobre o qual é a\r\nespectativa do pessoal da Toyota, o que eles esperam disso,\r\npor exemplo:\r\n\r\n1. até que nível temos que analisar o histórico ? Apenas um nível\r\njá basta pra eles ? Ou temos que ver todos ?\r\nLembrando que qto mais decermos na árvore, mais lento/pesado fica\r\nessa consulta.\r\n\r\n2. e no caso de uma empresa mudar de grupo de empresas relacionadas\r\no seu histórico pode ser usado para este novo grupo ?\r\nEu particularmente acredito que sim, pois isso deve ser indiferente\r\npra Toyota.\r\n\r\n3. se uma empresa mudar/sair do grupo de empresas relaciondas, seu\r\nhistórico de compras deve ser removido do histórico do grupo ?\r\n\r\nEm caso afirmativo, uma outra estrutura tem que ser bolada para\r\no agente que povoaria a tabela com o histórico, pois o esquema\r\nde fazer o incremento semanal, nesse caso não atende. \r\n\r\nNesse primeiro momento eu pensei em deixar esse serviço configurável,\r\nonde ele poderia rodar incrementando os pedidos da semana(configuração\r\npadrão, como sugerida por vc), mas tb o usuário poderia escolher\r\na partir de que data ele iria iniciar a fazer a computação desse\r\nhistórico, sem fazer incremento, fazendo tudo outra vez.\r\nOu ainda ver junto ao Ricardo(ou o responsável) se é necessário\r\ntodo o histórico, tudo que está no banco de dados, ou apenas\r\nde um período, dos últimos 6 meses, 1 ano por exemplo.\r\n\r\nEu preciso das respostas dessas perguntas, pra termos isso bem definido,\r\nsabermos o que o cliente espera para que eu possa estimar o tempo\r\nque isso levará para ser desenvolvido, e principal que é atender o\r\nnosso cliente com exatidão.', '2005-06-30 12:07:59'),
	(198, 453, 'carlos.arruda', 'Para a implementação das funcionalidades:\r\n\r\n- Qualquer usuário com acesso ao item "Cadastro de Subconta" pode associar uma subconta a um advogado.\r\n- Uma subconta pode conter "n" advogados associados a ela.\r\n- O usuário com perfil de "advogado" poderá ter acesso a tela "EMISSÃO DE GUIA" através do caminho "Administração -> Emissão de Guia (Boleto)".\r\n- Alteração na tela de cadastro de subconta. Tela prototipada no CVS.', '2005-06-30 18:16:30'),
	(199, 365, 'lf.oliveira', 'fazendo uma melhor análise no relatório de carteira de pedidos\r\nme surgiram mais algumas dúvidas. \r\n\r\nDe acordo com a estrutura da Toyota, a previsão de atendimento\r\nde um veículo é feita em cima do chassi do veículo, ou seja,\r\nsomente depois que o veículo passa a ter um chassi, que\r\nele foi liberado para o faturamento, que é possivel setar uma\r\nprevisão de atendimento para este veículo.\r\n\r\nSendo assim, para os veículos que ainda não tiverem chassi, o \r\nque hoje é possível se fazer é deixá-los sem previsão de\r\natendimento. Agora isso tem que ficar claro para o cliente\r\ne saber também o que eles esperam desse relatório.\r\n\r\nPreciso saber se realmente posso fazer o relatório dessa\r\nforma, para poder dimensionar o tempo de desenvolvimento\r\ndesse relatótio.', '2005-06-30 20:16:46'),
	(200, 365, 'carlos.arruda', 'De acordo com a estrutura da Toyota, a previsão de atendimento \r\nde um veículo é feita em cima do chassi do veículo, ou seja, \r\nsomente depois que o veículo passa a ter um chassi, que \r\nele foi liberado para o faturamento, que é possivel setar uma \r\nprevisão de atendimento para este veículo. \r\n\r\nSendo assim, para os veículos que ainda não tiverem chassi, o \r\nque hoje é possível se fazer é deixá-los sem previsão de \r\natendimento. Agora isso tem que ficar claro para o cliente \r\ne saber também o que eles esperam desse relatório. \r\n\r\nPreciso saber se realmente posso fazer o relatório dessa \r\nforma, para poder dimensionar o tempo de desenvolvimento \r\ndesse relatótio.\r\n\r\nR: A previsão quem dá o grupo de vendas diretas, eles vão consultar a fábrica direto se for o caso, nao precisa ser algo atrelado a sistema (apenas veículos com chassi tem previsão), nada disso. Eles vao dizer o que eles acham que pode acontecer, "sem previsao", "Esse mes", "Mes que vem", etc.\r\n\r\n\r\nTambém estive conversando com o Joe sobre o esquema de histórico \r\nde compras de clientes e ficamos com dúvidas, sobre o qual é a \r\nespectativa do pessoal da Toyota, o que eles esperam disso, \r\npor exemplo: \r\n\r\n1. até que nível temos que analisar o histórico? Apenas um nível \r\njá basta pra eles? Ou temos que ver todos? \r\nLembrando que qto mais decermos na árvore, mais lento/pesado fica \r\nessa consulta. \r\n\r\nR: Nao entendi o que vc chama de nível de histórico. Tem que analisar os veiculos faturados e liberados pelo CNPJ/CPF e empresas relacionadas do cliente que está fazendo o pedido.\r\n\r\n\r\n2. e no caso de uma empresa mudar de grupo de empresas relacionadas \r\no seu histórico pode ser usado para este novo grupo? \r\nEu particularmente acredito que sim, pois isso deve ser indiferente \r\npra Toyota. \r\n\r\nR: Sim\r\n\r\n\r\n3. se uma empresa mudar/sair do grupo de empresas relaciondas, seu \r\nhistórico de compras deve ser removido do histórico do grupo? \r\n\r\nR: Sim\r\n\r\n\r\nEm caso afirmativo, uma outra estrutura tem que ser bolada para \r\no agente que povoaria a tabela com o histórico, pois o esquema \r\nde fazer o incremento semanal, nesse caso não atende. \r\n\r\nR: Ok\r\n\r\n\r\nNesse primeiro momento eu pensei em deixar esse serviço configurável, \r\nonde ele poderia rodar incrementando os pedidos da semana(configuração \r\npadrão, como sugerida por vc), mas tb o usuário poderia escolher \r\na partir de que data ele iria iniciar a fazer a computação desse \r\nhistórico, sem fazer incremento, fazendo tudo outra vez. \r\nOu ainda ver junto ao Ricardo(ou o responsável) se é necessário \r\ntodo o histórico, tudo que está no banco de dados, ou apenas \r\nde um período, dos últimos 6 meses, 1 ano por exemplo.\r\n\r\nR: É necessário todo histórico. Acredito que o caminho seja dar opções. Dimensione uma primeira opcao, mais sofisticada com consulta numa tabela real, alimentada em modo batch, etc. Outra segunda opcao, mais simples, como aquela que propus no protótipo.', '2005-07-01 12:08:09'),
	(201, 365, 'lf.oliveira', 'Sobre a pergunta que eu fiz que vc nao havia entendido,\r\nna verdade quis dizer, nível do relacionamento das empresas.\r\nQuem está relacionda a quem. Qdo disse até que nivel devemos\r\nanalisar o histórico me referia em até onde poderíamos descer\r\nno relacionamento das empresas. Vou dar um exemplo para mostrar\r\no que é um nível. Temos as empresas A, B, C e D que estao realcionadas\r\nfazendo parte do grupo de empresas "As mais". Porém\r\na ordem dos relaionametos é A a empresa principal,\r\ne a B está relacionda a empresa A, a empresa C está\r\nrelacionada a empresa B e por fim a D relacionada a\r\nempresa C. \r\nA\r\n B\r\n  C\r\n   D\r\nDessa forma teríamos 4 níveis.\r\n\r\n\r\nNo "Cadastro de Consultores/Dealer" é feita uma filtragem pelo\r\nconsultor e pelo estado que ele atua. \r\nComo a Toyota determina que determinados estados serão\r\nde responsabilidade de um determinado consultor, com\r\nexcessão dos estado de São Paulo, pois é o único estado em que\r\ntodos os consultores possuem concessionárias.\r\nA minha dúvida é a seguinte, "Consultor Atual" listado\r\nno relatório não deveria ser somente o consultor escolhido\r\ninicialmente para se fazer a busca(se o estado for diferente\r\nde SP) ?\r\n\r\n\r\n\r\nAssim como o cálculo de descontos por histórico de compras\r\ndo cliente necessitará da criação de uma estrutura para que\r\nisso seja feito on-line, para se exibir esse relatório em\r\num tempo hábil, teremos que adequar essa estrutura para que\r\npossa ser usada nas duas situações. Mas essa adequação,\r\npoderá aumentar o tempo de desenvolvimento do servico que\r\nirá povoar essa estrutura mas certamente irá aumentar o tempo\r\nque o "servico bat" levará para povar essa estrutura.\r\nPor isso preciso saber se iremos fazer com que esse relatório\r\nuse essa estrutura ou não para poder dimensionar o tempo\r\nde desenvolvimento da estrutura, pois o desenvolvimento do relatório\r\ndeve ser o mesmo, mas o tempo que o relatório vai levar para ser\r\nexibido vai ser muito diferente dependendo da estrutura usada.', '2005-07-01 15:09:32'),
	(202, 365, 'lf.oliveira', 'Fechei o levantamento, veja o documento em anexo se tiver alguma duvida\r\nerro me avise', '2005-07-01 18:31:49'),
