	(204, 450, 'rui.hayashi', '- Em relação ao estudo da ferramenta de Single Sing-ON, a ferramenta que será analisada é o CAS (Central Authentication Service) da Universidade Yale. É um projeto Open Source e o Spring-ACEGI tem suporte ao mesmo. Verificar se a Toyota tem o objetivo de analisar alguma ferramenta comercial, nesse caso seria necessário incluir um estudo específico, que demandaria provavelmente o mesmo tempo do CAS.\r\n- O estudo do CAS considera o acesso a base do SIS para autenticação do usuário, verificar se é necessário um estudo em relação a acesso a LDAP ou Active Directory. É possível integrar o CAS a essas ferramentas.', '2005-07-04 14:37:47'),
