	(208, 463, 'carlos.arruda', '- Criação de uma estrutura de dados no ambiente Toios/Progress a ser alimentada diariamente com dados do SIS por uma rotina batch Java. Podendo também ser "startada" manualmente a partir do próprio SIS. Contemplando as fases:\r\n \r\n- Modelagem Estrutura Toios\r\n- Projeto Rotina Toios\r\n- Implementação Rotina Toios\r\n- Testes Rotina Toios\r\n- Implantação Rotina Toios\r\n- Implementação da interface SIS que irá startar manualmente a rotina\r\n- Teste dessa interface\r\n- Implantação dessa interface', '2005-07-06 16:51:51'),
