	(210, 467, 'carlos.arruda', 'Protótipo no servidor:\r\n\r\n- Módulo de cadastro de notícias: \\agence_spc$Inetpubwwwrootcaol\new_htmlcad_noticia.htm\r\nA navegação tá feita, é só selecionar a opcao *Novo.\r\n\r\n\r\n- Módulo de consulta de notícias:\r\n\\agence_spc$Inetpubwwwrootcaol\new_htmlcon_noticia.htm\r\nTente deixar a foto como jornal, com o conteúdo que sobra entrando embaixo da foto, nao consegui isso porque fiz com tabela, acredito que com DIV dê.\r\n', '2005-07-07 20:56:16'),
