	(223, 453, 'carlos.arruda', 'A emissão de guia pelo advogado deve seguir as mesmas regras de negócio da reemissão. Ou seja, as mesmas restrições e privilégios. Pelo meu teste o advogado tá podendo emitir boleto para qualquer vara, comarca e processo. \r\nTem que existir as mesmas restrições da reemissão de guia.', '2005-07-11 11:40:49'),
