	(228, 478, 'carlos.arruda', 'Daniel,\r\n\r\nNos anexos dessa OS se encontra a especificação do projeto.\r\nMais detalhes no e-mail abaixo do Moriael:\r\n\r\n- A Linguagem de desenvolvimento é JAVA\r\n\r\n- Banco de dados SQL Server\r\n\r\n- A aplicação deve ser compatível com o Vignette / Intranet\r\n\r\n- A Autenticação deverá ser feita de duas formas: os Assistentes de RH\r\ndeverão ser autenticados no sistema em função do seu login de rede, nesse\r\ncaso será utilizada autenticação interna da CAIXA SEGUROS.\r\n \r\nQuanto àqueles que cadastrarem currículos no Portal, deverá haver\r\nautenticação, mas os procedimentos serão devidos posteriormente.\r\n\r\n- A Caixa Seguros utiliza store procedures\r\n\r\nQualquer dúvida ainda pode entrar em contato diretamente com o Moriael. Nos telefones: 61 8114-0909, 61 3226-9005.\r\n\r\nQuero que você faça esse dimensionamento dentro dos documentos padrões da Agence que se encontra em "Instruções e Documentação" no site CAOL, com o nome de "Planilha de Estimativas", é uma planilha excel, o seu preenchimento é bem fácil, caso ainda tenha dúvida fale comigo.\r\nDepois de fazê-lo anexe por favor a essa OS de prospecção.\r\n\r\nAtt.;\r\nCarlos', '2005-07-14 09:59:13'),
