	(239, 486, 'carlos.arruda', 'Marcio,\r\n\r\nEntenda o esforço de estarmos atendendo essa demanda do Fabio do site da Orbe com o Nivaldo e depois anexe a PE a essa OS.\r\n\r\n1- No cadastre-se, precisamos incluir um texto logo abaixo do item onde o cara marca se quer receber o informe diário, e precisamos mudar a programação para quando o cara escolher que quer receber o informa diário, os dados dele vão direto pro cadastro de emails do site (o do envio automatico), mas a entrada fica marcada por default como desativado (e aí, no futuro, quando este problema se resolver, marcamos todos como Ativados).\r\n\r\n2- Texto obrigatório. Na capa do site precisamos incluir um texto obrigatório por lei. Para não mudar muito o visual atual, nossa idéia é incluir este texto obrigatório na parte de baixo, embaixo da tabela de rentabilidade, no lugar daquele trecho que vem da página "A empresa". \r\n\r\nImportante: A primeira alteraçào é temporária. Dentro de 5 meses precisaremos voltar tudo ao normal, como está hoje.\r\n\r\nAtt.;\r\nCarlos', '2005-07-20 18:01:58'),
	(240, 485, 'carlos.arruda', 'Portal de RH possuindo:\r\n\r\n- Fórum de discussão sobre algum tema específico\r\n- Chats com data e hora marcada, com alguma figura importante da empresa\r\n- E-learning sobre algumas funções da empresa\r\n- Área apresentando empresas conveniadas a Toyota, separado por ramos de atividade como Convênios Médicos, Escola de Idiomas, etc.\r\n- Área de recrutamento interno, quadro de vagas da empresa onde o usuário possa se inscrever.\r\n- Adicionar o Google dentro do portal, aquele campo de busca do google mesmo, para que o pessoal entre no portal para buscar itens na Net.\r\n- Link para informações institucionais da empresa como A Missão, Valores, Visão.\r\n- Área de publicidade e propaganda feitas pela Toyota, destacando sempre a última propaganda/campanha feita pela Toyota, para que todos a conheça.\r\n- Notícias da empresa e do mercado automobilístico.\r\n- Quadro com aniversariantes da semana.', '2005-07-21 15:22:52'),
	(241, 488, 'nivaldo.junior', 'Inserir a promoção AMEX  para receber o bônus dos plano promocionais dos pais', '2005-07-21 17:57:21'),
	(242, 489, 'carlos.arruda', 'Marco, \r\n\r\nFavor dimensionar o esforço em dias preenchendo a PE (planilha de estimativas) disponível em "Instruções CAOL Agence" referente a funcionalidade Transferência do valor parcial de subContas.\r\nDepois de preenchido a PE anexe por favor a essa OS, após vc anexar e atualizar essa OS receberei um e-mail automática sabendo disso.\r\n\r\nObrigado.\r\nCarlos.', '2005-07-21 18:36:59'),
	(243, 479, 'carlos.arruda', 'Alterado o nome da OS, pode lançar inclusive as horas retroativas referente ao SVD.\r\nEm relação a suporte ao Gaudencio lança na fase de implantação.\r\n', '2005-07-21 19:54:41'),
	(244, 490, 'carlos.arruda', '1- No cadastre-se, precisamos incluir um texto logo abaixo do item onde o cara marca se quer receber o informe diário, e precisamos mudar a programação para quando o cara escolher que quer receber o informa diário, os dados dele vão direto pro cadastro de emails do site (o do envio automatico), mas a entrada fica marcada por default como desativado (e aí, no futuro, quando este problema se resolver, marcamos todos como Ativados).\r\n\r\n2- Texto obrigatório. Na capa do site precisamos incluir um texto obrigatório por lei. Para não mudar muito o visual atual, nossa idéia é incluir este texto obrigatório na parte de baixo, embaixo da tabela de rentabilidade, no lugar daquele trecho que vem da página "A empresa". \r\n\r\nImportante: A primeira alteração é temporária. Dentro de 5 meses precisaremos voltar tudo ao normal, como está hoje.', '2005-07-22 15:26:42'),
	(245, 487, 'marcio.lamego', 'Anexo: dimensionamento com a ára do administrador', '2005-07-22 15:47:02'),
	(246, 486, 'carlos.arruda', 'Márcio,\r\n\r\nO Fábio enviou mais outras funcionalidades para adicionar. Me passa o dimensionamento de mais isso por favor. No caso se tiver dúvidas mande e-mail direto pra ele.\r\n\r\n"Fizemos aquela tabela onde mostra a rentabilidade do nosso fundo, e de outros índices. Atualmente mostramos estas rentabilidades no mês atual e no ano. Queríamos incluir uma coluna a mais e mostrar também a\r\nrentabilidade acumulada nos últimos 12 meses."\r\n\r\nMais uma vez, tirar dúvidas antes com o Nivaldo, em último caso fale com ele.\r\n[]s\r\nCarlos', '2005-07-22 17:08:34'),
