	(260, 498, 'carlos.arruda', 'Documentação dos sistemas Toyota: SGV, SVD, 2Know e Blue Print\r\n\r\nContemplando no mínimo os seguintes documentos:\r\n\r\n- Documento de Visão\r\n- Documentos de Regras de Negócio\r\n- Glossário\r\n- Casos de uso com detalhamento\r\n- Diagrama de Classes com detalhamento\r\n- Diagrama de Sequencia com detalhamento\r\n- Documento de Arquitetura (citando patterns e frameworks utilizados, assim como servidores)\r\n- Modelo de entidade relacionamento\r\n- Dicionário de dados\r\n\r\nObs.: Todos os documentos devem ser entregues no formato word e os diagramas no formato Jude. O documento de entidade relacionamento deve ser entregue no formato excel.\r\n\r\nP.S.: O dimensionamento deve ser anexado a essa OS dentro do padrão atual da Agence (PE - Planilha de Estimativas) publicado no link "Instrucoes CAOL Agence" na guia "Documentos Agence".', '2005-07-28 10:31:02'),
