	(287, 523, 'carlos.arruda', '1) Solicitação 2282 - Na inclusão de Pedidos - Bloquear o cadastramento de CPF quando o cliente for Locadora/Frotista ou Empresa Frotista e o modelo for Hilux. (Para isto deve ser criado pela Toyota um parametro por Tipo de Cliente X Divisao X Modelo na tela abaixo) \r\n\r\n2) Solicitação 2305 - Na Inclusão de Pedidos:\r\n	2.1)Tornar o campo Inscrição Estadual obrigatório quando for informado CNPJ. Incluir mensagem "Inserir número da Inscrição Estadual ou ISENTO". \r\n	2.2)Tornar o campo RG obrigatório quando for informado CPF.\r\n\r\n3) Solicitação 2306 - Na Inclusão de Pedidos. \r\n	3.1)Tornar o campo CNPJ da Empresa relacionada obrigatório quando for o tipo de cliente for "Empresa Frotista" ou "Locadora Frotista". \r\n\r\n4) Solicitação 2307 - Carta de Correção. Quando a Dealer solicitar uma carta de correção no SVD e não permitir garvar cartas de correção em branco.', '2005-08-10 11:53:47'),
