	(290, 526, 'carlos.arruda', 'Marco,\r\n\r\nEstamos prospectando um cliente que atualmente possui um portal de e-commerce para vendas de vinhos: www.mistral.com.br\r\n\r\nAtualmente existe um outro desenvolvedor desse portal, mas devido à insatisfação do cliente, eles desejam migrar para um novo. O fornecedor atual não cumpre o prazo e entrega dos sistemas, entrega com bugs e eles tb têm problemas com o atendimento.\r\n\r\nO portal é todo desenvolvido em .NET com base SQL Server 2000.\r\n\r\nEstá hospedado no provedor NETPOINT.\r\n\r\nAtualmente essa loja virtual não está integrada com o ERP do cliente e hoje sua atualização de estoque é feita manualmente via uma interface de administração do site. A idéia deles para os próximos meses é exportar um arquivo do ERP deles e migrar automaticamente para o portal. As fotos já tratadas tb serão enviadas para o portal num mesmo diretório, salvas num mesmo padrão.\r\n\r\nTeremos acesso a todo o código fonte do portal, mas infelizmente o sistema não possui documentação alguma.\r\n\r\nNo momento necessitamos uma avaliação/dimensionamento da quantidade de horas que gastaremos para desenvolver os ajustes listados no portal e na ferramenta de administração no arquivo em anexo.\r\n \r\n\r\nTeremos duas fases nesse projeto:\r\n\r\n1 - Ano de 2005 (favor dimensionar essa fase)\r\n\r\n- Melhorias da Loja Virtual/Integração com o ERP Mistral (para suportar a demanda no fim deste ano).\r\n\r\n \r\n\r\n1 - Ano de 2006 (não iremos dimensionar agora)\r\n\r\n- Desenvolvimento e implementação do novo website (o ideal seria finalizar e começar a desenvolver o novo web site em 2005). O projeto deve estar no ar no início de 2006.\r\n\r\n \r\n\r\nPortanto solicito que vc nos dimensione o tempo que gastaremos para ajustar as pendências em anexo e desenvolver uma ferramenta de migração dos dados de um arquivo exportado do ERP deles.\r\n\r\nNão se esqueça de anexar depois a PE (Planilha de Estimativa), modelo disponível no CAOL, com o dimensionamento das fases em dias e não em horas.\r\n\r\n[]s\r\nCarlos', '2005-08-11 11:39:18'),
	(291, 362, 'carlos.arruda', 'Adicionado o analista Marcio para o estudo do Ajax.', '2005-08-11 14:29:52'),
	(292, 518, 'nivaldo.junior', 'Criar o serviço de Degustação SMS.', '2005-08-11 17:47:12'),
