	(303, 533, 'carlos.arruda', 'Rodrigo, \r\n\r\nFavor dimensionar o esforço em dias preenchendo a PE (planilha de estimativas) disponível em "Instruções CAOL Agence".\r\nDepois de preenchido a PE anexe por favor a essa OS, após vc anexar e atualizar essa OS receberei um e-mail automática sabendo disso. \r\n\r\nObrigado. \r\nCarlos.', '2005-08-24 10:01:29'),
