	(306, 535, 'carlos.arruda', 'Rodrigo, \r\n\r\nFavor dimensionar o esforço em dias preenchendo a PE (planilha de estimativas) disponível em "Instruções CAOL Agence". \r\nDepois de preenchido a PE anexe por favor a essa OS, após vc anexar e atualizar essa OS receberei um e-mail automática sabendo disso. \r\nO protótipo desse upgrade está dispoível em:\r\n\r\nRepositorio: d:/cvsrepo/prototipos\r\nModulo: toyota_SOS2\r\n\r\nObrigado. \r\nCarlos.', '2005-08-24 16:36:48'),
	(307, 535, 'carlos.arruda', '----------------------------------\r\n\r\n- Administração -> Cadastro de Pesquisa \r\n\r\nNova aba adicionada, a de Satisfação. A aba "eventual" fica a funcionalidade que já existe.\r\n\r\nEssa aba nova irá controlar pesquisas de satisfação, ou seja, toda pesquisa de satisfação ativa aparecerá sempre para o usuário responder, ele aparecerá para o usuário responder no momento em que ele entrar novamente no SOS, de modo que fique sempre obrigatório já que ele não conseguirá abrir novo chamado enquanto nao responder chamado.\r\n\r\n----------------------------------\r\n\r\n- Administração -> Manutenção de Problemas\r\n	\r\nAdicionado mais uma linha com um check-box a ser marcado, a de "necessita nome do chefe/gerência", que será utilizado mais para frente.\r\n\r\nClicando em Editar "Categorias/Sub-Categorias", em "Nova categoria" foi adicionado em "sub-categoria" o campo observacao.\r\n\r\n----------------------------------\r\n\r\n- Chamados - Novo Chamado\r\n\r\nQuando seleciona a opcao "Solicitacao de acesso a sistema" e o sub-problema "SVD" irá aparecer o campo "Nome do Chefe/Gerência" porque foi marcado anteriormete, o valor desse campo deve ser concatenado ao campo de descricao de chamado depois de salvo.\r\n\r\n----------------------------------\r\n\r\n- Chamados - Meus Chamados - Analista \r\n\r\nAo clicar no link de um problema como exemplo vc percebe que em "Descrição do Chamado" tá concatenado o nome do chefe. Esse é o momento em que o analista de help desk vai entrar com o nome correto do "chefe/gerecia", "Responsável do Módulo" e do "Auditor", procurar na seta e selecioar na combo. Ao salvar o chamado o work-flow seguirá a seguinte sequencia: 1 email vai para o chefe, o chefe autorizando o acesso, um segundo email vai para o responsavel do modulo, o resposavel autorizando um terceiro email vai para o auditor, o auditor autorizando um email vai para o responsavel pelo chamado dizendo que a solicitacao foi autorizado por todos atores do fluxo. Caso um desses atores nao autorize o chamado é fechado automaticamente. Todos os comentarios feitos pelo atores devem ser adicionados como observacoes do chamado.\r\n\r\nO email que irá para esses atores está em "Link Autorização" na parte inferior direita dessa página. Deve ser um email HTML pois terá efeito direto no sistema, podendo inclusive adicionar o comentario dentro do email.', '2005-08-25 12:04:53'),
	(308, 523, 'carlos.arruda', 'Adicionada a analista Cyntia para a confecção do plano de testes.', '2005-08-26 10:20:12'),
	(309, 533, 'luiz.paulo', 'Adição do analista Gustavo Gomes', '2005-08-29 10:55:53'),
	(310, 538, 'carlos.arruda', '- Administração -> Cadastro de Pesquisa \r\n\r\nNova aba adicionada, a de Satisfação. A aba "eventual" fica a funcionalidade que já existe.\r\n\r\nEssa aba nova irá controlar pesquisas de satisfação, ou seja, toda pesquisa de satisfação ativa aparecerá sempre para o usuário responder, ele aparecerá para o usuário responder no momento em que ele entrar novamente no SOS, de modo que fique sempre obrigatório já que ele não conseguirá abrir novo chamado enquanto não responder chamado.\r\n\r\n----------------------------------\r\n\r\n- Administração -> Manutenção de Problemas\r\n	\r\nAdicionar mais uma linha com um check-box a ser marcado, a de "necessita nome do chefe/gerência”.\r\n\r\nClicando em Editar "Categorias/Sub-Categorias", em "Nova categoria" deverá ser adicionado em "sub-categoria" o campo observação.\r\n\r\n----------------------------------\r\n\r\n- Chamados - Novo Chamado\r\n\r\nQuando preenchido o campo "Nome do Chefe/Gerência" esse valor deve ser concatenado ao campo de descrição de chamado depois de salvo.\r\n\r\n----------------------------------\r\n\r\n- Chamados - Meus Chamados - Analista \r\n\r\nAo clicar no link de um problema em "Descrição do Chamado" está concatenado o nome do chefe. Esse é o momento em que o analista de help desk vai entrar com o nome correto do "chefe/gerecia", "Responsável do Módulo" e do "Auditor", procurar na seta e selecionar na combo. O “responsável do módulo” pode existir “n”, e terá um botão “+” para que possa ser adicionado.\r\nAo salvar o chamado o work-flow seguirá a seguinte seqüência: 1 email vai para o chefe, o chefe autorizando o acesso, um segundo email vai para o responsável do modulo, o responsável autorizando um terceiro email vai para o auditor, o auditor autorizando um email vai para o responsável pelo chamado dizendo que a solicitação foi autorizado por todos atores do fluxo. Caso um desses atores não autorize, o chamado é fechado automaticamente. Todos os comentários feitos pelo atores devem ser adicionados como observações do chamado.\r\n\r\nO email que irá para esses atores está em "Link Autorização" na parte inferior direita dessa página. Deve ser um email HTML pois terá efeito direto no sistema, podendo inclusive adicionar o comentário dentro do email.', '2005-08-29 14:23:18'),
	(311, 521, 'carlos.arruda', 'Atualizado com os modelos de documentos.', '2005-08-29 17:16:01'),
	(312, 541, 'carlos.arruda', 'Fernando, \r\n\r\nEm anexo se encontra as alterações que foram solicitadas, me parece que você já fez esse dimensionamento, não tenho certeza, se refere àquelas solicitações do Ricardo.\r\nQualquer dúvida o protótipo se encontra atualizado.\r\n\r\nRepositório: d:/cvsrepo/prototipos\r\nMódulo: SVD\r\n\r\nFavor dimensionar o esforço em dias preenchendo a PE (planilha de estimativas) disponível em "Instruções CAOL Agence".\r\nDepois de preenchido a PE anexe por favor a essa OS, após vc anexar e atualizar essa OS receberei um e-mail automática sabendo disso. \r\n\r\nObrigado. \r\nCarlos.', '2005-08-30 10:39:53'),
