	(321, 563, 'carlos.arruda', '- Permitir que nas páginas: REIMPRESSÃO DE ALVARÁS, CONCILIAÇÃO DE PEDIDO DE LIBERAÇÃO, CANCELAMENTO DE ALVARÁS LIBERADOS, CANCELAMENTO DE SOLICITAÇÃO DE LIBERAÇÃO e CANCELAMENTO DE SOLICITAÇÃO ARQUIVADA tenha como saber o que se está cancelando se houver duplicidade e alvarás de valores iguais. \r\n\r\n- De forma apresentar um campo, em todos as páginas citadas, que pode ser do mesmo modo do COMPROVANTE DE LIBERAÇÃO, em que possibilite ver o conteúdo do alvará, antes de se fazer qualquer procedimento.', '2005-09-14 13:38:11'),
