	(329, 561, 'daniel.braga', 'Senhores,\r\n\r\n   Segue algumas considerações.\r\n\r\n   Bem, o certo seria refazer o sistema, pois não existe uma normalizão das implementações.\r\n   Não existe controle transional de serviços.\r\n   A aplicação de Design Patterns não segue o conceito do mesmo.\r\n   Não existe uma visão clara da regra de negócio.\r\n\r\nAtt.,\r\nDaniel Braga', '2005-09-15 18:59:32'),
