	(338, 526, 'marco.malaquias', 'Seguem algumas observações a respeito do dimensionamento:\r\n1)  Favor descrever os detalhes de funcionamento do ERP do cliente, para que possa haver a integração. \r\n2) Solicitar ao cliente um print screen das telas com problema de layout, para que haja um melhor entendimento do problema.\r\n3) Sendo que a plataforma do cliente é Macintosh, devemos pensar em como realizar os testes.\r\n4) Há um ítem que fala sobre a diagramaçao do mapa do site. Solicitar ao cliente como deverá ser feito\r\n\r\nCaso haja alguma dúvida, favor entrar em contato.\r\n\r\nMarco Malaquias', '2005-09-21 17:07:01'),
	(339, 572, 'nivaldo.junior', 'Alteração de horas por analista.', '2005-09-21 18:01:51'),
