	(345, 526, 'carlos.carvalho', 'Um esclarecimento geral: os Layouts serão desenvolvidos pela FutureBrand e o desenvolvimento e programação será desenvolvido pela Agence.\r\n\r\nDúvidas referente aos ajustes:\r\n\r\n1 - Deverá ser analisados todos os items ou apenas aqueles que não são da cor preta? \r\n\r\nSomente o de cor PRETA\r\n\r\n2 - Teria como o cliente enviar os print screen das tela para que haja um melhor entendimento dos problemas. \r\n\r\nSerá  realmente necessário? Como vocês já orçaram basta cortar o que não irá mais ser contemplado.\r\n', '2005-09-30 11:10:18'),
