	(352, 597, 'lf.oliveira', 'Plano de esitmativas para o upgrade de empresas no SIS', '2005-10-03 18:25:11'),
	(353, 602, 'carlos.carvalho', 'Documento: RFP (Request For Proposal)\r\nRFP.PDF\r\nTamanho (Kbytes): 2.689\r\n \r\nDocumento: Documento de Visão do Projeto\r\nVisao.PDF\r\nTamanho (Kbytes): 181\r\n\r\nDocumento: Arquivos HTML com o protótipo não funcional do projeto\r\nprototipo.zip\r\nTamanho (Kbytes): 142\r\n\r\nDocumento: Diagramas de caso de uso e regras de negócio\r\nusecases.zip\r\nTamanho (Kbytes): 1.427', '2005-10-04 14:22:45'),
	(354, 602, 'carlos.carvalho', 'O sistema obrigatoriamente deve ser densenvolvido em 3 camadas de software:\r\nCamada de Acesso a Dados, Camada de Aplicação (Regras de Negócio) e Camada de Apresentação.\r\n\r\nFases de desenvolvimento do sistema:\r\n1 - Definição do Escopo;\r\n2 - Detalhamento de Requisitos (analistas alocados na Webmotors);\r\n3 - Análise de Sistema (analistas alocados na Webmotors);\r\n4 - Design do sistema;\r\n5 - Codificação;\r\n6 - Teste e Implementação (analistas alocados na Webmotors);\r\n7 - Migração (analistas alocados na Webmotors);\r\n8 - Manutenção Corretiva (analistas alocados na Webmotors).\r\n\r\nObs.1: Garantia de 120 dias da entrega;\r\n\r\nObs.2: 30 dias depois da implementação é exigido que a equipe de desenvolvedores fique alocada no escritório da Webmotors para prover manutenção corretiva de maneira emergencial;\r\n\r\nObs.3: Meta de entrega do sistema: 15/Dez de 2005\r\n\r\nObs.4: Documentação será exigida;\r\n\r\nObs.5: Especificar o perfil e quantidade dos profissionais que estarão envolvidos no projeto bem como enviar o CURRÍCULO DE TODOS OS PROFISSIONAIS.', '2005-10-04 14:33:46'),
	(355, 602, 'carlos.carvalho', 'No próximo 06/Out 2005 das 16:30 às 18:30 haverá uma sessão de dúvidas e esclarecimentos no escritório da Webmotors.\r\n\r\nA proposta será enviada na segunda feira, portando enviar o dimensionamento na próxima sexta dia 7/Out de 2005.', '2005-10-04 14:36:47'),
	(356, 602, 'carlos.carvalho', 'As especificações do sistema bem como as regras da concorrência e contatos se encontram nos documentos listados abaixo prontos para download:\r\n\r\nUsuário: arquivos\r\nSenha: Wm2005\r\n\r\nDocumento: RFP (Request For Proposal)\r\nURL: http://arquivos.webmotors.com.br/patrocinador/RFP.PDF\r\nTamanho (Kbytes): 2.689\r\n\r\nDocumento: Documento de Visão do Projeto\r\nURL: http://arquivos.webmotors.com.br/patrocinador/Visao.PDF\r\nTamanho (Kbytes): 181\r\n\r\nDocumento: Arquivos HTML com o protótipo não funcional do projeto\r\nURL: http://arquivos.webmotors.com.br/patrocinador/prototipo.zip\r\nTamanho (Kbytes): 142\r\n\r\nDocumento: Diagramas de caso de uso e regras de negócio\r\nURL: http://arquivos.webmotors.com.br/patrocinador/usecases.zip\r\nTamanho (Kbytes): 1.427\r\n\r\nEstes arquivos ficaram disponíveis até o dia 10 de Outubro de 2005 as 17:00, prazo final para a entrega das proposta. Caso enfrentem problemas para baixarem estes arquivos favor entrar em contato o quanto antes.', '2005-10-04 14:47:09'),
	(357, 547, 'carlos.arruda', 'Gerencia nao aprovou.', '2005-10-04 15:59:15'),
	(358, 603, 'carlos.arruda', 'Desenvolvimento de upgrade de alterações no fluxo de solicitação de acesso a sistema para melhor se enquadrar as necessidades Toyota.\r\nAlterações em:\r\n1. Estrutura de autorização de chamados\r\n2. Estrutura do Email + htm\r\n3. Tela de abertura de chamados\r\n4. Gráficos e relatórios\r\nMaiores detalhes do escopo no documento que se encontra nas relações de anexo.', '2005-10-04 16:02:05'),
	(359, 605, 'carlos.arruda', '1. Criação de um módulo no SIS que faça o controle da associação entre usuários e empresas cadastradas no TOIOS. Essa nova funcionalidade implica na criação de uma tabela no banco de dados do SIS, criação de uma consulta de empresas na base TOIOS, interface gráfica para manutenção das informações e interface para chamada do método que busca as informações de empresa por usuário.\r\n\r\n2. Criação de uma interface que receba o id do usuário e a senha antiga e a senha nova. O retorno é um status informando se a troca de senha foi realizada com sucesso ou se ocorreu algum erro.\r\n\r\n3. Não retornar a senha do usuário na interface XML. A parte de criptografia da senha do usuário será discutida com mais detalhes posteriormente.', '2005-10-04 17:27:04'),
