	(367, 614, 'carlos.carvalho', 'Loja Virtual: vendas de produtos como: vinhos; presentes/acessórios (kits de vinhos, sugestões para presentes, wizard de presentes, acessórios e kits especiais)e ponta de estoque (sugestões de vinhos, destaques de vinhos, busca avançada)\r\nRevista Mistral: Noticias, dicas, sugestões, destaques de vinhos, entrevistas/artigos, especiais temáticos, lancamentos, eventos e jantares, produtor do mês, imprensa recomenda.\r\n\r\nNewsletter Mistral\r\n\r\nPerfil de consumidores (Cadastro, Histórico de Compras e Histórico de navegação)\r\n\r\nBusca de Produtos: Convencionais e Não Convencionais', '2005-10-09 23:49:34'),
