	(383, 638, 'nivaldo.junior', 'Criação de script para gravar arquivos encerrados que não estão na tabela de histórico.', '2005-11-10 18:16:09'),
	(384, 639, 'carlos.arruda', 'Na versão administrador o sistema permitirá o upload de fotos, do press release (arquivo .doc) e a visualização das fotos comuns e restritas, bem como a visualização do press release também.\r\nA visualização das fotos será feita de 15 em 15 e terá uma funcionalidade de paginação para a navegação, essas fotos serão apresentadas em formato miniatura. Ao clicar sobre uma foto abrirá a foto numa pop-up em tamanho natural, podendo assim ser salva.\r\n\r\nNa versão usuário o sistema permitirá apenas a visualização das fotos comuns e do press release (arquivo .doc)  mas não poderá fazer upload.\r\nA visualização das fotos será feita de 15 em 15 e terá uma funcionalidade de paginação para a navegação, essas fotos serão apresentadas em formato miniatura. Ao clicar sobre uma foto abrirá a foto numa pop-up em tamanho natural, podendo assim ser salva.', '2005-11-10 18:33:34'),
	(385, 640, 'nivaldo.junior', 'Gerar arquivos RE_CON_RECLAMACAO_D1 e RE_CON_HIST_RECALMACAO_D1 das seguintes datas: 17/09/2005, 18/09/2005, 19/09/2005, 20/09/2005, 21/09/2005, 04/10/2005, 05/10/2005, 06/10/2005, 07/10/2005, 08/10/2005, 14/10/2005, 15/10/2005, 16/10/2005', '2005-11-22 14:10:31'),
	(386, 641, 'nivaldo.junior', 'Não foram gerados/recebidos os arquivos referentes aos dados de "reclamações da CO/N" do dia 17/11 do Alonet.Não foram gerados/recebidos os arquivos referentes aos dados de "reclamações da CO/N" do dia 17/11. Esses arquivos deveriam ser disponibilizados hoje 18/11.Favor verificar e reprocessar novamente, pois esta afetando os relatórios da Engenharia que são reportados ao VP da área, e também os relatórios da DRC.', '2005-11-22 14:17:59'),
	(387, 643, 'nivaldo.junior', 'Gerar arquivos RE_CON_RECLAMACAO_D1 e RE_CON_RECLAMACAO_D1 do dia 17/11.', '2005-11-23 17:27:27'),
	(388, 645, 'nivaldo.junior', 'ALONET - Possibilitar que os representantes de atendimento da CRC consigam visualizar processos abertos no Alônet antes que estejam encerrados pelos Back Offices', '2005-11-24 18:09:47'),
	(389, 479, 'bruno.freitas', 'OS cancelada. Todas as horas gastas em análise e manutenção de sistemas Toyota já em produção devem ser cadastradas na OS: Sistemas Toyota>Manutenção.', '2005-12-01 11:35:48'),
	(390, 647, 'nivaldo.junior', 'Quando o usuário digitar o número do serial a ser utilizado na reabilitação, a aplicação, quando for inserir o modelo de aparelho na tabela de fila, tem que inserir o CO_BSCS da tabela BDN_ACESSO_PRE  e não o co_modelo da BDN. Isso por que os modelos da BDN para acessos pré, não existem no BSCS, sendo assim, ocorre erro pelo fato do modelo não lá existir.', '2005-12-01 17:28:36'),
	(391, 648, 'nivaldo.junior', 'Quando o usuário digitar o número do serial a ser utilizado na reabilitação, a aplicação, quando for inserir o modelo de aparelho na tabela de fila, tem que inserir o CO_BSCS da tabela BDN_ACESSO_PRE  e não o co_modelo da BDN. Isso por que os modelos da BDN para acessos pré, não existem no BSCS, sendo assim, ocorre erro pelo fato do modelo não lá existir.', '2005-12-01 17:33:32'),
	(392, 644, 'carlos.carvalho', 'Necessito de um dimensionamento para próxima segunda pela manhã (5/Dez) e de uma proposta de layout para terca pela manhã (6/Dez).\r\nTenho que enviar dia 5/Dez a proposta comercial do site e na terça (6/Dez) tenho uma apresentação de como possivelmente ficará o site novo.', '2005-12-01 23:16:22'),
	(393, 644, 'rodrigo.oliveira', 'Envio de planilha de estimativa', '2005-12-02 19:22:06'),
