	(396, 659, 'nivaldo.junior', 'Ao tentar encerrar o processo GO 010646 / 2005 gera erro ', '2005-12-08 10:15:29'),
	(397, 665, 'carlos.arruda', 'O sistema deve passar a salvar a senha do usuário no banco de dados em formato criptografado.\r\nEssa adequação no sistema deve ser feito via código Java para que não dependa de banco de dados utilizado nem de servidor de aplicação.', '2005-12-12 08:04:52'),
	(398, 342, 'carlos.carvalho', 'A analista Cyntia Nakamura da Agence SP foi envolvido para executar os testes do sistema.', '2005-12-13 12:38:58'),
	(399, 653, 'carlos.arruda', 'Fechado com sucesso.', '2005-12-15 14:18:19'),
	(400, 676, 'carlos.arruda', 'Incluir um campo na página de Solicitação para Liberação, de modo que o juiz autorize que o valor liberado seja corrigido, com TR diária, até a data em que a liberação for autorizada.\r\nO campo deve ser do tipo check box, que deverá ser marcado caso o juiz deseje que, no momento da autorização da liberação, o valor seja atualizado.\r\nTal solicitação é necessária pois a defasagem entre a data que a solicitação é feita e a data em que é autorizada implica na perda de dividendos para a parte envolvida, haja vista que em muitos casos a autorização para pagamento da liberação (o alvará) não é feita no mesmo dia da sua solicitação.', '2005-12-19 11:47:02'),
	(401, 677, 'carlos.carvalho', 'Apresentação do Layout na semana de 19/Dez. Estimativa de aprovação do layout em 22 ou 23/Dez.\r\nwww.agence.com.br/propostas/botti_rubin\r\n', '2005-12-20 18:12:03'),
	(402, 677, 'carlos.carvalho', 'O layout foi "quase" aprovado, com algumas alterações:\r\n1 - Cor de fundo: Eles não estão seguros se a cor branca de fundo é a melhor solução. Eles mudaram de idéia e gostam das cores que existe hoje no site atual. Uma sugestão é manter a cor branca no fundo apenas no menu e no rastro e alterar a cor da área de apresentação de projetos e do escritório.\r\n2 - Eles me informaram que a maioria dos clinetes/estudantes precisam imprimir partes do site. Eles querem ter certeza que nesse layout será possível imprimir o site.\r\n3 - Na página interna, há um menu superior. Eles querem movê-lo para o menu lateral esquerdo e com isso subir a imagem do projeto. Então toda a navegações do site será pelo menu fixo lateral.\r\n4 - Eles querem centralizar o end, tels, e-mail abaixo no rodapé;\r\n5 - Eles não querem um flash na Home lento que demore para carregar.\r\n6 - A bandeirinha do brasil está virada. arrumar isso tb.', '2005-12-22 10:10:18'),
	(403, 677, 'carlos.carvalho', 'O escritório do cliente entrará de férias coletivas do dia 23/Dez até 9/Jan e o cliente quer q iniciamos o processo apenas dps do dia 23/Jan. Então fica suspenso qq trabalo até essa data.', '2005-12-22 10:13:24'),
