	(414, 702, 'bruno.freitas', 'Ata da Reunião em 21/10/2005\r\n\r\n- O TOL ficará hospedado na Target em servidor windows com sql server rodando em PHP sobre um servidor Apache for windows.\r\n\r\n- Até o dia 28/10 o TOL deverá ser disponibilizado na Agence para testes de homologação da Target, rodando em PHP sobre um servidor Apache for windows com SQL Server. \r\n\r\n- A partir do dia 31/10 até o dia 11/11 irá acontecer essa fase de homologação que camaremos de testes/ajustes. \r\n\r\nEssa homologação será feita sobre as funcionalidades do sistema e sobre o comportamento dos dados dentro das tabelas do banco de dados. Uma porta do SQL Server deverá ser aberta para consulta remota pelos analistas da Target. A porta provável do SQL server é a 1433 e para maior segurança poderá ser aberta somente para o I.P. 201.20.202.150.\r\n\r\nDurante esse período os testes (Target) e ajustes (Agence) acontecerão simultaneamente, de forma que até o dia 11/11 isso termine com sucesso.\r\n\r\n- No dia 14/11 deverá ser enviado o pacote PHP para instalação no ambiente da Target, a partir dessa data é provável que aconteça uma homologação do fonte PHP.\r\n\r\nOs fontes do TOL deverão ser enviados sem lixo, ou seja, sem arquivos que estão sem uso como _backup, .bak, etc.', '2006-01-12 10:17:41'),
