	(423, 717, 'carlos.carvalho', 'Desenvolvimento de um Flash de Vendas Resumo na Home da Intranet Caltabiano. Com um resumo da situação de vendas por loja de Veículos Novos e Seminovos, Peças e Serviços.', '2006-01-26 10:42:39'),
	(424, 718, 'carlos.carvalho', 'Desenvolvimento de um sistema de relatório de vendas de veículos faturados por loja, com número de veículo entregue pela montadora e como número de veículo em estoque.', '2006-01-26 10:46:24'),
	(425, 719, 'carlos.carvalho', 'Desenvolvimento de um sistema de cadastro de fluxo de cliente de lojas (showroom e telefone) e de um sistema de consulta online dessas informações cadastradas.', '2006-01-26 10:48:48'),
	(426, 721, 'nivaldo.junior', 'Através do menu Serviços > Save Team PJ > Parâmetros, o usuário (Administrador de Holding) tem a opção de realizar cadastramento/exclusão de aparelhos e atribuir mais de 1 preço para cada aparelho e relacionar estes preços à segmentação da Vivo. A definição de parâmetros é realizada para que os usuários com perfil Save Team PJ possam realizar o cálculo de vendas no atendimento a clientes.A Vivo possui 5 ações relacionadas à venda de aparelhos através de aquisição com subsídios para clientes que já estão na base: Save Team, Contra Ataque, Blindagem, P-Churn e P-Inadimplência. Cada ação tem uma verba e objetivos específicos, por isso, os valores dos aparelhos devem ser diferentes por ação, por modelo e por segmentação.Atualmente o sistema já permite o cadastro de preços de aparelhos por segmentação e modelos, contudo, não permite o cadastramento separado por ação.', '2006-01-31 17:40:39'),
	(427, 723, 'marco.malaquias', '1.	Redefinir os recursos de senha utilizados atualmente (formato de senha)\r\n2.	Redefinir períodos de acesso;\r\n3.	Armazenar dados de identificação do usuário;', '2006-02-03 18:33:38'),
	(428, 724, 'carlos.arruda', 'Necessário geração de PE para as seguintes funcionalidades solicitadas:\r\n\r\n- Colocar imagem da ANBID no rodapé do site.\r\n\r\n- Na primeira página do site existe uma tabela, com rentabilidades de fundos Orbe e dos índices da Bolsa. Hoje está limitado a tabela em 3 linhas. Mudar isso pois a Orbe deve lançar 2 fundos novos, necessário então tirar esta regra de máximo.\r\n\r\n- Ainda sobre a tabela da primeira página do site, logo abaixo da tabela deve ter um item "Patrimonio sobre administração: R$ XXX" e mensalmente iríamos atualizar o valor (R$XXX).\r\n\r\n- No menu lateral, no item "Renda Variável" existe um sub-menu com 3 itens. Necessário retirar um deste itens (e a página correspondente) e incluir dois novos links (e suas páginas) que sao os dois fundos novos. As páginas destes fundos novos serào iguais em estrutura, apenas com conteúdo diferente, da página do nosso fundo atual "Orbe Value FIA".\r\n\r\n- Incluir nas páginas de cada fundo um link pros clientes baixarem direto uma ficha de cadastro (um PDF).', '2006-02-06 09:21:15'),
	(429, 724, 'carlos.arruda', 'Os nomes dos links que deverão ser adicionados são: "Orbe Balance FIM" e "Clube Orbe Value II".\r\nEm relaçao as conteúdos, seria de igual estrutura do "Orbe Value FIA", administrado pelo CMS.', '2006-02-06 09:48:46'),
	(430, 724, 'carlos.arruda', 'O link/página que deverá sair é o último: "Serviços Especiais de Gestão".', '2006-02-06 12:34:10'),
	(431, 721, 'nivaldo.junior', 'Prorrogação do prazo para a VIVO criar a tabela pedida na OS-AD.', '2006-02-06 17:49:05'),
	(432, 726, 'nivaldo.junior', 'O relatório (arquivo) a ser disponibilizado deverá conter o conjunto de reclamações abertas via aplicativo Alônet, segmentado em cada mês de referência, apresentando os principais campos de identificação da reclamação registrada. De janeiro a dezembro de 2005.', '2006-02-06 17:59:22'),
	(433, 633, 'bruno.freitas', 'Adicionando documento com os ajustes identificados durante o processo de homologação.', '2006-02-09 13:47:02'),
	(434, 633, 'bruno.freitas', 'Adicionando documento com os ajustes identificados durante o processo de homologação - Fase 1.', '2006-02-09 13:47:13'),
	(435, 720, 'carlos.arruda', 'Bruno,\r\n\r\nO protótipo desse projeto está fechado.\r\n\r\nFavor envolver algum analista para dimensionamento de tempo e preenchimento da PE. Lembrando que quero que vc anexe a PE a essa OS, e nao o analista. Para que tenha o crivo seu.\r\nLembrando que todas as horas gastas nesse dimensionamento devem ser lançadas nessa OS, na fase "dimensionamento TI"\r\n\r\nEsse sistema está prototipado e sincronizado no CVS.\r\n\r\nRepositório: d:cvsrepoprototipos\r\nMódulo: Pesquisa_PWM\r\n\r\nEsse sistema terá 2 ambientes, um acessado via celular e outro em página web. \r\nO ambiente de celular deve ser desenvolvido em J2ME para que os usuários possam sincronizar com a web em horários determinados. E será simples, apenas responder as perguntas cadastradas no ambiente web.\r\n\r\nQualquer dúvida ainda fale comigo. \r\n[]s\r\nCF', '2006-02-10 18:33:27'),
	(436, 720, 'bruno.freitas', 'Rodrigo/Alessandro,\r\n\r\nPrecisamos de um dimensionamento para esse projeto. Vocês poderiam se encarregar disso, por favor?\r\nUtilizem a planilha de estimativas da área de documentos Agence no CAOL.\r\n\r\nQqr dúvida, falem comigo.', '2006-02-13 08:41:25'),
	(437, 730, 'carlos.arruda', 'Bruno,\r\n\r\nPreciso de uma PE para a solicitação anexada. O protótipo está atualizado no CVS:\r\n\r\nRepositório: d:cvsrepoprototipos\r\nMódulo: SVD\r\n\r\nQualquer dúvida a respeito desse escopo me avise.\r\nAbrs.;\r\nCF', '2006-02-13 09:07:54'),
	(438, 730, 'bruno.freitas', 'Civio,\r\n\r\nFavor gerar uma PE para essa atualização do SVD utilizando o modelo de PE (CAOL - Documentos Agence). Qqr dúvida favor falar comigo.\r\n\r\nAbs.\r\nBruno.', '2006-02-13 15:07:38'),
	(439, 730, 'bruno.freitas', 'Civio,\r\n\r\nFavor gerar uma PE para essa atualização do SVD utilizando o modelo de PE (CAOL - Documentos Agence). Qqr dúvida favor falar comigo.\r\n\r\nAbs.\r\nBruno.', '2006-02-13 15:28:23'),
