	(445, 730, 'carlos.arruda', 'Atualizado o documento de especificação.\r\n\r\nAdicionado mais um item, uma nova página. A de bloqueio de clientes.\r\nO protótipo também está atualizado no CVS.\r\n\r\nAtt.;\r\nCF', '2006-02-14 18:16:51'),
	(446, 730, 'carlos.arruda', 'Atualizado o protótipo tb em relacao a nova pagina "Consultas -> Pedidos x Descontos".\r\n\r\nAdicionado mais uma informação ao lado da quantidade de veículos, a informacao de quantidade de clientes envolvidos com a referente qtde de veiculos vendidos. \r\n\r\nEssa qtde de clientes é link para uma pop-up com o detalhe do nome dos clientes.\r\nOutra alteracao nessa pagina foi a adição do filtro "agrupador", podendo agora agrupar por veiculo ou por estado.', '2006-02-14 18:43:08'),
