	(533, 750, 'carlos.arruda', 'Preciso de uma PE para o desenvolvimento do portal.\r\nO protótipo para esse projeto pode considerar o link abaixo, o novo portal terá as mesmas funcionalidades só que com um layout novo, o antigo código não será aproveitado.\r\n\r\nhttp://www.al.ms.gov.br/', '2006-03-09 17:24:19'),
	(534, 750, 'bruno.freitas', 'Inclusão de versão premiliar da PE para desenvolvimento do portal.', '2006-03-13 12:48:56'),
	(535, 752, 'carlos.arruda', 'Bruno,\r\n\r\nFavor gerar PE da ME anexada. Esse site é simples, acredito que consiga dimensionar até amanhã.\r\nO site atual é http://www.multicasa.com.br/site/index.php\r\n\r\nQualquer dúvida me avisa.\r\nCF', '2006-03-13 16:57:58'),
	(536, 753, 'nivaldo.junior', 'Foi criado erroneamente no Alonet, o código INCIDÊNCIAS/FRAUDE/TRATAMENTO PÓS CLONE/ CLONE CO_N. Em virtude disso, foram abertos vários processos indevidos nesse código. Não é possível encerrar manualmente esses processos, porque a página da reclamação não abre, ocorre erro.\r\n\r\nEfetuar o encerramento massivo de todos os processos abertos no código INCIDÊNCIAS/FRAUDE/TRATAMENTO PÓS CLONE/CLONE CO_N. A relação dos processos que devem ser encerrados estão em anexo.', '2006-03-13 17:38:21'),
	(537, 754, 'carlos.carvalho', 'O cliente deseja desenvolver um website para a empreda do grupo, com o institucional, lista de produtos e contato com a empresa. \r\n\r\nA Agence ficará reponsável pela manutenção do website. Eles não querem um site complexo, querem um site simples porém com atenção especial para o desing. \r\n\r\nQuerem um site que chame atenção na beleza e simplicidade. \r\n\r\nEles necessitam que seja criado o dominio: www.shemiton.com.br\r\n\r\nO site será todo em HTML e não haverá ferramenta de administração de conteúdo (CMS).\r\n', '2006-03-14 11:24:19'),
	(538, 724, 'carlos.arruda', 'Fechado o escopo. Segue abaixo:\r\n\r\n- Colocar imagem da ANBID no rodapé da primeira página do site. \r\n\r\n- Na tabela da primeira página do site, logo abaixo da tabela deve ter um item "Patrimonio sobre administração: R$ XXX". Esse valor financeiro (R$XXX) deve poder ser atualizado via CMS. \r\n\r\n- No menu lateral, no item "Renda Variável" existe um sub-menu com 3 itens. Necessário retirar o link/página "Serviços Especiais de Gestão" e incluir dois novos links/páginas que são os dois fundos novos ("Orbe Balance FIM" e "Clube Orbe Value II"). As páginas destes fundos novos serão iguais em estrutura, apenas com conteúdo diferente, da página do nosso fundo atual "Orbe Value FIA". Os conteúdos relacionados devem ser administrados pelo CMS.\r\n\r\nSomente isso.', '2006-03-14 12:09:20'),
	(539, 750, 'carlos.arruda', 'Anexada nova PE, atualizada.\r\n', '2006-03-14 12:17:32'),
	(540, 752, 'carlos.arruda', 'Anexada a PE detalhada e a PE resumida.\r\nPara a geração da proposta comercial utilizar a PE resumida + tabela de preços atualizada.\r\n\r\nAtt.;\r\nCF', '2006-03-16 14:00:16'),
	(541, 752, 'carlos.arruda', 'Atualizada a ME.', '2006-03-16 14:25:59'),
	(542, 731, 'luiz.paulo', 'Anexada planilha de estimativas com base no protótipo gerado.', '2006-03-20 16:59:36'),
	(543, 760, 'carlos.carvalho', 'Listas de Alterações:\r\n1 - Colocar em negrito a frase que aparece em todas as páginas no rodapé: "Valores do imóvel sujeito a consulta com proprietário";\r\n2 - Leantamento de quantos imóveis tem cadastrado no site;\r\n3 - Incluir a opção de "Indiferente" na busca por BAIRRO;\r\n4 - Excluir os campos na parte de CONTATOS: Adm, Fin, Loc,Vend;\r\n5 - Verificar para onde estão sendo mandados os dados da avaliação do imóvel que o usuário faz; Eles não recebem o e-mail.\r\n6 - Incluir o "Meta Description", "Meta keys" e "Metas robots" no começo do website para evitar q apareça mais o site antigo em site de busca. Atualizar o google e yahoo.\r\n7 - Colocar em aleatório os banners e fotos do vilareto magnólia da home e outros condomínios;\r\n8 - Explicar como inserir novos Banners na seleção de banners.', '2006-03-21 10:46:40'),
	(544, 761, 'carlos.carvalho', 'SISTEMA DE AGÊNCIA DE NOTÍCIAS (www.agenciabomdia.com.br)\r\n\r\n1 - USUÁRIO\r\n - cadastro;\r\n - navegação entre seções de textos (habilitados);\r\n - navegação entre textos da seção, sendo que ao final de cada texto devem aparecer as thumbs relacionadas.\r\n - navegação entre seções de imagens;\r\n - navegação entre imagens da seção, sendo que o mesmo só pode comprar se estiver habilitado;\r\n - caso a imagem não esteja mais disponível, avisar o responsável por imagens;\r\n - imagens anteriormente indisponíveis ficam em seção própria;\r\n\r\n2 - EDITOR DE TEXTOS\r\n - cadastra texto na respectiva seção (titulo, linha fina, matéria, palavras chaves);\r\n\r\n3 - EDITOR DE IMAGENS\r\n - cadastra imagem na respectiva seção;\r\n         thumb – sem tamanho fixo;\r\n         preview – com marca d´água (marca dágua programada?)\r\n         imagem original – (pegar file info via programação?? Palavras chaves)\r\n - controle de peso de imagens no servidor – o usuário acompanha qual o peso das imagens no servidor e pode deletar as imagens (originais e preview) da data X e da seção Y.\r\n - padronizar modo como as imagens serão nomeadas, de forma que o banco de imagens interno (jundiaí) possoa seguir o mesmo padrão com as imagens arquivadas.\r\n\r\n4 - FINANCEIRO\r\n - o sistema financeiro mostra o extrato de downloads por usuário, para que o financeiro possa cobrar.\r\n\r\n5 - ADMINISTRADOR\r\n - cadastro de seções;\r\n - aprovação de cadastros e liberação de acesso a texto e compra de imagens;\r\n', '2006-03-21 11:21:19'),
	(545, 762, 'carlos.arruda', 'Integração com o arquivo da ANFAVEA.\r\nDetalhes enviados pelo Alexandre da Toyota.', '2006-03-21 14:01:11'),
	(546, 762, 'bruno.freitas', 'Anexados arquivos de exemplo de layout dos arquivos que precisam ser lidos.', '2006-03-21 14:05:46'),
