	(554, 760, 'carlos.carvalho', 'LOCAWEB:\r\nLogin: riscali\r\nSenha: raposa1975\r\n\r\nCMS\r\nwww.riscali.com.br/cms\r\nLogin: agence \r\nSenha: 150rtml', '2006-03-24 15:45:51'),
	(555, 760, 'carlos.carvalho', 'Lista de Alterações atualizadas:\r\n1 - WEBSITE: Colocar em negrito na frase que aparece em todas as páginas no rodapé: "Valores do imóvel sujeito a consulta com proprietário"; \r\n2 - CMS: Incluir uma função para fazer Levantamento de quantos imóveis tem cadastrado no site; \r\n3 - CMS/WEBSITE: Incluir a opção de "Indiferente" na busca por BAIRRO; \r\n4 - CMS/WEBSITE: Excluir os campos na parte de CONTATOS: Adm, Fin, Loc,Vend; \r\n5 - CMS: Verificar para onde estão sendo mandados os dados da avaliação do imóvel que o usuário faz; Alterar o e-mail para gilberto@riscali.com.br;\r\n6 - WEBSITE: Incluir o "Meta Description", "Meta keys" e "Metas robots" no começo do website para evitar que apareça o site antigo em site de busca. (Preparar a atualização do Google e Yahoo)\r\n7 - CMS/WEBSITE: Colocar em aleatório os banners e fotos do “vilareto magnólia” da home e outros condomínios, pré-selecionar imóveis no CMS; \r\n8 - CMS: Desenvoler ferramenta para INSERIR/EXCLUIR novos Banners na seleção de banners.\r\n9 - WEBSITE: Retirar a musica inicial do site.\r\n', '2006-03-27 11:41:38'),
	(556, 760, 'carlos.carvalho', 'Bruno, \r\nO cliente solicitou mais uma alteração: \r\n"Peço a gentileza para incluir no orçamento um detalhe importante que esqueci de mencionar. Em visita a outros sites de imobiliárias, notei que a busca também é direcionado pelo tipo de imóvel: terreno, comercial, casa, apartamento. No site da Riscali a busca somente oferece as seguintes opções: residencial, comercial, terreno. Desta forma, se o cliente pretender comprar um apartamento, e selecionar a opção direcionada no site da Riscali (residencial), aparecerão além dos apartamentos, também casas e terrenos, pois o nosso direcionamento de busca não filtra a opção." \r\n\r\nFavor verificar se é possível fazer essas alteração dentro das 24h estimadas ou qto tmp necessitará para alterar isso.', '2006-03-28 10:05:48'),
	(557, 760, 'bruno.freitas', 'Carlinhos,\r\n\r\nQuais as informações que devem ir no "Meta Description", "Meta keys" e "Metas robots"?\r\n\r\nAbs, \r\n\r\nBruno.', '2006-03-28 10:39:27'),
	(558, 760, 'carlos.carvalho', 'Meta description:\r\nProcurando imóveis em Taboão da Serra ou cidades vizinhas? A Riscali Imóveis atua no mercado imobiliário desde 1974, e já comercializou milhares de unidades habitacionais e comercias na região.\r\n\r\nMeta keys:\r\nImóvel, Imóveis, Terreno, Casa, Apartamento, Sobrado, Flat, Conjunto Comercial, Taboão da Serra, Riscali Imóveis, Compra, Venda, Aluguel, Corretor, Cotia, Embu, Ibiuna, Itapecirica da Serra, Joinville, Juquitiba, Osasco, Peruíbe, São Paulo, Vila Santa Luzia.\r\n\r\n<meta name="robots" content="" />\r\nno content colocar:\r\nindex - será indexado\r\nou\r\nfollow - indexa a página inicial e navega pelos links da pág. para indexa-los tb.\r\n', '2006-03-28 11:42:40'),
	(559, 760, 'bruno.freitas', 'Detalhando Item 7)\r\n\r\n- Hj existe um destaque na HOME.\r\n- Selecionar dentro do CMS alguma imóvies (no max 5) que seriam destaques da HOME\r\n- Mostrar destaques aleatoriamente na HOME', '2006-03-28 12:06:42'),
	(560, 724, 'carlos.arruda', 'Envolvido o Rodrigo Toledo para implantação.', '2006-03-28 13:10:34'),
	(561, 766, 'carlos.arruda', 'Desenvolvimento do sistema Estoq OnLine, um sistema com foco para o setor atacadista.\r\n\r\nVersão office com as seguintes funcionalidades:\r\n\r\nHome\r\n\r\n	- Botões de atalho (Cadastro de Cliente / Cadastro de Produto / Cadastro de Pedido de Venda / Classe de Produtos / Relatório de Vendas / Consulta de Pedidos de Venda)\r\n	- Alerta de Contas a Pagar\r\n\r\nCadastros\r\n\r\n	- Cadastro de Fornecedores\r\n	- Classe de Produtos\r\n	- Cadastro de Clientes\r\n	- Cadastro de Vendedores\r\n	- Cadastro de Produtos\r\n	- Cadastro de Veículos\r\n	- Cadastro de Despesas\r\n\r\nOperação\r\n\r\n	- Lançamento Bancário\r\n	- Romaneio de Entrega\r\n	- Contas a Pagar\r\n\r\nPedidos\r\n\r\n	- Pedido de Venda\r\n	- Pedido de Compra\r\n\r\nConsultas\r\n\r\n	- Pedido de Venda\r\n	- Bancos Cadastrados\r\n	- Fornecedores\r\n- Veículos\r\n- Clientes\r\n- Estoque\r\n\r\nRelatórios\r\n\r\n	- Vendas\r\n	- Bancos\r\n	- Pedido de Compra\r\n	- Contas a Pagar/Pagas\r\n	- Histórico de Pedidos\r\n\r\nUsuário\r\n\r\n	- Cadastro de Usuário\r\n	- Troca de Senha\r\n\r\n\r\nVersão móbile com as seguintes funcionalidades:\r\n\r\nPedidos\r\n\r\n	- Pedido de Venda\r\n	\r\nConsultas\r\n\r\n-	Pedido de Venda\r\n-	Estoque\r\n-	Clientes\r\n\r\nUsuário\r\n\r\n	- Troca de Senha', '2006-03-30 09:27:22'),
	(562, 767, 'carlos.arruda', 'Desenvolvimento de novas funcionalidades no sistema, tanto na versão office como móbile, de forma adequar o sistema dentro do escopo inicial contratado.\r\n\r\nEssas novas funcionalidades podem ser novos links, novos campos, novos relatórios, tudo que não se tenha previsto inicialmente na OS de número 1, prototipada no link abaixo:\r\n\r\nhttp://www.agence.com.br/propostas/stampa/estoq/\r\n\r\n', '2006-03-30 09:30:15'),
	(563, 678, 'carlos.arruda', 'Protótipo atualizado no CVS:\r\n\r\nRepositório: d:cvsrepoprototipos\r\nMódulo: Agence_Fretes2\r\n\r\nFavor gerar PE e anexar a essa OS.', '2006-03-30 15:35:31'),
	(564, 770, 'carlos.carvalho', '1 - Incluir em todo o website tipo de imóvel: terreno, comercial, casa, apartamento (retirar residencial). No site da Riscali a busca somente oferece as seguintes opções: residencial, comercial, terreno. \r\n2 - Alterar o logo de todo o website e incluir: \r\n                             Riscali Imóveis \r\n                                   Desde 1974', '2006-03-31 15:37:22'),
	(565, 770, 'carlos.carvalho', '3 - Colocar o link da HOME no logo da Riscali. (se não for demorar muito)', '2006-03-31 15:42:45'),
	(566, 774, 'bruno.freitas', 'Pessoal,\r\n\r\nSó lançar horas nessa OS se estiver fazendo um refactoring indispensável no sistema relacionado ao código fonte. Novas requisições e alterações no cliente devem ter as horas lançados da OS de Desenvolvimento do Sistema.', '2006-03-31 17:12:19'),
	(567, 761, 'carlos.carvalho', 'Proposta perdida.\r\nA Traffic escolheu um outro fornecedor que "ofereceu mais funcionalidades no sistema que diminuirá  serviço dos usuários."\r\n', '2006-04-03 18:58:48'),
	(568, 776, 'carlos.arruda', 'Liberado como projeto interno da Agence, documentação de especificação do projeto Okube.', '2006-04-04 10:19:43'),
	(569, 777, 'carlos.carvalho', '1 - Cidades a serem excluídas: (favor já executar isso)\r\n1ª - Joinville\r\n2ª - Ibiúna\r\n3ª - Peruíbe\r\n4ª - Juquitiba\r\n5ª - teste (aparece no campo cidade) \r\n\r\n2 - Dimensionar qto tmp levará para desenvolver a funcionalidade de não aparecer a cidade no campo de busca da Home, quando não existir imóveis cadastrados para essa cidade ou os imóveis forem lançados como inativos? (por enquanto eles não estararão realizando esta mudança, somente gostariam de saber se há a possibilidade e qto tmp leva para isso) \r\n\r\n3 - Dimensionar o tempo que levará para desenvolver mais áreas com diferentes banners:\r\nhoje eles tem 5 páginas com banners diferentes. Eles desejam colocar um banner diferente para cada página no site gereciado pelo CMS. Por exemplo: na secao de DICAS RISCALI eles querem um banner para cada subseção. Eles querem q a agence desenvolva os banners tb. No total serão 12 banners que serão desenolvidos por algum webdesigner da Agence. (Apenas dimensioanr o tmp)\r\n\r\nObs: eles nos falaram que qdo realizaram um teste no campo "AVALIE SEU IMÓVEL" e está ocorrendo algum tipo de erro, pois na hora do envio, surgem as mesmas situações que estavam aparecendo quando o cliente tentava passar para a segunda página da procura de imóveis.', '2006-04-06 09:26:08'),
	(570, 724, 'carlos.arruda', 'Desenvolvimento concluído, em garantia até 25/06.', '2006-04-06 18:26:57'),
	(571, 767, 'Daniel Silveira Claudino', 'bicha', '2006-04-07 11:19:09'),
	(572, 777, 'carlos.carvalho', '4 - No campo de contato, o cliente hoje tem as seguintes opções: nome / e-mail / assunto / mensagem. \r\n \r\nO telefone, que para eles é uma ferramenta fundamental para que o corretor entre de imediato em contato com o cliente, não há campo para o mesmo, além de outras opções que resumiria de imeditato a intenção do cliente, incluir o seguinte: \r\n \r\nCONTATO\r\nnome:*\r\ne-mail: \r\ntelefone:*\r\nprocurando: ( ) residencial           ( ) comercial *\r\ntipo: ( ) casa ( ) apartamento ( ) galpão ( ) sala ( ) terreno *\r\ntransação: ( ) comprar ( ) vender ( ) alugar *\r\ncidade: ( ) *\r\nmensagem: \r\n \r\nretirar o campo "assunto" conforme consta na área de contato do site. \r\n* campos obrigatórios. \r\n', '2006-04-10 10:07:26'),
	(573, 785, 'carlos.arruda', 'Desenvolvimento de um site b2b Consulta Frete e seu back-end, conforme especificado em protótipo publicado no link abaixo.\r\n\r\nhttp://www.consultafrete.com/prototipo_zazaza/\r\n', '2006-04-11 19:38:19'),
	(574, 786, 'civio.couto', 'Essa etapa compreende a homologação do Gestão RI e implementação de uma nova validação de usuários para viabilizar a entrada do sistema em produção.\r\nPor isso, os valores estão estimados de acordo com a informação passada pelo analista Max Abrahão da Accenture e pode se estender de acordo com o cliente.', '2006-04-12 10:36:07'),
	(575, 786, 'civio.couto', 'Correção da arquitetura utilizada.', '2006-04-12 10:50:34'),
	(576, 766, 'carlos.arruda', 'Protótipo atualizado com o novo padrão de layout Agence, agora com menu cross-browser.\r\n\r\nAtualizar em:\r\n\r\nRepositório: d:cvsrepoprototipos\r\nMódulo: Stampa_NovoLayout\r\n\r\nQualquer dúvida entrem em contato.', '2006-04-13 10:08:31'),
	(577, 785, 'carlos.arruda', 'O layout será re-desenhado só que as funcionalidades já estão especificadas no protótipo disponível no CVS.\r\n\r\nMódulo: Agence_Fretes2\r\nRepositório: d:cvsrepoprototipos\r\n\r\nQualquer dúvida entre em contato.\r\n', '2006-04-18 09:18:17'),
	(578, 785, 'carlos.arruda', 'Segue abaixo do protótipo para ser baixado do back-end do sistema:\r\n\r\nrepositório: d:cvsrepoprototipos\r\nmódulo: Agence_Fretes_BackEnd\r\n\r\nPara a manutenção de alguns dados fora do site.', '2006-04-18 16:31:41'),
	(579, 785, 'carlos.arruda', '1) Qual o objetivo do sistema? \r\n    R: Oferecer um serviço de anúncio de frete de cargas e de caminhões para pessoas e empresas. Exatamente.\r\n\r\n2)Quem são os usuários do sistemas? \r\n   R: Existem 2 módulos, o site (front-end) e o site (back-end). No site front-end é o todo bonitinho, onde os usuários serão os que preencherem o cadastro no próprio site para poderem anunciar (caminhões ou cargas). No back-end os usuários serão apenas os administradores de sistema, que poderão cadastrar alguns dados exclusivos deles, especificado conforme protótipo sincronizado no cvs, esses usuários poderão cadastrar tipo de camihões, parceiros, extrair relatórios, etc.\r\n\r\n3) Qualquer pessoa pode usar o sistema?\r\n    R: Qualquer pessoa pode acessar o sistema para consultar fretes. Anunciar carga / caminhões, minhas buscas e meus anuncios somente para usuarios cadastrados, só que no caso do anunciar carga/caminhao só vai pedir a senha ou preencher o cadastro quando o usuário for salvar o anúncio, de modo não atrapalhar o preenchimento do anúncio.\r\n \r\n4) Parceiros.\r\n   R: Os parceiros são empresas cadastradas via backend, a partir de um contrato feito extra sistema.\r\n \r\n5) Na tela do protótipo, na parte superior esquerda existe uma parte para login que só aparece para as abas Anunciar Carga e Anunciar Caminhão. Todas as abas estariam visíveis para as pessoas da internet ou estariam condicionadas a um login?\r\n   R: Todas são visíveis aos usuários só que para anunciar carga/caminhao é necessário o login/senha, caso nao seja feito no momento em que ele entrar na aba sem problemas, o sistema deve permitir o preenchimento do anuncio só que no momento de salvar o sistema identificando a falta do login/senha ele pede para o usuario, caso ele nao tenha ele pode no mesmo momento cadastrar uma, de modo nao travar o processo por causa do cadastro.', '2006-04-18 16:47:37'),
	(580, 777, 'bruno.freitas', 'Carlinhos,\r\n\r\nFizemos um dimensionamento de 2 horas de desenvolvimento (WebDesigner) por banner.\r\nCom isso, temos 2*12 = 24 horas. \r\n\r\nPara as demais alterações (Item 2 e Item 3) o tempo de desenvolvimento é pequeno. Podemos colocar 4 horas para garantirmos os testes das funcionalidades.\r\n\r\nO dimensionamento total para o OS fica, então, em 28 horas.\r\n\r\nAbs,\r\n\r\nBruno.', '2006-04-18 17:15:43'),
	(581, 790, 'carlos.arruda', 'Desenvolvimento de adequações e integrações como especificado abaixo: \r\n\r\n1.1) Ler informações diretamente da base TOIOS sem armazenar em tabelas do BP. Desejado também que os processos não dependam de outros sistemas como SGV.\r\n\r\n1.2) Acertar relatório de BP para consolidar as informações vindas do TOIOS.\r\n\r\n2.1) Criar tabela no Oracle que armazene as informações dos arquivos da ANFAVEA \r\n           1)Emplacamentos \r\n           2)Renavan.\r\n\r\n2.2) Criar rotina no BP (start pelo usuário) que leia esses arquivos e armazene na tabela.\r\n\r\n2.3) Acertar relatório de BP para consolidar as informações vindas dessa tabela. ', '2006-04-19 09:14:32'),
