	(587, 794, 'carlos.arruda', '- Incluir sequencial de número da liberação e ano. \r\n\r\n- Incluir a informação nas páginas de alvará, relatórios e extrato.\r\n\r\n- Incluir cancelamento de transferências. Esta funcionalidade cancelaria automaticamente o último procedimento de transferência realizado em uma subconta.\r\n\r\n- Permitir não ser obrigatório na transferência ter as mesmas partes.\r\n\r\n- Armazenamento de histórico de saldos diários das subcontas.\r\n\r\n- Adaptação do relatório de modo que consulte a nova estrutura de dados que será desenvolvida.\r\n\r\n- Usuários do tipo Normal possam cadastrar apenas usuários do tipo Advogado. Atualmente um usuário do tipo Normal pode cadastrar qualquer tipo de usuário.\r\n', '2006-04-24 16:04:28'),
