	(636, 710, 'carlos.arruda', 'Novo contato do cliente para marcar nova discussão do projeto. Segue e-mail:\r\n\r\nCarlos,\r\nConforme havíamos falado há alguns dias, retomaremos o projeto do SGC agora em junho. \r\nGostaria de verificar com você a possibilidade de marcarmos uma reunião par discussão da proposta previamente apresentada por vocês e início dos trabalhos. \r\nComo ña semana que vem, estarei fora alguns dias e haverá jogo do Brasil, minha sugetsão é marcarmos na semana do dia 26, pode ser?\r\nVocês podem na 2a ou 3a feira, dias 26 ou 27?\r\n \r\nAbs,', '2006-06-18 17:32:38'),
	(637, 851, 'carlos.arruda', '1. Deixar apenas os 98 imóveis listados no documento anexo ativos no site, o restante poderá ser excluído.\r\n\r\n2. Alterar fluxo no website, o usuário visitante (internauta) anunciará o seu imóvel normalmente, no entanto ele não estará disponível imediatamente no portal. Deverá ser criado uma nova tela no "CMS" do site (http://www.riscali.com.br/cms/) que listará os anúncios pendentes de autorização, com isso o usuário administrador (Sr. Gilberto) poderá liberar ou não o imóvel anunciado pelo internauta. Com a liberação o imóvel passará a estar disponível no website Riscali (http://www.riscali.com.br). \r\n\r\n3. Listar como sugestão de softwares fáceis e bons para serem utilizados para gerar banners. \r\n', '2006-06-19 09:48:41'),
