	(656, 868, 'nivaldo.junior', 'Desenvolver relatório conforme layout anexo, utilizando como critério de seleção : \r\n- Todos os clientes pessoa jurídica (PJ) e PF que possuam plano do portifólio de PJ (inclusive SOHO e Associaçoes).\r\n- Que estejam bloqueados (suspensos) pelos motivos  "Perda e Roubo" ou  "A Pedido", independente da data em que ocorreu a suspensão.\r\nRelatório com entrega semanal a ser disponibilizado por e-mail ludmilla.groessler@vivo.com.br e adamita.mizuno@vivo.net.br.\r\n\r\nO layout é: \r\nTelefone: 9999999999 (ex:6199771200)        \r\nNome                      (ex: FULANO DA SILVA LTDA)\r\nCNPJ            	(ex: 00.111.222/0001-33)\r\nTipo Bloqueio  (ex: PERDA ou ROUBO)\r\nHabilitação (ex: 99/99/9999)\r\nBloqueio   (ex: 99/99/9999)\r\nUltima Troca de Celular (ex: 99/99/9999)\r\nCanal/login         (ex:DF123456)\r\nCARTEIRA (PME ou GCN)       (ex: Governo, embaixadas,...) – ver customergroup\r\nEndereço Completo (SHIS Qi......Brasilia, DF)	                    	\r\nTelContato_01 (ex:612444444)\r\nTelContato_02  (ex:612444444)\r\n\r\n', '2006-06-28 16:53:16'),
	(657, 831, 'carlos.arruda', 'Adicionado o analista Alex para estudo do framework adotado pela Agence para sistemas PHP/Ajax.\r\n\r\nHoras de estudo com tecnologias envolvidas no desenvolvimento de sistemas utilizando AJAX e PHP. Exemplos dessas tecnologias são: PHP, XOAD (framework ajax), SMARTY (template de páginas PHP), JAVASCRIPT.', '2006-07-03 17:36:46'),
