	(665, 873, 'carlos.arruda', 'Bruno,\r\n\r\nFavor gerar PE para a seguinte demanda da Orbe:\r\n\r\n- As páginas dos fundos (Orbe Value FIA, Orbe Balance FIM, Clube Orbe Value II), foram crescendo em quantidade de informações, e nos acabamos deixando muito bagunçadas em termos de conteúdo. Gostariamos de ver conseguiriamos reforma-las da alguma maneira, melhorando o design de alguma forma, organizando melhor o conteúdo.  \r\n\r\n- Colocar um link nas páginas de cada fundo com as fichas de cadastro para download. Podemos criar uma área para download só para quem quiser se cadastrar ou no final da página de cada fundo colococamos a opção. A questão é que isto se encaixa com o item 1, pois tem que ficar bonito. Incorporado à página e de preferência com uma figura e não um texto.   \r\n\r\n- Temos um e-mail diário que o site dispara para pessoas cadastradas. Gostaríamos de incluir neste mecanisno a possibilidade de colocar uma mensagem neste  e-mail diário, eventualmente, em dias que acontecem novidades ou problemas.  \r\n\r\n- Precisamos incluir um link na página na "A empresa" para o download de um documento, nosso "código de ética" \r\n\r\n- Precisamos criar um ferramenta no módulo administrador para podermos disparar mensagens para quem se cadastra no site. O texto a gente entra, mas o layout do email disparado é preciso fazer um bem legal. Hoje temos o mecanismo que envia o e-mail diário, mas só envia o lay-out definido do e-mail dário, queriamos um mecanismo para mandar um outro e-mail eventualmente para estes cadastrados. \r\n\r\n- Além disso precisamos fazer um página em ingles nosso, mas ainda precisamos definir se será um tradução total  do site, ou só algumas páginas. Por enquanto deixe isso fora do orçamento, mas em alguns dias vou ter isso definido.  \r\n\r\n- No modulo administrativo temos um banco de dados onde vamos acumulando diariamente as cotas dos fundos e os indices comparativos. Um destes indices, o FGV-100 mudou de forma, e agora temos lá 2 anos de informacoes diárias deste índice no formato 500.000, que precisavam ser alterados para 5.000, ou seja, dividir por 100  todas as entredas deste banco de dados. \r\n\r\n- Este já haviamos orçado no passado e agora precisamos fazer: na tabela que aparece na prim era página do site, voc6es colocaram um limitaçào que sempre terá somente 3 linhas, assim no modulo administrativo sempre temos que deixar "Ativados" apenas 3 fundos/indices. Precisamos retira esta limitação pois vamos ter mais fundos \r\n\r\nA Orbe tem um site desenvolvido conosco (http://www.orbeinvestimentos.com) feito em PHP e desenvolvido parte em CG (Nixon), parte em DF (Nivaldo) e alguma coisa por aqui (Toledo).', '2006-07-04 19:25:30'),
	(666, 767, 'bruno.freitas', 'OS cancela temporariamente. Todas as horas do projeto devem ser armazenadas na OS 1 de desenvolvimento do sistema.', '2006-07-05 13:52:24'),
