	(670, 849, 'carlos.arruda', 'Alterada de volta a OS para o status "em desenvolvimento".\r\nO Daniel Pires passou a informação que teriam ainda mais algumas implementações a serem feitas.', '2006-07-06 15:55:28'),
	(671, 766, 'carlos.arruda', 'Envolvida a Cyntia para o projeto para a confecção do protótipo da versão mobile.', '2006-07-06 17:15:28'),
	(672, 880, 'liana.duenha', 'Daniel e Alex, já estão disponíveis os arquivos .html e .css que temos até agora. Todos fazem parte do BACKEND. Na segunda-feira receberemos os arquivos do FRONTEND. Nossa data limite é dia 12. ', '2006-07-07 16:48:18'),
	(673, 272, 'nivaldo.junior', 'Inclusão de novo analista.', '2006-07-10 18:02:19'),
	(674, 883, 'carlos.arruda', 'Aprovado o dimensionamento, entrega prevista para dia 10/08.\r\n\r\nDesenvolvimento dos documentos de especificação e projeto, contemplando os seguintes artefatos: \r\n\r\n- Documento de Visão \r\n- Documentos de Regras de Negócio \r\n- Glossário \r\n- Casos de uso com detalhamento \r\n- Diagrama de Classes com detalhamento \r\n- Diagrama de Sequencia com detalhamento \r\n- Documento de Arquitetura (citando patterns e frameworks utilizados) \r\n- Modelo de entidade relacionamento \r\n- Dicionário de dados \r\n\r\nObs.: Todos os documentos vão ser entregues no formato Word e os diagramas no formato Jude Free. O documento de entidade relacionamento serão entregues no DBDesigner Free.\r\n', '2006-07-11 14:32:10'),
	(675, 880, 'bruno.freitas', 'Atualizado status do projeto.', '2006-07-12 00:23:58'),
	(676, 880, 'bruno.freitas', 'Adicionado Rodrigo Toledo a OS.', '2006-07-12 18:21:41'),
	(677, 884, 'carlos.arruda', 'As áreas em questão serão chamadas de “Rally dos Sertões” e “Calendário 2007” e deve contemplar as seguintes funcionalidades:\r\nSuporte para ftp dos dados, esses dados são arquivos .JPG e arquios .DOC.\r\nO sistema deverá suportar arquivos de alta resolução, com uma quantidade de bytes realmente alta.\r\n\r\nA área deverá ser acessada por usuários comuns, classificados como “usuário”. E também acessado por super usuários, classificados como “admin”.\r\n\r\nNa versão usuário o sistema lerá no servidor FTP todos os diretórios criados gerando tumbnails para cada diretório, dividindo assim na página web em grupos. \r\nEssas fotos serão apresentadas em formato miniatura. Ao clicar sobre uma foto abrirá a foto numa pop-up em tamanho natural, podendo assim ser salva.\r\nO diretório chamado “restrito” não será lido pelo sistema nessa versão usuário.\r\n\r\nNa versão admin o sistema lerá no servidor FTP todos os diretórios criados gerando tumbnails (miniatura das fotos) para cada diretório, dividindo assim na página web em grupos, cada grupo com o nome do diretório. \r\nEssas fotos serão apresentadas em formato miniatura. Ao clicar sobre uma foto abrirá a foto numa pop-up em tamanho natural, podendo assim ser salva.\r\nO diretório chamado “restrito” deverá ser lido pelo sistema nessa versão admin.\r\n', '2006-07-12 19:36:19'),
	(678, 880, 'carlos.arruda', 'Adicionado o Marco Malaquias à OS.', '2006-07-13 12:28:19'),
