	(700, 880, 'gustavo.gomes', 'Inclusão do analista Og Rafael.', '2006-07-25 09:26:56'),
	(701, 887, 'carlos.arruda', 'Cadastrada a OS.\r\nNo aguardo das informações.\r\n\r\n1. Quais os principais diferenciais da empresa, responsáveis por atrair clientes para ela? (localização geográfica, preços, prazo de entrega, qualidade, marketing, etc)\r\n  \r\n2. Você tem exemplos de sites com os quais você se identifica? Caso positivo, cite os links ao lado e as razões que o atraem nos mesmos.\r\n  \r\n3. Dados de FTP do site atual (host, login, senha).\r\n  \r\n4. Dados para acesso ao Banco de Dados do site atual (host, login, senha).\r\n \r\n', '2006-07-25 14:44:29'),
	(702, 853, 'liana.duenha', 'Data de início das atividades de desenvolvimento e data de entrega atualizadas.  ', '2006-07-25 16:05:16'),
	(703, 887, 'carlos.carvalho', 'Respostas as questões:\r\n\r\n1 - A NBS é hoje a única software house do mercado que tem sistema client-server com Banco de Dados Oracle e Interface Windows em todos os módulos.  A NBS é uma empresa que desenvolve softwares de gestão empresarial na área de concessionárias e distribuidoras. \r\n\r\n2 - www.microsiga.com.br .... mas utilizando as cores oficiais do atual website da NBS.\r\n\r\n3 - O site está hospedado no próprio servidor do NBS. Favor entrar em cotato o mais rápido possível pelo MSN com o Thiago  (sousa_thiago@hotmail.com) pessoa da NBS responsável pela manutenção do website. Temos que nos preparar tecnicamente para desenvolver o sistema na plataforma deles. \r\n\r\n4 - idem para o base ORACLE.\r\n\r\nEXTRAS:\r\n- Favor conversar com o Thiago sobre  a área de download atual do site  (hoje eles tem um FTP tambem)\r\n- Existe uma Central de Pedidos (área de cliente) q eles não sabem se vão vai chamar o novo CRM deles ou nao. Vai ser decidido isto. Mas teremos que criar a área com o link para a área deles.\r\n- verificar a questão de seguranca pq eles ja foram invadidos varias vezes. Seria o caso de sugerimos outro provedor?\r\n- Eles desejam q o site seja .net mesmo. \r\n\r\n\r\n\r\n', '2006-07-25 21:15:44'),
	(704, 887, 'carlos.carvalho', 'Mais detalhes:\r\n\r\n- As cores oficiais da NBS é Azul e Branco e Cinza (as mesmas do logo);\r\n- Necessito do layout para aprovação do cliente, enquanto isso, devemos contatar o thiago (NBS) para alilharmos toda a parte técnica do atual site e do futuro.\r\n- Eles gostam muito do site da Microsiga mas não querem uma introdução inicial do site (é desnecessária).\r\n- o cliente tem urgência no novo website e portanto devemos aprovar o layout e iniciar o desenvolvimento ainda essa semana.\r\n- o ótimo trabalho que iremos fazer para esse cliente será uma porta de entrada para VARIAS concessionários clinetes deles.', '2006-07-25 21:30:35'),
	(705, 194, 'bruno.freitas', 'Adicionado Felipe a OS.', '2006-07-26 10:45:44'),
	(706, 888, 'felipe.chahad', 'Criada a Os de prospecção do projeto NBSWeb.', '2006-07-26 13:22:17'),
	(707, 806, 'bruno.freitas', 'Adicionado Paulo a OS.', '2006-07-26 17:43:44'),
	(708, 889, 'carlos.arruda', 'Desenvolvimento de upgrade no site e no admin contemplando as seguintes funcionalidades:\r\n\r\n- Desenvolvimento de novo editor de conteúdo para o "Admin" que possa manter as propriedades de um editor de texto como Word. De forma permitir os usuários apresentar o conteúdo dos fundos da forma mais customizada possível.\r\n\r\n- Colocar um link nas páginas de cada fundo para o download das fichas de cadastro. Esse link deve seguir de um ícone que simbolize essa ação. O "Admin" deve então permitir o cadastramento dessas fichas para cada fundo do site (Orbe Value FIA, Orbe Balance FIM, Clube Orbe Value II).\r\n\r\n- Colocar um link na página "A empresa" com o "código de ética". Adicionar então o recurso no "Admin" onde possa administrar um documento na página "A empresa" permitindo assim o download do documento na página. \r\n\r\n- Desenvolvimento de ferramenta de e-mail marketing, permitindo o envio de e-mail customizado para os usuários cadastrados no site. Essa ferramenta deve possuir um editor de conteúdo tão bom quanto o novo que deverá ser desenvolvido, para permitir formatações feitas no Word.\r\n\r\n- No modulo administrativo temos um banco de dados onde vamos acumulando diariamente as cotas dos fundos e os indices comparativos. Um destes indices, o FGV-100 mudou de forma, e agora temos lá 2 anos de informacoes diárias deste índice no formato 500.000, que precisavam ser alterados para 5.000, ou seja, dividir por 100 todas as entredas deste banco de dados. \r\n\r\n- Retirar limitação de somente 3 linhas, assim no modulo administrativo tem que poder deixar "Ativados" quantos fundos/indices for desejado.\r\n', '2006-07-27 10:09:55'),
	(709, 806, 'bruno.freitas', 'Adicionado Eric a OS.', '2006-07-31 17:54:30'),
	(710, 858, 'nivaldo.junior', 'Inclusão de novo analista.', '2006-07-31 18:33:46'),
