	(80, 5, 'marcio.lamego', 'Alteração para enviar email se o usuário cadastrou algum comentário seja na área do caol como na area do cliente . envia email em todas as abas: pendentes, atendidos e cancelados.', '2005-07-06 16:17:06', '', NULL),
	(81, 14, 'carlos.arruda', 'Mas continua aparecendo todos os sistemas que possuam chamados abertos, ou seja, todo consultor poderá consultar chamados abertos de outros sistemas onde ele não é responsável, só que terá que selecionar na combo o sistema desejado. \r\nPor default levará "Todos os sistemas que sou responsável", pode alterar o nome "Todos" para esse.', '2005-07-06 16:26:30', '', NULL),
	(82, 18, 'carlos.arruda', 'Não é por causa do erro jscript que o sistema não salva, nao sei o que há mas nao consigo salvar qualquer alteração no cadastro de sistema. Como se o botao tivesse desabilitado.', '2005-07-06 16:45:41', '', NULL),
