	(100, 29, 'marcio.lamego', 'A troca de senha já foi corrigida', '2005-07-08 14:42:29', '', NULL),
	(101, 33, 'marcio.lamego', 'Este problema é devido ao fato da tabela utilizada já existir antes do refactoring assim existiam emails com os cadastradas para acompanhamento . Precisa-se entrar no banco pelo phpmyadmin e excluir os acompanhamentos que não são necessários', '2005-07-08 14:51:36', '', NULL),
	(102, 32, 'carlos.arruda', 'Somente na guia "Chamados atendidos" que a ordenacao fica por data/hora. Na guia "Chamados pendentes" continua normal, por prioridade. \r\nE nao tá normal, verifiquei agora na guia "Chamados atendidos" e tem um chamado do dia 07 que vem depois de um do dia 06.', '2005-07-08 15:32:45', '', NULL),
