	(168, 89, 'carlos.arruda', 'CH,\r\n\r\nJá tem as guias "Chamados Pendentes", "Chamados Atendidos" e "Chamados Cancelados", que é para isso mesmo.\r\n\r\nCarlos', '2005-07-27 14:17:07', '', ''),
	(169, 89, 'carlos.carvalho', 'Explicação:\r\nEu sei que tem essas guias mas são somente para CONSULTA. \r\n1 - Incluir o COMBO, depois da OS e antes do Chamado com o filtro para selecionar de os Chamados Pendentes, Cancelados e Atenditos.\r\nNo caso de uma OS que ja tenha muitos chamados abertos, qdo vamos alterar/editar um chamado, temos que ficar procurando numa lista bem grande de chamados onde está o chamado que desejamos alterar. Por isso seria interessante mais um filtro. (ex. OS website Caltabiano) \r\n\r\n2 - Incluir tb o Status do Chamado (Pendente, Cancelado, Atendido) na visualização do chamado no Cadastro de Chamados.  Qdo estamos alterando um chamado, não sabemos qual o status atual dele. Temos que ir nas Guias de Chamados Pendentes para saber qual o estatos. \r\n\r\nSugestão: Poderíamos ter um link das guia de chamados para ALterar/Editar o Chamado selecionado.', '2005-07-27 15:28:31', '', ''),
