	(463, 263, 'marcio.paulino', 'quando o valor da DATA TOYOTA for igual a NULO (não tiver valor) para os tipos mencionados na descrição acima, pode ser pêgo o valor da DATA DO PEDIDO ?', '2006-04-04 19:50:48', '', ''),
	(464, 263, 'marcio.paulino', 'quando o valor da DATA TOYOTA for igual a NULO (não tiver valor) para os tipos mencionados na descrição acima, pode ser pêgo o valor da DATA DO PEDIDO ?', '2006-04-04 19:54:18', '', ''),
	(465, 263, 'marcio.paulino', 'quando o valor da DATA TOYOTA for igual a NULO (não tiver valor) para os tipos mencionados na descrição acima, pode ser pêgo o valor da DATA DO PEDIDO ?', '2006-04-04 19:59:33', '', ''),
	(466, 267, 'marcio.paulino', 'Foi corrigo a aparição da legenda estranha na geração do gráfico. Na correção foi adicionado mais um gráfico de linhas, sendo que, quando existem Vendas Realizadas é utilizado o gráfico de Colunas e Linhas (informação fundamental para calcular o O/R), caso contrário é utilizado somente o gráfico de Linhas.', '2006-04-05 11:07:26', '', ''),
	(467, 267, 'marcio.paulino', '"Vendas Realizadas" e "Vendas Realizadas mês passado" são capturadas a partir da junção das tabelas Veiculos, ItemPedidoExtra, Divisao, PS, Cor, TipoCliente, ItemPedidoVenda e PedidoVenda. Sendo que os valores diários de um determinado mês são obtidos a partir do campo "dataNf" da tabela "VEICULOS" e do campo "qtFaturada" da tabela "ITEM-PEDIDO-VENDA". Segue em anexo um exemplo da consulta utilizada.', '2006-04-05 11:32:20', '', 'h050420061132_vendasRealizadas_SVD.sql'),
	(468, 267, 'marcio.paulino', '"Objetivos" são capturadas a partir da junção das tabelas SVD_OBJETIVO_CONSULTOR, SVD_DIVISAO_OBJETIVO e SVD_OBJETIVO_DIARIO_VENDAS. Sendo que os valores diários de um determinado mês são obtidos a partir do cálculo do objetivo diário de venda (objetivoDiarioVendas.objetivo) e da porcentagem do objetivo do consultor (objetivoConsultor.objetivo). Segue em anexo um exemplo da consulta utilizada.', '2006-04-05 12:00:36', '', 'h050420061200_objetivos_SVD.sql'),
	(469, 267, 'marcio.paulino', '"Carteiras" são capturadas a partir da junção das mesmas tabelas na consulta da funcionalidade da carteira de pedidos. Os valores retornado são diariamente a quantidade de vendas em carteira. Segue em anexo um exemplo da consulta utilizada.', '2006-04-05 12:06:02', '', 'h050420061206_carteiras_SVD.sql'),
	(470, 263, 'marcio.paulino', 'O Fernando (Bart) sugeriu que se o tipo for um dos mencionados acima e a DATA TOYOTA for nulo, o campo irá aparecer vazio no formulário (tela).', '2006-04-05 12:33:11', '', ''),
