	(473, 268, 'rodrigo.areco', 'Testes e ajustes nas consultas envolvidas na funcionalidade histórico de clientes', '2006-04-05 20:45:00', '', ''),
	(474, 268, 'rodrigo.areco', 'Testes e ajustes nas consultas envolvidas na funcionalidade histórico de clientes', '2006-04-05 20:45:52', '', ''),
	(475, 264, 'marcio.paulino', '(1) O primeiro problema foi resolvido atualizando a tabela SVD_TIPO_CLIENTE da base de homologação; (2) Não foi encontrado o segundo problema, sendo que a  TELA EM BRANCO aparece devido ao elevado processamento da funcionalidade de acordo com o processamento sem filtros. Com isso a TELA EM BRANCO aparece, mas com um tempo o resultado é mostrado normalmente na tela. Caso este problema da TELA EM BRANCO permaneça, por gentileza, notifique exatamente os filtros utilizados para que possamos testar na base de homologação da toyota.', '2006-04-06 10:59:44', '', ''),
	(476, 269, 'marcio.paulino', 'Tal problema foi resolvido devido a remoção da formatacao de data no jsp, sendo que a formatacao é feita no codigo java e o jsp apenas imprime a data.\r\n', '2006-04-06 11:01:13', '', ''),
