	(489, 262, 'marcio.paulino', '1) Foi implementado o filtro com o intervalo menor da faixa de volume de compras. Agora, os valores destes intervalos estão sendo pegos na tabela SVD_DESCONTO (campos DE e ATE).\r\n\r\n2) Foi sugerido e acertado com a Paula Regina Tamassia (Toyota) o desenvolvimento de um módulo em Excel para a geração do relatório da consulta de preços. Isto foi sugerido para adiantarmos o fechamento do pacote do SVD - fase 2, visto que a geração do mesmo em PDF irá demandar um elevado tempo para a conclusão. Após a conclusão do pacote, com os devidos ajustes, será desenvolvido o módulo para a geração de tal relatório em PDF como exigido na funcionalidade.', '2006-04-11 19:03:08', '', ''),
