	(708, 446, 'jefferson.silva', 'Existe uma regra para isso,  q o Bruno havia me passado:\r\n"Sobre as datas para desconto: Qdo o termo for enviado até o dia 15 de cada mês o desconto deve ser no dia 05 do 1ª mês subseqüente e depois do dia 15 no 2º mês subseqüente."\r\n\r\nou seja só pode ser dia 05 e ainda tem essa lógica.', '2006-12-13 16:17:21', '', ''),
