	(744, 469, 'jefferson.silva', 'Realizei o teste aqui, e não aconteceu conflito.\r\n1º Solicitei um veículo de 21/12/2006 até 22/12/2006, depois tentei solicitar o mesmo no período. E ele não estava mais disponível. Realizei todos os passos do veículo até ele ser liberado novamente e foi testado o período de indisponibilidade e funcionou perfeitamente. Explique melhor aonde está dando conflito.', '2006-12-21 17:04:26', '', ''),
