	(773, 474, 'jefferson.silva', 'Adicionado filtros Frota(Modelo) e Unidade.\r\nFiltro período não é possível pois precisaríamos também do turno, e esse relatório tem a função de indicar os veículos disponíveis para o momento atual.', '2006-12-23 17:21:06', '', ''),
