	(776, 478, 'carlos.arruda', 'Não está igual ao protótipo, campos como CHASSI ainda nao aparece no relatorio.', '2006-12-25 19:24:15', '', ''),
	(777, 469, 'carlos.arruda', 'Testei e o problema persiste. Abaixo segue os passos que fiz:\r\n\r\n- Com o usuário X solicitei um veículo com o seguinte período de permanência:\r\n\r\nPeríodo de Permanência(Sáida) 31/12/2006  Turno(Saída) 08:00 até 09:59  \r\nPeríodo de Permanência(Volta) 02/01/2007  Turno(Volta) 10:00 até 11:59  \r\n\r\nDepois logei com o usuario Y e coloquei o seguinte período de permanência:\r\n\r\nPeríodo de Permanência(Sáida) 02/01/2007  Turno(Saída) 08:00 até 09:59  \r\nPeríodo de Permanência(Volta) 06/01/2007  Turno(Volta) 10:00 até 11:59  \r\n\r\nQuando vejo a listagem de veículo o mesmo veículo solicitado pelo usuário X aparece na combo, só que veja que ele nao está respeitando a parametrizacao de insdisponibilidade, porque o veiculo nao pode aparecer para o usuario Y para uma solicitacao de saída no turno "08:00 até 09:59" se o veículo só vai ser devolvido no turno de "10:00 até 11:59".\r\n \r\n Esse veículo só poderia aparecer para o usuario Y a partir do no "14:00 até 15:59" porque eu  tinha parametrizado 2 horas de indisponibilidade.', '2006-12-25 20:30:16', '', ''),
	(778, 474, 'carlos.arruda', 'Tem que adicionar o período tb, e sem turno. Ele deve funcionar como um relatório para saber a disponibilidade de veículos para um determinado período, independente de turno, como se fosse das 00:00 até 24:00 daquele período.', '2006-12-26 07:10:42', '', ''),
	(779, 493, 'carlos.arruda', 'Quando clico no link "LIBERAR SAÍDA DE VEÍCULO" abre pop-up com mensagem: \r\n\r\n"O acesso a este recurso não está autorizado para o seu perfil. " \r\n\r\nUsuário logado: Tipo "Operador", com o usuário do tipo "Admnistrador" não dá erro.', '2006-12-26 07:23:03', '', ''),
	(780, 491, 'carlos.arruda', 'Usuario do tipo "Operador" só enxerga os itens:\r\n\r\n- Servicos -> Saída de Veículo\r\n- Servicos -> Entrada de Veículo\r\n\r\nHoje ele está vendo tb o item "Cadastros -> Veículo" ', '2006-12-26 07:23:49', '', ''),
	(781, 491, 'jefferson.silva', 'Alterado a autorização.', '2006-12-26 08:51:20', '', ''),
	(782, 493, 'jefferson.silva', 'Alterado a autorização.', '2006-12-26 09:10:28', '', ''),
	(783, 469, 'jefferson.silva', 'Ok Carlos, em um ponto se confirmou o usuário realmente estava conseguindo solicitar o veículo entre o horário de uma outra solicitação.\r\nAgora esse parâmetro de indisponibilidade do veículo, somente se aplica qdo o veículo já foi solicitado e retornado para o pátio, ou seja o q passa a valer é o :\r\n\r\ndisponivel = horário em q este veículo foi liberado + tempo de indisponibilidade \r\n\r\nSe disponível for menor q a data turno da nova solicitação liberado, do contrário não.', '2006-12-26 10:20:34', '', ''),
	(784, 492, 'jefferson.silva', 'Implementado, não havia notado isso no protótipo.', '2006-12-26 10:33:27', '', ''),
	(785, 490, 'jefferson.silva', 'Ok Flávio, a maneira correta é essa mesmo, pois o veículo é quem "conhece" o FIPE(Configuração) e não o contrário, ou seja se não existir nenhum veículo para essa configuração ela continuará existindo. Facilitando assim qdo um novo veículo for incluído e necessitar dessa configuração, ela já estará cadastrada e tb já terá o seu valor.', '2006-12-26 10:37:58', '', ''),
	(786, 489, 'jefferson.silva', 'Label Alterado', '2006-12-26 10:39:43', '', ''),
	(787, 495, 'jefferson.silva', 'Provavelmente usuário estava sem unidade. Inclui essa validação para não mais apresentar esse erro. Usuários sempre devem ter os dados mínimos para usar o sistema, entre eles Frota, unidade, departamento...', '2006-12-26 10:44:02', '', ''),
	(788, 498, 'jefferson.silva', 'Não consegui reproduzir esse erro.', '2006-12-26 10:59:16', '', ''),
	(789, 469, 'carlos.arruda', 'Entao, talvez a regra de negócio nao tenha sido explicado de forma correta.\r\nO tempo de indisponibilidade é para as solicitacoes que ainda nao retornaram, ou seja, se o veiculo ficou de retornar no turno de "10:00 até 11:59" e o tempo parametrizado é de "02:00" entao somente a partir do turno "14:00 até 15:59" que esse mesmo veículo poderá ser solicitado.\r\n\r\nQuando o veículo retorna efetivamente daí fica a cargo do sistema, ou seja, somente quando liberado que ele pode ser solicitado por algum usuario.', '2006-12-26 11:24:53', '', ''),
	(790, 478, 'jefferson.silva', 'Alterado relatório.', '2006-12-26 11:54:00', '', ''),
	(791, 494, 'jefferson.silva', 'Não foi possível reproduzir esse erro.', '2006-12-26 11:57:16', '', ''),
	(792, 498, 'carlos.arruda', 'Quando edito a OS em pop-up e preencho as abas "Servicos a Realizar" e "Complementos" funciona normal mas quando volto para a aba "Dados do Veículo / Fornecedor" dá o seguinte erro:\r\n\r\n[ServletException in:/mantainenceOrderVehiclePop.jsp] Failed to lazily initialize a collection - no session or session was closed\' \r\n\r\nE constatei que apesar de estar segurando a informação nas abas quando navego pelas "Servicos a Realizar" e "Complementos" a informação não está salvando efetivamente.', '2006-12-26 12:02:58', '', ''),
	(793, 499, 'jefferson.silva', 'Realizei o mesmo teste, e não foi reproduzido essa falha. Abri a tela, e direto coloquei para buscar a multa sem preecher nada, retornou todas as multas, apliquei os filtro um a um, e funcionou perfeitamente.', '2006-12-26 15:21:33', '', ''),
