	(845, 540, 'carlos.arruda', 'Estou podendo solicitar veículo para início dia 11/01 com OS aberta com data previsa de entrega para o dia 11/01. Não pode, tem que poder somente a partir do dia 12/01, já que a previsão é de entrega é 11/01. Se eu coloco início dia 11/01 e fim dia 11/01 nao aparece, mas se coloco início dia 11/01 e entrega dia 12/01 ele aparece. Mesmo estando com status "andamento". E essa restricao de status tem que tirar, o que manda é a data de previsao de entrega, sempre.', '2007-01-10 17:26:26', '', ''),
