	(852, 538, 'raphael.araujo', 'Para retirada de um dos links cadastrados no Sub-item "Outros itens" do menu utiliza-se o script SQL:\r\n\r\nDELETE FROM `admin_permissao` WHERE `per_id` = 114 LIMIT 1;\r\n\r\n\r\n\r\nPara mudar o cadastro de arquivos CSV de emails para o Sub-item "Outros itens" do menu:\r\n\r\nUPDATE `admin_permissao` SET `bloco_id` = \'18\' WHERE `per_id` = 119 LIMIT 1;\r\n\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'1\' WHERE `per_id` = 85 LIMIT 1;\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'2\' WHERE `per_id` = 106 LIMIT 1;\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'3\' WHERE `per_id` = 113 LIMIT 1;\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'4\' WHERE `per_id` = 84 LIMIT 1;\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'5\' WHERE `per_id` = 138 LIMIT 1;\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'6\' WHERE `per_id` = 133 LIMIT 1;\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'7\' WHERE `per_id` = 134 LIMIT 1;', '2007-01-12 13:14:39', '', ''),
	(853, 538, 'raphael.araujo', 'ATENÇÂO ERRO NO SCRIPT DA MENSAGEM ANTERIOR!!!\r\n\r\nPara retirada de um dos links cadastrados no Sub-item "Outros itens" do menu utiliza-se o script SQL:\r\n\r\nDELETE FROM `admin_permissao` WHERE `per_id` = 114 LIMIT 1;\r\n\r\n\r\n\r\nPara mudar o cadastro de arquivos CSV de emails para o Sub-item "Outros itens" do menu:\r\n\r\nUPDATE `admin_permissao` SET `bloco_id` = \'18\' WHERE `per_id` = 138 LIMIT 1;\r\n\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'1\' WHERE `per_id` = 85 LIMIT 1;\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'2\' WHERE `per_id` = 106 LIMIT 1;\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'3\' WHERE `per_id` = 113 LIMIT 1;\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'4\' WHERE `per_id` = 84 LIMIT 1;\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'5\' WHERE `per_id` = 138 LIMIT 1;\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'6\' WHERE `per_id` = 133 LIMIT 1;\r\nUPDATE `admin_permissao` SET `co_ordem_apresentacao` = \'7\' WHERE `per_id` = 134 LIMIT 1;', '2007-01-12 13:18:05', '', ''),
