	(998, 649, 'saulo.coelho', 'Sobre os cometários:\r\n1. Estou buscando uma solução para esse problema.\r\n2. OK, vou acrescentar os campos DDD e Ramal\r\n3. Sobre o campo de cidade, o cadastro de representantes é importado e no banco deles não existe uma tabela de cidades, por esse motivo optamos por não usar a tabela, pois podem ocorrer problemas de importação.\r\n4. Também é um problema que está sendo resolvido.\r\n5. Novamente, eles não tem um cadastro de foto na compactor e como não aparecia a exibição da foto no protótipo optamos por postergar esse recurso.', '2007-06-21 14:34:30', '', ''),
