	(1003, 651, 'carlos.arruda', '- O sistema não tá cadastrando novo usuário.\r\n- No momento do cadastro de um novo usuário e não preencho o campo "matrícula" tá dando mensagem de "o campo Registro é obrigatório". Não sei por que aparece Registro e não precisa ser obrigatório.\r\n- Quando edito um usuário e altero a matrícula dá erro no sistema.\r\n- O campo CPF tem que apresentar com máscara, ou seja com a pontuação de CPF.\r\n- O campo telefone tem que apresentar como é salvo, se salvo com traço tem que apresentar com traço.\r\n- Quando valida o CPF e tá errado aparece uma mensagem de "False" no lugar do CPF digitado. Tem que manter os dados do CPF digitado, para facilitar para o usuário consertar o que digitou errado.\r\n- Acertei o CPF e quando fui tentar salvar novamente apareceu o seguinte erro: IOError at /user/register/\r\n[Errno 2] No such file or directory: \'/home/agence/tmp/teste.txt\'\r\nRequest Method: POST \r\nRequest URL: http://agence.webfactional.com/user/register/ \r\nException Type: IOError \r\nException Value: [Errno 2] No such file or directory: \'/home/agence/tmp/teste.txt\' \r\nException Location: /home/agence/webapps/django/tim/user/views.py in message, line 43 ', '2007-06-26 22:59:17', '', ''),
