	(1030, 651, 'ricardo.perez', '- Foram colcadas mascaras nos campos de CPF, data de nascimento e dos campos de telefones.\r\n- Foi tirado a obrigatoriedade do preenchimento do campo da matrícula.\r\n- Foi ajustado o problema dos telefones.\r\n- Tinha uma chamada para abertura de um arquivo que não existia, a mesma foi retirada.', '2007-06-28 15:57:00', '', ''),
	(1031, 664, 'ricardo.perez', 'Foi colocado indice no cpf e necessário rodar no ar\r\npython manage.py sqlindexes', '2007-06-29 16:39:31', '', ''),
