	(1043, 652, 'carlos.arruda', '- Sumiu de dentro do drop-down a opção para cadastrar nova operadora.', '2007-07-02 22:28:42', '', ''),
	(1044, 659, 'carlos.arruda', 'Na realidade é valor máximo e mínimo. O sistema só pode permitir salvar com a soma de todos os pilares dando 100%. \r\nSó quando crio um novo pilar que ele pode ficar com um valor em branco, mas depois quando for salvar tem que fazer essa crítica.', '2007-07-02 22:31:22', '', ''),
	(1045, 660, 'carlos.arruda', 'Não pode ser CASE SENSITIVE, se tiver nome de pilar minúsculo ou maiúsculo tem que criticar do mesmo jeito. Tá permitindo cadastrar pilar com o mesmo nome porém com letras minúsculas.', '2007-07-02 22:33:19', '', ''),
	(1046, 658, 'carlos.arruda', 'Para todos os itens de drop-downs do sistema tem que ter a seguinte regra:\r\nValores ativos em preto, valore inativos em vermelho e a opcao Novo em azul.\r\nNão tá assim. Na manutencao de pilares por exemplo tá tudo azul.', '2007-07-02 22:34:58', '', ''),
	(1047, 651, 'carlos.arruda', '- Qdo cadastro usuario e nao seleciono territorio dá mensagem "Campo Território com valor selecionado nao existe!" só que quando vou selecionar sumiram os territórios.\r\n- Qdo edito um usuário e troco alguma informacao e tento salvar dá erro de "Já exite um usuário com este cpf.", ou seja, o sistema tá entendendo como se eu tivesse inserindo um novo usuário.\r\n- Nos campos Tel. Comercial e Tel. Celular colocar o jscript que passa de campo automaticamente quando digito 2 dígitos de DDD, já tem que passar para o campo telefone.\r\n- Deixar todos os campos obrigatórios. O ideal é validar no jscript isso pra não ficar dando requisição ao banco de dados sem antes verificar se tá tudo preenchido.\r\n- Depois de ter editado um usuário e tentado salvar ele o sistema sumiu com ele. No webfaction o nome do usuário era "CVV da Silva" com o email cvv@tim.com.br', '2007-07-02 22:42:22', '', ''),
	(1048, 665, 'carlos.arruda', '- Quando clico em cima da "questão" dá erro jscript\r\n- Quando altero algum parâmetro e tento "Salvar" não funciona.', '2007-07-02 22:51:28', '', ''),
	(1049, 654, 'carlos.arruda', '- O campo CONTATO PRINCIPAL está como campo de telefone, com DDD. Tinha errado isso no protótipo mas já arrumeir, falta arrumar aí no sistema.\r\n- Tem dois campos CUSTCODE, o segundo na realidade é campo de telefone comercial e o outro é de celular.\r\n- Quando tento salvar um novo PDV dá mensagem "Campo(s) de telefone inválido(s)!".\r\n- Quando tento salvar um novo PDV e ainda tem alguma informação pendente o sistema perde as informações de EStados, Cidade e Território. \r\n- Qdo o CNPJ é inválido o sistema apaga totalmente o formulário.\r\n- Qdo consegui preencher todas as informacoes aparece o seguinte erro:\r\n	"UnicodeDecodeError at /pdv/register/\r\n	\'ascii\' codec can\'t decode byte 0xc3 in position 7: ordinal not in range(128)\r\n	Request Method: POST \r\n	Request URL: http://agence.webfactional.com/pdv/register/ \r\n	Exception Type: UnicodeDecodeError \r\n	Exception Value: \'ascii\' codec can\'t decode byte 0xc3 in position 7: ordinal not in range(128) \r\n	Exception Location: /home/agence/lib/python2.4/django/db/backends/util.py in execute, line 19"', '2007-07-02 22:53:11', '', ''),
