	(8, 'Colocar o busca rápido dentro da combo de clientes.', 3, '', '2004-10-15 13:39:40'),
	(9, 'Deixar a combo consultor/analista somente com os usuarios de perfil consultor.', 3, '', '2004-10-15 13:40:47'),
	(10, 'O início está marcado para o dia 28/10 com a chegada do Rui.', 5, '', '2004-10-21 20:02:55'),
	(11, 'm,bnvjhvghv', 8, 'luis.morales', '2004-10-25 09:25:48'),
	(12, 'sdfasfd', 3, 'luis.morales', '2004-10-25 09:55:40'),
	(13, 'sdfsdfdsf', 9, 'luis.morales', '2004-10-25 10:10:53'),
	(14, 'O cliente deseja a utilização de um banco de dados instalado na própria máquina do usuário, sugerimos o ACCESS.', 172, 'carlos.arruda', '2005-02-23 13:05:56'),
	(15, 'Este sistema seguirá padrões exigidos pelos gestores da Agence Interativa, Carlos Flávio e Carlos Cezar, sob a políticas administrativas adotadas pelos mesmos. Haverá, sobretudo, a metodologia de trabalho da área de consultoria comercial, já adotada pela cia, em relação às melhores práticas utilizadas até então, através de padrões de mercado, bem como, ações inovadoras, a fim de proporcionar o treinamento adequado para novos consultores e consultores em processo de reciclagem, visando sempre, a maximização de resultados em suas ações junto aos clientes.', 189, 'edy.bruno', '2005-05-31 00:33:04'),
	(16, 'Desenvolvido pela ProcWork. Com framework próprio.', 196, '', '2005-09-20 17:08:08'),
	(17, 'Proposta de layout para o site em: www.agence.com.br/propostas/botti_rubin', 202, '', '2005-12-20 17:41:58'),
	(18, 'hotsite', 220, '', '2006-07-21 11:29:08'),
	(19, 'Endereço de produção: http://dj.tj.mt.gov.br/dj', 149, '', '2006-08-01 16:10:03'),
	(20, 'site com novo visual. Clean, requintado,um visual elegante. Condizente com o produto "jóias"', 223, '', '2006-08-09 17:11:13'),
	(21, 'Nas versões moderada e aberta', 225, '', '2006-08-31 16:03:00'),
	(22, 'http://www.agence.com.br/propostas/facundo/FacundoOnline ', 233, '', '2006-11-22 17:23:04'),
	(23, 'já existe um site www.facundoimobiliaria.com.br', 234, '', '2006-11-22 17:31:22'),
	(24, 'Sistema desenvolvido pela SIC. Base Oracle.', 236, '', '2006-12-01 17:20:56'),
	(25, 'Contemplando nessa versão compact somente arquivos ANFAVEA.', 237, '', '2006-12-20 18:29:23'),
	(26, 'Criação do sistema', 238, '', '2006-12-21 11:18:45'),
	(27, 'Consultoria técnica para análise de performance / configuração de servidores de aplicação (JBOSS e Tomcat). O profissional iniciará a consultoria alocado nas instalações do cliente, a empresa Central de Intercâmbio.', 239, '', '2007-01-10 18:16:59'),
	(28, 'Cadastro corrigido.', 239, '', '2007-01-12 15:49:24'),
	(29, 'Alterado o nome para Projetos em prospecção, antes era Sistemas em Prospecção.\r\nEssa alteração foi necessária para suportar todos os serviços da Agence, a fim de concentrar num único item as horas gastas. Dessa forma sistemas, websites, consultorias, todos os serviços podem ficar concentrados nesse item.', 187, '', '2007-01-24 15:01:55'),
	(30, 'Cliente ainda não enviou as fotos, logomarca e senhas para continuação do projeto.', 198, '', '2007-02-06 14:26:54'),
	(31, 'Cliente já registrou os domínios .com e .com.br. \r\nLogomarca ainda está em desenvolvimento com a agência local (Praia do Forte).\r\nSerá necessário sugerirmos ao cliente três opções de hospedagem.', 198, '', '2007-02-07 12:09:08'),
	(32, 'Sem observações para o momento', 246, '', '2007-02-14 19:39:05'),
	(33, 'Integração com outros sistemas da empresa.', 249, '', '2007-03-12 18:01:21'),
	(34, 'Sistema de administração para o website da Jica, com protótipo e layout fornecidos pela Digital Group', 250, '', '2007-03-12 18:58:35'),
	(35, 'Alterado nome do projeto para SAWS - JICA (Sist. Admin. do WebSite - Jica).', 250, '', '2007-03-12 19:08:26'),
	(36, 'Projeto em parceria com a Digital Group.', 253, '', '2007-04-13 11:01:13'),
	(37, 'Parceria - Grupo Traffic.', 255, '', '2007-04-17 15:33:01'),
	(38, 'Consultoria Estratégica que contará também com participação do analista Agence de um treinamento fornecido pela CADSoft para geração de propostas de soluções aos problemas encontrados.', 256, '', '2007-04-27 11:48:46'),
