 round(sum((`f`.`valor` - `f`.`total_imp_inc`)),2) AS `ganancia_neta`,round(`sal`.`brut_salario`,2) AS `costo_fijo`,
 round(((sum(`f`.`valor`) - (sum(`f`.`valor`) * (`f`.`total_imp_inc` / 100))) * (`f`.`comissao_cn` / 100)),2) AS `comision`,
 round((sum((`f`.`valor` - `f`.`total_imp_inc`)) - (`sal`.`brut_salario` + ((`f`.`valor` - (`f`.`valor` * (`f`.`total_imp_inc` / 100))) *
 (`f`.`comissao_cn` / 100)))),2) AS `beneficio`,
 sum(f.valor) as valor, sum(f.total_imp_inc)  as total_imp_inc,
 DATE_FORMAT(data_emissao,"%Y-%m") as data_emissao2
 from (((`cao_fatura` `f`
 join `cao_os` `os` on((`f`.`co_os` = `os`.`co_os`)))
 join `cao_usuario` `cu` on((`cu`.`co_usuario` = `os`.`co_usuario`))) join `cao_salario` `sal` on((`sal`.`co_usuario` = `os`.`co_usuario`))) group by year(`f`.`data_emissao`),month(`f`.`data_emissao`),`cu`.`no_usuario` order by `cu`.`no_usuario`,`f`.`data_emissao`) ;

